INSERT INTO `peliculas` (`idpelicula`, `titulo`, `titulooriginal`, `sinopsis`, `idiomaoriginal`, `fondo`, `poster`, `estreno`, `duracion`, `trailer`, `estado`, `idgenero`) VALUES
(3, 'La milla verde', 'The Green Miles', '\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"  En el sur de los Estados Unidos, en plena Depresión, Paul Edgecomb es un vigilante penitenciario a cargo de la Milla Verde, un pasillo que separa las celdas de los reclusos condenados a la silla eléctrica. Esperando su ejecución está John Coffey, un gigantesco negro acusado de asesinar brutalmente a dos hermanas de nueve años. Tras una personalidad ingenua, Coffey esconde un don sobrenatural prodigioso. A medida que transcurre la historia, Paul Edgecomb aprende que los milagros ocurren... incluso en los lugares más insospechados.  \"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"\"', 'Es', '/l6hQWH9eDksNJNiXWYRkWqikOdu.jpg', '/9jfxlPX4nJvpBC3QxcqXvyBteaK.jpg', '1999-12-10', 232, 'hBtSF4-cnzk', 'Preparación', 6),
(4, 'Jason X', 'Jason X', '  En el año 2445, la Tierra es un lugar contaminado al que regresan de vez en cuando los hombres para recoger residuos de la vieja civilización. Poco se imaginan los jóvenes e intrépidos exploradores que acaban de aterrizar en la Tierra el destino que les aguarda.  ', 'en', '/woLUvHqkxDUFDpaZ43ORzjTRpJV.jpg', '/g50BkeMOO5ZXcT0B9OBGS4VLvBc.jpg', '2001-07-24', 91, 'YnbwFOPzZi0', 'Preparación', 0),
(5, 'Matrix Resurrections', 'The Matrix Resurrections', '  En un mundo compuesto por dos realidades, lo cotidiano y lo oculto tras ella, Thomas Anderson se ve obligado de nuevo a ir tras el conejo blanco. Dicha elección continúa siendo la vía de acceso a Matrix, que esta vez es más poderosa e intrincada que en ocasiones anteriores.  ', 'en', '/eNI7PtK6DEYgZmHWP9gQNuff8pv.jpg', '/dLIwpCTf4QoW01pp85KP9jcfTpu.jpg', '2021-12-16', 148, 'JT6pn9KHMh4', 'Cartelera', 0),
(6, 'El príncipe de Zamxunda', 'Coming to America', '\"\"  El principe Akeen del africano reino de Zamunda cumple veintiún años. Su futura esposa ya ha sido elegida por el rey y es presentada en la corte. Akeen decide ir a Norteamérica para buscar novia de su gusto. Un barrio marginal de Nueva York será su morada.  \"\"', 'en', '/hP4PMoQfaofHbLDPIAXrirR7wSF.jpg', '/ky3DCsfEeciQmInTA94w6uyz98v.jpg', '1988-06-29', 116, '', 'Pasado', 0),
(7, 'Thor', 'Thor', ' Thor es un arrogante y codicioso guerrero cuya imprudencia desata una antigua guerra. Por ese motivo, su padre Odín lo castiga desterrándolo a la Tierra para que viva entre los hombres y descubra así el verdadero sentido de la humildad. Cuando el villano más peligroso de su mundo envía a la Tierra a las fuerzas más oscuras de Asgard, Thor se dará cuenta de lo que realmente hace falta para ser un verdadero héroe. ', 'en', '/3SDoquTjagne0jWzdxEu31KFLmw.jpg', '/qFAVW4XJaxhj7PcpiUI5hhO9bOX.jpg', '2011-04-21', 115, 'gNOX4SEQ7aM', 'Pasado', 0),
(8, 'Thor: Love and Thunder', 'Thor: Love and Thunder', '  Cuarta película sobre \"Thor\" del MCU, en la que el Dios del trueno contará con Lady Thor como acompañante, personaje que interpretará Natalie Portman.  ', 'en', '/bcpATvKQmSgCbwxONs9PPQrer3A.jpg', '/kf9Bib75eduxt0QiVJO4pawfd9p.jpg', '2022-07-06', 0, '9jrffoywRUU', 'Proximamente', 0),
(9, 'Thor: Ragnarok', 'Thor: Ragnarok', ' Thor está preso al otro lado del universo sin su poderoso martillo y se enfrenta a una carrera contra el tiempo. Su objetivo es volver a Asgard y parar el Ragnarok porque significaría la destrucción de su planeta natal y el fin de la civilización Asgardiana a manos de una todopoderosa y nueva amenaza, la implacable Hela. Pero, primero deberá sobrevivir a una competición letal de gladiadores que lo enfrentará a su aliado y compañero en los Vengadores, ¡el Increíble Hulk! ', 'en', '/6G2fLCVm9fiLyHvBrccq6GSe2ih.jpg', '/pGtkLdk4rnF2A3Yz2BHiTgRwMU4.jpg', '2017-10-24', 131, 'r6EM929pUoY', 'Pasado', 0),
(11, 'Torrente 3: El protector', 'Torrente 3: El protector', ' Una popular eurodiputada, Giannina Ricci, llega de visita a España. Su objetivo, a través de un detallado informe que desvela las ilegalidades e irregularidades de la multinacional Petronosa, es cerrar las factorías de dicha empresa que atentan contra el medio ambiente. El más alto directivo de la compañía soborna a dos mandos de los cuerpos de seguridad encargados de proteger a la señorita Ricci, para que faciliten el atentado que planea contra la eurodiputada. No se les ocurre nada mejor que encargar la protección durante la estancia en España de la diputada, a José Luís Torrente, con probabilidad, uno de los individuos más anormales de la tierra. ', 'es', '/6QEjYHQEIgKHMzdmCwNY1C2WVV3.jpg', '/s6T6Sg2d98FKo3g1VCAjzJcW4H0.jpg', '2005-09-30', 96, '', 'Pasado', 0),
(12, 'Torrente 5: Operación Eurovegas', 'Torrente 5: Operación Eurovegas', ' Año 2018. Torrente sale de la cárcel y se encuentra aturdido ante una España convulsa y dividida. Debe encontrar respuestas en su interior para despejar su confusión, y por ello decide convertirse en un \"fuera de la ley\", así que se propone atracar un casino con una banda de incompetentes. A través de un contacto de su estancia en prisión, localiza a John Marshall, la persona que se ocupó de supervisar la seguridad cuando se planificó el principal casino-hotel de Eurovegas. Marshall, el más indicado para planificar un golpe, le explica la necesidad de organizar una banda de especialistas, que Torrente se encargará de reclutar entre sus contactos. ', 'es', '/vIX3kOne1TzYO57cWPAWNtTV7dH.jpg', '/dfd0rTS4g6J7EqJDxWZm8KJjGKT.jpg', '2014-10-03', 102, 'TEH4G2Qsk2U', 'Pasado', 0),
(13, 'Torrente 2: Misión en Marbella', 'Torrente 2: Misión en Marbella', ' Torrente tiene que luchar contra un terrorista internacional que se encuentra actuando en Marbella. Salvará a la ciudad de las manos de este criminal contando con la colaboración de un ayudante. ', 'es', '/qlZhJXm2F898eTSQfo855AvdLtm.jpg', '/5AACrCo881PtAy3Q6BhSa8L4avr.jpg', '2001-03-30', 88, '', 'Pasado', 0),
(14, 'Torrente, el brazo tonto de la ley', 'Torrente, el brazo tonto de la ley', '  Torrente es un policía español, fascista, machista, racista, alcohólico y del Atleti. En su mismo inmueble vive un chaval, Rafi, al que le gustan las peliculas de acción y las pistolas, y que vive con su madre y su prima Amparito, una ninfómana. Juntos, Torrente y Rafi, patrullarán por la noche las calles de la ciudad  ', 'es', '/zmLobjBZtfZiCqOUMKJJUCrrNF9.jpg', '/3wAeqkJ8vq7TjkfUp4ikHT15oVn.jpg', '1998-03-13', 100, '', 'Pasado', 0),
(15, 'Torrente 4: Lethal crisis', 'Torrente 4: Lethal crisis', ' Cuarta entrega de las aventuras del casposo policía José Luis Torrente. En esta ocasión encontramos a nuestro (anti)héroe en una situación delicada. Tras varios intentos fallidos de llevar una vida digna (como si eso fuese posible atrapado en su propia piel), decide aceptar un peligroso encargo que le hace un viejo conocido. Tendrá que afrontar entonces uno de los momentos mas críticos de su carrera. Todo empieza con Torrente ante la tumba de \"El Fary\", lamentando la muerte del cantante, así como que \"los maricones ahora se casen\", o que \"hayan puesto a un negro en la Casa Blanca, y no para limpiar\"... ', 'es', '/ubw8VzDkffEu30EMYwfERCRgQTQ.jpg', '/nOxFLs4C7ogejYal13rHcomtmu3.jpg', '2011-03-11', 93, 'Fq1mg2J29AY', 'Pasado', 0),
(16, 'Cómo entrenar a tu dragón', 'How to Train Your Dragon', '  Ambientada en el mítico mundo de los rudos vikingos y los dragones salvajes, y basada en el libro infantil de Cressida Cowell, esta comedia de acción narra la historia de Hipo, un vikingo adolescente que no encaja exactamente en la antiquísima reputación de su tribu como cazadores de dragones. El mundo de Hipo se trastoca al encontrar a un dragón que le desafía a él y a sus compañeros vikingos, a ver el mundo desde un punto de vista totalmente diferente.  ', 'en', '/v529QdjxwGKmJycQWnJj6qGSpta.jpg', '/vUF9bN3pT99IgdRMSInG0YSqPCN.jpg', '2010-03-18', 98, '-k5ve8onP1M', 'Pasado', 0),
(18, 'Mary Poppins', 'Mary Poppins', ' Reinado de Eduardo VII (1901-1910). Una familia inglesa formada por un padre banquero, una madre sufragista y dos niños rebeldes -que pretenden llamar la atención de su padre haciendo la vida imposible a todas las niñeras-, se verá alterada con la llegada de Mary Poppins, una institutriz muy especial, que desciende de las nubes empleando su paraguas como paracaídas. Debut y Oscar para Julie Andrews en este clásico del cine familiar que en su día batió récords de taquilla. Una niñera mágica y canciones pegadizas que harán las delicias de los más pequeños de la casa. ', 'en', '/prVH6SyQ6yDmzVxxkcr57zhLM5C.jpg', '/8hU9v0EYEiAWYOkROcy4iWnSNpl.jpg', '1964-08-27', 139, '8lawrTvl35c', 'Pasado', 0),
(19, 'La bella y la bestia', 'Beauty and the Beast', ' Una hermosa joven llamada Bella acepta alojarse en un castillo con una bestia a cambio de la libertad de su padre. La bestia es, en realidad, un príncipe encantado. Para romper el hechizo, deberá ganarse el amor de una preciosa dama antes de que caiga el último pétalo de una rosa encantada. ', 'en', '/lNCfjI6DOD4huCyBvbzBxflX2M5.jpg', '/1FxMtEUc6DP1MXsTBftOFaoCVVO.jpg', '1991-10-22', 84, '', 'Pasado', 0),
(20, 'A todo gas', 'The Fast and the Furious', ' Una misteriosa banda de delincuentes se dedica a robar camiones en plena marcha desde vehículos deportivos. La policía decide infiltrar a un hombre en el mundo de las carreras ilegales para descubrir posibles sospechosos. El joven y apuesto Brian entra en el mundo del tuning donde conoce a Dominic, rey indiscutible de este mundo y sospechoso número uno, pero todo se complica cuando se enamora de la hermana de éste. ', 'en', '/jY9ef5nqY4xIIMu3yzW3qamUCoi.jpg', '/rCdEN70nBLJfrzE7NwPtCSxjjrA.jpg', '2001-06-22', 109, 'RFee3iNoTQ4', 'Pasado', 0),
(21, 'Fast & Furious: Hobbs & Shaw', 'Fast & Furious Presents: Hobbs & Shaw', ' Desde que Hobbs, agente del Servicio de Seguridad Diplomática de Estados Unidos, y el británico Shaw, proscrito sin ley, se enfrentaron por primera vez, solo han intercambiado bofetadas y malas palabras. Pero cuando las despiadadas acciones de Brixton, un anarquista cibergenéticamente mejorado, amenazan el futuro de la humanidad, ambos se unen para derrotarlo. ', 'en', '/hpgda6P9GutvdkDX5MUJ92QG9aj.jpg', '/5REralbYRALUnTpICY3TBMyXYGW.jpg', '2019-08-01', 137, 'LlIU1o2iyjw', 'Pasado', 0),
(22, 'Transporter', 'The Transporter', ' El ex operador de Fuerzas Especiales Frank Martin vive lo que parece ser una vida tranquila a orillas del Mediterráneo francés, donde presta sus servicios como un “transportador”, un mercenario que traslada bienes —humanos o de cualquier tipo— de un lugar a otro. Siempre sin preguntas de por medio. Frank, que en su Mercedes equipado lleva a cabo misiones secretas y a veces peligrosas, se apega a un estricto juego de 3 reglas que nunca rompe. Regla numero uno: Nunca modifiques el trato. Dos: Omitir nombres, Frank no quiere saber para quién trabaja o qué es lo que transporta. Tres: Nunca ver qué hay dentro del paquete. La carga más reciente de Frank aparenta ser igual a los incontables paquetes que ha entregado en el pasado. Ha sido contratado por un norteamericano conocido solamente como “Wall Street” para que lleve a cabo una entrega. Pero cuando Frank se detiene en el trayecto, se percata que su “paquete” se mueve... ', 'en', '/gXv8fwdJETasmMTVGjSvUpuX3r0.jpg', '/gEiyyNU0CVZBgmH08l3GMgw4BfZ.jpg', '2002-10-02', 94, '__fFn0Xy8ys', 'Pasado', 0),
(23, 'Megalodon', 'Megalodon', ' Un buque militar en búsqueda de un sumergible no identificado se encuentra cara a cara con un tiburón gigante, obligado a usar solo lo que tiene a bordo para defenderse de la monstruosa bestia. ', 'en', '/fXFQnOSbybaU9h2kJ3jtRUU4OpA.jpg', '/hES2eVAbVt08JJTqgu3jmI34Yxx.jpg', '2018-08-10', 86, '', 'Pasado', 0),
(24, 'Los mercenarios 2', 'The Expendables 2', ' Barney Ross, Lee Christmas, Yin Yang, Gunner Jensen, Toll Road, Hale Caesar y Billy, un nuevo colega, se vuelven a reunir cuando el señor Church les encarga un trabajo aparentemente sencillo y muy lucrativo. Sin embargo, el plan se tuerce cuando un peligroso terrorista llamado Villain les tiende una emboscada. Entonces su único deseo será vengarse. Así es como van sembrando a su paso la destrucción y el caos entre sus enemigos hasta que se encuentran con una amenaza inesperada: cinco toneladas de plutonio apto para uso militar, una cantidad más que suficiente para cambiar el equilibrio de poder en el mundo. ', 'en', '/41QdmNKbwmVD7R6A7hMqMe9FYMy.jpg', '/2d7d61wOgYtStCjdV2BWFHGiFAc.jpg', '2012-08-08', 102, 'OkF6KFG_Bmw', 'Pasado', 0),
(25, 'Los mercenarios', 'The Expendables', ' Un grupo de mercenarios es contratado para infiltrarse en un país sudamericano y derrocar a su despiadado y corrupto dictador. Una vez allí, se verán atrapados en una telaraña de engaño y traición. Una vez fracasada la misión, tendrán que enfrentarse a un reto aún más difícil; salvar la unidad del grupo y la amistad que los ha unido durante largos años. ', 'en', '/tMpeVt7T2S2NaeEaNCUunCm7laX.jpg', '/gmbMhNLsa0cEJIbsGUmTTtmLSPT.jpg', '2010-08-03', 103, 'Z1rhjERTBb8', 'Pasado', 0),
(26, 'Los mercenarios 4', 'The Expendables 4', '  Cuarta entrega de la saga Los Mercenarios.  ', 'en', '', '/6eEFJTQTkoNmR41Fj6OnZOcT4u4.jpg', '', 0, '', 'Proximamente', 0),
(27, 'Los mercenarios 3', 'The Expendables 3', ' El grupo de los mercenarios, dirigidos por Barney, durante una misión en África, se encuentran frente a frente con Stonebanks, el otro miembro fundador del grupo, al que Barney creía muerto. Stonebanks es ahora un rico y despiadado traficante de armas que el gobierno de los EEUU quiere capturar con vida para llevarlo al tribunal internacional de la Haya. ', 'en', '/sJDBJxKWG7h3VpG6jc9Mm9bw4kG.jpg', '/9aRQlzp1CttwSDgHOKGy1TrLPpL.jpg', '2014-08-07', 123, 'q25ZPx0ggIQ', 'Pasado', 0),
(30, 'Fast & Furious 6', 'Fast & Furious 6', '     Desde que Dom y Brian destruyeron el imperio de un mafioso y se hicieron con cien millones de dólares, se encuentran en paradero desconocido; no pueden regresar a casa porque la ley los persigue. Entretanto, Hobbs ha seguido la pista por una docena de países a una banda de letales conductores mercenarios, cuyo cerebro cuenta con la inestimable ayuda de la sexy Letty, un viejo amor de Dom que éste daba por muerta. La única forma de detenerlos es enfrentarse a ellos en las calles, así que Hobbs le pide a Dom que reúna a su equipo en Londres. ¿Qué obtendrán a cambio? Un indulto para que todos puedan volver a casa con sus familias.     ', 'en', '/mRfI3y2oAd7ejur2di09xC9niqp.jpg', '/6zUkjB5OtiFhN2DiqdT1IllNJTa.jpg', '2013-05-21', 130, 'kiSEFwqh2Qk', 'Pasado', 0),
(34, 'Wonder Woman 1984', 'Wonder Woman 1984', ' En 1984, en plena guerra fría, Diana Prince, conocida como Wonder Woman se enfrenta al empresario Maxwell Lord y a su antigua amiga Barbara Minerva / Cheetah, una villana que posee fuerza y agilidad sobrehumanas. ', 'en', '/yzpCv8CCWondN7O5au1KGiqnC3A.jpg', '/jIIjsExCEv6lsfQGHTXDPk3Q0M5.jpg', '2020-12-16', 151, 'uaPbtACMxdQ', 'Pasado', 0),
(35, 'Wonder Woman', 'Wonder Woman', ' Diana, princesa de las Amazonas, entrenada para ser una guerrera invencible, fue criada en una isla paradisíaca protegida, hasta que un día, un piloto norteamericano, que tuvo un accidente y acabó en sus costas, le habló de un gran conflicto existente en el mundo, la Primera Guerra Mundial. Diana decidió salir de la isla, convencida de que podía detener la terrible amenaza. Ahora lucha como Wonder Woman, junto a los hombres, en la guerra que acabará con todas las guerras y descubre todos sus poderes y su verdadero destino. ', 'en', '/AaABt75ZzfMGrscUR2seabz4PEX.jpg', '/skVHFykCQrEwQJdrpUHgJbvqo1u.jpg', '2017-05-30', 141, 'WXMwfxYAmiA', 'Pasado', 0),
(36, 'Batman vs Superman: El amanecer de la Justicia', 'Batman v Superman: Dawn of Justice', ' Ante el temor de las acciones que pueda llevar a cabo Superman, el vigilante de Gotham City aparece para poner a raya al superhéroe de Metrópolis, mientras que la opinión pública debate cuál es realmente el héroe que necesitan. El hombre de acero y Batman se sumergen en una contienda territorial, pero las cosas se complican cuando una nueva y peligrosa amenaza surge rápidamente, poniendo en jaque la existencia de la humanidad. ', 'en', '/doiUtOHzcxXFl0GVQ2n8Ay6Pirx.jpg', '/mS3t9puIjLKgoex82cu9d6G0835.jpg', '2016-03-23', 153, '2PT260yUXXw', 'Pasado', 0),
(37, 'Matrix', 'The Matrix', ' Thomas Anderson lleva una doble vida: por el día es programador en una importante empresa de software, y por la noche un hacker informático llamado Neo. Su vida no volverá a ser igual cuando unos misteriosos personajes le inviten a descubrir la respuesta a la pregunta que no le deja dormir: ¿qué es Matrix? ', 'en', '/ncEsesgOJDNrTUED89hYbA117wo.jpg', '/qK76PKQLd6zlMn0u83Ej9YQOqPL.jpg', '1999-03-30', 138, 'nL5kq0rfbBk', 'Pasado', 0),
(38, 'Doctor Strange', 'Doctor Strange', ' La vida del Dr. Stephen Strange cambia para siempre tras un accidente automovilístico que le deja muy malheridas sus manos. Cuando la medicina tradicional falla, se ve obligado a buscar esperanza y una cura en un lugar impensable: una comunidad aislada en Nepal llamada Kamar-Taj. Rápidamente descubre que éste no es sólo un centro de recuperación, sino también la primera línea de una batalla en contra de fuerzas oscuras y ocultas empeñadas en destruir nuestra realidad. En poco tiempo, Strange, armado con sus poderes mágicos recientemente adquiridos, se ve obligado a elegir entre volver a su antigua vida de riqueza y prestigio o dejarlo todo, para defender el mundo como el mago más poderoso del planeta. ', 'en', '/eQN31P4IEhyp6NkdccvppJnyuJ4.jpg', '/wJEZI3PWyMW7qcW6n9jyCh7Cclf.jpg', '2016-10-25', 115, 'PqTILYUNU3s', 'Pasado', 0),
(39, 'Doctor Strange en el multiverso de la locura', 'Doctor Strange in the Multiverse of Madness', '  Viaja a lo desconocido con el Doctor Strange, quien, con la ayuda de tanto antiguos como nuevos aliados místicos, recorre las complejas y peligrosas realidades alternativas del multiverso para enfrentarse a un nuevo y misterioso adversario.  ', 'en', '/gUNRlH66yNDH3NQblYMIwgZXJ2u.jpg', '/vThe85YlGE5r7fqEVFePETqnWzk.jpg', '2022-05-04', 126, 'JDYdGnpmsgo', 'Cartelera', 0),
(40, 'Star Trek', 'Star Trek', ' Todo está preparado para el viaje inaugural de la nave más moderna que jamás se haya creado: la USS Enterprise. Su joven tripulación tiene una importante misión: encontrar una manera de detener al malvado Nero que, movido por la venganza, amenaza a toda la humanidad. Pero el destino de la galaxia está en manos de dos jóvenes rivales, que nacieron en mundos diferentes. Uno de ellos, Tiberius James Kirk, humano, busca emociones y es un líder nato. El otro, Spock, medio humano y medio vulcaniano, es menospreciado por los vulcanianos, por sus emociones humanas. ', 'en', '/hqzIuGbwAYMKljhoXwtFFfOrg1J.jpg', '/AkgW79i6Z26Y1omckHA6SR5lKx.jpg', '2009-05-06', 127, 'xftdFugdA70', 'Pasado', 0),
(41, 'Star Trek: Más allá', 'Star Trek Beyond', ' El USS Enterprise, la nave insignia de la Flota Estelar, liderada por el capitán James T. Kirk, vuelve a surcar el universo, para proteger la Tierra y el resto de planetas aliados. Pero la tranquilidad durará poco y el peligro acecha. La primera etapa de su misión les llevará a un territorio desconocido, y su travesía pronto se convertirá en una carrera por la supervivencia, cuando se enfrenten a un nuevo y fiero enemigo, Krall, de una especie alienígena avanzada. A la vez que intentan encontrar el modo de volver a la Tierra, su objetivo será proteger el futuro de la raza humana y preservar la armonía entre especies... ', 'en', '/m4F1KRK5jAoQHi2mKDFE2jFKEIb.jpg', '/2yfbpstJY4Fan8DSfPFDl05jx9.jpg', '2016-07-07', 122, 't0jgLoLAr-E', 'Pasado', 0),
(42, 'Star Trek: En la oscuridad', 'Star Trek Into Darkness', ' Cuando a la tripulación de la nave Enterprise le ordenan que regrese a casa, en la Tierra se enfrentan a una terrorífica fuerza que, aparentemente desde dentro, ha perpetrado un ataque a la cúpula de la Federación y todo lo que ésta representa, sumiendo a la flota en una profunda crisis. Para intentar solucionar el problema, y con un asunto personal que resolver, el capitán Kirk encabeza una incursión a un planeta en guerra, para capturar a un hombre que es un arma de destrucción masiva. A medida que nuestros héroes se van sumergiendo en una épica partida de ajedrez a vida o muerte, la lealtad se verá puesta a prueba, las amistades se romperán, y habrá que hacer ciertos sacrificios por la única familia que le queda a Kirk: su tripulación. ', 'en', '/6A0P0iJUtxnIpfxbWt5gUF5DC1V.jpg', '/7ncnBVignnCQ4vFNxiSLWDpFUcs.jpg', '2013-05-05', 132, 'FFAiOtL_rNo', 'Pasado', 0),
(43, 'La guerra de las galaxias', 'Star Wars', ' La princesa Leia, líder del movimiento rebelde que desea reinstaurar la República en la galaxia en los tiempos ominosos del Imperio, es capturada por las malévolas Fuerzas Imperiales, capitaneadas por el implacable Darth Vader, el sirviente más fiel del emperador. El intrépido Luke Skywalker, ayudado por Han Solo, capitán de la nave espacial \"El Halcón Milenario\", y los androides, R2D2 y C3PO, serán los encargados de luchar contra el enemigo y rescatar a la princesa para volver a instaurar la justicia en el seno de la Galaxia. ', 'en', '/jBFxXKCrViA88hhO59fDx0Av4P.jpg', '/ahT4ObS7XKedQkOSpGr1wQ97aKA.jpg', '1977-05-25', 121, 'beAH5vea99k', 'Pasado', 0),
(44, 'Star Wars: El despertar de la fuerza', 'Star Wars: The Force Awakens', ' Treinta años después de la victoria de la Alianza Rebelde sobre la segunda Estrella de la Muerte (hechos narrados en el Episodio VI: El retorno del Jedi), la galaxia está todavía en guerra. Una nueva República se ha constituido, pero una siniestra organización, la Primera Orden, ha resurgido de las cenizas del Imperio Galáctico. A los héroes de antaño, que luchan ahora en la Resistencia, se suman nuevos héroes: Poe Dameron, un piloto de caza, Finn, un desertor de la Primera Orden, Rey, una joven chatarrera, y BB-8, un androide rodante. Todos ellos luchan contra las fuerzas del Mal: el Capitán Phasma, de la Primera Orden, y Kylo Ren, un temible y misterioso personaje que empuña un sable de luz roja. ', 'en', '/k6EOrckWFuz7I4z4wiRwz8zsj4H.jpg', '/vI86GLIkT5pP3ZfNs2EvmTrBLBm.jpg', '2015-12-15', 136, 'V8qlIZsutAQ', 'Pasado', 0),
(45, 'Star Wars: Los últimos Jedi', 'Star Wars: The Last Jedi', 'La fuerza siente un cambio y los Maestros Jedi saben que es el momento de regresar. La galaxia se encuentra perdida y separada, y deberán unir fuerzas si no quieren que sea el fin de la paz. Con el rumor de una guerra, los pocos aliados que quedan emprenderán la búsqueda para aumentar sus aliados, mientras se enfrentan a la desconfianza y el temor de aquellos que no olvidan ni perdonan. Mundos casi olvidados, personajes misteriosos y viejas caras conocidas, una nueva aventura está a punto de comenzar para mantener la frágil supervivencia de La República, mientras se preparan para lo que está por llegar. ', 'en', '/5Iw7zQTHVRBOYpA0V6z0yypOPZh.jpg', '/rjBwhsOzHKUw2NIOrE7aMqjfe6s.jpg', '2017-12-13', 151, 'anOJjqQb8x0', 'Pasado', 0),
(46, 'LEGO Star Wars Cuentos escalofriantes', 'LEGO Star Wars Terrifying Tales', ' Tras aterrizar de emergencia en el planeta volcánico Mustafar, Poe y BB-8 buscan ayuda en el escalofriante castillo de Darth Vader. Allí encuentran a un intrigante Hutt, un intrépido mecánico y el antiguo asistente de Darth Vader, Vaneé, que les obsequia con tres relatos aterradores ligados a antiguos artefactos y a villanos icónicos de todas las épocas de Star Wars. ', 'en', '/f53Jujiap580mgfefID0T0g2e17.jpg', '/p8cPUCexDTFZxHI3ooqHYi6AUgL.jpg', '2021-10-01', 45, '', 'Pasado', 0),
(47, 'Star Wars: El ascenso de Skywalker', 'Star Wars: The Rise of Skywalker', ' La Resistencia sobreviviente se enfrenta a la Primera Orden una vez más mientras continúa el viaje de Rey, Finn y Poe Dameron. Con el poder y el conocimiento de las generaciones detrás de ellos, comienza la batalla final. ', 'en', '/SPkEiZGxq5aHWQ2Zw7AITwSEo2.jpg', '/16G2wZAkmKqSGK3it2VPjco5oyn.jpg', '2019-12-18', 142, '82R2u7OuGOA', 'Pasado', 0),
(48, 'Han Solo: Una historia de Star Wars', 'Solo: A Star Wars Story', ' Precuela de la saga Star Wars, en la que se conocerán los primeros pasos que dio el personaje de Han Solo, desde joven hasta convertirse en el antihéroe que vimos en \"Una nueva esperanza\", antes de que se encontrase con Luke y Obi-Wan en la cantina de Mos Eisley. ', 'en', '/ojHCeDULAkQK25700fhRU75Tur2.jpg', '/isFKKZS3JEIxGfcciL2DQEYhiy1.jpg', '2018-05-15', 135, 'C-YZiAXcbY8', 'Pasado', 0),
(49, 'Star Wars: Las guerras clon', 'Star Wars: The Clone Wars', ' Mientras las Guerras Clon barren la galaxia, Anakin Skywalker y su nueva aprendiz Padawan, Ahsoka Tano, se aventuran en una arriesgada misión para rescatar al hijo secuestrado de Jabba el Hutt, el señor del Crimen. El renegado Conde Dooku y su letal y cruel vasalla Asajj Ventress harán todo lo posible por hacerles fracasar, haciendo que la misión de Anakin Skywalker tenga graves consecuencias.Mientras, en la línea de batalla, Obi-Wan Kenobi y el maestro Yoda lideran el masivo ejército clon en un valiente esfuerzo por derrotar al ejército droide y resistir a las fuerzas del lado oscuro. ', 'en', '/xEdnGUc8KeZ7h0eEgSN3ERhjgL0.jpg', '/ywRtBu88SLAkNxD0GFib6qsFkBK.jpg', '2008-08-05', 98, 'tRuDieYWAqA', 'Pasado', 0),
(50, 'La guerra de las galaxias. Episodio I: La amenaza fantasma', 'Star Wars: Episode I - The Phantom Menace', ' La Federación de Comercio ha bloqueado el pequeño planeta de Naboo, gobernado por la joven Reina Amidala, como parte de un plan ideado por Sith Darth Sidious, que manteniéndose en el anonimato dirige a los neimoidianos, que están al mando de la Federación. Amidala es convencida por los Jedis Qui-Gon Jinn y su aprendiz, o padawan, Obi-Wan Kenobi a viajar hasta Coruscant, capital de la República y sede del Consejo Jedi para intentar mediar esta amenaza. Pero esquivando el bloqueo, la nave real resulta dañada, obligando a la tripulación a aterrizar en el desértico y remoto planeta de Tatooine... ', 'en', '/5fu7fzy4NZTsL1Jap00UBIInAuB.jpg', '/rJwpYgQWfebnNnIIKSUTUx3sBc4.jpg', '1999-05-19', 131, 'n1CUHjrc9Sc', 'Pasado', 0),
(51, 'Rogue One: Una historia de Star Wars', 'Rogue One: A Star Wars Story', ' El Imperio Galáctico ha terminado de construir el arma más poderosa de todas, la Estrella de la muerte, pero un grupo de rebeldes decide realizar una misión de muy alto riesgo: robar los planos de dicha estación antes de que entre en operaciones, mientras se enfrentan también al poderoso Lord Sith conocido como Darth Vader, discípulo del despiadado Emperador Palpatine. ', 'en', '/6t8ES1d12OzWyCGxBeDYLHoaDrT.jpg', '/mAqgFQxaBaLkcQBRQf9YnAz9sNQ.jpg', '2016-12-14', 133, 'Xcs4OpUJWrM', 'Pasado', 0),
(52, 'La guerra de las galaxias. Episodio III: La venganza de los Sith', 'Star Wars: Episode III - Revenge of the Sith', ' Último capítulo de la saga de Star Wars, en el que Anakin Skywalker definitivamente se pasa al lado oscuro. En el Episodio III aparecerá el General Grievous, un ser implacable mitad-alien mitad-robot, el líder del ejército separatista Droid. Los Sith son los amos del lado oscuro de la Fuerza y los enemigos de los Jedi. Ellos fueron prácticamente exterminados por los Jedi hace mil años, pero la orden del mal sobrevivió en la clandestinidad. ', 'en', '/eFaRU5y8wIwV0D14DPkbLaRUzOV.jpg', '/fen971QdTOagZEv4rAU3sjSlpj1.jpg', '2005-05-17', 140, 'kqkfjBKmWc4', 'Pasado', 0),
(53, 'La guerra de las galaxias. Episodio II: El ataque de los clones', 'Star Wars: Episode II - Attack of the Clones', ' Corren tenebrosos tiempos para la República. Ésta continúa envuelta en luchas y sumida en el caos. Un movimiento separatista, formado por centenares de planetas y poderosas alianzas y y lideradas por el misterioso conde Dooku, abre nuevas amenazas para la galaxia, a la que ni siquiera los Jedi parecen poder poner freno. Estas maniobras, planeadas hace mucho por una poderosa fuerza, conducen al estallido de las guerras clones y al principio del fin de la República. Para allanar el camino, los separatistas intentan asesinar a la senadora Padme Amidala. Para evitar futuros atentados, su seguridad es encomendada a dos caballeros Jedi... ', 'en', '/pXnNSeyTCUebjpHTiZt7v6FZId0.jpg', '/pwwBIUqVSWrCBuUAvbaNdf7VajF.jpg', '2002-05-15', 132, 'DywnxIuPtUs', 'Pasado', 0),
(63, 'Cinco lobitos', 'Cinco lobitos', 'Amaia (Laia Costa) acaba de ser madre y se da cuenta de que no sabe muy bien cómo serlo. Al ausentarse su pareja por trabajo unas semanas, decide volver a casa de sus padres, en un bonito pueblo costero del País Vasco y así compartir la responsabilidad de cuidar a su bebé. Lo que no sabe Amaia es que, aunque ahora sea madre, no dejará de ser hija.', 'es', '/ikr6ujf5hPDyLKFdxnHQR6KpvJ8.jpg', '/7Iacor1r5Z4aj4SlGpW8HceyM7C.jpg', '2022-05-20', 104, 'xBuqdeNtXp4', 'Cartelera', 0),
(64, 'Jurassic World: Dominion', 'Jurassic World Dominion', 'Cuatro años después de la destrucción de Isla Nublar, los dinosaurios conviven – y cazan – con los seres humanos en todo el mundo. Este frágil equilibrio cambiará el futuro y decidirá, de una vez por todas, si los seres humanos seguirán en la cúspide de los depredadores en un planeta que comparten con los animales más temibles de la creación.', 'en', '/QOMBHUrMCTw6nugUsGQdLKYxr8.jpg', '/sXeWfpT1EhG7f4uBouqraOhmouH.jpg', '2022-06-01', 147, 'NWg0w25zjfI', 'Cartelera', 0),
(66, 'Los Tipos Malos', 'The Bad Guys', 'Cinco villanos notorios: el Sr. Wolf, Mr. Snake, Mr. Piranha, Mr. Shark y Ms. Tarantula, que han pasado toda una vida juntos realizando grandes atracos.', 'en', '/fEe5fe82qHzjO4yej0o79etqsWV.jpg', '/wFdwJh3fbhp5aiRbQelVz1mbbwP.jpg', '2022-03-17', 100, 'gzsRenSxjyE', 'Cartelera', 0),
(67, 'Sonic 2: La película', 'Sonic the Hedgehog 2', 'Después de establecerse en Green Hills, Sonic se muere por demostrar que tiene madera de auténtico héroe, pero Robotnik regresa con nuevo compañero Knuckles, en busca de una esmeralda que tiene el poder de destruir civilizaciones, pero Sonic no está solo, le ayudará Tails.', 'en', '/egoyMDLqCxzjnSrWOz50uLlJWmD.jpg', '/sJiHVM0A3OXDVxl4Z6a7ihMPHfm.jpg', '2022-03-30', 122, 'cF5uf8a2Xds', 'Cartelera', 0),
(68, 'Sonic the Hedgehog 3', 'Sonic the Hedgehog 3', '', 'en', '/j0xO6355h5HfvC425sWDT6tiBZM.jpg', '/aNSBaYTgPz8QEADi3xiD52X4uVF.jpg', '', 0, '', 'Proximamente', 0),
(69, 'Sonic: La película', 'Sonic the Hedgehog', 'Sonic, el descarado erizo azul basado en la famosa serie de videojuegos de Sega, vivirá aventuras y desventuras cuando conoce a su amigo humano y policía, Tom Wachowski (James Marsden). Sonic y Tom unirán sus fuerzas para tratar de detener los planes del malvado Dr. Robotnik (Jim Carrey), que intenta atrapar a Sonic con el fin de emplear sus inmensos poderes para dominar el mundo.', 'en', '/stmYfCUGd8Iy6kAMBr6AmWqx8Bq.jpg', '/rK25c71fYVi0Bv7RrTChK7NAQjC.jpg', '2020-02-12', 99, 'XPqAai3WBag', 'Pasado', 0),
(70, 'Top Gun: Maverick', 'Top Gun: Maverick', 'Después de más de 30 años de servicio como uno de los mejores aviadores de la Armada, Pete \"Mavericks\" Mitchel (Tom Cruise) se encuentra dónde siempre quiso estar, empujando los límites como un valiente piloto de prueba y esquivando el alcance en su rango, que no le dejaría volar emplazándolo en tierra. Cuando se encuentra entrenando a un destacamento de graduados de Top Gun para una misión especializada, Maverick se encuentra allí con el teniente Bradley Bradshaw (Miles Teller), el hijo de su difunto amigo \"Goose\"... Secuela de Top Gun.', 'en', '/odJ4hx6g6vBt4lBWKFD1tI8WS4x.jpg', '/AlWpEpQq0RgZIXVHAHZtFhEvRgd.jpg', '2022-05-24', 131, 'zmFdhZ6gyUM', 'Cartelera', 0),
(71, 'Top Gun', 'Top Gun', 'La Marina de los Estados Unidos ha creado una escuela de élite para pilotos con el fin de sacar una promoción de expertos en técnicas de combate. En la academia, más conocida como Top Gun, a los mejores se les entrena para ser intrépidos y fríos al mismo tiempo, capaces de no perder los nervios en situaciones extremas y de no inmutarse al romper la barrera del sonido a los mandos de un F-14. A la escuela llega el joven Maverick, famoso por su temeraria aunque brillante forma de pilotar.', 'en', '/am0wHjplG1YynuDWz2LPWx5V9kJ.jpg', '/W8QUPhiBOCdj2urJDzc2D9xdQb.jpg', '1986-05-16', 110, '', 'Pasado', 0),
(72, 'Lightyear', 'Lightyear', 'Atrapado en un planeta hostil a 4,2 millones de años luz de la Tierra junto a su comandante y su tripulación, Buzz Lightyear intenta encontrar la manera de volver a casa a través del espacio y el tiempo. Pero la llegada de Zurg, una presencia imponente con un ejército de robots despiadados y una agenda misteriosa, complica aún más las cosas y pone en peligro la misión.', 'en', '/35nKk3idV96xVae6Bw26iyUfWbr.jpg', '/bPIm1SXYp5RQ3c4wP91JQRewIb8.jpg', '2022-06-15', 107, 'lieiD32FLTI', 'Cartelera', 0),
(73, 'Elvis', 'Elvis', 'Elvis es una próxima película de drama biográfico sobre Elvis Presley coescrita y dirigida por Baz Luhrmann , y protagonizada por Austin Butler y Tom Hanks .', 'en', '/1zgz0LAT3avelWe6whHSa9j7zfq.jpg', '/FTBDId0Ntc8YmJpolZe8fLJcoI.jpg', '2022-06-22', 160, 'lI5iwHPtn58', 'Proximamente', 0),
(74, 'Minions: El origen de Gru', 'Minions: The Rise of Gru', 'Fanboy de un supergrupo de supervillanos conocido como Vicious 6, Gru trama un plan para volverse lo suficientemente malvado como para unirse a ellos, con el respaldo de sus seguidores, los Minions.', 'en', '/2gGVdr0BcKzma68SW2jpZfJtOlB.jpg', '/asE7W6XInrfxZ24svc5k24DTpek.jpg', '2022-06-16', 87, 'EgXQmSW16YY', 'Cartelera', 0),
(75, 'Padre no hay más que uno 2: la llegada de la suegra', 'Padre no hay más que uno 2: la llegada de la suegra', 'El éxito del asistente virtual Conchy, desarrollado por Javier, le ha valido un lugar favorable en la sala de chat de los padres, hasta que algo inesperado lo arruina todo.', 'es', '/rbONN3UloJa4syJn6pHlDqZsQqx.jpg', '/7MjODwcPV5tAEa1zlje9N4gReGS.jpg', '2020-07-29', 96, 'MIn-Iui3r-E', 'Pasado', 0),
(76, 'Padre no hay mas que Uno 3', 'Padre no hay mas que Uno 3', '', 'es', '', '/k0NLfgdPckYziQ9EusUGXI1S6iF.jpg', '2022-07-15', 0, '', 'Proximamente', 0),
(77, 'Padre no hay más que uno', 'Padre no hay más que uno', 'Javier es un hombre que cree saberlo todo, pero no mueve un dedo para ayudar a su mujer en el cuidado de la casa y de sus cinco hijos. Sin embargo, este padre de familia tiene que enfrentarse a la realidad cuando su mujer decide irse de viaje y dejarlo solo con sus hijos. Esta será una experiencia que cambiará las vidas de todos para siempre.', 'es', '/1ILgy7Qw3aDDIIU1u3bauMimhSS.jpg', '/eDLO2nr5xhjOfxDAj3gQao495kw.jpg', '2019-08-02', 95, 'eO5uFEEmrIE', 'Pasado', 0),
(78, 'Flores', 'Loreak', 'La vida de Ane da un giro cuando semanalmente comienza a recibir de forma anónima un ramo de flores en su casa. Por su parte las vidas de Lourdes y Tere también se ven afectadas por unas misteriosas flores. Un desconocido deposita cada semana un ramo en memoria de alguien que fue importante en sus vidas. Esta es la historia de tres mujeres, tres vidas alteradas por la mera presencia de unas flores. Flores que harán brotar en ellas sentimientos que parecían olvidados… Pero al fin y al cabo, no son más que flores.', 'eu', '/if1Tu2BHexu1KDvFs4KuqUtetvj.jpg', '/7qhYyOZ6m6mrwC3c0XY27UzDlQz.jpg', '2014-10-10', 99, 'kTFRCIp_gks', 'Pasado', 0),
(80, 'Avatar: El sentido del agua', 'Avatar: The Way of Water', 'Ambientada más de una década después de los acontecimientos de la primera película, \'Avatar: The Way of Water\' empieza contando la historia de la familia Sully (Jake, Neytiri y sus hijos), los problemas que los persiguen, lo que tienen que hacer para mantenerse a salvo, las batallas que libran para seguir con vida y las tragedias que sufren.', 'en', '/wEQ0Pu2jEyqHKOJRAdAKaeTFCML.jpg', '/9M7keGGsRmCQq1jX4p9wujLZ3bQ.jpg', '2022-12-14', 0, 'wWkPlwNimS4', 'Proximamente', 0),
(81, 'De storm', 'De storm', 'Una terrible tormenta en Zelanda causa en 1953 la ruptura de los diques que protegen estas tierras de los embates del mar. Julia, una madre soltera que vive en la granja de sus padres, queda atrapada en mitad de una inundación que afecta a toda la región del sur de los Países Bajos. A pesar de que su joven vecino Aldo consigue rescatarla la mujer está desconsolada ya que su bebé quedó atrapado en una caja de madera en el ático de la casa. Cuando vuelven a la zona del desastre descubren que el niño ha desaparecido. Las posibilidades de que su hijo siga vivo son mínimas, pero Julia está convencida de que su hijo vive y comienza su búsqueda en compañía de Aldo (FILMAFFINITY).', 'nl', '/vLrYs1tQuT8VbETvTd1CGLXEv3u.jpg', '/ywfOSmEsMnBHN6jmLBkYMcmmcYI.jpg', '2009-09-17', 96, '', 'Pasado', 0),
(82, 'Dark Storm', 'Dark Storm', 'En una base militar secreta, un grupo de científicos  inventa el Eruptor, un arma capaz de reducir cualquier cuerpo a cenizas inyectándole materia a presión. De repente, el aparato se descontrola y se vuelve contra uno de los especialistas, que en vez de morir, adquiere superpoderes. Ahora, el hombre deberá enfrentarse a su jefe, que pretende utilizar el Eruptor para acabar con la Humanidad.', 'en', '/xYg1nKwLPJOUVL6nWnRst4AeGMK.jpg', '/tHZroeyMpXmOaIO2E0TER6rzte3.jpg', '2006-06-15', 90, '', 'Pasado', 0),
(83, 'Tormenta magnética', 'Polar Storm', 'Un cometa impacta la Tierra causando diversas catástrofes naturales. Cuando el Dr. James Mayfield -el único que predijo que había peligro de impacto contra el planeta- y su equipo de científicos descubren que la corteza de la Tierra se desprende, emprenden una carrera contrarreloj para salvar al planeta de su total destrucción.', 'en', '/mxo3vQ9J8HMArAZqQLzgHIPD9w9.jpg', '/mD7nAZXnkIYJ6T4c1xOyK9qxRO8.jpg', '2009-03-28', 92, '', 'Pasado', 0),
(84, 'Huracán', '500 MPH Storm', 'Al fallar un experimento de energía, una ola de huracanes masivos cruza a través de Norteamérica, destruyen todo a su paso. Un profesor de ciencias debe sacar a su familia y llevarla a un lugar seguro, antes que se combinen los huracanes dando lugar a la creación de un \"hipercán\" con el poder de borrar los Estados Unidos del mapa. (FILMAFFINITY)', 'en', '/nddudkiXQbmE1cKUDQBSs4XAbME.jpg', '/qHAAMu1eFRY5648otdCeP4OiaeT.jpg', '2013-02-28', 90, '', 'Pasado', 0),
(85, 'Lluvia de fuego', 'Meteor Storm', 'San Francisco se convierte en objetivo de las ondas de los meteoritos destructivos, después de separarse de la un cometa que esta en órbita con la Tierra. Para el astrónomo, Dr. Michelle Young, se convierte en su peor pesadilla al ver que miles de meteoritos rompen la superficie de la atmósfera y bombardean la ciudad.', 'en', '/vDRcux3EHYluUF1TTi2DcE1K98Q.jpg', '/uBtzK2LNfhTzxmY0bSMQKKKXtYt.jpg', '2010-01-30', 90, '', 'Pasado', 0),
(86, 'Amigos para siempre', 'Storm Boy', 'Basada en el aclamado libro homónimo, Storm Boy es la historia de un joven que crece en la hermosa pero deshabitada costa del sur de Australia y que inesperadamente rescata a tres pelícanos huérfanos. Tras crear un vínculo cercano con ellos se verá en una peculiar situación con su padre pescador, con lo que su vida dará un nuevo e inesperado giro.', 'en', '/2Oli8Jo72w4NjkHLOMy6EzkoYkU.jpg', '/geQ8xR84vmv44NuYgjmhvHF5HNm.jpg', '2019-01-17', 99, '', 'Pasado', 0),
(87, 'Tormenta del pasado (Tornado)', 'Storm Cell', 'Tras presenciar cómo sus padres morían a causa de un tornado, una joven decide convertirse en una experta de condiciones climática extremas. Cuando un tornado amenaza con destruir la ciudad en la que su hermano es el Sherif, intentará persuadirle para evacuar la ciudad... (FILMAFFINITY)', 'en', '/6lrMEBk5TNGfag1hg0l602VS0Ck.jpg', '/hdfKZzMVyV07kyU30hQbDspsHKc.jpg', '2008-04-26', 92, '', 'Pasado', 0),
(88, 'La tormenta de hielo', 'The Ice Storm', 'Noviembre de 1973, New Cannan, Connecticut. La liberación sexual tan de moda ha llegado a los suburbios y ha salpicado a las acomodadas y tradicionales familias americanas, que, de pronto, se aficionan al intercambio de parejas. Esta situación afecta a la familia Hood. Ben Hood pretende acostarse con la vecina de enfrente, pero su esposa empieza a estar harta de las mentiras de su marido. En la noche de Acción de Gracias, una serie de acontecimientos lleva a los Hood a replantearse su vida.', 'en', '/tJaLKL1ARoF6eG2aUzaKY4C22vP.jpg', '/zkPnm8mCrCsMavdJYQEX39zk9bz.jpg', '1997-02-05', 120, '', 'Pasado', 0),
(90, 'La tormenta perfecta', 'The Perfect Storm', 'Gloucester (Massachussetts), octubre de 1991. El Andrea Gail es un barco de pesca capitaneado por Billy Tyne, un veterano pescador cuyas últimas salidas se han saldado con paupérrimas capturas. Buscando un golpe de suerte que haga cambiar esta mala racha, se interna en el Flemish Cap, un lugar más allá de las zonas frecuentadas por los pescadores. Lo que ignora es que, a la zona donde faena, se está aproximando la tormenta más aterradora, violenta y destructiva que se pueda concebir.', 'en', '/cmOWlfDvBSMyLaeZ85M87GmkH8v.jpg', '/75aRoXgG74D5wbSqEQAYFpFFJ0V.jpg', '2000-06-29', 130, '', 'Pasado', 0),
(91, 'En el ojo de la tormenta', 'Into the Storm', 'En el transcurso de un solo día, la ciudad de Silverton es azotada por una serie de tornados sin precedentes. Toda la ciudad está a merced de ciclones erráticos y mortales, mientras que los cazadores de tormentas predicen que lo peor está aún por llegar. La mayoría de las personas buscan refugio, mientras que otras corren hace el vórtice, poniendo a prueba hasta dónde está dispuesto a llegar un cazador de tormentas para conseguir esa foto única que sólo se hace una vez en la vida. Contada a través de los ojos y de los objetivos fotográficos de cazadores profesionales de tormentas, aficionados en busca de emociones y valientes vecinos de la ciudad, “En el ojo de la tormenta” te lleva directamente al ojo de la tormenta para experimentar lo que ofrece la Madre Naturaleza en sus momentos más extremos.', 'en', '/5fHgVvQgndLSiUxbeQuJaZlkQl.jpg', '/3uXIByYUDDhRgkY4uyIE9bgTdA3.jpg', '2014-08-06', 89, 'iJJJUEy5Vsg', 'Pasado', 0),
(92, 'Infinite Storm', 'Infinite Storm', 'El viaje de una mujer por el autodescubrimiento se convierte en una desgarradora historia de supervivencia.', 'en', '/o0JpLYCadyUCR4KwxN7hrzFE968.jpg', '/4B34NKfHCFVHriYfKhbsunHYl4x.jpg', '2022-03-25', 97, '', 'Pasado', 0),
(93, 'Resident Evil: El capítulo final', 'Resident Evil: The Final Chapter', 'La humanidad está agonizando tras la traición sufrida por Alice a manos de Wesker. Alice deberá regresar a donde la comenzó la pesadilla -Raccoon City-, ya que allí la Corporación Umbrella está reuniendo fuerzas antes de un último ataque a los últimos supervivientes del apocalipsis. En una carrera contra el tiempo, Alice tendrá que unir fuerzas con viejos amigos y con un inesperado aliado en una batalla contra hordas de zombis y nuevos monstruos mutantes. Será la aventura más difícil de Alice para salvar a la humanidad, que está al borde de la extinción.', 'en', '/sQRfWdDxH53Vk7ZJ1UqzcaBHocO.jpg', '/il1B9mM7Cn9ccavnilzUGKL1xzQ.jpg', '2016-12-23', 107, 'ft8-IJ-vFr4', 'Pasado', 0),
(94, 'Resident Evil 4: Ultratumba', 'Resident Evil: Afterlife', 'En un mundo asolado por un virus infeccioso que convierte a sus víctimas en muertos vivientes, Alice continúa buscando supervivientes para ponerlos a salvo. Su batalla a muerte con la Corporación Umbrella llega a alturas insospechadas, pero Alice, inesperadamente, recibe ayuda de una vieja amiga. Nuevas pistas, con la promesa de un paraíso a salvo de muertos vivientes, los conduce hasta Los Ángeles, pero cuando llegan, la ciudad está infectada con miles de muertos vivientes. Alice y sus compañeros están a punto de caer en una trampa mortal.', 'en', '/eh6hHxOuYE1JfZmg4285Hq7S0ra.jpg', '/20Lc7ZCcbVuDCbBBmtB2Ul0o90.jpg', '2010-09-09', 97, 'MgMrw9yX9bM', 'Pasado', 0),
(95, 'Resident Evil: Venganza', 'Resident Evil: Retribution', 'El virus de la corporación Umbrella sigue haciendo estragos en La Tierra convirtiendo a la población en legiones de muertos sedientos de sangre. La última esperanza de la humanidad, Alice, despierta en el centro de operaciones de la compañía donde comienza a conocer más detalles de su pasado. Alice seguirá persiguiendo a los responsables del virus llevándola por Tokio, Nueva York, Washington y Moscú donde le será revelado algo que la hará plantearse todo lo que la ha sucedido hasta ahora. Con la ayuda de sus nuevos aliados, Alice deberá sobrevivir el tiempo suficiente para escapar de un mundo hostil... La cuenta atrás ha comenzado.', 'en', '/fB0a9sR2fdR1WIRvjzrqMd3WSFL.jpg', '/s1jwnt0mfZNrYcTlws5nzCaFp5Q.jpg', '2012-09-12', 96, '', 'Pasado', 0),
(96, 'La víctima perfecta', 'The Resident', 'Juliet Deverau (Hilary Swank) es una doctora que está buscando un apartamento de alquiler en Nueva York, ya que ha decidido cambiar de hogar. En su búsqueda encuentra un apartamento a su gusto en el que conoce a Max (Jeffrey Dean Morgan), el propietario del bloque de apartamentos donde se encuentra y a su abuelo August (Christopher Lee). Por las noches, con el paso cercano de un tren, tiembla la casa y los objetos se caen. Este ruido produce que Juliet no se de cuenta de que hay un acosador en su casa que la está observando. Poco a poco, Juliet se dará cuenta de que están pasando cosas sospechosas y empezará a preguntarse si hay alguien más en la casa.', 'en', '/6opP1ChcxCXb9FS7yEn1xyxIIJC.jpg', '/a6gzrOLHU1H7H9Fpc9kCkM8hf2m.jpg', '2011-02-10', 88, '', 'Pasado', 0),
(97, 'Resident Evil 3: Extinción', 'Resident Evil: Extinction', 'Tercera entrega de la saga basada en los famosos videojuegos. En esta ocasión, nuestra heroína, Milla Jovovich, junto con los supervivientes de la catástrofe acontecida en la ciudad de Raccoon deben atravesar el desierto de Nevada con la esperanza de llegar a Alaska, antes de que los de la Corporación Umbrella les alcancen.', 'en', '/cNFrY4dK3r6BhXrE8f1crjEn5rb.jpg', '/7pYyfJwwiR5vl1ZCrni2fVsfqyj.jpg', '2007-09-20', 95, '', 'Pasado', 0),
(98, 'Resident Evil 2: Apocalipsis', 'Resident Evil: Apocalypse', 'Un virus mortal ha sido liberado sobre la población de Raccoon City. Alice (Milla Jovovich), una de las supervivientes del desastre bioquímico, se encuentra en el corazón de esta devastada ciudad. Sometida a experimentos que han alterado su genética, ahora posee fuerza, sentidos y destreza sobrehumana. Estas habilidades, y más, serán las que deba utilizar quien quiera sobrevivir en esta nueva aventura. Junto con otros supervivientes deberá escapar de la cada vez más peligrosa Raccoon City. Para alcanzar su meta necesitarán luchar contra las fuerzas de la Umbrella Corporation, las violentas criaturas de bioingeniería creadas en sus laboratorios, los zombies que plagan la ciudad y, finalmente, enfrentarse a la más colosal y mortal de estas creaciones: Nemesis.', 'en', '/48RFr2WhpVgLSQGS3ugaXlX2Ykx.jpg', '/goVSqAsY54LJZ29gNRM8Kq8lDlp.jpg', '2004-09-10', 94, 'SwSLx-Img2w', 'Pasado', 0),
(99, 'Resident Evil', 'Resident Evil', 'En un centro clandestino de investigación genética -con fines militares- de una poderosa multinacional se produce un brote vírico que contamina todo el edificio. Para contener la fuga el ordenador que controla el centro sella toda la instalación y, en un principio se cree que mueren todos los empleados, pero en realidad se han convertido en feroces zombis...', 'en', '/l5KvxFVOru3Qyf3dl2asNw5g1MD.jpg', '/f8kYxuHNkFkhA7I4IKAk8sN9bdY.jpg', '2002-03-15', 96, '', 'Pasado', 0),
(100, 'Resident Evil: Bienvenidos a Raccoon City', 'Resident Evil: Welcome to Raccoon City', 'Nueva adaptación al cine de los videojuegos de Capcom. La que fue una pujante ciudad sede del gigante farmacéutico Umbrella Corporation, Raccoon City, es ahora un pueblo agonizante del Medio Oeste. El éxodo de la compañía dejó a la ciudad convertida en un erial… con un gran mal gestándose bajo la superficie. Cuando ese mal se desata, un grupo de supervivientes deben unirse para destapar la verdad detrás de Umbrella y sobrevivir a la noche.', 'en', '/o76ZDm8PS9791XiuieNB93UZcRV.jpg', '/5mmh2jNV7NMZt2yw32OApuB0mw0.jpg', '2021-11-24', 107, '', 'Pasado', 0),
(101, 'Star Trek: Beyond the Final Frontier', 'Star Trek: Beyond the Final Frontier', '', 'en', '/ysM4ju2BKrI4R5BuAv2mtVJdC3n.jpg', '/7F9L9EozjXtn30Hw2TsK42UedX5.jpg', '2007-02-19', 90, '', 'Pasado', 0),
(102, 'Star Trek: Secrets of the Universe', 'Star Trek: Secrets of the Universe', '', 'en', '/jA09e9RryWU4zKOTxTDKVbnFHlE.jpg', '/yn5uWoBdjKvJA8m04z4H2sjUeRC.jpg', '2013-05-16', 81, '', 'Pasado', 0),
(103, 'Building Star Trek', 'Building Star Trek', '', 'en', '/71xyy6Ix9g9QV1kpQgCm1lrgtb6.jpg', '/4jWFApBrTGO4BBbHo3frxFvRRkP.jpg', '2016-09-04', 92, '', 'Pasado', 0),
(104, 'Star Trek: 25th Anniversary Special', 'Star Trek: 25th Anniversary Special', '', 'en', '', '/qifn2LhQThccAg6wR6alv8CoJ3h.jpg', '1991-09-28', 93, '', 'Pasado', 0),
(105, 'Star Trek III: En busca de Spock', 'Star Trek III: The Search for Spock', 'Tras la desaparición de Spock y la creación del planeta Génesis, la tripulación del Enterprise se dispone a localizar el cuerpo de su compañero, a petición del padre de éste.', 'en', '/5lUpy6OrDhzdeAGBaM1mIsQvfOl.jpg', '/mYpIdoeO9jb0llGP6NGc8uCA0Wy.jpg', '1984-06-01', 101, '', 'Pasado', 0),
(106, 'Star Trek VI: Aquel país desconocido', 'Star Trek VI: The Undiscovered Country', 'Tras años de guerra, la Federación y el Imperio Klingon se disponen a celebrar una conferencia de paz. Pero el panorama de una negociación intergaláctica, con implacables enemigos, preocupa al Almirante Kirk. Cuando una nave Klingon es atacada y responsabilizan al Enterprise, ambos mundos se preparan para el que puede ser su encuentro definitivo.', 'en', '/nGJTamFPZ9V4JX5YpiOS0UDuwmx.jpg', '/hRc7IjEmCxglPqs5uQ07bq4Tm3Y.jpg', '1991-12-06', 109, '', 'Pasado', 0),
(107, 'Star Trek II: La ira de Khan', 'Star Trek II: The Wrath of Khan', 'El Enterprise transporta a un grupo de científicos que se disponen a poner a prueba el mayor experimento jamás imaginado por el hombre: la formación de vida en un planeta inerte.', 'en', '/oXs8kp1oX5N0Mte6U8UUAwmLwt6.jpg', '/dOiRM3jNyI4whH4GtO1PePluHK6.jpg', '1982-06-04', 112, 'JjjPwogbT9o', 'Pasado', 0);
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `titulooriginal`, `sinopsis`, `idiomaoriginal`, `fondo`, `poster`, `estreno`, `duracion`, `trailer`, `estado`, `idgenero`) VALUES
(108, 'Star Trek V: La última frontera', 'Star Trek V: The Final Frontier', 'La nave Enterprise se dirige al planeta Nimbus III, para negociar la liberación de unos embajadores secuestrados. Allí descubrirán que el jefe de la banda es un pariente de Spock, obsesionado por encontrar el planeta que es considerado la fuente de la vida.', 'en', '/y0klN15XPVyYtd4P7HYecgJXSsZ.jpg', '/qpca5hNu3eUR68c80YnMukZ3cNm.jpg', '1989-06-09', 102, '', 'Pasado', 0),
(109, 'Star Trek IV: Misión salvar la Tierra', 'Star Trek IV: The Voyage Home', 'En el siglo XXIII, un misterioso poder alienígena amenaza la Tierra, evaporando los océanos y destruyendo la atmósfera. En un frenético intento para salvar a la humanidad, el Capitán Kirk y su tripulación viajan en el tiempo y regresan al San Francisco de 1986, encontrándose con un mundo de punks, pizza y autobuses de cambio exacto, que les resultan tan alienígenas como todo lo que han encontrado en los lugares más recónditos de la galaxia.', 'en', '/wN3dgwkiWSLrMVukPQIeccv5EJ6.jpg', '/242qm4seg37y6I6Y0ADAaLLQw2n.jpg', '1986-11-26', 114, '', 'Pasado', 0),
(110, 'Star Trek VII: La próxima generación', 'Star Trek: Generations', 'James T. Kirk, Montgomery Scott y Pavel Chekov asisten al viaje inaugural del USS Enterprise-B, que es requerido para ayudar a un convoy de naves que se hallan atrapadas en un cinturón de energía. Debido a la inexperiencia del capitán, Kirk decide ayudar pero cuando la cubierta donde se hallaba es destruida por una ráfaga de energía, es dado por muerto.', 'en', '/mNdsbVuRdsyo8eitW2IBW2BWRkU.jpg', '/jPq2exR55lDKbgNOK1EZYJe1G1S.jpg', '1994-11-18', 113, '', 'Pasado', 0),
(111, 'Star Trek: La película', 'Star Trek: The Motion Picture', 'Siglo XXIII. Al Almirante James T. Kirk, de la nave Enterprise, se le encomienda una difícil misión: neutralizar un extraño cuerpo para que no colisione con la Tierra. El Oficial Spock, el Capitán Willard Decker, la Asesora Ilía y el Doctor McCoy ayudan al Almirante Kirk a descubrir la naturaleza de este cuerpo sideral, provisto de un mecanismo de inteligencia de origen terrestre. La expedición del Enterprise localiza al ente y entonces se apresta a introducirse en su centro de operaciones...', 'en', '/tdEsBRophyizObx5ABwJkOUQHOA.jpg', '/zvrs4RU6zSFzcRWdqZFWsGUAsOS.jpg', '1979-12-07', 131, '', 'Pasado', 0),
(112, 'Star Trek VIII: Primer contacto', 'Star Trek: First Contact', 'El Capitán del Enterprise encuentra de nuevo a sus adversarios, los Borg, a quienes intenta impedir modificar la historia y conquistar la Tierra en el siglo XXI, por medio de un viaje en el tiempo, que impediría el primer vuelo warp de la raza humana y el consiguiente primer contacto con una raza extraterrestre: los vulcanos.', 'en', '/wygUDDRNpeKUnkekRGeLCZM93tA.jpg', '/vbsy6QcogVJoeDiEweoE8zxgJON.jpg', '1996-11-22', 106, '', 'Pasado', 0),
(113, 'Star Trek IX: Insurrección', 'Star Trek: Insurrection', 'Jean-Luc Picard, capitán del USS Enterprise, recibe un mensaje de la flota. Al parecer, el comandante Data, que se encontraba estudiando una sociedad primitiva, ha sufrido un cortocircuito y ha revelado la existencia del equipo de investigación a los habitantes del planeta Ba\'Ku. Pronto descubrirá que intentaba defender a ésta sociedad inocente de las aspiraciones de los Son\'a.', 'en', '/goNk0VDnUjxKjB6o69kYS5vvZo2.jpg', '/9ZB8LIxXySEkHPjdpnRMWQg4HMQ.jpg', '1998-12-11', 99, '', 'Pasado', 0),
(114, 'Star Trek X: Némesis', 'Star Trek: Nemesis', 'La policía romulana obtiene ADN del Capitán Picard y fabrican un clon, llamado Shinzon, con la finalidad de introducirlo en la Federación, pero ese plan queda en nada y envían al clon a las minas de dilitio de Remo, el planeta hermano de Rómulo, la capital del Imperio Romulano. Shinzon organiza un golpe de estado gracias a las fuerzas Remanas y su imbatible nave erigiéndose nuevo Pretor Romulano.', 'en', '/6z9w8eidKWDDXwZNSVNaRolAYEP.jpg', '/aoCmdSirI5PWyFJMTkx23lLILRW.jpg', '2002-12-13', 112, '', 'Pasado', 0),
(115, 'Harry Potter: una historia de magia', 'Harry Potter: A History Of Magic', 'En el período previo a la exhibición de Harry Potter: Una historia de magia, J.K. Rowling va tras bambalinas en la Biblioteca Británica para revelar algunas de las contrapartes de la vida real de sus personajes.', 'en', '/mjCYpJXCBYDZgMr1U1KZcFgFDfC.jpg', '/geike7VgTrftxwzcvND4dRdZdAv.jpg', '2017-10-28', 60, '', 'Pasado', 0),
(116, 'Harry Potter y la Orden del Fénix', 'Harry Potter and the Order of the Phoenix', 'Harry Potter regresa por quinto año a Hogwarts aún sacudido por la tragedia ocurrida en el Torneo de los Tres Magos. Debido a que el Ministro de la Magia niega el regreso de Lord Voldemort, Harry se convierte en el centro de atención de la comunidad mágica. Mientras lucha con sus problemas en el colegio, incluyendo a la nueva profesora Dolores Umbridge, intentará aprender más sobre la misteriosa Orden del Fénix.', 'en', '/sO2VWeJ8qagNtYoznyLRL8TeSkw.jpg', '/z5bL1z1ZOAKBkvbOhVQp6GfBv4u.jpg', '2007-06-28', 138, 'wmef9GgR3T4', 'Pasado', 0),
(118, 'Harry Potter y las Reliquias de la Muerte - Parte 1', 'Harry Potter and the Deathly Hallows: Part 1', 'Una tarea casi imposible cae sobre los hombros de Harry: deberá encontrar y destruir los horrocruxes restantes para dar fin al reinado de Lord Voldemort. En el episodio final de la saga, el hechicero de 17 años parte junto con sus amigos Hermione Granger y Ron Weasley en un peligroso viaje por Inglaterra para encontrar los objetos que contienen los fragmentos del alma del Señor Tenebroso, los cuales garantizan su longevidad. Pero el camino no será fácil pues el lado oscuro adquiere más poder con cada minuto que pasa y las lealtades serán puestas a prueba. Harry deberá usar todos los conocimientos que gracias a Dumbledore ha adquirido sobre su enemigo para poder encontrar la forma de sobrevivir a esta última aventura.', 'en', '/fXRXpzxUApE3OuXhIqsdavQjCVa.jpg', '/w6wsYKdXERaXRdByPsI2O9rn20b.jpg', '2010-10-17', 146, 'f3O0odK1VIQ', 'Pasado', 0),
(119, 'Harry Potter y las Reliquias de la Muerte - Parte 2', 'Harry Potter and the Deathly Hallows: Part 2', 'La segunda parte de la batalla final entre las fuerzas del bien y el mal. El juego nunca ha sido tan peligroso y nadie está a salvo. Se acerca el momento de la confrontación final entre Harry Potter y Lord Voldemort. Todo termina aquí…', 'en', '/n5A7brJCjejceZmHyujwUTVgQNC.jpg', '/wjKy2wSlDiLLLIkM7tHnxsXG8Tp.jpg', '2011-07-07', 130, 'M1me0fEgYxY', 'Pasado', 0),
(122, 'Harry Potter y la cámara secreta', 'Harry Potter and the Chamber of Secrets', 'Harry regresa a su segundo año a Hogwarts, pero descubre que cosas malas ocurren debido a que un sitio llamado la Cámara de los Secretos ha sido abierto por el heredero de Slytherin y hará que los hijos de muggles, los impuros, aparezcan petrificados misteriosamente por un animal monstruoso.', 'en', '/1stUIsjawROZxjiCMtqqXqgfZWC.jpg', '/3nvGqfZE3yrsqehpF107byUdUSq.jpg', '2002-11-13', 150, 'C8CL5TbiFwY', 'Pasado', 0),
(124, 'Harry Potter y la piedra filosofal', 'Harry Potter and the Philosopher\'s Stone', 'Harry Potter es un huérfano que vive con sus desagradables tíos, los Dursley, y su repelente primo Dudley. Se acerca su undécimo cumpleaños y tiene pocas esperanzas de recibir algún regalo, ya que nunca nadie se acuerda de él. Sin embargo, pocos días antes de su cumpleaños, una serie de misteriosas cartas dirigidas a él y escritas con una estridente tinta verde rompen la monotonía de su vida: Harry es un mago y sus padres también lo eran.', 'en', '/5jkE2SzR5uR2egEb1rRhF22JyWN.jpg', '/roKMM6S9DRGFNujmvqlk8l5YbN3.jpg', '2001-11-16', 152, 'WE4AJuIvG1Y', 'Pasado', 0),
(125, 'Vengadores: Endgame', 'Avengers: Endgame', 'Después de los eventos devastadores de \'Vengadores: Infinity War\', el universo está en ruinas debido a las acciones de Thanos. Con la ayuda de los aliados que quedaron, los Vengadores deberán reunirse una vez más para intentar deshacer sus acciones y restaurar el orden en el universo de una vez por todas, sin importar cuáles sean las consecuencias... Cuarta y última entrega de la saga \"Vengadores\".', 'en', '/7RyHsO4yDXtBv1zUU3mTpHeQ0d5.jpg', '/br6krBFpaYmCSglLBWRuhui7tPc.jpg', '2019-04-24', 181, 'UQ3bqYKnyhM', 'Pasado', 0),
(126, 'Vengadores: La era de Ultrón', 'Avengers: Age of Ultron', 'Cuando Tony Stark intenta reactivar un programa caído en desuso cuyo objetivo es mantener la paz, las cosas empiezan a torcerse y los héroes más poderosos de la Tierra, incluyendo a Iron Man, Capitán América, Thor, El Increíble Hulk, Viuda Negra y Ojo de Halcón, tendrán que afrontar la prueba definitiva cuando el destino del planeta se ponga en juego. Cuando el villano Ultron emerge, le corresponderá a Los Vengadores detener sus terribles planes, que junto a incómodas alianzas llevarán a una inesperada acción que allanará el camino para una épica y única aventura.', 'en', '/xnqust9Li4oxfhXD5kcPi3UC8i4.jpg', '/71wSx6MQm8EbMNDi3vVaD8nD9SL.jpg', '2015-04-22', 140, 'JQWGle-bKmE', 'Pasado', 0),
(127, 'Vengadores: Infinity War', 'Avengers: Infinity War', 'El todopoderoso Thanos ha despertado con la promesa de arrasar con todo a su paso, portando el Guantelete del Infinito, que le confiere un poder incalculable. Los únicos capaces de pararle los pies son los Vengadores y el resto de superhéroes de la galaxia, que deberán estar dispuestos a sacrificarlo todo por un bien mayor. Capitán América e Ironman deberán limar sus diferencias, Black Panther apoyará con sus tropas desde Wakanda, Thor y los Guardianes de la Galaxia e incluso Spider-Man se unirán antes de que los planes de devastación y ruina pongan fin al universo. ¿Serán capaces de frenar el avance del titán del caos?', 'en', '/lmZFxXgJE3vgrciwuDib0N8CfQo.jpg', '/ksBQ4oHQDdJwND8H90ay8CbMihU.jpg', '2018-04-25', 156, '-f5PwE_Q8Fs', 'Pasado', 0),
(128, 'Terminator 3: La rebelión de las máquinas', 'Terminator 3: Rise of the Machines', 'Ha pasado una década desde que John Connor salvara a la humanidad de la destrucción. En la actualidad John tiene 25 años y vive en la clandestinidad: no hay ninguna prueba documental de su existencia. Así evita ser rastreado por Skynet, la sofisticada corporación de máquinas que una vez intentó acabar con su vida. Pero, ahora, desde el futuro, ha sido enviado el T-X, la máquina destructora cyborg más desarrollada de Skynet. Su misión es completar el trabajo que no pudo terminar su predecesor, el T-1000. El T-X es una máquina tan implacable como bello su aspecto humano. Ahora la única esperanza de sobrevivir para Connnor es Terminator.', 'en', '/kbXMOnz2RhTSAbLtHX5hy5AXtwv.jpg', '/ugVNhnnH3DKUZZ3JtzRkViIh4L9.jpg', '2003-07-02', 109, 'ibBd95IMeTo', 'Pasado', 0),
(129, 'Terminator 2: El juicio final', 'Terminator 2: Judgment Day', 'Ha pasado once años desde que Sarah Connor fue marcada como objetivo para ser eliminada por un cyborg del futuro. Ahora su hijo John, el futuro líder de la resistencia, es el objetivo de un Terminator más moderno, más mortífero. Una vez más, la resistencia se las ha ingeniado para enviar un protector de vuelta al pasado para intentar salvar a John y a su madre Sarah.', 'en', '/xKb6mtdfI5Qsggc44Hr9CCUDvaj.jpg', '/qtgdiEwBDdyyMj241DURRCiD5se.jpg', '1991-07-03', 137, 'UJ4JNMdrhKI', 'Pasado', 0),
(130, 'Terminator', 'The Terminator', 'Un cyborg ha sido enviado desde el futuro en una misión mortal: eliminar a Sarah Connor, una joven cuya vida tendrá una gran importancia en los próximos años. Sarah tiene sólo un protector —Kyle Reese— también enviado desde el futuro. El Terminator utiliza su inteligencia excepcional y fuerza para encontrar a Sarah, pero ¿hay alguna forma de detener al cyborg aparentemente indestructible?', 'en', '/ahUaAgnkFu7QlBh5h4LCNeaSurV.jpg', '/kbPqRWsGS1siVUeEFVtLKloTG0Y.jpg', '1984-10-26', 108, 'xWCBs-Ib1Fo', 'Pasado', 0),
(131, 'Terminator: Destino oscuro', 'Terminator: Dark Fate', 'Sarah Connor une todas sus fuerzas con una mujer cyborg para proteger a una joven de un extremadamente poderoso y nuevo Terminator.', 'en', '/a6cDxdwaQIFjSkXf7uskg78ZyTq.jpg', '/k7PuHoj2oE7nEHExwliF2FSXFnr.jpg', '2019-10-23', 120, 'jZwOU8mxoVg', 'Pasado', 0),
(132, 'Terminator: Salvation', 'Terminator Salvation', 'Nueva entrega de la saga de Terminator, que transcurre en un post-apocalíptico 2018, tras el día del Juicio Final. John Connor es el hombre destinado a liderar la resistencia de los humanos contra Skynet y su ejército de Terminators. Pero el futuro en el que a Connor le enseñaron a creer se ve alterado en parte por la aparición de Marcus Wright, un extraño cuyo último recuerdo es haber estado en el corredor de la muerte, y que afirma haber estado con Kyle Reese, el padre de John. Connor debe decidir si Marcus ha sido enviado desde el futuro o rescatado del pasado, todo en una carrera contrareloj mientras la Resistencia prepara su ataque final contra el corazón del centro de operaciones de Skynet.', 'en', '/lo70DEjfUOweEosuPPIlcIOhhBm.jpg', '/rgNYnAT16rn592QjjxJ1zRB5uoG.jpg', '2009-05-20', 115, 'DfpWaRfN35w', 'Pasado', 0),
(133, 'Terminator Génesis', 'Terminator Genisys', 'Año 2032. La guerra del futuro se está librando y un grupo de rebeldes humanos tiene el sistema de inteligencia artificial Skynet contra las cuerdas. John Connor es el líder de la resistencia, y Kyle Reese es su fiel soldado, criado en las ruinas de una postapocalíptica California. Para salvaguardar el futuro, Connor envía a Reese a 1984 para salvar a su madre, Sarah de un Terminator programado para matarla con el fin de que no llegue a dar a luz a John. Pero lo que Reese encuentra en el otro lado no es como él esperaba.', 'en', '/g4a5YLWwi6OCp8TcvxsUNrXMbN5.jpg', '/vky6H7mCBjSsg1GMGJtJpGUeVS1.jpg', '2015-06-23', 126, '0vrj9V-vYZc', 'Pasado', 0),
(134, 'Fast and Furious - La Saga no Limit', 'Fast and Furious - La Saga no Limit', '', 'fr', '', '/xxiwm75ADoHu0NCDObRG1AnHi02.jpg', '2017-04-12', 41, '', 'Pasado', 0),
(135, 'A todo gas: Tokyo Race', 'The Fast and the Furious: Tokyo Drift', 'Shaun Boswell es un chico que no acaba de encajar en ningún grupo. Su única conexión con el mundo de indiferencia que le rodea es a través de las carreras ilegales, lo que no le ha convertido en el chico favorito de la policía. Cuando amenazan con encarcelarle, le mandan fuera del país a pasar una temporada con su tío, un militar destinado en Japón. En el país donde nacieron la mayoría de los coches modificados, las simples carreras en la calle principal han sido sustituidas por el último reto automovilístico que desafía la gravedad, las carreras de \"drift\" (arrastre), una peligrosa mezcla de velocidad en pistas con curvas muy cerradas y en zigzag. En su primera incursión en el salvaje mundo de las carreras de \"drift\", Shaun acepta ingenuamente conducir un D.K, el Rey del Drift, que pertenece a los Yakuza, la mafia japonesa. Para pagar su deuda, no tiene más remedio que codearse con el hampa de Tokio y jugarse la vida.', 'en', '/dMARcKLrv0T7kVJ4iQR3vqTTdtT.jpg', '/v9Wu4u2FkGFgT0K9pxUX4IH8UYh.jpg', '2006-06-03', 104, 'PTs-6FIXQiI', 'Pasado', 0),
(136, 'El señor de los anillos: La comunidad del anillo', 'The Lord of the Rings: The Fellowship of the Ring', 'En la Tierra Media, el Señor Oscuro Saurón creó los Grandes Anillos de Poder, forjados por los herreros Elfos. Tres para los reyes Elfos, siete para los Señores Enanos, y nueve para los Hombres Mortales. Secretamente, Saurón también forjó un anillo maestro, el Anillo Único, que contiene en sí el poder para esclavizar a toda la Tierra Media. Con la ayuda de un grupo de amigos y de valientes aliados, Frodo emprende un peligroso viaje con la misión de destruir el Anillo Único. Pero el Señor Oscuro Sauron, quien creara el Anillo, envía a sus servidores para perseguir al grupo. Si Sauron lograra recuperar el Anillo, sería el final de la Tierra Media.', 'en', '/vRQnzOn4HjIMX4LBq9nHhFXbsSu.jpg', '/1xb5DSjOEltxhBP5KWnJli4wzhx.jpg', '2001-12-18', 179, '2KTjutR3mGA', 'Pasado', 0),
(137, 'El señor de los anillos: El retorno del rey', 'The Lord of the Rings: The Return of the King', 'Las fuerzas de Saruman han sido destruidas, y su fortaleza sitiada. Ha llegado el momento de que se decida el destino de la Tierra Media, y por primera vez en mucho tiempo, parece que hay una pequeña esperanza. La atención del señor oscuro Sauron se centra ahora en Gondor, el último reducto de los hombres, y del cual Aragorn tendrá que reclamar el trono para ocupar su puesto de rey. Pero las fuerzas de Sauron ya se preparan para lanzar el último y definitivo ataque contra el reino de Gondor, la batalla que decidirá el destino de todos. Mientras tanto, Frodo y Sam continuan su camino hacia Mordor, a la espera de que Sauron no repare en que dos pequeños Hobbits se acercan cada día más al final de su camino, el Monte del Destino.', 'en', '/lXhgCODAbBXL5buk9yEmTpOoOgR.jpg', '/mWuFbQrXyLk2kMBKF9TUPtDwuPx.jpg', '2003-12-01', 202, 'h-9RYiqyqjk', 'Pasado', 0),
(138, 'La celda', 'The Cell', 'Catherine Deane es una psicoterapeuta que forma parte de un revolucionario tratamiento que le permite literalmente introducir su mente en la de sus pacientes. Sus experiencias con este método cobran un giro inesperado cuando un agente del FBI le llega con una petición desesperada: introducirse en la mente de un asesino en serie, Carl Stargher, que se encuentra en coma tras haber secuestrado y atrapado a una mujer cuya vida está en serio peligro si no consiguen descubrir su paradero.', 'en', '/2G20ecZ4HrWWmxn2gBdN2gxcxTy.jpg', '/vBJuude7Wgb2h9VJvid7ExZigsU.jpg', '2000-08-17', 107, '', 'Pasado', 0),
(139, 'Celda 211', 'Celda 211', 'El día previo a la incorporación oficial en su nuevo destino como funcionario de prisiones, Juan se ve atrapado en un motín carcelario. Haciéndose pasar por un preso más, luchará por salvar su vida al tiempo que trata de poner fin a la revuelta. Tendrá que jugársela a base de astucia, engaños y riesgo. Pero aún no sabe qué otra encerrona le depara el destino…', 'es', '/kujUJjGGKNN2d7G5NcCnplZPfGd.jpg', '/i2XCKfV81GcDbXbDNM80kK25Y0o.jpg', '2009-11-06', 110, 'QaP3A1bKaNo', 'Pasado', 0),
(141, 'Jamón, jamón', 'Jamón, jamón', 'José Luis es el hijo de un acaudalado matrimonio que posee una fábrica de ropa interior masculina, en la que trabaja su novia Silvia. Cuando ella se queda embarazada, él promete casarse con ella a pesar de la oposición de sus padres. Con el fin de frustrar esa boda no deseada, la madre decide contratar a un joven aspirante a torero para que seduzca a la joven.', 'es', '/vAhrNWyOe0ID8cxN6o7h9sUNWZC.jpg', '/4BMVtVqCLsWPKkk14kcTOpCuZ8O.jpg', '1992-09-03', 95, '', 'Pasado', 0),
(143, 'Hijos de un mismo dios', 'Edges of the Lord', 'Segunda Guerra Mundial (1939-1945). Un matrimonio judío, para evitar que su hijo caiga en manos de los nazis, decide trasladarlo al campo, donde es acogido por una familia de campesinos católicos. (FILMAFFINITY)', 'en', '/j724iaQRnQTaxZ5dNIsvYaE4RQo.jpg', '/lLWIT561ck67useJzBgfUHPUPpC.jpg', '2001-01-01', 95, '', 'Pasado', 0),
(145, 'Predator', 'The Predator', 'Cuando el pequeño Rory (Jacob Tremblay) activa accidentalmente el regreso a la Tierra de los yautjas, desencadenará la vuelta de los cazadores más letales del universo, una especie extraterrestre caracterizada por convertir en su trofeo al resto de criaturas y por obtener su poder a través de la hibridación. Ahora, estos alienígenas han mejorado su ADN y ahora son aún más peligrosos, fuertes, inteligentes y mortales. Por eso, solo un grupo de exsoldados y una profesora de ciencias podrán evitar el fin de la humanidad.', 'en', '/f4E0ocYeToEuXvczZv6QArrMDJ.jpg', '/mMNnrjCFRIczAVNINTNtxKgAbff.jpg', '2018-09-05', 101, 'pfkcAEvxjDc', 'Pasado', 0),
(146, 'Depredador', 'Predator', 'Un comando de mercenarios es contratados por la CIA para rescatar a unos pilotos apresados por las guerrillas en la selva Centroamericana. La misión resulta satisfactoria, pero durante su viaje de regreso se dan cuenta de que algo está dándoles caza uno a uno, ese algo resulta ser un cazador alienígena que se queda con las calaveras de sus víctimas como trofeos', 'en', '/gIp0L6VRu2xrX4uCnH9jPsmpaCG.jpg', '/spgPmu5bTk8N6KZXrIOBwfd3cNb.jpg', '1987-06-12', 102, 'PyfkVDkixqQ', 'Pasado', 0),
(147, 'Depredador 2', 'Predator 2', 'Un grupo de policías de Los Angeles se enfrenta a un misterioso asesino que descuartiza a sus víctimas con un salvajismo inusitado. Pronto, el jefe del grupo, el capitán Harrigan, descubrirá que su enemigo es un alienígena llegado a la Tierra con el único propósito de practicar la caza.', 'en', '/tqYAfDloa6YgZpKnVJ401Xu4ky.jpg', '/92Lqy293CqAExYXlqDc456eYCWp.jpg', '1990-11-20', 108, '', 'Pasado', 0),
(148, 'Alien vs. Predator', 'AVP: Alien vs. Predator', 'El descubrimiento de una antigua pirámide enterrada bajo los hielos de la Antártida hace acudir hasta el continente helado a un equipo de científicos y aventureros. Una vez allí, hacen un descubrimiento aún más aterrador: dos razas de extraterrestres en guerra. Gane quien gane, nosotros perdemos. La increíble y terrorífica aventura comienza cuando el millonario industrial Charles Bishop Weyland reúne a un equipo internacional de arqueólogos, científicos y expertos en seguridad, dirigidos por la especialista en medioambiente y aventurera Alexa ”Lex” Woods, para investigar unas misteriosas ”emanaciones de calor” que surgen desde las profundidades de la Antártida.', 'en', '/tOvoWzkUzCMJ8Ra5nkmNg7ehCET.jpg', '/4KyXdnsQI7p81T4o6UcfhEjP2mZ.jpg', '2004-08-12', 100, 'qDnWi5q1nAE', 'Pasado', 0),
(149, 'El núcleo', 'The Core', 'Los científicos descubren que el corazón del planeta Tierra va a detener su movimiento giratorio, lo que causará un tremendo desastere natural, eliminando la vida tal y como la conocemos. Un grupo de científicos son reclutados para una peligrosa misión al centro de la tierra que pueda prevenir la catástrofe.', 'en', '/v2YxWPX2yKdo6arIAknJzKLxhZY.jpg', '/l4HpogVLiVtx0LWW8XuJoWT7WfZ.jpg', '2003-03-28', 135, '', 'Pasado', 0),
(150, 'Misión a Marte', 'Mission to Mars', 'En el año 2020 el comandante Luke Graham es seleccionado para dirigir la primera misión tripulada de la NASA a Marte. Una vez en el planeta rojo, descubren una antigua estructura con forma de cúpula que parece ser una especie de baliza. La cúpula mata a la tripulación y deja herido a Luke. El coronel Jim McConnell, recientemente enviudado, encabezará la misión de rescate.', 'en', '/i3TisW0YbXEtUQSIJPgKUI4WCF3.jpg', '/hjGZVp7xS39qROjI3EG5zgehiJU.jpg', '2000-03-10', 114, '', 'Pasado', 0),
(151, 'Planeta Rojo', 'Red Planet', 'La comandante de misión Kate Bowman es la piloto y comandante de la misión más importante del siglo XXI: salvar a la raza humana. Es el año 2050, la Tierra se está muriendo, y colonizar Marte es la única alternativa a la destrucción. Bowman y su tripulación han hecho este viaje para investigar a qué se ha debido el fallo del proyecto Mars Terra-Forming, y repararlo. Pero lo que sucede cuando llegan allí es bastante más aterrador de lo que cualquiera podría haber adivinado: un aterrizaje forzoso los deja sin equipo científico, de comunicación y de salvamento, y hace que su robot de exploración y cartografía militar falle, convirtiéndose en su enemigo. Desafiando las órdenes de Houston, Bowman se niega a abandonar a Gallagher, con el que comparte un intenso lazo afectivo, y al resto del equipo, y trata de guiarles de vuelta a las alturas.', 'en', '/ccfG7FUEJcTABSD9SIGbMnrEli4.jpg', '/dz51Grb68ScPpP4z9gKe6CJleXj.jpg', '2000-11-10', 103, '', 'Pasado', 0),
(152, 'Marte (The Martian)', 'The Martian', 'El astronauta Mark Watney, botánico e ingeniero mecánico, es dado por muerto y queda atrapado en el planeta Marte cuando la tripulación del Ares 3, a causa de una emergencia, debe evacuar su lugar de aterrizaje y regresar a la Tierra. Sin su tripulación, se ve obligado a sobrevivir y encontrar la forma de regresar a la Tierra, antes de que se le agoten los suministros. Mientras sus compañeros astronautas piensan que ha muerto, la N.A.S.A. descubre, a través de un satélite, que sigue vivo, y  comienza a trabajar sobre su rescate, ocultándoselo al resto de la tripulación.', 'en', '/3dPhs7hUnQLphDFzdkD407VZDYo.jpg', '/jPvNTtQMtLJrEqPZF1FbMGmiHwu.jpg', '2015-09-30', 142, 'YunRU1tE1X4', 'Pasado', 0),
(153, 'La rebelión de los simios', 'Conquest of the Planet of the Apes', 'Estados Unidos, 1991. Tras una epidemia que mató a todos los gatos y perros de la Tierra, los hombres decidieron adoptar como mascotas a los monos, que acabaron convertidos en sirvientes. Se creó entonces un centro para civilizar a los ejemplares salvajes, por medio de la violencia. Armando ha criado en secreto a César, el hijo de dos simios parlantes: Zira y Cornelius. Cuando César comprueba lo que los hombres están haciendo con los de su especie, manifiesta públicamente su desacuerdo y, desde ese momento, se ve obligado a ocultarse. Al descubrir que puede comunicarse con los suyos telepáticamente, empieza a tramar una insurrección: incita a la desobediencia general, arma a los suyos y empieza a entender que la inteligencia es poder.', 'en', '/aoIhq1EFhpyNC2KCecvCDWHMFSY.jpg', '/jvgClcSOyFrODmnHkTfdKHz7nSv.jpg', '1972-06-29', 88, '', 'Pasado', 0),
(154, 'Detrás del planeta de los simios', 'Behind the Planet of the Apes', 'Extenso documental que ahonda en la pre-producción, rodaje y desarrollo del proyecto de El Planeta de los Simios desde su origen hasta que llegó a hacerse realidad. Presentado por Roddy McDowall (Cornelius), en él descubriremos numerosos detalles de interés sobre este mito cinematográfico. También se realiza un recorrido por el resto de secuelas que tuvo la película ya sea en cine como en televisión, así como su explotación aún a día de hoy del merchandising relativo a los Simios.', 'en', '/wB2xUAzjuGK9pVTiGJmv55wrPSF.jpg', '/5Ku4Sn0piPBSm24CC2B5CI3VMuN.jpg', '1998-09-05', 127, '', 'Pasado', 0),
(155, 'La conquista del planeta de los simios', 'Battle for the Planet of the Apes', 'César, el simio que capitaneó la revuelta contra la raza humana, es un benévolo gobernante que fomenta la convivencia con los hombres, a pesar de la oposición del general Aldo, jefe militar de los simios. No obstante, los hombres que han sobrevivido al holocausto nuclear son considerados ciudadanos de segunda clase. César decide realizar un viaje a la \"Ciudad Prohibida\" con MacDonald y el sabio Virgil, en busca de unas cintas en las que estaría grabada la muerte de sus padres. Durante el viaje, es observado por un grupo de hombres mutantes que viven en la devastada zona de guerra. Éste es el motivo por el que el General Aldo desafiará la autoridad de César y, además, provocará un enfrentamiento entre simios y hombres, para dirimir quién gobernará el planeta.', 'en', '/2WTO5FW8BT39fokxrJmzDgZqdWM.jpg', '/mYRiQwDBYZQ4DGfvODLPZfrrJ2M.jpg', '1973-06-15', 93, 'FxfNd4P-D9w', 'Pasado', 0),
(156, 'Regreso al planeta de los simios', 'Beneath the Planet of the Apes', 'Una nueva nave procedente del espacio y del tiempo aterriza al mando del astronauta Brent, que acude en busca del desaparecido George Taylor. Vuelve a encontrarse con los simios que dominan el mundo, relegando a los humanos a la esclavitud. Sin embargo, con la ayuda de la doctora Zira seguirá las huellas de Taylor hasta la Zona Prohibida, en cuyas catacumbas, lo que son las ruinas del metro de Nueva York, encuentra a una raza humana mutante con poderes telepáticos.', 'en', '/5vhuNmBt3oxbmsu7L4exJjJixC4.jpg', '/oRbJBwILlyciMqsOVw6auC67X1d.jpg', '1970-04-23', 95, '', 'Pasado', 0),
(158, 'Huida del planeta de los simios', 'Escape from the Planet of the Apes', 'Tres simios, la doctora Zira, Cornelius y el doctor Milo, han conseguido sobrevivir al desastre nuclear en su planeta y, tras arreglar la nave de los humanos, viajan en el tiempo hasta llegar a la Tierra de finales del siglo XX. Al llegar, mientras son estudiados en un centro de investigación para determinar su nivel de inteligencia, se niegan a revelar lo que saben sobre la civilización humana.', 'en', '/6JxJminJvYIVXbTakYJkbnga14P.jpg', '/2CcWnH9P1472GTRrOcCimhG1mNY.jpg', '1971-05-20', 97, '', 'Pasado', 0),
(159, 'El planeta de los simios', 'Planet of the Apes', 'Año 2029. En una misión rutinaria, el astronauta Leo Davidson (Mark Wahlberg) pierde el control de su nave y aterriza en un extraño planeta, habitado por una raza de simios de inteligencia similar a la de los humanos y que tratan a éstos como a animales. Con la ayuda de una chimpancé llamada Ari (Helena Bonham-Carter) y de una pequeña banda de humanos rebeldes, Leo encabeza el enfrentamineto contra el terrible ejército dirigido por el general Thade (Tim Roth) y su hombre de confianza, el guerrero Attar (Michael Clarke Duncan). La clave es llegar a un templo sagrado que se encuentra en la zona prohibida del planeta, en el que podrán descubrir los sorprendentes secretos del pasado de la humanidad y la clave para su futuro.', 'en', '/rF0Y0fYVsNFEvGve8Nq0Ij9EDCM.jpg', '/rRvUkYCByrlVMy4GMME3iDAe6er.jpg', '2001-07-25', 119, '', 'Pasado', 0),
(161, 'El origen del planeta de los simios', 'Rise of the Planet of the Apes', 'Precuela del ya mítico largometraje \"El planeta de los simios\". Will Rodman (James Franco) es un joven científico que está investigando con monos para obtener un tratamiento contra el alzheimer, una enfermedad que afecta a su padre (John Lithgow). Uno de esos primates, al que llaman César (Andy Serkis), experimenta una evolución en su inteligencia tan notable que el protagonista decide llevárselo a su casa para protegerlo. Le ayudará una bella primatóloga llamada Caroline (Freida Pinto).', 'en', '/dENLz9Np9EV5Ro8UIBhbKC8BmSS.jpg', '/kyCXO8lTKs62V5A4IsdNLjvskWM.jpg', '2011-08-03', 105, 'e3-vnIKDV2Q', 'Pasado', 0),
(162, 'La guerra del planeta de los simios', 'War for the Planet of the Apes', 'César y sus monos son forzados a encarar un conflicto mortal contra un ejército de humanos liderado por un brutal coronel. Después de sufrir pérdidas enormes, César lucha con sus instintos más oscuros en una búsqueda por vengar a su especie. Cuando finalmente se encuentren, Cesar y el Coronel protagonizarán una batalla que pondrá en juego el futuro de ambas especies y el del mismo planeta. Tercera película de la nueva saga de El Planeta de los Simios.', 'en', '/pyHBqcp0EfzcKpRSXkvn6qfnO4k.jpg', '/4s51V3REPzdABoEDLC4TPDPkY3b.jpg', '2017-07-11', 140, '3d3rAJ8R0Fg', 'Pasado', 0),
(163, 'Taxi Driver', 'Taxi Driver', 'Para sobrellevar el insomnio crónico que sufre después de su regreso de Vietnam, Travis decide trabajar como taxista nocturno. Como individuo tiene poco contacto con la gente, pero observa la violencia y desolación en la que se hunde la ciudad de Nueva York. Travis anota en su diario todas sus impresiones, hasta que un día decide pasar a la acción.', 'en', '/a58oc5qGNazb3QOxEH8eG5S7gjr.jpg', '/jhNv3GvyCoPNZASqOIsFeGHT7mq.jpg', '1976-02-09', 113, 'XQljOh9p6P8', 'Pasado', 0),
(164, 'Baby Driver', 'Baby Driver', 'Baby, un joven y talentoso conductor especializado en fugas, depende del ritmo de su banda sonora personal para ser el mejor en lo suyo. Cuando conoce a la chica de sus sueños, Baby ve una oportunidad de abandonar su vida criminal y realizar una huida limpia. Pero después de haber sido forzado a trabajar para un jefe del crimen, deberá dar la cara cuando un malogrado golpe amenaza su vida, su amor y su libertad.', 'en', '/yir5430WblZSZuIMd9C6pIZerfA.jpg', '/o2YToge3eBhxC89m87zkWKVEx2O.jpg', '2017-06-28', 115, '_XnNVXahJ2k', 'Pasado', 0),
(165, 'Pretty Woman', 'Pretty Woman', 'Un acaudalado y frío hombre de negocios conoce en Hollywood Boulevard a una joven y atractiva prostituta a la que alquila durante una semana para que sea su acompañante en sus cenas con los clientes. Para ello la chica se verá sometida a todo un cambio de look tras el que nadie podrá ver, a simple vista, que es una chica de la calle.', 'en', '/3tuWpnCTe14zZZPt6sI1W9ByOXx.jpg', '/iKaKr8aUqOy1aojENu5XuwBI8Uj.jpg', '1990-03-23', 119, '', 'Pasado', 0),
(166, 'E.T. el extraterrestre', 'E.T. the Extra-Terrestrial', 'Un pequeño ser de otro planeta se queda abandonado en la Tierra cuando su nave se marcha olvidándose de él. Tiene miedo. Está completamente solo, pero se hará amigo de un niño, que lo esconde en su casa. El niño y sus hermanos intentarán encontrar la forma de que el pequeño extraterrestre regrese a su planeta antes de que los científicos y la policía lo encuentren.', 'en', '/mXLVA0YL6tcXi6SJSuAh9ONXFj5.jpg', '/lVUsjKHXPvLTNpFBABnrPzhx5Dc.jpg', '1982-06-11', 115, 'jzC0c-GWeDQ', 'Pasado', 0),
(167, 'Billy Elliot the Musical Live', 'Billy Elliot: The Musical Live', 'Un joven bailarín con talento tiene que aprender a luchar por su sueño a pesar de la desaprobación social y la incomprensión inicial de su familia. (FILMAFFINITY)', 'en', '/6C1t83zS4TgYmRUVdYVF0UC2aA8.jpg', '/bGRC2gZZe3DJhaoY0qo3cHfS0pt.jpg', '2014-09-28', 169, '', 'Pasado', 0),
(168, 'Airbag', 'Airbag', 'Juantxo pertenece a la alta sociedad, tiene pasta, carrera universitaria, un magnífico trabajo y una novia guapa y rica, pero es un auténtico pardillo. Mientras celebra su despedida de soltero, pierde su valioso anillo de compromiso en el lugar más inesperado. Él y sus amigos, Pako y Konradín, se lanzarán a la búsqueda de la joya en un trepidante viaje lleno de vicio, corrupción y delirio.', 'es', '/btMZb16brRzEoH9MnAdoLvC7WXw.jpg', '/pDKe4iKw2ZQ7IBrPEkSlm1w8C9c.jpg', '1997-06-20', 125, 'xU6Mj4o2biA', 'Pasado', 0),
(169, 'Big Driver', 'Big Driver', 'Una famosa escritora de misterio busca venganza después de un brutal ataque.', 'en', '/qv1wx1r4i0mvU0Bv9ISowKFkjMS.jpg', '/zcybpUupCVNwk9lEPIohilof3Ic.jpg', '2014-10-18', 87, '', 'Pasado', 0),
(170, 'Big', 'Big', 'Josh Baskin tiene trece años pero, cansado de que las chicas no le hagan caso y de que sus padres le traten como a un niño, desea ser mayor. Una noche, encuentra, en una feria, una vieja máquina que concede un deseo a cambio de una moneda. Josh, sin dudarlo un instante, pide hacerse mayor. A la mañana siguiente, descubre en el espejo un cuerpo de adulto. La otra cara de la moneda serán los problemas y responsabilidades que debe asumir sin ninguna experiencia previa.', 'en', '/dGbBnTYxdHf1qyUgHsuFpxn1K4E.jpg', '/ri6DEF9rul9Z0nOkPdTWHilZgJd.jpg', '1988-06-03', 104, '', 'Pasado', 0),
(171, 'Big Hero 6', 'Big Hero 6', 'En la metrópolis de San Fransokyo (cruce de San Francisco y Tokio), vive Hiro Hamada, quien aprende a sacar provecho de su capacidad gracias a su brillante hermano Tadashi y sus también brillantes amigos: la buscadora de adrenalina GoGo Tamago, el meticuloso de la limpieza Wasabi-No-Ginger, la genia de la química Honey Lemon y el fanático de los cómics Fred. Cuando tras un devastador giro de los acontecimientos, se ven envueltos en una peligrosa conspiración que tiene lugar en las calles de San Fransokyo, Hiro recurre a su amigo más íntimo: un robot llamado Baymax, y transforma al grupo en una banda de héroes de última tecnología decididos a resolver el misterio.', 'en', '/wURLf7FW0WYytXl9aeYu5dTbmAT.jpg', '/qVU0ag4i5BCmH5h4o04cdvUo0Zf.jpg', '2014-10-24', 101, 'UC7KNAthiVQ', 'Pasado', 0),
(172, 'Stargate: Puerta a las estrellas', 'Stargate', 'Un coronel y un científico, movidos por distintos intereses, investigan el misterioso hallazgo en unas excavaciones de un extraño artefacto al que llaman \"Puerta de las Estrellas\". Acompañados de un equipo de reconocimiento, atraviesan la Puerta y son transportados a un lejano planeta.', 'en', '/s2bqHApZlliCuwgyHod0qucrYqZ.jpg', '/4T6Po0XnZlevmhfPh3ZfEs5butR.jpg', '1994-10-27', 128, '', 'Pasado', 0),
(173, 'Stargate: El contínuo', 'Stargate: Continuum', 'Mientras que el SG-1 participa en la ejecución de Baal, el último de los Señores del Sistema Goa\'uld, Teal\'c y Vala desaparecen inexplicablemente en el aire. Carter, Daniel y Mitchell corren de regreso a un mundo en el que ha cambiado la historia: el programa Stargate ha sido borrado de la línea de tiempo. A medida que tratan de convencer a las autoridades de lo que ha pasado, llega a la órbita una flota de naves nodrizas Goa\'uld dirigida por Baal, su reina, Qetesh (Vala), y su primado, Teal\'c. El SG-1 debe encontrar el Stargate y arreglar las cosas antes de que el mundo sea esclavizado por los Goa\'uld.', 'en', '/cXBWShG3jPpKWJEgadsb1795KXm.jpg', '/cEOlQJNXbKdJO1yc4dSag8iiZRG.jpg', '2008-07-29', 95, '', 'Pasado', 0),
(174, 'Stargate: El arca de la verdad', 'Stargate: The Ark of Truth', 'Mientras el SG-1 busca un artefacto antiguo con el que esperan poder derrotar a los ejércitos de los Ori, descubren que más naves Ori están a punto de ser enviadas a través del SuperStargate para lanzar un asalto final sobre la Tierra. Daniel descubre que un artefacto, el Arca de la Verdad, puede estar en la galaxia Ori, y el SG-1 se embarca a bordo del Odyssey para encontrarlo y dificultar el ataque. El IOA tiene un plan propio y el SG-1 termina en una galaxia distante luchando contra dos enemigos poderosos.', 'en', '/hPHahVM3JDlE0Zexu6avavypk0g.jpg', '/u4LnsaYRqz9wJ5Am6M9N6luPtrR.jpg', '2008-03-11', 97, '', 'Pasado', 0),
(175, 'Stargate SG-1: True Science', 'Stargate SG-1: True Science', '', 'en', '/jCcvhae8MmkqYtR1EGtMYFdpQud.jpg', '/3e2gPmE5KDPFpWjDkziOyeho5SD.jpg', '2006-01-03', 45, '', 'Pasado', 0),
(176, 'Stargate Universe: SGU', 'Stargate Universe: SGU', '', 'en', '/8nrZkZ6H7DYfiOUApqe7OXkK4JW.jpg', '/pjbafQ1QtZPl3mTWbYOuVrUsHf3.jpg', '2009-10-02', 138, '', 'Pasado', 0),
(177, 'Stargate Universe: SGU', 'Stargate Universe: SGU', '', 'en', '/8nrZkZ6H7DYfiOUApqe7OXkK4JW.jpg', '/pjbafQ1QtZPl3mTWbYOuVrUsHf3.jpg', '2009-10-02', 138, '', 'Pasado', 0),
(178, 'The Batman', 'The Batman', 'Cuando un asesino se dirige a la élite de Gotham con una serie de maquinaciones sádicas, un rastro de pistas crípticas envía Batman a una investigación en los bajos fondos. A medida que las pruebas comienzan a acercarse a su casa y se hace evidente la magnitud de los planes del autor, Batman debe forjar nuevas relaciones, desenmascarar al culpable y hacer justicia al abuso de poder y la corrupción que durante mucho tiempo han asolado Gotham City.', 'en', '/xHrp2pq73oi9D64xigPjWW1wcz1.jpg', '/zFTLPipninMF4THDbdkQUZLWMEw.jpg', '2022-03-01', 176, 'L6DEcPaNdLs', 'Pasado', 0),
(179, 'Batman', 'Batman', 'Atormentado por haber visto morir a sus padres delante suyo, Bruce Wayne se enfunda cada noche en el traje de Batman, adopta la terrorífica forma de un murciélago y surca los tejados de Gotham City combatiendo el crimen y manteniendo a raya la corrupción de su ciudad. Pero esta vez Batman tendrá que enfrentarse a su más terrible enemigo, El Joker, que pretende someter a toda la ciudad bajo los deseos de su mente perturbada.', 'en', '/2va32apQP97gvUxaMnL5wYt4CRB.jpg', '/kbeWnmnHNEnuVej6wcjUv0eY6IL.jpg', '1989-06-23', 121, 'hZernuRv_KA', 'Pasado', 0),
(180, 'Batman Begins', 'Batman Begins', '¿Cómo cambia un hombre el mundo? Es una pregunta que obsesiona a Bruce Wayne al igual que el fantasma de sus padres, muertos a tiros ante sus ojos en las calles de Gotham una noche que cambió su vida para siempre. Atormentado por la culpa y la ira, el desilusionado heredero industrial desaparece de Gotham y viaja en secreto por el mundo, buscando los medios de luchar contra la injusticia y utilizar el miedo contra los que se aprovechan de los que tienen miedo. Con la ayuda de su leal mayordomo Alfred, el detective Jim Gordon - uno de los pocos buenos policías de las fuerzas del orden público de Gotham - y Lucius Fox, su aliado en la división de Ciencias Aplicadas de Wayne Enterprises, Bruce Wayne libera a su imponente alter ego: Batman, un justiciero enmascarado que utiliza la fuerza, la inteligencia y un despliegue de artefactos de alta tecnología para combatir las fuerzas siniestras que amenazan con destruir la ciudad.', 'en', '/hQrHN6WXERVw6XUMpfCgLfvrh5V.jpg', '/6yMWU1vWkOBbNRIwOxhetd2aHhO.jpg', '2005-06-10', 140, 'k4nCN2HIXkc', 'Pasado', 0),
(181, 'Batman vuelve', 'Batman Returns', 'Gotham City se enfrenta a dos nuevos y peculiares criminales: el diabólico y siniestro Pingüino, una criatura solitaria y extrañamente deformada, y la hermosa y seductora -aunque letalmente peligrosa- Catwoman. Batman se deberá enfrentar a Pingüino, que quiere convertirse en el amo de la ciudad.', 'en', '/fsJgRuXzNnnXk5IVwVbBPdavaNX.jpg', '/i5xLIx2vkisiLPQqaeI3uiSaG1b.jpg', '1992-06-19', 126, 'YJ6tQBrsl-Y', 'Pasado', 0),
(182, 'Batman: Death in the Family', 'Batman: Death in the Family', 'Producida, dirigida y escrita por Brandon Vietti, \"Death in the Family\" ofrece una nueva perspectiva sobre una historia de sobra conocida por los aficionados del Caballero Oscuro. En ella, el asesinato de Jason Todd provocará que el futuro de Batman, Robin y Joker tomen nuevos derroteros en los que el espectador puede incidir con sus propias decisiones.  Primera propuesta de película interactiva del universo DC.', 'en', '/kU7ZiyeUwcpTkYj3UcxSqGdZmxY.jpg', '/gHNPuaZLXtiIowtIjzYDdYnITJU.jpg', '2020-10-13', 31, '', 'Pasado', 0),
(183, 'Batman y Robin', 'Batman & Robin', 'Unos experimentos de criogenia han convertido al Dr. Victor Fries en el malvado Mr. Freeze, un villano que necesita mantener su cuerpo a temperaturas gélidas y que, por ello, intentará congelar a todos los habitantes de la ciudad de Gotham. Por otro lado, la tímida botánica Pamela Isley se transformará en el transcurso de un experimento en la terrible Hiedra Venenosa, que querrá asesinar a todos los seres humanos de la tierra, para que las plantas recuperen su hegemonía sobre el planeta. Por este motivo, Batman y Robin deberán enfrentarse a ellos y detener sus siniestros planes.', 'en', '/m4UT6yKXhXgbzxpeV35L4jLoJoP.jpg', '/gJAvyXHdIjeKHS07Dlim7LETBEK.jpg', '1997-06-20', 125, 'x8fW3SU6ZgM', 'Pasado', 0),
(184, 'Batman Forever', 'Batman Forever', 'La ciudad de Gotham está amenazada de nuevo. Esta vez, se trata de una maligna pareja compuesta por Dos Caras y Enigma, que procurarán alterar la paz de sus conciudadanos y del mundo entero para siempre. Por este motivo, Bruce Wayne deberá enfundarse otra vez el traje de Batman y luchar contra ellos; pero esta vez no estará solo, ya que será acompañado por el joven Robin.', 'en', '/snlu32RmjldF9b068UURJg8sQtn.jpg', '/wg6BN76E9iIEtiawMJnCecY0zgY.jpg', '1995-06-16', 121, 'ep5LlHrLjmQ', 'Pasado', 0),
(185, 'John Wick (Otro día para matar)', 'John Wick', 'John Wick es un antiguo asesino a sueldo de Nueva York que se había retirado de la profesión después de perder a su esposa. Pero, al descubrir la oscura trama que la mafia había planeado para acabar con él, arrebatándole lo que más quería, volverá a introducirse en el negocio, esta vez por su cuenta, para vengarse.', 'en', '/ff2ti5DkA9UYLzyqhQfI2kZqEuh.jpg', '/4A9KmccvMqJA8MQzIes0G9Uobh5.jpg', '2014-10-22', 101, 'UNIv8nzUryo', 'Pasado', 0),
(186, 'John Wick: Pacto de sangre', 'John Wick: Chapter 2', 'El legendario asesino John Wick (Keanu Reeves) se ve obligado a salir del retiro por un ex-asociado que planea obtener el control de un misterioso grupo internacional de asesinos. Obligado a ayudarlo por un juramento de sangre, John emprende un viaje a Roma lleno de adrenalina estremecedora para pelear contra los asesinos más peligrosos del mundo.', 'en', '/r17jFHAemzcWPPtoO0UxjIX0xas.jpg', '/yIa04BbZMO4pIZ1cvnYB4cZVakd.jpg', '2017-02-08', 122, '8vB_rZV2kSw', 'Pasado', 0),
(187, 'John Wick 4', 'John Wick: Chapter 4', 'Continúacion de \"John Wick 3: Parabellum\"', 'en', '/72p6d4MPEcA7FqHJjiE4u44SO2B.jpg', '/kPsRQfoyYgcpbI6hvDQvUSCo0q3.jpg', '2023-03-23', 0, '', 'Proximamente', 0),
(188, 'John Wick: Capítulo 3 - Parabellum', 'John Wick: Chapter 3 - Parabellum', 'John Wick (Keanu Reeves) regresa a la acción, solo que esta vez con una recompensa de 14 millones de dólares sobre su cabeza y con un ejército de mercenarios intentando darle caza. Tras asesinar a uno de los miembros del gremio de asesinos al que pertenecía, Wick es expulsado de la organización, pasando a convertirse en el centro de atención de multitud de asesinos a sueldo que esperan detrás de cada esquina para tratar de deshacerse de él.', 'en', '/vVpEOvdxVBP2aV166j5Xlvb5Cdc.jpg', '/aKw7oqYdfn4pkKYvp18Gd1YhK6m.jpg', '2019-05-15', 131, 'F4_o_Ci6o7E', 'Pasado', 0),
(189, 'John Wick: Chapter 5', 'John Wick: Chapter 5', '', 'en', '', '/ndPy3KNHsbPQcoHU9RK92hSwEJ0.jpg', '', 0, '', 'Proximamente', 0),
(190, 'Wonder', 'Wonder', 'Un niño de 10 años (Jacob Tremblay, conocido por \'La habitación\') nacido con una deformidad facial que le ha obligado a ser operado 27 veces de cirugía, se esfuerza por encajar en su nuevo colegio.', 'en', '/b7xQ5fuyVO4c24igizCfPgF6n7q.jpg', '/wowB0C4S5KX5SNbhGMkbZZEOqCR.jpg', '2017-11-13', 120, 'S6AXHRx_0xk', 'Pasado', 0),
(191, 'Doctor Sueño', 'Doctor Sleep', 'Secuela del film de culto \"El resplandor\" (1980) dirigido por Stanley Kubrick y también basado en una famosa novela de Stephen King. La historia transcurre algunos años después de los acontecimientos de \"The Shining\", y sigue a Danny Torrance (Ewan McGregor), traumatizado y con problemas de ira y alcoholismo que hacen eco de los problemas de su padre Jack, que cuando sus habilidades psíquicas resurgen, se contacta con una niña de nombre Abra Stone, a quien debe rescatar de un grupo de viajeros que se alimentan de los niños que poseen el don de \"el resplandor\".', 'en', '/ap6Zc5NDOfbZaMhkRDyghbGeLf0.jpg', '/oYx5zclp0WHZ0gVQ9nyDIwDcgxd.jpg', '2019-10-30', 151, '8U8N0mJU15Q', 'Pasado', 0),
(192, 'Aguas Profundas', 'Deep Water', 'Un marido adinerado, que permite que su esposa tenga relaciones extramatrimoniales para evitar el divorcio, se convierte en el principal sospechoso de la desaparición de los amantes de ella... Adaptación de la novela de Patricia Highsmith.', 'en', '/qswImgf57wBf2i8Fv6K2O2BdMoe.jpg', '/aarAi6bp8Cl3RYXy2lpeLc1hGS7.jpg', '2022-03-18', 153, 'yERv9roVKn0', 'Pasado', 0),
(193, 'Deep Blue Sea 3', 'Deep Blue Sea 3', 'La doctora Emma Collins y su equipo están pasando su tercer verano en la isla Little Happy estudiando el efecto del cambio climático en el gran tiburón blanco. Junto a los dos últimos habitantes del antiguo pueblo pesquero, su vida se ve alterada cuando un equipo \"científico\" liderado por su exnovio y marino biológico Richard aparece buscando tres tiburones toro que son algo más de lo que aparentan en un principio.', 'en', '/hIHtyIYgBqHybOgUdoAmveipuiO.jpg', '/96rOUJEbHrhVW7JYzPJm5ZyMDg0.jpg', '2020-08-25', 100, '', 'Pasado', 0),
(194, 'Deep Impact', 'Deep Impact', 'El descubrimiento de un meteorito que viene en dirección a la Tierra a gran velocidad pone a toda la Humanidad en estado de alerta. Las naciones de todo el mundo preparan planes para tratar de salvar al mayor numero de personas y de especies animales posibles.', 'en', '/w53FK3MoMLavk1sxErUiGMnLpf2.jpg', '/71SSQCG61ckKVZc3e2U1aZlHNY5.jpg', '1998-05-08', 121, '9cqDWRIv7Mg', 'Pasado', 0),
(195, 'Deep Rising: El misterio de las profundidades', 'Deep Rising', 'En el Mar de China, un trasatlántico de lujo ha sido atacado por misteriosos monstruos marinos que han devorado a la mayor parte de la tripulación y los pasajeros. Unos mercenarios que abordan el barco para atracarlo tendrán que enfrentarse a las feroces criaturas junto a los pocos supervivientes que encuentran.', 'en', '/29Cl4q2nidh9lTcBjBqAw7vdeEq.jpg', '/9dJAjcieyjuqDDYYhBr6O2sSSRT.jpg', '1998-01-30', 106, 'Hokh_DutU-k', 'Pasado', 0),
(196, 'Deep Blue Sea', 'Deep Blue Sea', 'Utilizando tiburones Mako, una de las máquinas de matar más rápidas y perfectas de la naturaleza, la doctora McAlester (Saffron Burrows) espera encontrar la clave de la regeneración de los tejidos del cerebro humano. Pero para alcanzar su meta ha violado los códigos éticos, modificando el ADN de los tiburones, haciendo que sean más inteligentes y más rápidos, convirtiéndolos de depredadores peligrosos en monstruos depredadores que pondrán en peligro a todo el equipo de trabajo...', 'en', '/d8TIyaOwqrzWWxERxQ9fJ9jrFrb.jpg', '/xNa8pcnF1oQUav6h3Sh6jEClmD0.jpg', '1999-07-28', 109, 'l2C07HRRd5g', 'Pasado', 0),
(197, 'El día de mañana', 'The Day After Tomorrow', 'Las investigaciones del climatólogo Jack Hall indican que el calentamiento global podría desencadenar un repentino y catastrófico cambio climático de la Tierra. Hall advierte a los dirigentes políticos de la necesidad de adoptar inmediatamente medidas para evitarlo, pero sus advertencias llegan demasiado tarde: una serie de anómalos fenómenos climáticos empiezan a producirse en distintas partes del globo. El calentamiento global ha puesto el planeta al borde de una nueva era glacial. Mientras Jack advierte a la Casa Blanca del inminente cambio climático, su hijo Sam y sus amigos se encuentran atrapados en Nueva York, a donde han ido para participar en un concurso académico entre institutos.', 'en', '/fXJhA3pjLMDkHPgZ2GVhRDXA5M3.jpg', '/c4IUWfr4AokGlVSWNRAat0DfbgZ.jpg', '2004-05-26', 124, '', 'Pasado', 0),
(198, 'Spider-Man 2: Making the Amazing', 'Spider-Man 2: Making the Amazing', '', 'en', '/rd8Ji5TbiTBNDQI7SSUYBv9XHLJ.jpg', '/3oF3GbxSSQxO9rWjrUjwAFi1fSF.jpg', '2004-11-30', 126, '', 'Pasado', 0),
(199, 'Spider-Man', 'Spider-Man', 'Peter Parker es un joven y tímido estudiante que vive con su tía May y su tío Ben desde la muerte de sus padres. Un día es mordido por una araña que ha sido modificada genéticamente, descubriendo al día siguiente que posee unos poderes poco habituales: tiene la fuerza y agilidad de una araña.', 'en', '/gUATaiYFjlIYWLmVsPcuThGTFnU.jpg', '/bCDaKZLRkrVVtPNyHxUfKvepW1N.jpg', '2002-05-01', 121, 'RcU2F0gFWoY', 'Pasado', 0),
(200, 'Spider-Man: No Way Home', 'Spider-Man: No Way Home', 'Peter Parker es desenmascarado y por tanto no es capaz de separar su vida normal de los enormes riesgos que conlleva ser un súper héroe. Cuando pide ayuda a Doctor Strange, los riesgos pasan a ser aún más peligrosos, obligándole a descubrir lo que realmente significa ser Spider-Man.', 'en', '/ocUp7DJBIc8VJgLEw1prcyK1dYv.jpg', '/osYbtvqjMUhEXgkuFJOsRYVpq6N.jpg', '2021-12-15', 148, 'Df00ZNYEcAY', 'Pasado', 0);
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `titulooriginal`, `sinopsis`, `idiomaoriginal`, `fondo`, `poster`, `estreno`, `duracion`, `trailer`, `estado`, `idgenero`) VALUES
(201, 'Spider-Man: Homecoming', 'Spider-Man: Homecoming', 'Peter Parker comienza a experimentar su recién descubierta identidad como el superhéroe Spider-Man. Después de la experiencia vivida con los Vengadores, Peter regresa a casa, donde vive con su tía. Bajo la atenta mirada de su mentor Tony Stark, Peter intenta mantener una vida normal como cualquier joven de su edad, pero interrumpe en su rutina diaria el nuevo villano Vulture y, con él, lo más importante de la vida de Peter comenzará a verse amenazado.', 'en', '/tTlAA0REGPXSZPBfWyTW9ipIv1I.jpg', '/yJfPC6pjSJ5VOsVyXhx5PXBe0mR.jpg', '2017-07-05', 129, '8lI3_UpQyYA', 'Pasado', 0),
(202, 'Spider-Man 3', 'Spider-Man 3', 'Tercera entrega de las aventuras del joven Peter Parker (Maguire). Parece que Parker ha conseguido por fin el equilibrio entre su devoción por Mary Jane y sus deberes como superhéroe. Pero, de repente, su traje cambia volviéndose negro y aumentando sus poderes; también Peter se transforma, sacando el lado más oscuro y vengativo de su personalidad. Bajo la influencia de este nuevo traje, Peter deja de proteger a la gente que realmente lo quiere y se preocupa por él. En estas circunstancias, no tiene más remedio que elegir entre disfrutar del tentador poder del nuevo traje o seguir siendo el compasivo héroe de antes. Mientras tanto, dos temibles enemigos, Venom y el Hombre de Arena, utilizarán sus poderes para calmar su sed de venganza.', 'en', '/6MQmtWk4cFwSDyNvIgoJRBIHUT3.jpg', '/lkuQzlShE2uzJcsZYU4zBI4VQZP.jpg', '2007-05-01', 139, 'vcmPnDUdPGk', 'Pasado', 0),
(203, 'The Amazing Spider-Man', 'The Amazing Spider-Man', 'Un estudiante de secundaria que fue abandonado por sus padres cuando era niño, dejándolo a cargo de su tío Ben (Martin Sheen) y su tía May (Sally Field). Como la mayoría de los adolescentes de su edad, Peter trata de averiguar quién es y qué quiere llegar a ser. Peter también está encontrando su camino con su primer amor de secundaria, Gwen Stacy (Emma Stone), y juntos luchan por su amor con compromiso. Cuando Peter descubre un misterioso maletín que perteneció a su padre, comienza la búsqueda para entender la desaparición de sus padres, una búsqueda que le lleva directamente a Oscorp, el laboratorio del Dr Curt Connors (Rhys Ifans), ex-compañero de trabajo de su padre. Mientras Spider-Man se encuentra en plena colisión con el alter-ego de Connors, el Lagarto, Peter hará elecciones que alterarán sus opciones para usar sus poderes y darán forma a un destino héroico.', 'en', '/sLWUtbrpiLp23a0XDSiUiltdFPJ.jpg', '/4cw1Vpp68ec518BHiS6gfa3yDoU.jpg', '2012-06-23', 136, 'XmR5HlEPYiw', 'Pasado', 0),
(204, 'Spider-Man 2', 'Spider-Man 2', 'Han pasado dos años desde que el tranquilo Peter Parker dejó a Mary Jane Watson, su gran amor, y decidió seguir asumir sus responsabilidades como Spider-Man. Peter debe afrontar nuevos desafíos mientras lucha contra el don y la maldición de sus poderes equilibrando sus dos identidades: el escurridizo superhéroe Spider-Man y el estudiante universitario. Las relaciones con las personas que más aprecia están ahora en peligro de ser descubiertas con la aparición del poderoso villano de múltiples tentáculos Doctor Octopus, \"Doc Ock\". Su atracción por M.J. se hace más fuerte mientras lucha contra el impulso de abandonar su vida secreta y declarar su amor. Mientras tanto, M.J. ha seguido con su vida. Se ha embarcado en su carrera de actriz y tiene un nuevo hombre en su vida. La relación de Peter con su mejor amigo Harry Osborn se ha alejado por la creciente venganza de Harry contra Spider-Man, al que considera responsable de la muerte de su padre.', 'en', '/6al048Lat3eLVQOuKtc9h6Tu94d.jpg', '/tGYrkVuskQKyRZ9WRS6wPTPBJpm.jpg', '2004-06-25', 127, 'oMpJJ6GMj68', 'Pasado', 0),
(205, 'Spider-Man: Lejos de casa', 'Spider-Man: Far From Home', 'Peter Parker decide irse junto a Michelle Jones, Ned y el resto de sus amigos a pasar unas vacaciones a Europa después de los eventos ocurridos en Vengadores: EndGame. Sin embargo, el plan de Parker por dejar de lado sus superpoderes durante unas semanas se ven truncados cuándo es reclutado por Nick Fury para unirse a Mysterio (un humano que proviene de la Tierra 833, una dimensión del multiverso, que tuvo su primera aparición en Doctor Strange) para luchar contra los elementales (cuatro entes inmortales que vienen de la misma dimensión y que dominan los cuatro elementos de la naturaleza, el fuego, el agua, el aire y la tierra) . En ese momento, Parker vuelve a ponerse el traje de Spider-Man para cumplir con  su labor.', 'en', '/ng6SSB3JhbcpKTwbPDsRwUYK8Cq.jpg', '/iKVR1ba3W1wCm9bVCcpnNvxQUWX.jpg', '2019-06-28', 135, 'Sz-CfAthSVk', 'Pasado', 0),
(206, 'The Amazing Spider-Man 2: El poder de Electro', 'The Amazing Spider-Man 2', 'Peter Parker lleva una vida muy ocupada, compaginando su tiempo entre su papel como Spider-Man, acabando con los malos, y en el instituto con la persona a la que quiere, Gwen. Peter no ve el momento de graduarse. No ha olvidado la promesa que le hizo al padre de Gwen de protegerla, manteniéndose lejos de ella, pero es una promesa que simplemente no puede cumplir. Las cosas cambiarán para Peter cuando aparece un nuevo villano, Electro, y un viejo amigo, Harry Osborn, regresa, al tiempo que descubre nuevas pistas sobre su pasado.', 'en', '/mPyiNWS0upEG1mGKOKyCQSoZpnp.jpg', '/8W0mMrmaVdSoLz5LnX61gJOXfEb.jpg', '2014-04-16', 142, 'BQq8z6o3aJk', 'Pasado', 0),
(207, 'Spider-Man: Un nuevo universo', 'Spider-Man: Into the Spider-Verse', 'En un universo paralelo donde Peter Parker ha muerto, un joven de secundaria llamado Miles Morales es el nuevo Spider-Man. Sin embargo, cuando el líder mafioso Wilson Fisk (a.k.a Kingpin) construye el \"Super Colisionador\" trae a una versión alternativa de Peter Parker que tratará de enseñarle a Miles como ser un mejor Spider-Man. Pero no será el único Spider Man en entrar a este universo:  4 versiones alternas de Spider-Man aparecerán y buscarán regresar a su universo antes de que toda la realidad se colapse.', 'en', '/x2IqsMlpbOhS8zIUJfyl1yO4gHF.jpg', '/xRMZikjAHNFebD1FLRqgDZeGV4a.jpg', '2018-12-06', 117, 'qLObEn9IK20', 'Pasado', 0),
(208, 'Misión imposible 5 - Nación secreta', 'Mission: Impossible - Rogue Nation', 'Con la FMI disuelta y Ethan Hunt abandonado a su suerte, el equipo tiene que enfrentarse contra el Sindicato, una red de agentes especiales altamente preparados y entrenados. Estos grupos están empeñados en crear un nuevo orden mundial mediante una serie de ataques terroristas cada vez más graves. Ethan reúne a su equipo y une sus fuerzas con la agente británica renegada Ilsa Faust, quien puede que sea o no miembro de esta nación secreta, mientras el grupo se va enfrentando a su misión más imposible hasta la fecha…', 'en', '/eR20N1flPCQyp9HzpxlTcxgDAO7.jpg', '/ww0IX7Xla6tHgrwYSupfXcksV3n.jpg', '2015-07-23', 131, 'HX3CkwBvOGI', 'Pasado', 0),
(209, 'Misión imposible 3', 'Mission: Impossible III', 'Tras haber llevado a cabo diversas misiones, el agente especial Ethan Hunt (Tom Cruise) se ha retirado del servicio activo y se ha prometido con su amada Julia (Michelle Monaghan). Pero, cuando es secuestrado uno de los agentes entrenados por él, volverá de nuevo a la acción. También tendrá que enfrentarse a Owen Davian (Philip Seymour Hoffman), un individuo sin escrúpulos que trafica con armas y con información.', 'en', '/bYKeB9uUcPmvikjouEEQ86uvPw9.jpg', '/xuZmV5WSpaKZacrVDCOAgH5ydjK.jpg', '2006-05-03', 126, '7O8XMYWMOa4', 'Pasado', 0),
(210, 'Misión imposible 2', 'Mission: Impossible II', 'El agente especial Ethan Hunt tiene una nueva misión: evitar que un despiadado ex-agente y ahora terrorista internacional se haga con un virus mortal que podría soltar sobre Australia causando millones de víctimas. Para evitarlo, contará otra vez con la inestimable ayuda del genio informático Luther Stickell, del experto conductor Billy Baird y de la presencia de la sensual y exótica ladrona internacional Nhye, que en el pasado mantuvo una relación sentimental con el criminal y que ahora se siente atraída por Hunt.', 'en', '/u819Obji086jtXzPfEDZbG1GEBt.jpg', '/mskE3W88cjMRrnKQye8pjmJu3O1.jpg', '2000-05-24', 123, '', 'Pasado', 0),
(211, 'Misión imposible 6 - Fallout', 'Mission: Impossible - Fallout', 'En ocasiones, hasta las mejores intenciones pueden volverse en contra. Después de una misión fallida, Ethan Hunt y su equipo IMF, junto con algunos aliados conocidos, se enfrentarán a una nueva carrera contrarreloj.', 'en', '/aw4FOsWr2FY373nKSxbpNi3fz4F.jpg', '/cUlWqDLEYMN3OWlOZ0U18WcIw5F.jpg', '2018-07-13', 147, 'Rvk57tunWXY', 'Pasado', 0),
(212, 'Misión imposible', 'Mission: Impossible', 'MISIÓN IMPOSIBLE 1: Ethan Hunt es un superespía capaz de resolver cualquier arriesgada situación con la máxima elegancia. Forma parte de un competente equipo dirigido por el agente Jim Phelps, que ha vuelto a reunir a sus hombres para participar en una dificilísima misión: evitar la venta de un disco robado que contiene información secreta de vital importancia.', 'en', '/pbaAkR1FDvgndTVFgGRIzf9o49r.jpg', '/xCpmxw3UUjv4PGzbIPOHeoKAV0l.jpg', '1996-05-22', 110, 'EAcGTtm18ec', 'Pasado', 0),
(213, 'Misión imposible 4 - Protocolo fantasma', 'Mission: Impossible - Ghost Protocol', 'El agente Ethan Hunt, acusado de un atentado terrorista con bombas contra el Kremlin, es desautorizado junto con toda la organización, al poner en marcha el presidente el llamado \'Protocolo fantasma\'. Abandonado a su suerte y sin recursos, el objetivo de Ethan es rehabilitar el buen nombre de su agencia e impedir un nuevo ataque. Pero emprende esta misión con un equipo formado por fugitivos, cuyos motivos personales no conoce bien.', 'en', '/hqyjzDRCs1N5gEsh2gklzPdsEFD.jpg', '/nIhsxDPPuTiQX9wPFqlENeBZ7V1.jpg', '2011-12-07', 132, '9MMPQ88NDWY', 'Pasado', 0),
(214, 'El legado de Bourne', 'The Bourne Legacy', 'En \'El legado de Bourne\', el director y guionista Tony Gilroy amplía el universo de Bourne, creado por Robert Ludlum, con una historia original que revela una conspiración mucho mayor: Aaron Cross es uno de los seis agentes secretos creados por el programa Outcome del Departamento de Defensa, que han sido diseñados para funcionar en solitario en misiones altamente arriesgadas de larga duración. El estudio del comportamiento que dio pie al programa Treadstone ha evolucionado mucho, pero dado que ambos programas comparten el mismo origen, Outcome se convierte en un peligro cuando la historia de Bourne pasa al dominio público.', 'en', '/akNBILfG0vh7WhuzjA1bXfrgpYI.jpg', '/pWVaLBdcVrTqSTBKIJLinmuxRso.jpg', '2012-08-08', 135, 'CJKo5T098RU', 'Pasado', 0),
(215, 'Jason Bourne', 'Jason Bourne', 'Jason Bourne ha recuperado su memoria, pero eso no significa que el más letal agente de los cuerpos de élite de la CIA lo sepa todo. Han pasado doce años desde la última vez que Bourne estuviera operando en las sombras. ¿Qué ha ocurrido desde entonces? Todavía le quedan muchas preguntas por responder. En medio de un mundo convulso, azotado por la crisis económica y el colapso financiero, la guerra cibernética, y en el que varias organizaciones secretas luchan por el poder, Jason Bourne vuelve a surgir, de forma inesperada, en un momento en que el mundo se enfrenta a una inestabilidad sin precedentes. Desde un lugar oscuro y torturado, Bourne reanudará la búsqueda de respuestas sobre su pasado.', 'en', '/7mHeyU0a538bgguOeF57I8ZroSk.jpg', '/vnyWFMUtI74kHORVLDcXdA2Elyd.jpg', '2016-07-27', 123, 'qQGCgT2i5gY', 'Pasado', 0),
(216, 'El ultimátum de Bourne', 'The Bourne Ultimatum', 'Jason Bourne sigue investigando quién es y qué hay realmente detrás del programa secreto de la CIA llamado Treadstone. Ahora un reportero británico de \"The Guardian\" le pone sobre una nueva pista con el nombre de Blackbriar. Bourne dará con él en Londres, en un intento de encajar las últimas piezas de ese pasado que él aún intenta recuperar.', 'en', '/3W2PntikGPhaIxBHyesf26Su64o.jpg', '/1OIp3IY2KZO6DehQ29gDW5RRgqs.jpg', '2007-08-03', 111, '', 'Pasado', 0),
(217, 'The Bourne Identity: El caso Bourne', 'The Bourne Identity', 'Un hombre amnésico es rescatado por la tripulación de un barco pesquero italiano cuando flota a la deriva en el mar. Carece de identidad y de pasado, pero posee unas serie de talentos extraordinarios en artes lingüísticas, marciales y de autodefensa que sugieren una profesión de riesgo. Confuso y desorientado, emprende una frenética búsqueda para descubrir quién es y por qué su vida ha tomado un giro tan peligroso.', 'en', '/pqp1YaqfHhshB0cvzyHeG9zvkzb.jpg', '/c346jzMOGmE9ugyEr5WWaVaqA2R.jpg', '2002-06-14', 113, '', 'Pasado', 0),
(218, 'Náufrago', 'Cast Away', 'Chuck Noland, un ejecutivo de la empresa multinacional de mensajería FedEx, se ve apartado de su cómoda vida y de su prometida a causa de un accidente de avión por el que queda aislado de la civilización en una remota isla tropical. Único superviviente y solo en la isla, tras cuatro años de subsistencia Chuck aprende todas las técnicas de supervivencia mientras sufre la tortura de la soledad. La solución: arriesgar la vida adentrándose mar adentro.', 'en', '/ioqaIhJSkwa9DGRHGtOOUTiGRs2.jpg', '/cAYdzYUUOWeXpnFY6QsE1T2ls1m.jpg', '2000-12-22', 143, '', 'Pasado', 0),
(219, 'Salvar al soldado Ryan', 'Saving Private Ryan', 'Iniciándose con la invasión aliada a Normandía el 6 de junio de 1944, los miembros del segundo batallón de asalto, bajo las ordenes del capitan Miller, luchan por ganar el control de la playa. En el combate dos hermanos resultan muertos. Un poco antes, en Nueva Guinea, un tercer hermano muere también. Su madre, la señora Ryan, va a recibir tres telegramas de defunción el mismo día. El jefe del ejército estadounidense, George C. Marshall, ve la oportunidad de aliviar el sufrimiento de la señora cuando se entera de la existencia de un cuarto hermano, el soldado James Ryan, y decide enviar a 8 hombres (el capitan Miller y un grupo selecto de su batallón) a buscarlo y devolverlo a casa de su madre.', 'en', '/3E5pvJLNEz5WmYWl6GfFW8hEVV3.jpg', '/dcKfD8xWf8XnS3tHVp7v331wdNT.jpg', '1998-07-24', 169, '', 'Pasado', 0),
(220, 'Jack Ryan: Operación sombra', 'Jack Ryan: Shadow Recruit', 'Jack Ryan (Chris Pine) es un veterano de guerra que lleva una doble vida: es un ejecutivo de Wall Street y además trabaja de forma encubierta como analista de la CIA. Cuando descubre un complot meticulosamente planeado para hundir la economía norteamericana y sembrar el caos en todo el mundo, deciden que él es el hombre más adecuado para impedirlo debido a su habilidad para interpretar datos globales. Jack tendrá que viajar a Moscú para intentar descubrir toda la verdad, porque de ello depende la vida de millones personas, pero eso implica moverse en un mundo en el que no puede fiarse de nadie.', 'en', '/Adr9KGNyh5MVIELvACznDq2H64y.jpg', '/eNpySHnJeP8tq5ctN6QCkECe8HI.jpg', '2014-01-15', 105, 'moMYoE1SBEg', 'Pasado', 0),
(221, 'Alicia en el País de las Maravillas', 'Alice in Wonderland', 'Alicia, una joven de 19 años, asiste a una fiesta en una mansión victoriana, donde descubre que está a punto de recibir una propuesta de matrimonio frente a un montón de gente estirada de la alta sociedad. Alicia entonces se escapa, corriendo tras un conejo blanco, entra a un agujero tras él... y acaba en el país de las Maravillas, un lugar que visitó hace 10 años, pero el cual no recuerda. El país de las Maravillas era un reino pacífico hasta que la Reina Roja derrocó a su hermana, la Reina Blanca. Las criaturas del país de las maravillas, listos para la revuelta, esperan que Alicia les ayude, y éstas a su vez le ayudarán a recordar su primera visita al mágico reino.', 'en', '/qNdlZgz9yoSJ8f0YxQWfKGPoVV.jpg', '/lTL10rosTEhOZp8E3zoniXddyRC.jpg', '2010-03-03', 109, 'mUHSNPfNkIs', 'Pasado', 0),
(222, 'Los amantes del Círculo Polar', 'Los amantes del Círculo Polar', 'Ana y Otto cuentan su apasionada y secreta historia de amor que se extiende desde los ocho años hasta los veinticinco. Todo empieza en 1980, cuando dos niños, a la salida de un colegio, echan a correr por distintos motivos. Desde ese día, las vidas de Ana y Otto formarán un círculo que se cerrará en Finlandia, al borde del Círculo Polar.', 'es', '/v27qs9LEtgxXgNYuzkdjXy9Hpcc.jpg', '/c2MSWUxtRxGyJhAzAkaDADYJT5h.jpg', '1998-09-04', 114, '', 'Pasado', 0),
(223, 'City of Angels', 'City of Angels', 'Cuando sentimos una especie de presencia invisible, es que un ángel de la guarda está entre nosotros. Éste es el caso de Maggie, una cardióloga por la que empieza a interesarse Seth, un ángel llegado del cielo. El único obstáculo en su relación es la inmortalidad de Seth.', 'en', '/fqaq7q8rxvySxZQHR9lcNqmK5hR.jpg', '/6QGGsTvbeNvQ5kNcshnAIDBSbn.jpg', '1998-04-10', 114, 'mwWL8cB2Ix8', 'Pasado', 0),
(224, 'Invasión a la Tierra', 'Battle: Los Angeles', 'Durante años ha habido casos documentados de avistamientos de OVNIS en todo el mundo. Pero en 2011, lo que hasta ese momento eran simples avistamientos resulta una terrible realidad cuando la Tierra es atacada por fuerzas desconocidas. Mientras todos son testigos de cómo caen las grandes ciudades del mundo, Los Ángeles se convierte en el último bastión de la humanidad en una batalla que nadie esperaba. Un sargento de la Marina (Aaron Eckhart) y su división son los que tendrán que definir los límites frente a un enemigo como jamás se habían encontrado.', 'en', '/xl6xyJ3t5EhGoro9zLa21uUrPU5.jpg', '/ioU6K3KSbrPAVJ8J6FqyOmjuqGJ.jpg', '2011-03-08', 116, '', 'Pasado', 0),
(225, 'Cocodrilo Dundee en Los Ángeles', 'Crocodile Dundee in Los Angeles', 'Nuevas aventuras del famoso personaje creado por Paul Hogan, esta vez con su hijo, acaecidas en la \"jungla\" californiana. Mick Dundee vive en la actualidad con Sue, la mujer que le robó el corazón. El padre de Sue le ruega a su hija que se traslade urgentemente a California para hacerse cargo de la dirección de su periódico. En la selva de Los Ángeles \"Cocodrilo Dundee\", su mujer y su hijo vivirán las más divertidas y emocionantes aventuras investigando un misterio que les llevará a un estudio cinematográfico en Hollywood.', 'en', '/rz39qQDglxfpadDNVc30zL6EDuz.jpg', '/cruYZMxJdoMY23cR71J2QssFqm4.jpg', '2001-04-12', 92, 'ZYzUDtzi8CQ', 'Pasado', 0),
(226, 'El sexo de los ángeles', 'El sexo de los ángeles', 'Carla y Bruno son una pareja de universitarios. Son jóvenes e inteligentes y creen que lo saben todo acerca del amor, son tolerantes y abiertos. Sin embargo aparecerá en sus vidas un elemento que todo lo perturbará: Rai, un kamikaze de los sentimientos capaz de nadar en cualquier orilla, que desafía los convencionalismos y proclama una libertad sexual que Carla y Bruno ni siquiera se habrían planteado nunca. Así, a ritmo de funky callejero y de break dance, los tres iniciarán una relación más allá de los tabúes en la que aprenderán mucho más de ellos mismos de lo que puedan imaginar.', 'es', '/lBeROrAwwPUXEiALmg7mMapNAll.jpg', '/xQMir1x7xDk3nP59aQyKj67Wsmj.jpg', '2012-05-04', 90, '', 'Pasado', 0),
(227, 'Noche de bodas', 'Ready or Not', 'Durante la noche de su boda, una mujer recibe la invitación por parte de la rica y excéntrica familia de su marido para participar en una tradición ancestral que se convierte en un juego letal de supervivencia.', 'en', '/oKX8t52F25bkWUWVXiAUfTXFnLA.jpg', '/47BlTRVQ43NyzgMWPLOkKYYnHez.jpg', '2019-08-21', 95, 'R0IDMmSVAvw', 'Pasado', 0),
(228, 'Ready Player One', 'Ready Player One', 'Año 2044. Wade Watts es un adolescente al que le gusta evadirse del cada vez más sombrío mundo real a través de una popular utopía virtual a escala global llamada Oasis, hasta que su excéntrico y multimillonario creador muere. Antes de morir, ofrece su fortuna como premio a una elaborada búsqueda del tesoro a través de los rincones más inhóspitos de su creación. Será el punto de partida para que Wade se enfrente a jugadores, poderosos enemigos corporativos y otros competidores despiadados dispuestos a hacer lo que sea, tanto dentro de Oasis como del mundo real, para hacerse con el premio.', 'en', '/q7fXcrDPJcf6t3rzutaNwTzuKP1.jpg', '/2iuVrtC5IpwLtSFSgkIIIKLs0Zq.jpg', '2018-03-28', 140, 'J0ZKannF6l4', 'Pasado', 0),
(229, 'Con Air (Convictos en el aire)', 'Con Air', 'Un grupo de presos considerados muy peligrosos son trasladados a un nuevo centro penitenciario. En el avión viaja también Cameron Poe, que acaba de conseguir la libertad condicional y cuyo único deseo es reunirse de nuevo con su esposa y su hija. Sin embargo, durante el trayecto, Poe se ve envuelto en un secuestro aéreo urdido meticulosamente por Cyrus Grissom. Mientras que Cameron intenta evitar que Cyrus y sus secuaces masacren a toda la tripulacion y que el avión se estrelle contra la ciudad de Las Vegas, Vince Larkin, de la policia judicial, tiene que convencer a sus superiores para que no hagan explotar al avion con todos sus pasajeros.', 'en', '/4iUuOIYBBy12N21AAcEbHr5LQJr.jpg', '/mZv1XUFAzhVvyTwrtjclzbtW4HJ.jpg', '1997-06-05', 116, 'H8GfCfpUnQ0', 'Pasado', 0),
(230, 'Air Force One (El avión del presidente)', 'Air Force One', 'Un grupo de terroristas rusos se hacen pasar por periodistas y secuestran el avión donde viaja el presidente de Estados Unidos. La negociación en el aire no es tan sencilla como en tierra y los secuestrados comenzarán a luchar por sus vidas.', 'en', '/8JIPjSvx1LdtQZTpr3VR2hagU84.jpg', '/pzbVEOhZ86qZyHHwi7PKjrV3X79.jpg', '1997-07-25', 124, 'RwQzfS-Di98', 'Pasado', 0),
(231, 'Combate en el cielo', 'Air Strike', 'Un coronel norteamericano (Bruce Willis) entrena a pilotos chinos para que combatan contra el ejército japonés. El temperamento de algunos hace que su trabajo sea más complicado de lo que había previsto cuando le asignaron la misión, pero no por ello pierde la confianza en los jóvenes soldados que le han sido asignados. Mientras tanto, un pequeño grupo de espías y de refugiados transportan un descodificador a través de zonas rurales devastadas con la esperanza de que sea el artilugio definitivo para que la contienda llegue a su fin.', 'en', '/fhYWAKXeEbhD20S3sp4RFaxiOG9.jpg', '/tw0tphnqFx70ElN7TYmsKM8qD2r.jpg', '2018-10-26', 96, 'kxp5-yobpaw', 'Pasado', 0),
(232, 'Arma letal 4', 'Lethal Weapon 4', 'La pareja de policías formada por Martin Riggs y Roger Murtaugh vuelve a la carga para enfrentarse a un capo de la mafia asiática que ha extendido sus actividades a Los Angeles. En la investigación les ayudará un joven policía responsable de los quebraderos de cabeza familiares de Murtaugh, ya que ha dejado embarazada a su hija. En casa de Riggs, las cosas también se complican cuando su compañera espera un hijo y amenaza con hacerle pasar por el altar.', 'en', '/u4d4vymNPo1UuJ6ihtyy9OQgco2.jpg', '/o1oLMCHkxrqXHGNCEgUosnwlLuV.jpg', '1998-07-10', 127, 'KQGX6YOc-t8', 'Pasado', 0),
(233, 'Arma letal 3', 'Lethal Weapon 3', 'Riggs y Roger son una pareja de policías de Los Ángeles que se enfrentan a un difícil caso. Armas confiscadas y a punto de ser destruidas han desaparecido de las dependencias oficiales y están llegando a los delincuentes más peligrosos de la ciudad. El responsable resulta ser Travis, antiguo teniente expulsado del cuerpo por corrupción.', 'en', '/kmt9XmhmX36sJduuDVFlTgEWh9U.jpg', '/6AYVXfpC4tE7pYNpa6Zf6wKu6f2.jpg', '1992-05-15', 118, 'vqQ166sE5OU', 'Pasado', 0),
(234, 'Arma letal', 'Lethal Weapon', 'Antiguos soldados de la guerra del Vietnam han creado una poderosa red de tráfico de droga. Dos policias reciben el encargo de esclarecer un asesinato en el que esa peligrosa organización se halla implicada.', 'en', '/guTNnSWS3CaH71jasY8W1FMptjG.jpg', '/bOmKVohi6yjxBnoP7XvX6tpXR56.jpg', '1987-03-06', 110, '0NCl9eue_jo', 'Pasado', 0),
(235, 'Arma letal 2', 'Lethal Weapon 2', 'Una pareja de policías tiene como misión proteger a un individuo que va a testificar en contra de una organización de traficantes de droga. Las cosas se complican cuando uno de ellos decide iniciar la investigación por su cuenta sin comunicarlo a la comisaría.', 'en', '/i4R2yYpGeyF7O9GRrNlItAVRBYl.jpg', '/aSEqIMal3ZjFgYi9OE9y8zucJfp.jpg', '1989-07-07', 114, '', 'Pasado', 0),
(236, 'John Rambo', 'Rambo', 'John Rambo, el ex-boina verde con una ajetreada vida marcada por la guerra, vive ahora una solitaria y apacible existencia en la jungla del norte de Tailandia, pescando y cazando cobras para luego venderlas. Todo cambia cuando un grupo de misioneros católicos necesita que les guíe hasta la frontera con Birmania para suministrar medicinas y alimentos a unos refugiados asediados por el ejército birmano, que ha hecho de las torturas y los asesinatos algo habitual. Rambo no tendrá más remedio que volver a involucrarse. Se verá obligado a hacer lo que mejor sabe porque, muy a su pesar, lleva la guerra en la sangre.', 'en', '/fG6vl6Fj1RDPk2BUaWk3vpeUChj.jpg', '/d9DEHlztqhZL7cWn4D6c5EdP3AI.jpg', '2008-01-24', 93, 'At1ReucxHCk', 'Pasado', 0),
(237, 'Rambo: Last Blood', 'Rambo: Last Blood', 'Después de luchar contra sus demonios durante décadas, John Rambo vive ahora en paz en su rancho familiar en Arizona, pero su descanso se ve interrumpido cuando Gabriela, la nieta de su ama de llaves María, desaparece después de cruzar la frontera con México con el propósito de conocer a su padre biológico. Rambo, que con los años se ha convertido para Gabriela en una verdadera figura paterna, emprende un desesperado y peligroso viaje para encontrarla.', 'en', '/pAsZ0ifQwKTHVab8bCHHn2qtizE.jpg', '/ajfGtf3LQk7GFcWvGbpsN6ZmVqe.jpg', '2019-09-19', 101, '3WcrgWJXCHg', 'Pasado', 0),
(238, 'Rambo III', 'Rambo III', 'Cuando descubre que el coronel Trautman ha caído en manos soviéticas en Afganistán, Rambo regresa al servicio para intentar liberar a su amigo. Después de contactar a la resistencia afgana, entra en la zona sitiada por las tropas enemigas…', 'en', '/nEuPSz6LhmrtYp7K56dbsmomuqA.jpg', '/1HYQa4o1aAKzuCxD8oLqlGoABin.jpg', '1988-05-24', 101, 'UxpNwJCHZNU', 'Pasado', 0),
(239, 'Rambo: Acorralado Parte II', 'Rambo: First Blood Part II', 'Rambo es excarcelado y enviado de vuelta al Vietnam con una nueva misión: averiguar el paradero de unos soldados norteamericanos desaparecidos. Tras saltar en paracaídas en la jungla, portando únicamente un cuchillo y un arco con flechas, se le dice que no ataque al enemigo y que sólo haga fotografías de reconocimiento. Pero el plan no saldrá como estaba previsto.', 'en', '/iUCNrTKQZRKmKMEMIznm2UlUmEd.jpg', '/pDsrygpyGl5o5hkvpV5JzK85dYE.jpg', '1985-05-21', 96, 'V2_-0TE-UNk', 'Pasado', 0),
(240, 'Juez Dredd', 'Judge Dredd', 'En el año 2139, la humanidad vive envuelta en una permanente violencia. Sin embargo, en MegaCity Uno, una de las tres megaciudades que existen en Estados Unidos, hay un hombre dispuesto a luchar contra el crimen: el impacable Juez Dredd.', 'en', '/baJHUXBcoaHnMf2sjwegbuhIjEV.jpg', '/9sw2Z9V0E0NxRvJY3cRxF5jQtko.jpg', '1995-06-30', 96, 'WUC0jWc9yJQ', 'Pasado', 0),
(241, 'Furia de titanes', 'Clash of the Titans', 'Adaptación libre del mito de Perseo, hijo de Zeus, el padre de los dioses griegos. Perseo y su madre Dánae, son encerrados en un baúl por Acrisio, su abuelo, y arrojados al mar. Arrastrados por la corriente, llegan a la isla de Sérifos, donde Perseo alcanza la madurez. Cuando sepa cuál es la misión que le ha sido encomendada por el Destino, emprenderá un durísimo viaje, en el que tendrá que ir superando diversas pruebas.', 'en', '/hUUTJPmvBvBKILNLrBu16pRxr6M.jpg', '/gn2q6HooPdGfFaOI2U2nbjw3BSZ.jpg', '2010-03-31', 106, '', 'Pasado', 0),
(242, 'Mad Max: Furia en la carretera', 'Mad Max: Fury Road', 'Perseguido por su turbulento pasado, Mad Max cree que la mejor forma de sobrevivir es ir solo por el mundo. Sin embargo, se ve arrastrado a formar parte de un grupo que huye a través del desierto en un War Rig conducido por una Emperatriz de élite: Furiosa. Escapan de una Ciudadela tiranizada por Immortan Joe, a quien han arrebatado algo irreemplazable. Enfurecido, el Señor de la Guerra moviliza a todas sus bandas y persigue implacablemente a los rebeldes en una \'guerra de la carretera\' de altas revoluciones.', 'en', '/nlCHUWjY9XWbuEUQauCBgnY8ymF.jpg', '/mnVZLdo9C4X80sJmgcGNpMNCbgk.jpg', '2015-05-13', 120, 'UyqFAle_4aE', 'Pasado', 0),
(243, 'Mad Max: Salvajes de la autopista', 'Mad Max', 'En las autopistas desiertas de una Australia desconocida, tiene lugar una guerra sin merced entre motoristas forajidos y policías Interceptor, que intentan triunfar sobre la gentuza al volante de coches con motores trucados. En un mundo en plena decadencia, la moral se difuminará en el escenario post apocalíptico donde lo único que tiene valor es el bien más preciado: la gasolina. La depravación, crueldad y salvajismo reinan en las bandas que no dudarán en perseguir y acabar con cualquiera que se ponga entre ellos y su ansia destruir y ser los amos de la carretera. Max se cruzará en su camino y lo que empieza como un acto de justicia no tardará en tornarse una lucha personal para acabar con ellos.', 'en', '/mWQg2INejtX1PCWRAN4vseadA6H.jpg', '/9LSgFb5pU2hO0nbOTG803uWeXfn.jpg', '1979-04-12', 85, 'caHnaRq8Qlg', 'Pasado', 0),
(244, 'Mad Max 2: El guerrero de la carretera', 'Mad Max 2', 'Tras el holocausto nuclear, la gasolina se ha convertido en un bien escaso y muy codiciado. Mad Max, héroe solitario, inicia una lucha sin cuartel para ayudar a una colonia de supervivientes constantemente atacada por un grupo de violentos guerreros que intenta arrebatarle un tanque de gasolina. Max decide ayudar a los defensores del tanque utilizando un enorme camión como trampa. La banda de guerreros persigue al camión, pensando que transporta miles de litros de gasolina.', 'en', '/MMSI9WzRmOdqXarevQ3Kqnytrx.jpg', '/iPXzpZVP7t3lj5ezxKnvDn6hIf6.jpg', '1981-12-24', 97, '', 'Pasado', 0),
(245, 'Mad Max 3: Más allá de la cúpula del trueno', 'Mad Max Beyond Thunderdome', 'Tras la catástrofe nuclear, Mad Max cruza un desierto donde pierde su caravana de camellos. Llega a una ciudad donde le proponen cambiárselos a cambio de que ataque al tirano de la ciudad subterránea, un enano que fabrica gas metano con excrementos de cerdo.', 'en', '/cO8zcdPhLT3UdykkXCvfhIVrgHK.jpg', '/pgmOX4PQl5xPAdAx18zPPnQjQKs.jpg', '1985-06-29', 107, '', 'Pasado', 0),
(246, 'Guardianes de la galaxia Vol. 2', 'Guardians of the Galaxy Vol. 2', 'Una poderosa raza alienígena contrata a los Guardianes para que protejan sus valiosas baterías de energía, pero, cuando Rocket las roba, los alienígenas envían a sus tropas de combate a vengarse de ellos. Mientras tratan de escapar con vida, intentan resolver el misterio de los verdaderos orígenes de Peter Quill.', 'en', '/xpFIaHL7Rm5kKLcEPDEMpjh4Xq6.jpg', '/kdg6Y06jfq9FV7qknWNcKLYtBJn.jpg', '2017-04-19', 137, '', 'Pasado', 0),
(247, 'Guardianes de la galaxia', 'Guardians of the Galaxy', 'El temerario aventurero Peter Quill es objeto de un implacable cazarrecompensas después de robar una misteriosa esfera codiciada por Ronan, un poderoso villano cuya ambición amenaza todo el universo. Para poder escapar del incansable Ronan, Quill se ve obligado a pactar una complicada tregua con un cuarteto de disparatados inadaptados: Rocket, un mapache armado con un rifle, Groot, un humanoide con forma de árbol, la letal y enigmática Gamora y el vengativo Drax the Destroyer. Pero cuando Quill descubre el verdadero poder de la esfera, deberá hacer todo lo posible para derrotar a sus extravagantes rivales en un intento desesperado de salvar el destino de la galaxia.', 'en', '/2UFxrUHVuSK3Tth7DvQQlF4mGTd.jpg', '/rzEmtM8qrvRKNdJUUiizdNHTccV.jpg', '2014-07-30', 122, 'F60FZKt_36s', 'Pasado', 0),
(248, 'Héroes fuera de órbita', 'Galaxy Quest', 'Galaxy Quest es el título de una serie de televisión que se ha emitido con gran éxito durante treinta años. Una vez que deja de emitirse, sus protagonistas se dedican a pasear sus antiguos uniformes por convenciones y programas especiales. Lo que no saben es que una raza alienígena del espacio exterior, los Thermians, captaban la serie creyendo que se trataba de un documento histórico. En su lucha contra el perverso Roth\'h\'ar Sarris, deciden secuestrar a los protagonistas para que les ayuden a combatirlo.', 'en', '/uIyxbTK1FXJj2wINnlGZzxphlv5.jpg', '/baZFHHGuy08feYHrJM1fmayiVLd.jpg', '1999-12-23', 102, '', 'Pasado', 0),
(249, 'Guía del autoestopista galáctico', 'The Hitchhiker\'s Guide to the Galaxy', 'Todo empieza con Arthur Dent, un chico normal y corriente que tiene un mal día. Su casa está a punto de derrumbarse, acaba de descubrir que su mejor amigo es un alienígena y para colmo, el planeta Tierra está a punto de ser demolido para construir una carretera de circunvalación hiperespacial. He aquí la única posibilidad de Arthur para sobrevivir: hacer autostop y subirse a bordo de una nave espacial con la ayuda de su mejor amigo Ford Prefect. En este viaje hacia lo desconocido, Arthur hace importantes descubrimientos, la mayoría de ellos inofensivos, sobre la verdadera naturaleza del universo. Por ejemplo, descubre que la toalla es el objeto más preciado del universo,  encuentra la respuesta exacta al sentido de la vida y se da cuenta que todo lo que siempre hemos querido saber acerca del universo cabe en un fantástico libro electrónico: la guía del autoestopista galáctico.', 'en', '/i3IOqOFdAdjw0ebQXkIevybkkNF.jpg', '/u3Mr30XEHUwAWlJuUvZIdBfKjNF.jpg', '2005-04-28', 108, 'SF9KHCqRGug', 'Pasado', 0),
(250, 'Sólo se vive una vez', 'Sólo se vive una vez', 'Leo es un estafador de poca monta que, sin quererlo, es testigo de un crimen cometido por unos peligrosos asesinos a sueldo. Colocado en el punto de mira de los sicarios, solo encontrará refugio en una comunidad judía. Una alocada comedia de acción argentina a ritmo de Kiss, con un reparto internacional que incluye a Gérard Depardieu, Santiago Segura, Hugo Silva y Carlos Areces.', 'es', '/eDG4xQDiXhPfou4Fl264KeOjnoK.jpg', '/tKPTUSyy9AaO2l0KIROOpicKaPs.jpg', '2017-06-15', 90, 'fVO_ADIxZLs', 'Pasado', 0),
(251, 'El Roast de El Gran Wyoming', 'El Roast de El Gran Wyoming', 'El \"roast\" es un formato estadounidense en el que una persona famosa se enfrenta a una serie de amigos y enemigos que la critican y se burlan en su cara sin que ésta pueda tener derecho a réplica hasta el final. En España ya se ha visto algún \'Roast\', como el que protagonizó Santiago Segura el pasado 2014. En aquella ocasión, El Gran Wyoming fue el más ingenioso y mordaz, y esta vez es su turno de recibir.', 'es', '/fkiDEPdvGFtP8isxRT72Br3GKPJ.jpg', '/xpHUkq08kIjiy4rTqqPBQoDcLzj.jpg', '2015-07-16', 67, '', 'Pasado', 0),
(252, 'Le llaman Bodhi', 'Point Break', 'Un joven agente del FBI investiga unos robos cometidos por una peculiar banda de asaltantes. Para seguir sus pesquisas se infiltra en un grupo de surfistas cuyo líder es una especie de místico.', 'en', '/yGOHbICOQwlJ20UjK8F2ChGJjvl.jpg', '/jJSCOKKSgnHTbiOGgjUiCMgtpp7.jpg', '1991-01-31', 120, '', 'Pasado', 0),
(253, 'Hardball', 'Hardball', 'Conor (Keanu Reeves), un aficionado a las apuestas cuyos presentimientos fallan siempre, pasa por un grave apuro económico. La única solución para saldar sus deudas es entrenar a un equipo infantil de béisbol de un conflictivo barrio de Chicago. El problema es que a Conor no le gustan mucho los niños, pero sí su maestra, la atractiva señorita Wilkes (Diane Lane). (FILMAFFINITY)', 'en', '/kSrL8dDfaInfekoHS02zqdC1Bu1.jpg', '/9RMcwwnK8a9WCt8dVlwmtNsFCg3.jpg', '2001-09-14', 110, '', 'Pasado', 0),
(254, 'El protector (The Zookeeper)', 'The Zookeeper', 'Jonah Ludovic, el guardián del zoo de una ciudad de los Balcanes en plena guerra civil, es el encargado de cuidar de los animales hasta que puedan ser rescatados. En su cometido, mantiene la guerra fuera de los muros del zoológico, hasta que un niño de 10 años y su madre le piden ayuda.', 'en', '/2wHCH7EayQuKTfatJUgzueVsne6.jpg', '/CL06HCdWB9ewda8aiiDsS0PFEx.jpg', '2001-09-13', 108, '', 'Pasado', 0),
(255, 'Lindy Chamberlain: The True Story', 'Lindy Chamberlain: The True Story', '', 'en', '', '/s0KRwURDjZbj6YOyUlczM0KXM5v.jpg', '2020-09-27', 147, '', 'Pasado', 0),
(256, 'Voice Activated', 'Voice Activated', '', 'en', '/A3vW6YuS6qJ7kXYSF7lJnhyhCqp.jpg', '/ddgohMyKj2yo4OFYoS2sONmWi2p.jpg', '2022-06-15', 13, '', 'Pasado', 0),
(257, 'Capitán América: Civil War', 'Captain America: Civil War', '\"Captain America: Civil War” continúa la historia de “Avengers: Age of Ultron”, con Steve Rogers liderando un nuevo equipo de Vengadores en su esfuerzo por proteger a la humanidad. Tras otro incidente internacional relacionado con los Vengadores que ocasiona daños colaterales, la presión política fuerza a crear un sistema de registro y un cuerpo gubernamental para determinar cuándo se requiere los servicios del equipo. El nuevo status quo divide a los Vengadores mientras intentan salvar al mundo de un nuevo y perverso villano.', 'en', '/7FWlcZq3r6525LWOcvO9kNWurN1.jpg', '/jPPy7tCfglppQo6J9nGwU6UmJ8X.jpg', '2016-04-27', 147, '6aWYmFCRsEI', 'Pasado', 0),
(258, 'Godzilla', 'Godzilla', 'Gareth Edwards dirige este \"reboot\", que se sitúa antes en el tiempo que la película de 1998 dirigida por Roland Emmerich, que nos llevará a conocer los orígenes del famoso monstruo japonés gigante Godzilla.  Protagonizada por Bryan Cranston, ganador del Globo de Oro por Breaking Bad, que da vida a Joe Brody un científico que descubre que algo terrible está a punto de suceder cuando una serie de tsunamis comienzan a llegar a las costas, anticipando la llegada de numerosos monstruos de gran tamaño mientras el ejército intenta defenderse en vano.', 'en', '/zCjZfevPFBbOh2SAx2syIBHSqEI.jpg', '/1t0FcqSsBs51PDhDkFd7EiEytU6.jpg', '2014-05-14', 123, '_MVDpmKxLNg', 'Pasado', 0),
(259, 'Capitán América: El soldado de invierno', 'Captain America: The Winter Soldier', 'Capitán América, Viuda Negra y un nuevo aliado, Falcon, se enfrentan a un enemigo inesperado mientras intentan sacar a la luz una conspiración que pone en riesgo al mundo.', 'en', '/yHB0eNR8rvCpn0VdghEwBsXAC0N.jpg', '/6QBRnyvJHD7slOlX6aukvMwcEu.jpg', '2014-03-20', 136, 'jwOp9DLfsqk', 'Pasado', 0),
(261, 'El insoportable peso de un talento descomunal', 'The Unbearable Weight of Massive Talent', 'Nicolas Cage se interpreta a sí mismo en esta loca comedia de acción. La versión ficticia de Cage es un actor sin blanca que se ve obligado a aceptar una oferta de un millón de dólares para asistir al cumpleaños de un superfan excéntrico multimillonario (Pedro Pascal). Pero la situación da un giro inesperado cuando Cage es reclutado por una agente de la CIA (Tiffany Haddish) y obligado a estar a la altura de su propia leyenda para salvarse a sí mismo y a sus seres queridos. Con una carrera construida para este preciso momento, el actor ganador de premios debe asumir el papel de su vida: Nick Cage.', 'en', '/m0YjB4VfghKey8Ppsmz8qCd0v1m.jpg', '/3n2LTkEO1TQg2hyQPv6Feus3H0J.jpg', '2022-04-20', 106, '', 'Pasado', 0),
(262, 'Alita: Ángel de combate', 'Alita: Battle Angel', 'Ido, un compasivo médico de cíborgs, encuentra a Alita abandonada en el desguace de Iron City. Cuando Alita despierta, no sabe quién es, ni reconoce el mundo en el que se encuentra, todo es nuevo para ella. Ido intentará proteger a Alita de su misterioso pasado, mientras que su nuevo amigo Hugo le ayudará a despertar sus recuerdos. En ese momento, Alita descubre que posee habilidades de combate extraordinarias, que podría usar para salvar a su nueva familia y amigos. Decidida a encontrar la verdad tras sus orígenes, Alita comienza un viaje que le enfrentará a las injusticias de un mundo oscuro y corrupto, descubriendo que sólo ella puede cambiarlo.', 'en', '/8RKBHHRqOMOLh5qW3sS6TSFTd8h.jpg', '/quWP5VIzTUf0Hr8AJZLloM6js8I.jpg', '2019-01-31', 122, 'FBzsLjbaoKQ', 'Pasado', 0),
(263, 'Guardianes de la galaxia Vol. 3', 'Guardians of the Galaxy Vol. 3', 'Sinopsis pendiente de confirmación, en ésta tercera entrega se contará con la presencia de Adam Warlock, un ser superpoderoso creado por Ayesha, la lider de Los Soberanos', 'en', '/jRSAkKG9QSu6Nc1zvI3ejmgLshe.jpg', '/1neAtYqPFfuyzpOnj3ZVDXtGXLf.jpg', '2023-05-03', 0, '', 'Proximamente', 0),
(265, 'Onward', 'Onward', 'Ambientado en un mundo de fantasía suburbana, dos hermanos elfos adolescentes, Ian y Barley Lightfood, se embarcan en una aventura en la que se proponen descubrir si existe aún algo de magia en el mundo que les permita pasar un último día con su padre, que falleció cuando ellos eran aún muy pequeños como para poder recordarlo.', 'en', '/xFxk4vnirOtUxpOEWgA1MCRfy6J.jpg', '/4jiwsh6i9DeguL4iRgQkpkP7m11.jpg', '2020-02-29', 102, 'tWAeY2NqRoI', 'Pasado', 0),
(266, 'Nunca digas su nombre', 'The Bye Bye Man', 'Cuando tres estudiantes universitarios se mudan a una vieja casa fuera del campus, sin querer, liberan a \"Bye Bye Man\", un ente sobrenatural que persigue a quien descubre su nombre. Intentarán mantener su existencia en secreto para alejar al resto de una muerte segura.', 'en', '/xoh4iWOQ3l0JFFD8BBrmLMTvKSU.jpg', '/1LmAWXnqnYm7IHZUVhmXru24TnX.jpg', '2017-01-12', 97, 'fyRECFFa6R4', 'Pasado', 0),
(267, 'Cerebro en llamas', 'Brain on Fire', 'Una periodista del periódico New York Post llamada Susannah Cahalan (Chloë Grace Moretz) comienza a tener problemas de salud graves, como convulsiones y escuchar voces. A medida que las semanas pasan, su condición empeora y rápidamente se mueve de la violencia a la catatonia. Después de numerosos diagnósticos erróneos y una hospitalización, un médico finalmente le da el diagnóstico y la esperanza de reconstruir su vida.', 'en', '/tSLEERGWD6M10hneBjqfyA1rMk8.jpg', '/ulOCM9UYjiXxggjDBtNmGTmsJDA.jpg', '2017-02-22', 95, '', 'Pasado', 0),
(268, 'Dragon Nest: Warriors\' Dawn', '龙之谷：破晓奇兵', 'La tierra de Altera ha observado una paz precaria desde hace años entre los humanos, elfos y bestias malas que son leales al legendario Dragón Negro. Pero éste sale de su hibernación, por lo que las bestias que marchan a través de Altera. Con una conquista peligrosamente cerca, un pequeño grupo de humanos y elfos se unen para tratar de encontrar un camino oculto secreto en la cueva del Dragón Negro para destruirlo. Pero el destino de todos ellos puede estar en las manos del joven guerrero Lambert, quien debe reunir la confianza y la habilidad necesaria para enfrentar al propio Dragón justo cuando todo esta a punto de perderse.', 'zh', '/6i29AyCu1aKAbzbmQITTmOF2cVb.jpg', '/g2w3C3qap1btgCvFOJiYki4aNmy.jpg', '2014-05-20', 88, '', 'Pasado', 0),
(270, 'Percy', 'Percy', 'Percy Schmeiser, un agricultor de tercera generación, es demandado por un gigante corporativo por supuestamente usar sus semillas patentadas. Con pocos recursos para librar una batalla legal, Percy une fuerzas con el prometedor abogado Jackson Weaver y la activista medioambiental Rebecca Salcau en un caso monumental que lleva hasta la Corte Suprema.', 'en', '/zjOXE4BHnZGbHvi0aXMArbDlR71.jpg', '/uCUkbZ34pQyyCOpT3DTypWI8ivP.jpg', '2020-10-09', 100, '', 'Pasado', 0),
(271, 'La familia Addams', 'The Addams Family', 'El delirante y gótico estilo de vida de la peculiar familia Addams se ve amenazado peligrosamente cuando el codicioso dúo que forman madre e hijo, con la ayuda de un abogado sin ningún escrúpulos, conspiran para hacerse con la fortuna familiar...', 'en', '/7OxGhxUYAdtuike29VMzEFxJx7y.jpg', '/6RqnaUcDH2dpR2kmdnmSEHTcS0V.jpg', '1991-11-22', 101, '', 'Pasado', 0),
(272, 'La familia Addams: La tradición continúa', 'Addams Family Values', 'Fue amor al primer susto cuando Gomez y Morticia acogieron a un nuevo miembro en el grupo familiar -Pubert, su delicado, blandito y bigotudo niño. Fue entonces cuando Fétido se enamoró de la voluptuosa niñera. Pero tras algunas investigaciones, Miércoles y Pugsley descubren que la inocente niñera es en realidad una viuda negra asesina que planea añadir a Fétido a su colección de maridos muertos.', 'en', '/yrjFk8OVnwOQ5qUxbHZJYobxQra.jpg', '/3ZcXBJq9DRxEXHEtgZTiwBERqW4.jpg', '1993-11-19', 95, '', 'Pasado', 0),
(273, 'Casper', 'Casper', 'La señora Crittenden contrata al doctor Harvey, para que libere la mansión de Whipstaff de los cuatro fantasmas que la habitan. Látigo, Tufo y Gordy no toleran a los mortales dentro de la casa y tienen un sentido del humor tan negro que ahuyenta a los más atrevidos. Su sobrino Casper, en cambio, es un joven amistoso que está harto de sus tíos. Harvey se presenta en la mansión con su hija Kat, una soñadora adolescente. Ella y Casper simpatizan inmediatamente, a pesar de que ambos tienen problemas para relacionarse. De Casper huye todo el mundo porque es un fantasma, y de Kat, en cuanto se enteran de la profesión de su padre. El fantasma y la joven son dos almas gemelas que entran en continuo conflicto con sus respectivos parientes por cualquier cosa.', 'en', '/g5hN9Kp4ShUcXmnjoaqg3LSWcHr.jpg', '/1t2tCquAPYj15mP1Mj652ytOgg3.jpg', '1995-05-26', 101, '', 'Pasado', 0),
(274, 'Buzz Lightyear: La película', 'Buzz Lightyear of Star Command: The Adventure Begins', 'Tras descubrir los orígenes de Woody en En Toy Story 2 , ahora en Buzz Lightyear: La Película se muestra descubrir cómo Buzz se convirtió en Guardián del Espacio, el auténtico Buzz Lightyear que tendrá que vérselas con el malvado Emperador Zurg, en una lucha intergaláctica para salvar el Universo. Buzz no está sólo, le acompañan nuevos personajes y los gracioso Hombrecillos Verdes.', 'en', '/q8vUVi7BGQAbZbLRSuOliok1bTs.jpg', '/bXMPdUMCiZhGvIRS0IvOBrPVrWo.jpg', '2000-08-08', 70, '', 'Preparación', 0),
(275, 'Duelo en Diablo', 'Duel at Diablo', 'El teniente McAllister recibe la orden de transportar un cargamento de municiones a través de territorio apache. Para realizar esta misión sólo cuenta con un pequeño destacamento formado por inexpertos soldados de caballería. Les acompaña Jess Remsberg, un veterano explorador del ejército que intenta encontrar a Ellen Grange, una cautiva de los apaches que, después de haber sido liberada, inexplicablemente ha vuelto con ellos. (FILMAFFINITY)', 'en', '/aElAderKmhCdx6T96ZXP88jsHcj.jpg', '/mxKco7b1DUWE6kavRZqdQ6U18Yx.jpg', '1966-06-15', 103, '', 'Pasado', 0),
(276, 'Steve McQueen: The Man & Le Mans', 'Steve McQueen: The Man & Le Mans', 'Documental alrededor del legendario actor Steve McQueen y la grabación de la película del año 1971 \"Le Mans\", la historia de la lucha de la estrella por hacer \"la película definitiva sobre las carreras de coches\". Como muestra de la pasión por esta competición deportiva, solía decir Steve McQueen: \"Cuando estás corriendo, eso es vivir. Todo lo que sucede antes o después es simple espera.\"', 'en', '/sUWdqB0jjMpaGM60KlrdXUPawNK.jpg', '/uQGYyBBGWXgSv9PhgKbUoHS7azS.jpg', '2015-05-16', 122, '', 'Pasado', 0),
(277, 'Aventuras en Juguetelandia', 'Babes in Toyland', 'En la vida de Lisa, una niña de once años, no tienen cabida los juguetes. Está demasiado ocupada cuidando a sus hermanos y cocinando para su madre. Pero el día de Nochebuena, la ventisca la transporta al mundo mágico de Juguetelandia, donde está a punto de celebrarse la boda entre el viejo Barnaby Barnacle y la joven Mary Contrary, que, en realidad, está enamorada Jack Be Nimble. Lisa y sus nuevos amigos tratarán de resolver el conflicto.', 'en', '/996KoWowbORw0i5Du6yXKyyiczd.jpg', '/mTg72oYoK18oV1uuuZGW2JI752x.jpg', '1986-12-19', 140, '', 'Pasado', 0),
(278, 'Her', 'Her', 'En un futuro cercano, Theodore, un hombre solitario a punto de divorciarse que trabaja en una empresa como escritor de cartas para terceras personas, compra un día un nuevo sistema operativo basado en el modelo de Inteligencia Artificial, diseñado para satisfacer todas las necesidades del usuario. Para su sorpresa, se crea una relación romántica entre él y Samantha, la voz femenina de ese sistema operativo.', 'en', '/sPPsR9f4K0movWVQ99u4uMqFzEL.jpg', '/n1sY9uAsQKOus91A4FtvN3JdHYH.jpg', '2013-12-18', 126, '', 'Pasado', 0),
(279, 'Ópera prima', 'Ópera prima', 'Un divorciado de 25 años que pasea su amargura por Madrid, en la Plaza de la Ópera, se enamora de su prima, que sólo tiene 18. Aunque ni siquiera él mismo lo pueda creer y pese a los consejos de sus amigos, llega a la conclusión de que es la mujer de su vida.', 'es', '', '/cMq4WfKq2G0V1uhIlpJwtuc6oct.jpg', '1980-04-02', 100, '', 'Pasado', 0),
(280, 'Viernes 13', 'Friday the 13th', 'Remake del clásico film de terror, dirigido en 1980 por Sean S. Cunningham. Buscando a su hermana desaparecida, Clay se dirige al espeluznante bosque del legendario Crystal Lake, donde tropieza con los viejos y decrépitos restos de una cabaña que yace detrás de unos árboles cubiertos por denso musgo. Y esto no es lo único que se esconde entre la maleza… En contra del consejo de la policía y las advertencias de los habitantes de la zona, Clay continúa con su búsqueda, ayudado por una joven mujer que ha conocido entre un grupo de jóvenes estudiantes preparados para pasar un emocionante fin de semana. Sin embargo, ellos están a punto de encontrar algo más que no habían tenido en cuenta. Lo que menos se imaginan es que han entrado en el dominio de uno de los más terroríficos espectros de la historia del cine americano: el infame asesino que caza en Crystal Lake armado con una sierra eléctrica', 'en', '/j1PzqAMU4LzUnz60q9EEqmeX24n.jpg', '/wYQA4UwVLaI4Sf0d5IXEhGO2Ueh.jpg', '2009-02-11', 97, 'MfwLgrasoqs', 'Preparación', 0),
(281, 'Twister', 'Twister', 'Dos grupos de científicos persiguen a las tormentas en busca de conseguir estudiar los comportamientos de los tornados. Ambos compiten por ser los primeros en analizar estos peculiares fenómenos meteorológicos desde dentro de un tornado. Su objetivo es analizar en profundidad la mayor tormenta que caerá sobre Oklahoma en el último medio siglo. En uno de los grupos está Jo Harding, una mujer que, con escasos medios y a punto de divorciarse, tendrá que pedir ayuda a su todavía marido Bill. Éste se la da, pero se presenta acompañado de su nueva amante, Melissa. El otro equipo, con mejor equipamiento, está dirigido por el doctor Miller..', 'en', '/aoWQe00ctaK5k56yc7vsoqEWdHI.jpg', '/sqGlDmGDNv8jtUQkPiZx83WbaUd.jpg', '1996-05-10', 113, '', 'Preparación', 0);
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `titulooriginal`, `sinopsis`, `idiomaoriginal`, `fondo`, `poster`, `estreno`, `duracion`, `trailer`, `estado`, `idgenero`) VALUES
(282, 'Siete hermanas', 'What Happened to Monday', 'En un futuro distópico en el que la sobrepoblación y la hambruna han obligado al gobierno a implantar una política de un único hijo, siete hermanas, cada una con el nombre de un día de la semana, luchan por sobrevivir y pasar inadvertidas haciéndose pasar por una sola persona cuando salen a la calle: Karen Settman. Pero un día una de ella, Lunes, desaparece sin dejar rastro. Las otras hermanas intentarán encontrarla.', 'en', '/rUYc0sUab5mogG5MHPQguPZTi80.jpg', '/At07X7YA9O8LSKhhtm82oCR9eTP.jpg', '2017-08-18', 123, 'Fn4KXfsoP94', 'Pasado', 0),
(283, 'Thor: el mundo oscuro', 'Thor: The Dark World', 'Thor lucha por restablecer el orden en el cosmos, pero una antigua raza liderada por el vengativo Malekith regresa con el propósito de volver a sumir el universo en la oscuridad. Se trata de un villano con el que ni siquiera Odín y Asgard se atreven a enfrentarse; por esa razón, Thor tendrá que emprender un viaje muy peligroso, durante el cual se reunirá con Jane Foster y la obligará a sacrificarlo todo para salvar el mundo.', 'en', '/uhYoytlNaq46dG81wLmHqaSuzWu.jpg', '/gPAmH41VpK5UPaNhAiNJePzrL8z.jpg', '2013-10-30', 112, 'Dos2w0C3LP0', 'Pasado', 0),
(284, 'Tiana y el sapo', 'The Princess and the Frog', 'Tiana, una muchacha de origen humilde que vive en Nueva Orleans, trabaja como camarera y cocinera para conseguir realizar el sueño que compartio con su padre, conseguir abrir su propio restaurante.Pero todo cambia cuando el Príncipe Naveen, heredero de la corona de Maldonia, llega a la ciudad. En su camino se cruza el Doctor Facilier, un brujo vudú que engaña al príncipe y lo convierte en una rana. Atrapado en su nueva forma, Naveen intentará romper el encantamiento utilizando la forma clásica de los cuentos, es decir, con el beso de una princesa. Convence a Tiana para que le bese pero, las cosas no son tan sencillas.', 'en', '/z62CBlBBBOoNUuuxZ1jMAcq5ARE.jpg', '/lSNqVycC40mujo0tiRZvp6Ef5qQ.jpg', '2009-12-08', 97, 'QIB5xThGLcU', 'Preparación', 0),
(285, 'Avatar 3', 'Avatar 3', '', 'en', '', '/ocmG9jo7aorZtjmewSbfwQuJr95.jpg', '2024-12-18', 0, '', 'Proximamente', 0),
(286, 'Avatar 4', 'Avatar 4', '', 'en', '', '/pHxxkaRtiCTDX3tOi1V7aZfOPKO.jpg', '2026-12-16', 0, '', 'Proximamente', 0),
(287, 'Avatar 5', 'Avatar 5', 'Habrá que esperar...', 'en', '', '/qeAknsrFRHRvjIq2HrlBsmYy2KL.jpg', '2028-12-20', 0, '', 'Proximamente', 0),
(288, 'Muerte en el Nilo', 'Death on the Nile', 'Vuelven las pesquisas del célebre detective Hércules Poirot. Esta vez, durante un viaje en crucero por el Nilo, Poirot deberá investigar el misterioso asesinato de una joven heredera sin explicación aparente. Esta secuela de Asesinato en el Orient Express (2017) es la adaptación de la novela Muerte en el Nilo (1937) de Agatha Christie.', 'en', '/lRbDyjI7HEaXxflFQbYpqHRGFBJ.jpg', '/4Fbl3qZSraPXdgmQQzQIDJA736N.jpg', '2022-02-09', 0, '2HQPNRtMbJ0', 'Pasado', 0),
(289, 'El cazador de dragones', 'El cazador de dragones', 'Gorka ha cambiado de vida, pero no puede impedir que su pasado lo persiga. Lleva un tiempo intentando eludir los interrogatorios a los que le somete su hijo pequeño, Aitor, que quiere saber a qué se dedicaba su padre. Sin embargo, Gorka no quiere desvelarle que fue miembro de ETA político-militar hasta su disolución a principios de los ochenta y termina incorporándose a las guerrillas de América Central. Una experiencia vital que comparte con Maddalen, una enfermera, cristiana y comprometida; con José, un guerrillero indígena, y con Andrés, un ex-militar que encabeza la insurrección, experiencia que los transformará a todos.', 'es', '', '/Amja10QXwmQG6AkGLr8jygUl3P2.jpg', '2012-08-31', 106, '', 'Pasado', 0),
(290, 'Independence Day', 'Independence Day', 'En víspera del 4 de julio, unas gigantescas naves espaciales aparecen en el cielo. El estupor inicial se convierte en terror al ver cómo éstas atacan al planeta lanzando rayos destructivos en las mayores ciudades de todo el mundo. Ahora la única esperanza para la salvación de la tierra está en la voluntad de algunos supervivientes, que se unen planeando el último ataque masivo contra los alienígenas, antes de que sea demasiado tarde para la humanidad.', 'en', '/uw4SnKFZ453Gxmj5XR5Susj8TNo.jpg', '/q5DEw5OWMVSn5tm6mL4osl4aNp1.jpg', '1996-06-25', 145, 'B1E7h3SeMDk', 'Pasado', 0),
(291, 'Bad Boys for Life', 'Bad Boys for Life', 'El Departamento de Policía de Miami y su equipo de élite AMMO intentan derribar a Armando Armas, jefe de un cartel de la droga. Armando es un asesino de sangre fría con una naturaleza viciosa y contaminante. Él está comprometido con el trabajo del cartel y es enviado por su madre Isabel, para matar a Mike.', 'en', '/3N316jUSdhvPyYTW29G4v9ebbcS.jpg', '/zXYARspjKpwN9vAOp2F9MF3NWa1.jpg', '2020-01-15', 123, 'kwD0-awPZms', 'Pasado', 0),
(292, 'Escuadrón suicida', 'Suicide Squad', 'Mientras el gobierno de EE.UU no tiene claro cómo responder a una visita alienígena a la Tierra con intenciones malignas, Amanda \'El Muro\' Waller, la líder de la agencia secreta A.R.G.U.S., ofrece una curiosa solución: reclutar a los villanos más crueles, con habilidades letales e incluso mágicas, para que trabajen para ellos. Sin demasiadas opciones a dar una negativa, los ocho supervillanos más peligrosos del mundo acceden a colaborar con el Ejecutivo en peligrosas misiones secretas, casi suicidas, para así lograr limpiar su expediente.', 'en', '/sMRwI5trKI6qhxYcjPgGghmPBef.jpg', '/9ymhU7NclJr29MpZnBQbJurYbuc.jpg', '2016-08-03', 132, 'TwaBdZT0vfk', 'Pasado', 0),
(293, 'Hancock', 'Hancock', 'Hancock es un sarcástico e incomprendido superhéroe que ha perdido el cariño de la gente. Cuando Hancock accede a regañadientes a una operación de lavado de imagen por parte del publicista Ray Embrey, su vida y su reputación emergen de las cenizas y todo parece ir bien de nuevo. Hasta que conoce a una preciosa mujer.', 'en', '/qndvrOXGyoOxkhc12SqfLi9Hr31.jpg', '/5QkoSqDPwSVWx51r2lBCUre7GzE.jpg', '2008-07-01', 92, 'CX_gtA5uBQE', 'Pasado', 0),
(294, 'Soy leyenda', 'I Am Legend', 'Año 2012. Robert Neville es el último hombre vivo que hay sobre la Tierra, pero no está solo. Los demás seres humanos se han convertido en unos mutantes nocturnos llamados \"Darkseekers\" y todos ansían beber su sangre. Durante el día vive en estado de alerta, como un cazador, y busca a los muertos vivientes mientras duermen; pero durante la noche debe esconderse de ellos y esperar el amanecer. Esta pesadilla empezó hace tres años: Neville era un brillante científico, pero no pudo impedir la expansión de un terrible virus creado por el hombre. Él ha sobrevivido porque es inmune al virus; todos los días envía mensajes por radio con la esperanza de que haya otros supervivientes, pero es inútil. Lo único que puede hacer es buscar una fórmula que le permita utilizar su sangre inmune para devolverles a los hombres su naturaleza. Pero está en inferioridad de condiciones y el tiempo se acaba.', 'en', '/usw8PMcbWqAtmABo2jO7KRRSrqi.jpg', '/pO1SrJgf5BumqcIRkYviSGIFdmX.jpg', '2007-12-12', 100, 'F53gHFtGSwQ', 'Pasado', 0),
(295, 'Magnolias de acero', 'Steel Magnolias', 'Comedia de carácter coral que refleja la vida cotidiana, no exenta de dramatismo, de un grupo de amigas de diversas edades de una pequeña ciudad sureña. La protagonista, Shelby Eatenton (Julia roberts), es una joven diabética de salud muy precaria que acaba de casarse y a la que los médicos han aconsejado no tener hijos.', 'en', '/nvrQW1NmhkQ7B4FjNik7uqMOldP.jpg', '/6TKbq2xyCiAmwZboOrGQ6m4Kdul.jpg', '1989-11-15', 119, '', 'Pasado', 0),
(297, 'prueba', 'b', 'c', 'd', 'ert', 'te', '2023-03-29', 3443, 'g', 'h', 2),
(298, 'La milla verde', 'The Green Mile', '\"  En el sur de los Estados Unidos, en plena Depresión, Paul Edgecomb es un vigilante penitenciario a cargo de la Milla Verde, un pasillo que separa las celdas de los reclusos condenados a la silla eléctrica. Esperando su ejecución está John Coffey, un gigantesco negro acusado de asesinar brutalmente a dos hermanas de nueve años. Tras una personalidad ingenua, Coffey esconde un don sobrenatural prodigioso. A medida que transcurre la historia, Paul Edgecomb aprende que los milagros ocurren... incluso en los lugares más insospechados.  \"', '', '/l6hQWH9eDksNJNiXWYRkWqikOdu.jpg', '/9jfxlPX4nJvpBC3QxcqXvyBteaK.jpg', '1999-12-10', 189, 'hBtSF4-cnzk', 'Preparación', 0),
(300, 'prueba', 'prueba', 'ewfwf', 'ad', '', '', '2023-04-28', 3232, '', 'asfsa', 3);
