INSERT INTO `personas` (`idpersona`, `nombre`, `biografia`, `nacimiento`, `lugarnacimiento`, `defuncion`, `genero`, `idimdb`, `idtmdb`, `foto`, `popularidad`) VALUES
(1, 'Álex Angulo', 'Con dieciocho años decidió ser actor y se presentó al casting del grupo teatral independiente bilbaíno Karraka, que dirigía Ramón Barea, con el que trabajó en varios proyectos posteriores durante su carrera. Tras ser aceptado en esta compañía, Angulo vio como la siguiente década de su vida transcurrió sobre los escenarios teatrales.\n\nEn 1981 el actor recibió su primera oportunidad cinematográfica en La fuga de Segovia, donde Angulo daba vida a Anot.\n\nTras este papel, Álex Angulo comenzó a trabajar en  programas de la ETB como Con los pies en el agua, la comedia Bertan Zoro o el programa de Antxón Urrusolo, Detrás del Sirimiri.\n\nAngulo participó en El anónimo (1990), en Todo por la pasta (1990), donde coincidió con Antonio Resines, Kiti Manver o María Barranco, entre otros.\n\nLa dirección artística de Todo por la pasta corrió a cargo de un joven vasco llamado Álex de la Iglesia, quien convenció a Angulo, para que protagonizara su primer cortometraje, Mirindas asesinas (1991). Es esa época también trabajó como a', '1953-04-12', 'Erandio, Vizcaya, Spain', '2014-07-20', 2, 'nm0029962', '3813', '/lm5zGF6qHk318fsiopLCgMToejy.jpg', 1),
(2, 'Armando De Razza', '', '1955-05-24', 'Roma, Italia', NULL, 0, 'nm0211089', '66815', '/cc6jUaH7fTfcqASSmARdDUb0RaL.jpg', 4),
(3, 'Santiago Segura', 'Santiago Segura Silva (Madrid, 17 de julio de 1965) es un actor, guionista, director y productor de cine español, popular por su pentalogía de Torrente. Ha trabajado también, y en menor medida, como presentador de televisión, actor de doblaje y guionista de historietas, siendo además coleccionista de cómics originales.', '1965-07-17', 'Madrid - Spain', NULL, 2, 'nm0782213', '10847', '/w5gSHzLWoivAN2g4z2yaxCSFyTY.jpg', 4),
(4, 'Terele Pávez', '', '1939-07-29', NULL, '2017-08-11', 1, 'nm0701715', '66816', '/i5adV75a3arbpRCSELevAGUC8TC.jpg', 1),
(5, 'Nathalie Seseña', 'Nathalie Denise Ronse Seseña (11 de noviembre de 1967) es una actriz española.\n\nEn la actualidad trabaja en la serie de televisión La que se avecina, emitida por la cadena Telecinco, donde interpreta a Berta Escobar.', '1967-11-11', '  Madrid, Spain', NULL, 1, 'nm0785897', '233766', '/xyMwSWkM5bsPV3UPqEtCksweEpS.jpg', 4),
(6, 'Maria Grazia Cucinotta', 'Maria Grazia Cucinotta (n. 27 de julio de 1968 en Mesina, de Sicilia) es una actriz italiana que ha trabajado en varias películas y series televisivas desde 1990 como actriz, como productora, guionista y modelo.\n\nEs reconocida en Italia como actriz de cine y televisión, pero internacionalmente se la conoce más por sus papeles en Il Postino y como la chica Bond \"Cigar Girl\" en la película de James Bond The World Is Not Enough.\n\nFue la estrella invitada en el episodio de The Sopranos \"Isabella\". También apareció en Los Simpson, en el episodio \"The Italian Bob\" como la maliciosa esposa de Sideshow Bob, Francesca.\n\nContrajo matrimonio con Giulio Violati en 1995, y tienen una hija, Giulia.\n\nMide 1,77 m de estatura.', '1968-07-27', 'Messina, Sicily, Italy', NULL, 1, 'nm0002029', '10777', '/zZ46tuQnCEnYlfGiyuZTAb7w4BL.jpg', 13),
(7, 'Saturnino García', '', '1935-02-25', 'Bariones de la Vega, León, Spain', NULL, 0, 'nm0306498', '93831', '/yubpcNgsdb5rKZPhKmiNRJfA0qX.jpg', 1),
