(11, 'Antonio Dechent', 'Nacido en Sevilla, en 1960, Dechent es un actor conocido sobre todo por su participación en algunas de las películas más representativas del cine español y, en especial, del cine andaluz de los últimos años.\n\nSu primera intervención como actor fue con trece años en clase de literatura con un texto de Cervantes: La elección de los alcaldes de Daganzo. Posteriormente estudió Psicología, aunque a los 23 años se decantó por la interpretación, formándose en el Instituto de Teatro de Sevilla.1\n\nEn el cine debutó en 1987 con la película Las dos orillas, y cuenta con más de 80 títulos en su carrera, con producciones como Solas, Intacto, Smoking Room, Carmen, 7 vírgenes, Alatriste, Los Borgia, Tres días, La voz dormida o A puerta fría, y ha trabajado a las órdenes de directores de prestigio como Agustín Díaz Yanes, José Luis Garci, Vicente Aranda, Mario Camus o Chus Gutiérrez, entre otros muchos.\n\nTambién ha actuado en televisión, realizado diversas producciones como Brigada central, Lleno, por favor, Éste es mi barri', '1960-02-16', 'Sevilla, Andalucía, Spain', NULL, 2, 'nm0213766', '6535', '/3aZ2VQrsGmZl5QKlS5Z4kth5ch8.jpg', 1),
