(49, 'Robert Downey Jr.', 'Robert John Downey Jr. (4 de abril de 1965) es un actor, productor y cantante estadounidense, ganador de dos Globos de Oro y un BAFTA. Con cuatro décadas en el mundo del espectáculo, ha rodado más de 80 películas. Ha sido nominado dos veces a los Óscar: la primera en 1993 por su papel en Chaplin y la segunda en 2009 por Tropic Thunder.\n\nHa participado en películas tales como: Golpe al sueño americano (1987), Natural Born Killers (1994), Wonder Boys (2000), Kiss Kiss Bang Bang (2005), Fur: An Imaginary Portrait of Diane Arbus (2006), Zodiac (2007), Iron Man (2008),The Incredible Hulk(2008), Sherlock Holmes (2009), Iron Man 2 (2010), Sherlock Holmes: juego de sombras (2011), The Avengers (2012), Iron Man 3 (2013), The Judge (2014), Avengers: Age of Ultron (2015), Capitán América: Civil War (2016) Spider-Man: Homecoming (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).  Downey ha protagonizado 6 películas que recaudaron más de 500 millones de dólares cada una en todo el mundo. Tres de esas pelícu', '1965-04-04', 'Manhattan, New York, USA', NULL, 2, 'nm0000375', '3223', '/5qHNjhtjMD4YWH3UP0rm4tKwxCL.jpg', 39),
(50, 'Chris Evans', 'Christopher Robert \"Chris\" Evans (nacido el 13 de junio de 1981) es un actor y cineasta americano. Evans es conocido por su papel de superhéroe, como Capitán América en el universo Marvel, y como la Antorcha humana en los 4 Fantásticos. En el 2014, hizo su debut como director con el drama romántico \"Antes de que te vayas\"', '1981-06-13', 'Sudbury, Massachusetts, USA', NULL, 2, 'nm0262635', '16828', '/3bOGNsHlrswhyW79uvIHH1V43JI.jpg', 31),
(51, 'Mark Ruffalo', 'Mark Alan Ruffalo (Kenosha, Wisconsin, 22 de noviembre de 1967) es un actor de cine, productor, escritor y cineasta estadounidense. Cuenta con tres nominaciones al Premio Óscar.\n\nRuffalo inició su carrera como actor de teatro en la obra Avenue A, en el teatro The Cast, ubicado en Los Ángeles.​ Su debut cinematográfico fue en la película de suspense Mirror, Mirror 2: Raven Dance en 1994. Tres años más tarde, su participación en la obra Betrayal by Everyone le permitió ganarse la aprobación de la crítica. Pero el mundo teatral no le ayudaba a subsistir económicamente, por lo que tuvo que dedicarse a la labor de barman. Durante esta época realizó varias audiciones en todo tipo de papeles.\n\nRuffalo tuvo pequeñas participaciones en películas como The Dentist (1996), la comedia de crimen Safe Men y la película de la Guerra Civil estadounidense aclamada por la crítica Ride with the Devil (1999) del director Ang Lee. Sin embargo, la suerte llamó a su puerta cuando estaba a punto de dejarlo todo. Es así que convenció ', '1967-11-22', 'Kenosha, Wisconsin, USA', NULL, 2, 'nm0749263', '103', '/z3dvKqMNDQWk3QLxzumloQVR0pv.jpg', 15),
(52, 'Chris Hemsworth', 'Chris Hemsworth nació en Melbourne, Australia, de Leonie (van Os), profesora de inglés, y Craig Hemsworth, un consejero de servicios sociales. Sus hermanos son los actores Liam Hemsworth y Luke Hemsworth. Es de ascendencia holandesa (de su abuelo materno inmigrante), irlandés, inglés, escocés y alemán. Su tío, por matrimonio, fue Rod Ansell, el hombre de monte que inspiró la película Cocodrilo Dundee (1986).\n\nChris vio mucho del país en su juventud, después de que su familia se mudara al Territorio del Norte antes de finalmente establecerse en Phillip Island, al sur de Melbourne. En 2004, audicionó sin éxito para el papel de Robbie Hunter en la telenovela australiana Home and Away (1988), pero fue recordado por el papel de Kim Hyde que jugó hasta 2007. En 2006, entró en la versión australiana de Dancing with the Stars (2004) y su popularidad en el jabón le permitieron aguantar hasta el show 7 (Dancing with the Stars: Episode # 5.7 (2006) cuando se convirtió en el quinto participante en ser eliminado.\n\nSu prim', '1983-08-11', 'Melbourne, Victoria, Australia', NULL, 2, 'nm1165110', '74568', '/jpurJ9jAcLCYjgHHfYF32m3zJYm.jpg', 72),
(53, 'Scarlett Johansson', 'Scarlett Johansson, es una actriz, modelo y cantante estadounidense. Hizo su debut cinematográfico en North (1994) y más tarde fue nominada para el premio Independent Spirit a la mejor protagonista femenina por su actuación en Manny & Lo (1996), obteniendo más aclamación y prominencia con papeles en The Horse Whisperer (1998) y Ghost. Mundo (2001). Pasó a papeles adultos con sus actuaciones en Girl with a Pearl Earring (2003) y Lost in Translation (2003) de Sofia Coppola, por la que ganó un premio BAFTA a la Mejor Actriz en un Papel Protagónico; ambas películas también le valieron nominaciones al Globo de Oro.\n\nUn papel en A Love Song for Bobby Long (2004) le valió a Johansson su tercera nominación al Globo de Oro a la Mejor Actriz. Johansson obtuvo otra nominación al Globo de Oro a la Mejor Actriz de Reparto con su papel en Match Point de Woody Allen (2005). Ha interpretado al personaje del cómic de Marvel Black Widow / Natasha Romanoff en Iron Man 2 (2010), The Avengers (2012) y Captain America: The Winter ', '1984-11-22', 'New York City, New York, USA', NULL, 1, 'nm0424060', '1245', '/6NsMbJXRlDZuDzatN2akFdGuTvx.jpg', 30),
(54, 'Jeremy Renner', 'Jeremy Lee Renner (7 de enero de 1971) es un actor, productor, cantante y compositor estadounidense, nominado en dos ocasiones al Premio Óscar. Conocido por su papel como el Sargento de primera clase William James en The Hurt Locker.\n\nEs conocido por interpretar a Hawkeye en las películas del Universo cinematográfico de Marvel Thor (2011), The Avengers (2012), Avengers: Age of Ultron (2015), Capitán América: Civil War (2016) y Avengers: Endgame (2019).', '1971-01-07', 'House', NULL, 2, 'nm0719637', '17604', '/ycFVAVMliCCf0zXsKWNLBG3YxzK.jpg', 25),
(55, 'Tom Hiddleston', 'Thomas William Hiddleston (9 de febrero de 1981) es un actor de cine, televisión y teatro británico. Fue galardonado con el premio Globo de oro por su interpretación en The Night Manager.\n\nEs conocido por haber interpretado a Loki en las adaptaciones cinematográficas de la Trilogía de Thor de Marvel Studios: Thor (2011), Thor: The Dark World (2013) y Thor: Ragnarok (2017), así como también en The Avengers (2012), Avengers: Infinity War (2018) y Avengers: Endgame (2019). El papel de Loki le aseguró la permanencia en el mundo del cine; recibió críticas favorables y en el 2011 fue nominado al premio BAFTA en la categoría \"Mejor Estrella Emergente\".\n\nLas películas más destacables de Hiddleston son: War Horse (2011), de Steven Spielberg; el drama inglés The Deep Blue Sea (2011); la comedia romántica de Woody Allen Midnight in Paris (2011), y en los telefilmes de la BBC Henry IV y Henry V (2012). Además, apareció en un papel principal en el largometraje Crimson Peak (2015) interpretando a Sir Thomas Sharpe. Por últ', '1981-02-09', 'Westminster, London, England, UK', NULL, 2, 'nm1089991', '91606', '/mclHxMm8aPlCPKptP67257F5GPo.jpg', 33),
(56, 'Samuel L. Jackson', 'Samuel Leroy Jackson (Washington D. C., 21 de diciembre de 1948), conocido simplemente como Samuel L. Jackson, es un actor y productor de cine, televisión y teatro estadounidense.\n\nCandidato al Óscar, a los Globos de Oro y al Premio del Sindicato de Actores y ganador de un BAFTA al mejor actor de reparto. Es conocido por sus intervenciones en películas como Coming to America (1988), Goodfellas (1990), Jurassic Park (1993), Pulp Fiction (1994), Die Hard: With a Vengeance (1995), A Time to Kill (1996), Unbreakable (2000), Changing Lanes (2002), S.W.A.T. (2003), Django Unchained (2012), en el Universo cinematográfico de Marvel como el director de S.H.I.E.L.D., Nick Fury, en la saga Star Wars como el maestro Mace Windu (1999, 2002 y 2005) y en The Hateful Eight (2015) como el mayor Marquis Warren, El Cazarrecompensas. Jackson también es conocido por interpretar la voz del superhéroe Frozono en The Incredibles (2004), la de Whiplash en Turbo (2013), ZOG en Astro Boy (2009) y el sargento Frank Tenpenny en el exitos', '1948-12-21', 'Washington, D.C., USA', NULL, 2, 'nm0000168', '2231', '/nCJJ3NVksYNxIzEHcyC1XziwPVj.jpg', 48),
(57, 'Cobie Smulders', 'Jacoba Francisca Maria (3 de abril de 1982) conocida como Cobie Smulders,​ es una actriz y modelo canadiense, conocida por su papel de Robin Scherbatsky en la comedia de situación estadounidense Cómo conocí a vuestra madre.\n\nEs conocida por interpretar a Maria Hill en el Universo cinematográfico de Marvel en la películas The Avengers (2012), Captain America: The Winter Soldier (2014), Avengers: Age of Ultron (2015), Avengers: Infinity War (2018), Avengers: Endgame (2019), Spider-Man: Lejos de casa (2019).', '1982-04-03', 'Vancouver, British Columbia, Canada', NULL, 1, 'nm1130627', '71189', '/klOl0L9mSV74DRgVRgaY7pUnVXm.jpg', 23),
(58, 'Clark Gregg', 'Robert Clark Gregg (2 de abril de 1962) es un actor, guionista y director estadounidense.  Es conocido sobre todo por su papel como Phil Coulson en las películas Iron Man (2008), Iron Man 2 (2010), Thor (2011) y The Avengers (2012) y en la serie de televisión Agents of S.H.I.E.L.D., que se transmite por la cadena ABC. También da voz al personaje en la serie de televisión animada Ultimate Spider-Man.  Interpretó a Richard, el exesposo de Christine Campbell en la sitcom de la CBS The New Adventures of Old Christine, serie que debutó en marzo de 2006 y concluyó en mayo de 2010. Además, es conocido por ser el agente especial del FBI Mike Casper en la serie de NBC The West Wing y Cam en la serie de NBC Will & Grace.', '1962-04-02', 'Boston, Massachusetts, USA', NULL, 2, 'nm0163988', '9048', '/nbxFbr2SaF4Sdc6HdsF193GInvJ.jpg', 9),
(59, 'Stellan Skarsgård', 'Stellan John Skarsgård (13 de junio de 1951) es un actor sueco de cine, televisión y teatro. Ganó el Oso de Plata del Festival de Berlín de 1982, entre otros.\n\nAlgunos de sus papeles más conocidos son el del profesor Lambeau, en El indomable Will Hunting; el de Bill Anderson, en la película Mamma Mia!; el de Bill «Bootstrap» Turner, en la saga «Piratas del Caribe», y el del Dr. Erik Selvig, en las películas Thor (2011), The Avengers (2012), Thor: The Dark World (2013) y Avengers: Age of Ultron (2015).', '1951-06-13', 'Gothenburg, Västra Götalands län, Sweden', NULL, 2, 'nm0001745', '1640', '/x78BtYHElirO7Iw8bL4m8CnzRDc.jpg', 13),
(60, 'Gwyneth Paltrow', 'Gwyneth Kate Paltrow​ (27 de septiembre de 1972) es una actriz y cantante estadounidense ganadora de un Óscar, un Globo de Oro y dos Premios del Sindicato de Actores, todos ellos por su interpretación de Viola de Lesseps en la película Shakespeare in Love (1998). Recibió su estrella en el Paseo de la Fama de Hollywood en 2010.\n\nEs actualmente conocida por haber interpretado a Virginia «Pepper» Potts en las películas del Universo cinematográfico de Marvel Iron Man (2008), Iron Man 2 (2010), The Avengers (2012), Iron Man 3 (2013), Spider-Man: Homecoming (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1972-09-27', 'Los Angeles, California, USA', NULL, 1, 'nm0000569', '12052', '/slPWN0VvYJtNOEuxlFSsXSNQMaF.jpg', 14),
(61, 'Paul Bettany', 'Paul Bettany (27 de mayo de 1971) es un actor de cine, televisión y teatro y guionista inglés. Fue candidato al BAFTA al mejor actor de reparto. Es conocido por su participación en películas como A Knight\'s Tale (2001), A Beautiful Mind (2001), Master and Commander: The Far Side of the World (2003), Wimbledon (2004), El código Da Vinci (2006), The Secret Life of Bees (2008) y en Legion (2009) y además por su participación como Visión y J.A.R.V.I.S (voz) en el Universo cinematográfico de Marvel.\n\nSus películas más exitosas comercialmente han sido Avengers: Infinity War con más de 2000 millones, Los Vengadores (2012) con 1500 millones de dólares a nivel mundial, la secuela Avengers: Age of Ultron (2015) con 1400 millones, Iron Man 3 (2013) con 1200 millones y El código Da Vinci con 758 millones de dólares en todo el mundo.', '1971-05-27', 'London, England, U.K.', NULL, 2, 'nm0079273', '6162', '/vcAVrAOZrpqmi37qjFdztRAv1u9.jpg', 41),
