(79, 'Harry Dean Stanton', 'Harry Dean Stanton (West Irvine, Kentucky; 14 de julio de 1926-Los Ángeles, California; 15 de septiembre de 2017) fue un actor estadounidense. Se hizo conocido por su papel protagonista en Paris, Texas (1984) y por distintos papeles secundarios en películas de renombre, como  La leyenda del indomable (1967), Pat Garrett y Billy the Kid (1973), El padrino II (1974), Alien, el octavo pasajero (1979), Escape from New York (1981), Repo Man (1984), La última tentación de Cristo (1988), Corazón salvaje (1990), Twin Peaks: Fuego camina conmigo (1992), The Straight Story (1999), The Green Mile (1999) o Inland Empire (2006), así como en las series Big Love (2006-2010) y Twin Peaks (2017).', '1926-07-14', 'West Irvine, Kentucky, USA', '2017-09-15', 2, 'nm0001765', '5048', '/197UiLVdxPOv8196sqmUpJzOQB5.jpg', 8),
