(96, 'Stan Lee', 'Stanley Martin Lieber (Manhattan, Nueva York; 28 de diciembre de 1922), más conocido como Stan Lee, es un escritor y editor de cómics estadounidense, además de productor y ocasional actor de cine. Es principalmente conocido por haber creado personajes icónicos del mundo del cómic tales como Spider-Man, Hulk, Iron Man, Los 4 Fantásticos, Thor, Los Vengadores, Daredevil, Doctor Strange, X-Men y Bruja Escarlata, entre otros muchos superhéroes, casi siempre acompañado de los dibujantes Steve Ditko y Jack Kirby. El trabajo de Stan Lee fue fundamental para expandir Marvel Comics, llevándola de una pequeña casa publicitaria a una gran corporación multimedia. Todavía hoy, los cómics de Marvel se distinguen por indicar siempre «Stan Lee presenta» en los rótulos de presentación. También tuvo un programa televisivo en History Channel en donde buscaba superhumanos \"reales\".', '1922-12-28', 'New York City, New York, USA', '2018-11-12', 2, 'nm0498278', '7624', '/kKeyWoFtTqOPsbmwylNHmuB3En9.jpg', 11),
