(162, 'Tom Hanks', 'Thomas Jeffrey Hanks (nacido el 9 de julio de 1956) es un actor y cineasta estadounidense. Conocido por sus papeles cómicos y dramáticos, Hanks es una de las estrellas de cine más populares y reconocibles en todo el mundo, y es ampliamente considerado como un ícono cultural estadounidense.\n\nHanks hizo su gran avance con papeles principales en las comedias Splash (1984) y Big (1988). Ganó dos premios consecutivos de la Academia al Mejor Actor por interpretar a un abogado gay que padecía SIDA en Filadelfia (1993) y un joven con un coeficiente intelectual inferior al promedio en Forrest Gump (1994). Hanks colaboró ​​con el director de cine Steven Spielberg en cinco películas: Saving Private Ryan (1998), Catch Me If You Can (2002), The Terminal (2004), Bridge of Spies (2015) y The Post (2017), así como la miniserie de 2001 Band of Brothers, que lo lanzó como director, productor y guionista.\n\nOtras películas notables de Hanks incluyen las comedias románticas Sleepless in Seattle (1993) y You Have Got Mail (1998); ', '1956-07-09', 'Concord, California, United States', NULL, 2, 'nm0000158', '31', '/xndWFsBlClOJFRdhSt4NBwiPq2o.jpg', 36),
