(166, 'James Cromwell', 'James Oliver Cromwell (Los Ángeles, 27 de enero de 1940) es un actor estadounidense, conocido también por ser un defensor de los animales, vegetariano después de actuar en la película Babe y darse cuenta de cómo se trataba a los animales en las granjas. En 2013 ganó un Emmy por su papel de Dr. Arden en American Horror Story: Asylum.', '1940-01-27', 'Los Angeles, California, USA', NULL, 2, 'nm0000342', '2505', '/vpNQQbM5PtxsYmVm4oh79SGFyUK.jpg', 9),
