(170, 'Sam Rockwell', 'Sam Rockwell (5 de noviembre de 1968) es un actor estadounidense, ganador de un Óscar, un Globo de Oro, un BAFTA y un Premio del Sindicato de Actores al mejor actor de reparto por su papel en la película Three Billboards Outside Ebbing, Missouri.\n\nEs conocido por ser el protagonista de películas como Lawn Dogs, Confessions of a Dangerous Mind, Choke y Moon, y ha tenido papeles destacados en cintas como The Green Mile, Galaxy Quest, Clownhouse, Frost/Nixon, The Hitchhiker\'s Guide to the Galaxy, Matchstick Men, Todos están bien, El asesinato de Jesse James por el cobarde Robert Ford y Iron Man 2.', '1968-11-05', 'Daly City, California, USA', NULL, 2, 'nm0005377', '6807', '/4zjUldl3ykbgcLO7FxWppR6s7Ck.jpg', 13),
