(230, 'Keanu Reeves', 'Keanu Charles Reeves, cuyo primer nombre significa \"brisa fresca sobre las montañas\" en Hawai, nació el 2 de septiembre de 1964 en Beirut, Líbano. Él es el hijo de Patricia Taylor, una diseñadora de vestuario, y Samuel Nowlin Reeves, un geólogo. El padre de Keanu nació en Hawai, de ascendencia británica, portuguesa, nativa de Hawái y china, y la madre de Keanu es originaria de Inglaterra. Después de que el matrimonio de sus padres se disolvió, Keanu se mudó con su madre y su hermana menor, Kim Reeves, a la ciudad de Nueva York, luego a Toronto. El padrastro # 1 fue Paul Aaron, un director de teatro y cine. Él y Patricia se divorciaron en un año, luego de lo cual ella se casó (y se divorció) del promotor de rock Robert Miller y el dueño de la peluquería Jack Bond. Reeves nunca se reconectó con su padre biológico. En la escuela secundaria, Reeves era tibio con los académicos, pero se interesó mucho en el hockey sobre hielo (como portero del equipo, se ganó el apodo de \"El Muro\") y el drama. Finalmente abandonó ', '1964-09-02', 'Beirut, Lebanon', NULL, 2, 'nm0000206', '6384', '/4D0PpNI0kmP58hgrwGC3wCjxhnm.jpg', 32),
(231, 'Carrie-Anne Moss', 'Carrie-Anne Moss (21 de agosto de 1967) es una actriz canadiense que consiguió fama mundial tras sus apariciones en la trilogía The Matrix como Trinity.', '1967-08-21', 'Burnaby, British Columbia, Canada', NULL, 1, 'nm0005251', '530', '/xD4jTA3KmVp5Rq3aHcymL9DUGjD.jpg', 18),
