(233, 'Jessica Henwick', 'Henwick nació y creció en Surrey , Inglaterra, hija de una madre china nacida en Singapur y un padre inglés nacido en Zambia. Su padre, Mark, es autor y su madre está retirada del negocio minorista. Ella es la hija del medio y tiene dos hermanos. Se formó en la Escuela de Teatro Redroofs y en el Teatro Nacional de la Juventud.', '1992-08-30', 'Surrey, England', NULL, 1, 'nm3725055', '1202689', '/hRrEqDIWlov1FvYRmBN2vLaAxyl.jpg', 27),
