(238, 'Jada Pinkett Smith', 'Jada Koren Pinkett-Smith (18 de septiembre de 1971)1​ es una actriz, productora, directora, cantante, compositora y empresaria estadounidense.  Es conocida por su personaje de Niobe en las películas The Matrix Reloaded y The Matrix Revolutions, y por ser la voz de Gloria, en la franquicia de películas animadas Madagascar. Esta casada con el actor y rapero Will Smith (de ahí, la inclusión de su último apellido), con quien tiene dos hijos, los actores y raperos Jaden Smith y Willow Smith.', '1971-09-18', 'Baltimore, Maryland, USA', NULL, 1, 'nm0000586', '9575', '/vt1Z1Fsu7gjp4L0OHey9Aa79lWj.jpg', 22),
