(288, 'Laurence Fishburne', 'Laurence John Fishburne III, más conocido como Laurence Fishburne, (30 de julio de 1961) es un actor de cine estadounidense. Conocido principalmente por su rol como Morfeo en la película de ciencia ficción The Matrix y sus secuelas.  En 1993 fue nominado al premio Óscar al mejor actor por la película Tina, un biopic sobre la vida de la cantante Tina Turner en la que Fishburne interpretaba al marido de esta. Ha participado también en la popular serie de CBS, CSI y representó a Perry White en la cinta El hombre de acero.', '1961-07-30', 'Augusta, Georgia, USA', NULL, 2, 'nm0000401', '2975', '/8suOhUmPbfKqDQ17jQ1Gy0mI3P4.jpg', 19),
(289, 'Hugo Weaving', 'Hugo Wallace Weaving (4 de abril de 1960) es un actor anglo-australiano.\n\nEs conocido por sus papeles como el Agente Smith en la trilogía de Matrix, Elrond en las trilogías de El Señor de los Anillos y El hobbit, V en V for Vendetta, Mitzi en Las aventuras de Priscilla, reina del desierto, y como Johann Schmidt (Red Skull) en Capitán América: el primer vengador.', '1960-04-04', 'Ibadan, Nigeria', NULL, 2, 'nm0915989', '1331', '/ze8GZjOhLnhftj1pDBwsxcMMWPS.jpg', 18),
(290, 'Gloria Foster', '', '1933-11-15', 'Chicago, Illinois, USA', '2001-09-29', 1, 'nm0287825', '9364', '/AriGXtC9fjBOia9Zr8CZjn4o3rx.jpg', 9),
(291, 'Eddie Murphy', 'Edward Regan Murphy, conocido artísticamente como Eddie Murphy (Brooklyn, Nueva York; 3 de abril de 1961)1​ es un actor, director de cine, comediante y cantante estadounidense. Fue miembro del reparto habitual en Saturday Night Live de 1980 a 1984. Ha trabajado como comediante de stand-up y ocupó el puesto número 10 en la lista de Comedy Central de los 100 mejores stand-ups de todos los tiempos.2​\n\nEn películas, Murphy ha recibido nominaciones al Globo de Oro por sus actuaciones en 48 horas., la Beverly Hills Cop series, Trading Places y The Nutty Professor . En 2007, ganó el Globo de Oro al Mejor Actor de Reparto y recibió una nominación al Premio de la Academia al Mejor Actor de Reparto por su interpretación del cantante de soul James \"Thunder\" Early in Dreamgirls.3​\n\nEl trabajo de Murphy como actor de voz en películas incluye Thurgood Stubbs en The PJs, Burro en la serie Shrek de DreamWorks Animation y el dragón chino Mushu en Mulan de Disney. En algunas películas, desempeña múltiples roles además de su pe', '1961-04-03', 'Brooklyn, New York, USA', NULL, 2, 'nm0000552', '776', '/35NneLV2mx3c4eHptwcCMDmihik.jpg', 14),
