(311, 'Jim Abrahams', 'Director, guionista, productor y actor norteamericano nacido en Shorewood, Wisconsin. Heredero de la escuela de humor judío del barrio de Brooklyn y cofundador con Jerry y David Zucker del Kentucky Fried Theater en Madison. El trío se trasladó con su grupo a Los Ángeles y se aventuraron en el cine con Aterriza como puedas (1980), continuando en la misma línea cómica con Top Secret (1984) y Por favor maten a mi mujer (1986). Ya en solitario dirigió, Ensalada de gemelas (1988), Aquí te pillo, aquí te mato (1990), Hot Shots (1991) y Mafia, estafa como puedas (1998), homenajes satíricos, algunas de ellas, de las películas de desastres, de espías y de policías.', '1944-05-10', 'Shorewood, Wisconsin, USA', NULL, 2, 'nm0000720', '12936', '/22B24mvWEkorhoxEOPCxNcYdcTX.jpg', 4),
