(370, 'Natalie Portman', 'Natalie Portman es la primera persona nacida en la década de 1980 que ganó el Premio de la Academia a la Mejor Actriz (por Cisne negro (2010)).\n\nNatalie nació Natalie Hershlag el 9 de junio de 1981, en Jerusalén, Israel. Ella es la única hija de Avner Hershlag, un médico nacido en Israel, y Shelley Stevens, una artista estadounidense (de Cincinnati, Ohio), que también actúa como agente de Natalie. Sus padres son ambos de ascendencia judía Ashkenazi. La familia de Natalie dejó Israel para ir a Washington, D.C., cuando aún era muy joven. Después de algunos movimientos más, su familia finalmente se estableció en Nueva York, donde todavía vive hasta el día de hoy. Se graduó con honores y sus logros académicos le permitieron asistir a la Universidad de Harvard. Fue descubierta por un agente en una pizzería a la edad de 11 años. Fue empujada hacia una carrera en el modelaje, pero decidió que preferiría seguir una carrera en la actuación. Apareció en muchas presentaciones en vivo, pero hizo su poderoso debut cinemat', '1981-06-09', 'Jerusalem, Palestine (now Israel)', NULL, 1, 'nm0000204', '524', '/edPU5HxncLWa1YkgRPNkSd68ONG.jpg', 23),
(371, 'Anthony Hopkins', 'Philip Anthony Hopkins, CBE (Margam, Port Talbot, Gales; 31 de diciembre de 1937) es un actor galés estadounidense de cine, teatro y televisión, además de compositor. Es muy conocido por su interpretación del asesino en serie Hannibal Lecter en The Silence of the Lambs, en su secuela Hannibal y en su precuela Red Dragon.\n\nAlgunas de sus películas más notables son: El hombre elefante, Drácula, de Bram Stoker, Leyendas de pasión, Lo que queda del día, Howards End, La máscara del Zorro, The World\'s Fastest Indian, Hearts in Atlantis, Nixon y Fracture. Nació y creció en Gales, y en abril del 2000 adquirió, además, la ciudadanía estadounidense, y es reconocido como unos de los mejores actores vivos.\n\nDurante su carrera ha ganado varios premios, entre otros: el Óscar, el Emmy, el Premio Cecil B. DeMille de los Globo de Oro, el BAFTA y el Premio Donostia del Festival Internacional de Cine de San Sebastián. Se ha encontrado varias veces con el también actor británico Gary Oldman: Hopkins tuvo un papel secundario en l', '1937-12-31', 'Margam, Port Talbot, Glamorgan, Wales, UK', NULL, 2, 'nm0000164', '4173', '/9ukJS2QWTJ22HcwR1ktMmoJ6RSL.jpg', 14),
(372, 'Kat Dennings', 'Katherine Litwack (13 de junio de 1986), más conocida como Kat Dennings, es una actriz estadounidense. Es más famosa por su papel como Max Black en la serie de comedia de la CBS 2 Broke Girls.', '1986-06-13', 'Bryn Mawr, Pennsylvania, USA', NULL, 1, 'nm0993507', '52852', '/rrfyo9z1wW5nY9ZsFlj1Ozfj9g2.jpg', 11),
