(374, 'Idris Elba', 'Idrissa Akuna Elba (6 de septiembre de 1972), conocido como Idris Elba, es un actor británico de televisión, teatro y cine.\n\nInició su carrera en Estados Unidos, siendo su papel más conocido el de Russell \"Stringer\" Bell, traficante de drogas que aspira a convertirse en un hombre de negocios en la serie The Wire. Protagonista a su vez en la serie Luther donde ganó un Globo de Oro al mejor actor de miniserie o telefilme.  Es también un DJ -conocido como DJ Big Driis / Big Driis the Londoner- y un cantante de Hip hop y soul.', '1972-09-06', 'Hackney, London, England, UK', NULL, 2, 'nm0252961', '17605', '/be1bVF7qGX91a6c5WeRPs5pKXln.jpg', 24),
