(416, 'Christian Bale', 'Christian Charles Philip Bale (Haverfordwest, Gales, 30 de enero de 1974), más conocido como Christian Bale, es un actor británico, ganador de un Globo de Oro, un premio SAG y un Óscar.\n\nEntre su filmografía más aclamada destacanː American Psycho (2000); The Machinist (2004); y la trilogía del director Christopher Nolan dedicadas al superhéroe Batmanː Batman Begins (2005), The Dark Knight (2008), The Dark Knight Rises (2012); The Fighter (2010); American Hustle (2013); y The Big Short (2015).\n\nOtros carteles destacados de Bale son: Empire of the Sun (1987), Equilibrium (2002), The Prestige (2006), 3:10 to Yuma (2007), Public Enemies (2009), Terminator Salvation (2009).', '1974-01-30', 'Haverfordwest, Pembrokeshire, Wales, UK', NULL, 2, 'nm0000288', '3894', '/qCpZn2e3dimwbryLnqxZuI88PTi.jpg', 37),
(417, 'Tessa Thompson', 'Tessa Lynne Thompson (3 de octubre de 1983)1​ es una actriz estadounidense. Se hizo conocida por su rol en la película del 2009 Mississippi Damned. Obtuvo un mayor reconocimiento por sus papeles protagónicos como Nyla Adrose en la película dramática For Colored Girls (2010), la activista por los derechos civiles Diane Nash en la película de drama histórico Selma (2014), Bianca en la película de drama deportivo Creed (2015), Josie Radek en la película de terror de ciencia ficción Annihilation (2018) y la Agente M en Men in Black: International (2019).\n\nEs conocida por interpretar a Valkyrie en las películas del Universo cinematográfico de Marvel Thor: Ragnarok (2017) y Avengers: Endgame (2019).', '1983-10-03', 'Los Angeles, California, USA', NULL, 1, 'nm1935086', '62561', '/fycqdiiM6dsNSbnONBVVQ57ILV1.jpg', 17),
(418, 'Taika Waititi', 'Taika David Waititi (16 de agosto de 1975), también conocido como Taika Cohen, es un director, escritor, pintor, comediante y actor neozelandés.', '1975-08-16', 'Wellington, New Zealand', NULL, 2, 'nm0169806', '55934', '/zCLBXGo5BS2e27srDBa5WpRnKul.jpg', 26),
(419, 'Russell Crowe', 'Russell Ira Crowe (Wellington, Nueva Zelanda, 7 de abril de 1964) es un actor, director, productor de cine y músico neozelandés.\n\nCrowe captó la atención internacional por su papel como el general romano Maximus Decimus Meridius en la histórica película épica Gladiador (2000), dirigida por Ridley Scott, film por el que Crowe ganó un Óscar al mejor actor, un Premio de la Asociación de Críticos de Cine al Mejor Actor, un Premio Empire al Mejor Actor, un London Film Critics Circle Award por Mejor Actor y más de 10 candidaturas a mejor actor. Interpretó a Jeffrey Wigand en la película The Insider (El Dilema) (1999), por la que recibió cinco premios como mejor actor y siete nominaciones en la misma categoría. También, la representación de Crowe del matemático y Premio Nobel John Forbes Nash en la película biográfica A Beautiful Mind (Una mente maravillosa) (2001) le trajo numerosos premios, incluyendo un premio BAFTA al Mejor Actor en un papel principal, un Globo de Oro al Mejor Actor en una Película de Drama y un', '1964-04-07', 'Wellington, New Zealand', NULL, 2, 'nm0000128', '934', '/mGTtPuwE8OR00tkJGmVLJmt8KpW.jpg', 20),
(420, 'Chris Pratt', 'Christopher Michael Pratt (21 de junio de 1979), conocido simplemente como Chris Pratt, es un actor, actor de voz y productor estadounidense. Aunque nació en Virginia, creció en la ciudad de Lake Stevens y desde temprana edad tuvo problemas con su sobrepeso. Tras terminar la secundaria en 1997, abandonó sus estudios para mudarse a Maui (Hawái), donde vivió sin un hogar hasta que fue descubierto por la actriz Rae Dawn Chong mientras trabajaba como mesero a los 19 años.\n\nGracias a su carisma, Pratt vio éxito en la televisión durante la década del 2000 con las series Everwood, The O. C. y Parks and Recreation. Sin embargo, logró gran reconocimiento a nivel mundial en 2014 protagonizando la película Guardianes de la Galaxia con el personaje de Peter Quill / Star-Lord y se convirtió en un personaje recurrente del Universo cinematográfico de Marvel al repetir su papel en Guardianes de la Galaxia Vol. 2 (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019), películas que fueron aclamadas por la crítica y ', '1979-06-21', 'Virginia, Minnesota, USA', NULL, 2, 'nm0695435', '73457', '/gXKyT1YU5RWWPaE1je3ht58eUZr.jpg', 56),
(421, 'Dave Bautista', 'David Michael «Dave» Bautista Jr.​ (18 de enero de 19691​) es un actor, ex-luchador profesional y expeleador de artes marciales mixtas estadounidense.\n\nComenzó su carrera como luchador profesional en 1999 y firmó con la World Wrestling Federation (WWF, ahora WWE) en 2000. De 2002 a 2010, ganó fama con el nombre de Batista y se convirtió en un seis veces campeón mundial al ganar el Campeonato Mundial Peso Pesado cuatro veces y el Campeonato de la WWE dos veces. Tiene el récord del reinado más largo como Campeón Mundial de Peso Pesado en 282 días y también ha ganado el Campeonato Mundial en Parejas tres veces (dos veces con Ric Flair y una vez con John Cena) y el Campeonato en Parejas de la WWE una vez (con Rey Mysterio). Fue el ganador del Royal Rumble 2005 y fue parte del evento estelar de WrestleMania 21, uno de los cinco eventos de pago por ver con mayor recaudación en la historia de la lucha libre profesional. Bautista volvió a la WWE en 2014, ganando el Royal Rumble 2014 y fue parte del evento estelar de ', '1969-01-18', 'Washington, DC, USA', NULL, 2, 'nm1176985', '543530', '/ymn6iQBJbQZN6BYI60YJDXVP4gF.jpg', 24),
(422, 'Karen Gillan', 'Karen Gillan (28 de noviembre de 1987) es una actriz, directora y guionista escocesa. Interpretó el papel de Amy Pond, compañera del Undécimo Doctor, en la serie de ciencia ficción de la BBC One Doctor Who (2010-2013).\n\nEn el cine, interpretó a Nebula en el Universo Cinematografico de Marvel en las películas Guardianes de la Galaxia (2014) y Guardianes de la Galaxia Vol. 2 (2017), Vengadores: Infinity War (2018) y Vengadores: Endgame (2019), y también obtuvo el papel de Ruby Roundhouse en el éxito de taquilla Jumanji: Welcome to the Jungle (2017).\n\nEn 2018, lanzó su primer largometraje como escritora y directora, titulado The Party\'s Just Beginning.', '1987-11-28', 'Inverness, Scotland, UK', NULL, 1, 'nm2394794', '543261', '/52kqB0Bei1TaTBx2rABrijVhhTG.jpg', 60),
(423, 'Pom Klementieff', 'Pom Alexandra Klementieff (3 de mayo de 1986) es una actriz y modelo franco-canadiense conocida principalmente por interpretar a Mantis en el Universo Cinematográfico de Marvel, actuando en las películas Guardianes de la Galaxia Vol. 2 (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1986-05-03', 'Québec City, Québec, Canada', NULL, 1, 'nm2962353', '139820', '/hfUKAI2kXTMMWjno0i4sLPJud5N.jpg', 15),
(424, 'Bradley Cooper', 'Bradley Charles Cooper (5 de enero de 1975) es un actor, actor de voz, director, productor, guionista, cantante y compositor estadounidense. Inspirado por su padre, comenzó a interesarse por la actuación a temprana edad, y continuó con sus estudios hasta el 2000, cuando obtuvo su Máster en Bellas Artes en The New School, en Nueva York. Posteriormente, desempeñó roles menores en numerosas películas y series de televisión, entre estas Alias y Wedding Crashers (2005).\n\nCooper saltó a la fama con su papel en The Hangover (2009), que se convirtió en un éxito crítico y comercial, extendiéndose por dos secuelas igualmente exitosas lanzadas en 2011 y 2013.​ Su racha de filmes aclamados y taquilleros continuó con Silver Linings Playbook (2012), American Hustle (2013) y American Sniper (2014), con los cuales recibió nominaciones a los premios Óscar por su actuación. Asimismo, prestó su voz para dar vida al personaje de Rocket Raccoon en el Universo cinematográfico de Marvel.​ Además del cine, Cooper interpretó a Joseph', '1975-01-05', 'Philadelphia, Pennsylvania, USA', NULL, 2, 'nm0177896', '51329', '/pLD2XvxqHueLWOuqXoFngJU3A5H.jpg', 20),
(425, 'Vin Diesel', 'Mark Sinclair Vincent (18 de julio de 1967), más conocido por el nombre artístico de Vin Diesel, es un actor, productor y director de cine estadounidense.\n\nConocido por la interpretación de Dominic Toretto en la saga cinematográfica The Fast and the Furious y por el papel de Richard B. Riddick en la trilogía Las Crónicas de Riddick, también productor de las secuelas de ambas franquicias.\n\nDiesel también ha protagonizado películas como xXx y xXx: Return of Xander Cage (2002 y 2017); A Man Apart (2003); The Pacifier (2005); el 1492 (2006); y El último cazador de brujas (2015). Su trabajo también incluye la actuación de voz en off en las películas El gigante de hierro (1999), los videojuegos spin-offs de la franquicia Las Crónicas de Riddick, y el superhéroe Groot en Guardianes de la Galaxia o en otras películas del Universo Cinematográfico de Marvel. También escribió, dirigió, produjo y protagonizó los cortometrajes Multi-Facial (1995), Strays (1997) y Los chinneses (2004).\n\nDiesel es el fundador de las empresa', '1967-07-18', 'Alameda County, California, USA', NULL, 2, 'nm0004874', '12835', '/9uxTwqB8anAiPomB6Kqm6A73VTV.jpg', 35),
(426, 'Sean Gunn', 'Sean Gunn (22 de mayo de 1974) es un actor y guionista estadounidense. Es más conocido por su papel de Kirk Gleason en la serie de televisión Gilmore Girls. También es conocido por interpretar el personaje de Kraglin en las películas del Universo Cinematográfico Marvel Guardianes de la Galaxia, Guardianes de la Galaxia Vol. 2 y en Avengers: Infinity War.\n\nEs el hermano del director y productor James Gunn, del actor y escritor Matt Gunn, del actor, productor y escritor Brian Gunn y primo del guionista y productor Mark Gunn.', '1974-05-22', 'St. Louis, Missouri, USA', NULL, 2, 'nm0348231', '51663', '/vpU13iCGqCpCd3LH4Tem6sVr7it.jpg', 12),
(427, 'Jeff Goldblum', 'Jeffrey Lynn Goldblum (22 de octubre de 1952), más conocido como Jeff Goldblum, es un actor y músico estadounidense.  Su carrera comenzó a mediados de la década de 1970 y desde entonces se ha destacado en películas taquilleras como La mosca (1986), Parque Jurásico (1993), Independence Day (1996), El mundo perdido (1997), Jurassic World: El reino caído (2018), entre otras.  Entre 2009 y 2010 interpretó al detective Zach Nichols en la serie Law & Order: Criminal Intent. En 1996 fue nominado a los Premios Óscar por su dirección en el cortometraje Little Surprises.', '1952-10-22', 'Pittsburgh, Pennsylvania, USA', NULL, 2, 'nm0000156', '4785', '/m8p62pvkVtPxkfAIJhb5AgGw8kA.jpg', 26),
