(429, 'Matt Damon', 'Matthew Paige Damon (Cambridge, Massachusetts; 8 de octubre de 1970) es un actor, guionista y filántropo estadounidense. Su carrera se inició a raíz del éxito de la película Good Will Hunting (1997), a partir de un guion escrito con su amigo Ben Affleck. Fue ganador del premio Óscar al mejor guion original por Good Will Hunting y nominado a mejor actor por el mismo trabajo.\n\nDamon desde entonces ha participado en películas de éxito comercial como Saving Private Ryan (1998) o dando vida a Jason Bourne.\n\nMatt Damon nació en Cambridge (Massachusetts), hijo de Kent Telfer Damon, agente inmobiliario y excorredor de bolsa, y de Nancy Carlsson-Paige, maestra infantil y profesora en la Universidad de Lesley y tiene un hermano, Kyle, que es un escultor y artista', '1970-10-08', 'Boston, Massachusetts, USA', NULL, 2, 'nm0000354', '1892', '/jzUcQ7ybe92DUvns955pPaYUMYp.jpg', 20),
