(432, 'Ben Falcone', 'Nombre completo: Benjamin Scott Falcone\n\n- Actor, cineasta y comediante estadounidense, casado con la actriz Melissa McCarthy, sus papeles como coprotagonista fueron en \"What to expect when you\'re expecting\", o \"Enough Said\", Falcone debutó como director con \"Tammy\" que escribió y dirigió junto a su esposa.', '1973-08-25', 'Carbondale, USA', NULL, 2, 'nm1229520', '170820', '/jsRsK14OBLd8rqVaBB1IdLyvxN7.jpg', 8),
