(437, 'Cate Blanchett', 'Cate Blanchett nació el 14 de mayo de 1969 en Melbourne, Victoria, Australia, a junio (Gamble), un maestro australiano y desarrollador de propiedades, y Robert DeWitt Blanchett, Jr., un ejecutivo de publicidad estadounidense, originario de Texas. Ella tiene un hermano mayor y una hermana menor. Cuando tenía diez años, su padre de 40 años murió de un ataque cardíaco repentino. Su madre nunca se volvió a casar, y su abuela se mudó para ayudar a su madre.\n\nCate se graduó en el Instituto Nacional de Arte Dramático de Australia en 1992 y, en poco más de un año, ganó la aclamación crítica y popular. Al graduarse de NIDA, se unió a la producción de Caryl Churchill \"Top Girls\" de la Compañía de Teatro de Sydney, luego interpretó a Felice Bauer, la novia, en \"Kafka Dances\" de Tim Daly, ganando el Premio Newcomer 1993 del Círculo de Críticos de Teatro de Sydney por su actuación. . A partir de ahí, Blanchett asumió el papel de Carol en la polémica \"Oleanna\" de David Mamet, también para la Sydney Theatre Company, y ganó ', '1969-05-14', 'Melbourne, Victoria, Australia', NULL, 1, 'nm0000949', '112', '/vUuEHiAR0eD3XEJhg2DWIjymUAA.jpg', 13),
(438, 'Karl Urban', 'Karl Heinz Urban (7 de junio de 1972) es un actor neozelandés, famoso por papeles cinematográficos como el de Éomer en la trilogía de El Señor de los Anillos o el de Pathfinder, u otros televisivos como el de Julio César en la serie de televisión Xena: la princesa guerrera; y más recientemente por encarnar al doctor Leonard McCoy en Star Trek y al juez Dredd en la película británica Dredd 3D (2012).', '1972-06-07', 'Wellington, New Zealand', NULL, 2, 'nm0881631', '1372', '/bsAnEFgVm5kn8DbBZKfnlLNll89.jpg', 61),
(439, 'Benedict Cumberbatch', 'Benedict Timothy Carlton Cumberbatch (19 de julio de 1976) es un actor inglés de cine, televisión y teatro. Sus papeles más aclamados incluyen: Stephen Hawking en el drama de la BBC \"Hawking\" (2004); William Pitt en la película histórica \"Amazing Grace\" (2006); Stephen Ezard en el thriller de miniserie \"The Last Enemy\" (2008); Paul Marshall en \"Expiación\" (2007); Bernard en \"Small Island\" (2009); Sherlock Holmes en la moderna serie de adaptación de la BBC \"Sherlock\" (2010) y Stephen Strange en Doctor Strange (2016).\n\nEs hijo de los actores Timothy Carlton (Timothy Carlton Congdon Cumberbatch) y Wanda Ventham.', '1976-07-19', 'London, England, UK', NULL, 2, 'nm1212722', '71580', '/fBEucxECxGLKVHBznO0qHtCGiMO.jpg', 46),
