(441, 'Clancy Brown', 'Clarence J. \"Clancy\" Brown III (5 de enero de 1959) es un actor estadounidense conocido por su papel de El Kurgan en el clásico de culto Highlander.\n\nEn 1992 protagonizó la película de terror Pet Sematary Two en el papel del sheriff Gus Gilbert. También se le recuerda por haber interpretado a personajes como el duro e imponente celador Byron Hadley en la premiada Cadena perpetua/Sueño de fuga, el Hermano Justin Crowe en la aclamada serie de HBO Carnivàle o el sargento Zim en Starship Troopers. También trabaja frecuentemente como actor de voz en series de televisión animadas, de entre las cuales destaca su papel como Eugene H. Cangrejo en la serie Bob Esponja.\n\nInterpreta al sheriff August Corbin en la serie de televisión estadounidense Sleepy Hollow. En el 2002 participó en el episodio \"Encrucijada en el desierto\" de la serie Star Trek Enterprise. En el 2016 participó como parte del reparto de la superproducción estadounidense Warcraft encarnando el personaje de Puño Negro.', '1959-01-05', 'Urbana, Ohio, USA', NULL, 2, 'nm0000317', '6574', '/9RgzFqbmWBLVfq9wvyDo5UW8VT1.jpg', 21),
(442, 'Zachary Levi', 'Zachary Levi (29 de septiembre de 1980) es un actor y cantante estadounidense conocido sobre todo por sus papeles de Kipp Steadman en Less Than Perfect, Chuck Bartowski en Chuck, por dar voz a Eugene Fitzherbert (Flynn Rider) en el largometraje animado de Disney Enredados y por interpretar a Shazam, en la película homónima de DC para su universo extendido.', '1980-09-29', 'Lake Charles, Louisiana, USA', NULL, 2, 'nm1157048', '69899', '/1W8L3kEMMPF9umT3ZGaNIiCYKfZ.jpg', 12),
