(507, 'Elsa Pataky', 'Elsa Pataky nació Elsa Lafuente Medianu en Madrid, España. Su madre, Cristina Pataky Medianu, es publicista de ascendencia rumana y húngara, y su padre, José Francisco Lafuente, es un bioquímico español. Asistió a la Universidad de San Pablo CEU, donde estudió periodismo y comenzó a interesarse en la actuación. Se unió al Teatro Cámara de Ángel Gutiérrez, una compañía de teatro en Madrid, y dejó la universidad cuando se le ofreció un papel en la larga serie de televisión española Al salir de clase (1997).\n\nSiguieron más papeles en la televisión española, junto con una creciente carrera en películas, primero en España pero cada vez más internacionalmente.\n\nConoció a su esposo, Chris Hemsworth, a través de la compañía administradora que los representa a ambos, ROAR.\n\nSe dio a conocer gracias a su papel en la serie de televisión Al salir de clase. A lo largo de su carrera ha participado en películas como Ninette, Di Di Hollywood o Copito de nieve entre otras. También aparece en tres películas de la saga The Fast', '1976-07-18', 'Madrid, Spain', NULL, 1, 'nm0665235', '73269', '/qvXlQZWW5yvYZwXCt2fS6vgcePP.jpg', 109),
(508, 'Joe Cash', '', NULL, NULL, NULL, 2, 'nm11413315', '3255103', NULL, 1),
