(510, 'Javier Gutiérrez', 'Javier Gutiérrez Álvarez (17 de enero de 1971) es un actor de teatro, cine y televisión español, ganador de dos Premios Goya por su papel del detective Juan Robles en la película La isla mínima (2014) y por la película El autor (2017), y también conocido por sus interpretaciones en televisión en series como Estoy vivo, Los Serrano o Águila Roja.', '1971-01-17', 'Luanco,Gozón,Asturie,Spain', NULL, 2, 'nm0349522', '19024', '/xkVnaiiXtYJLjlJRsj8zD9r7k6t.jpg', 1),
(511, 'José Mota', 'José Sánchez Mota (30 de junio de 1965), conocido como José Mota, es un humorista, actor (también de doblaje), imitador y guionista español. Es conocido por haber sido miembro, junto con Juan Muñoz, del dúo humorístico Cruz y Raya entre 1989 y 2007.\n\nDesde 2007 ha desarrollado su carrera en solitario.', '1965-06-30', 'Ciudad Real, Castilla La Mancha, Spain', NULL, 2, 'nm1239566', '19854', '/6a8kpruWspF6fvfbm5JqY9GOK0T.jpg', 2),
(512, 'Tony Leblanc', 'Ignacio Fernández Sánchez, conocido por su nombre artístico Tony Leblanc (Madrid, 7 de mayo de 1922 - Villaviciosa de Odón, Madrid, 24 de noviembre de 2012),  fue un actor, humorista, director, guionista y compositor musical de pasodobles español', '1922-05-07', 'Madrid, Madrid, Spain', '2012-11-24', 2, 'nm0495764', '12089', '/tnIPeWGuWhn8q3iBC7jMOQnwboM.jpg', 1),
