(516, 'Carlos Latre', 'Carlos Latre Ruiz (30 de enero de 1979) es un humorista, actor, presentador e imitador español. Es conocido por ser jurado del programa Tu cara me suena de Antena 3.', '1979-01-30', 'Castellón de la Plana, Spain', NULL, 2, 'nm1265207', '234520', '/tpPVduOGEn9BBq40CTPFrq53pXF.jpg', 2),
