(518, 'Jaime Ordóñez', 'Jaime Ordóñez (19 de agosto de 1971), es un actor español. Famoso por participar como actor de reparto en Aquí no hay quien viva, por ser colaborador en los programas de José Mota y por ser actor habitual desde 2013 en las películas de Álex de la Iglesia.', '1971-08-19', 'Málaga, Spain', NULL, 2, 'nm1533932', '1206196', '/x46hVHDEGrX6148QT9fdQYK5pdu.jpg', 2),
