(520, 'Pablo Pinedo', '', NULL, NULL, NULL, 2, NULL, '1042160', '/3sr25zg3qd9OOwRDLdnnrQ8zIzI.jpg', 1),
(521, 'Andreu Buenafuente', 'Andreu Buenafuente Moreno es un humorista, presentador y productor español. Es el fundador de la productora audiovisual El Terrat, desde donde ha creado un buen número de distintos formatos en televisión y radio, así como producido teatro y publicidad.', '1965-01-24', 'Reus, Catalonia, Spain', NULL, 2, 'nm0119174', '228878', '/7uML2VxBqMZLlFAOBL1tPIIknF9.jpg', 1),
(522, 'Cañita Brava', 'Cañita Brava es el nombre artístico de Manuel González (Las Jubias, La Coruña; 1946-). Es un artista cómico-musical español que saltó a la fama a comienzos de los años 90, como uno de los pioneros del fenómeno “friki” en España.  Sus primeras apariciones fueron en el programa \"El semáforo\" donde gozó de gran popularidad junto al inolvidable Don José Failde. Se le conoce particularmente por su participación en el programa televisivo español Crónicas Marcianas y por su colaboración en las películas de Santiago Segura, Torrente.', '1956-01-01', 'A Coruña, Galicia, Spain', NULL, 2, 'nm0105987', '1423066', NULL, 1),
(523, 'Helga Liné', 'Helga Lina Stern, conocida como Helga Liné (Berlín, 14 de julio de 1931), es una actriz alemana que desarrolló gran parte de su trayectoria en España.\n\nSiendo una niña su familia abandona Alemania a causa de la Segunda Guerra Mundial para instalarse en Portugal, donde poco después comienza a trabajar como contorsionista y bailarina de circo.\n\nMás adelante se convierte en modelo y, tras ganar un concurso de belleza, rueda su primera película hispano-portuguesa, La mantilla de Beatriz (1946), de Eduardo García Maroto. Durante los siguientes años reparte su actividad profesional entre Portugal, España y Brasil como vedette de revista y actriz en numerosos filmes.\n\nEn 1954 se presenta en el madrileño Teatro Albéniz con el espectáculo de revista Mujeres de papel, de Manuel Paso Andrés.1​\n\nContinúa una trayectoria cinematográfica fecunda especialmente en Italia, que le permite trabajar en los géneros más diversos: spaghetti western, péplum, terror o comedias, tanto en el terreno del llamado landismo como más adelan', '1932-07-14', 'Berlin, Germany', NULL, 1, 'nm0513298', '31700', '/83O6t9xqw0pr0da2CFEh6B0DQt.jpg', 7),
(524, 'John Landis', '', '1950-08-03', 'Chicago, Illinois, USA', NULL, 2, 'nm0000484', '4610', '/nXKdxxELgAaGecCpxAWCoj6TV3f.jpg', 6),
(525, 'Eduardo García', 'Eduardo García Martínez (30 de abril de 1992) es un rapero y anteriormente actor español de cine y televisión, popular por los papeles de Josemi en Aquí no hay quien viva y Fran en La que se avecina.', '1992-04-30', 'Madrid, Spain', NULL, 2, 'nm1705284', '1253385', '/ouEpPedtyWO2ZzAlcrZO1bLmoDM.jpg', 1),
