(533, 'Nicolás Rodríguez-Villar', '', NULL, NULL, NULL, 0, NULL, '2371154', NULL, 1),
(534, 'Alec Baldwin', 'Alexander Rae \"Alec\" Baldwin III (3 de abril de 1958), es un actor estadounidense de cine y televisión, siendo el mayor de los Hermanos Baldwin, una familia que ha estado presente en cine y televisión durante las últimas dos décadas y en la que también destacan Daniel Baldwin, William Baldwin y Stephen Baldwin. Ha trabajado tanto en papeles secundarios como protagónicos, y en numerosas películas incluyendo Beetlejuice y La caza del Octubre Rojo, además de El aviador y The Departed de Martin Scorsese.\n\nHa sido nominado a los premios Óscar, Globo de Oro y Screen Actors Guild por su papel en la película The Cooler (2003). Alec Baldwin interpretó a Jack Donaghy en la serie 30 Rock (2006-2013), un papel por el cual ha ganado dos Emmy, tres Globo de Oro y siete Screen Actors Guild Awards.\n\nBaldwin también ha sido presentador de Saturday Night Live en 17 ocasiones.', '1958-04-03', 'Amityville, New York, USA', NULL, 2, 'nm0000285', '7447', '/hzKy7x574eeUS3wt1R3yvWBRpeR.jpg', 15),
(535, 'Fernando Sáez', '', NULL, NULL, NULL, 0, NULL, '1423095', NULL, 1),
(536, 'Fernando Esteso', 'La relación de Fernando Esteso con el mundo del espectáculo fue bastante temprana, comenzando a trabajar en el circo como payaso junto a su padre cuando tan solo era un niño.1\n\nSe trasladó a vivir a Madrid en 1964 con diecinueve años, donde al poco tiempo debutó como actor de teatro. Ya en los años 1970 se hizo popular como humorista en diversos programas de televisión, grabando clásicos del humor ibérico como el comercial del \"Coñac La Parra\".2 Después se hizo famoso por las películas de corte erótico-humorístico que, junto a Andrés Pajares, interpretó a finales de los 70 y principios de los 80.3\n\nTambién tuvo un cierto éxito como cantante humorístico. Sus canciones más conocidas fueron El Bellotero (juego de palabras con La Bella Otero) y La Ramona.4 Aprovechando el tirón y la fama cosechados, en 1987 escribió, dirigió y protagonizó una película para vídeo, titulada Viva la risa. Ese mismo año, protagonizó junto a Pajares la obra de teatro La extraña pareja, de Neil Simon.\n\nDespués de más de diez años de tr', '1945-02-16', 'Zaragoza, Spain', NULL, 2, 'nm0261681', '99812', '/pnfto3eEaEGRQHvo81mq3iIyKaZ.jpg', 2),
(537, 'Carlos Areces', '', '1976-03-27', '  Madrid, Spain', NULL, 2, 'nm1693112', '114461', '/aLir4uS9YBSXdLsGU7qSl3gC51G.jpg', 1),
(538, 'Paco Collado', 'Paco Collado nació en el madrileño barrio de Vallecas en 1960. Actualmente reside en Moratalaz con su pareja y sus 3 hijos. Debutó en televisión en la década de los 90 en el programa de Lluvia de Estrellas imitando a Joan Manuel Serrat.1​ Es un colaborador habitual de los trabajos de José Mota y Juan Muñoz (Cruz y Raya). Desde noviembre de 2013 comienza a colaborar en el programa Me resbala de Antena 3.', '1960-12-01', NULL, NULL, 2, NULL, '2366664', '/8UViO6KOJXAnMQtMYkpHGdDsPSB.jpg', 1),
(539, 'Enrique Sarasola', '', NULL, NULL, NULL, 0, 'nm1217828', '186397', NULL, 1),
(540, 'Anna Simon', 'Anna Simon Marí (9 de agosto de 1982) es una periodista y presentadora de televisión.\n\nSaltó a la fama tras su paso por Los mejores años de nuestra vida y Tonterías las justas. Trabaja actualmente en Zapeando como colaboradora y presentadora sustituta.', '1982-08-09', 'Barcelona, Spain', NULL, 1, 'nm3623593', '1423065', '/gUlawMfoVslA2EuGk0kmiYpDtsv.jpg', 2),
(541, 'Mad Crampi', '', NULL, NULL, NULL, 0, NULL, '1982716', NULL, 1),
(542, 'Chus Lampreave', 'María Jesús Lampreave Pérez (1930-2016) fue una actriz española conocida  por sus papeles secundarios del cine español, destacando sus participaciones en las películas de Pedro Almodovar y de otros directores, como Berlanga o Fernando Trueba', '1930-12-11', 'Madrid - Spain', '2016-04-04', 1, 'nm0483942', '3482', '/wMirBMOWfKEaaMKBkT5h8cau8Gr.jpg', 5),
(543, 'Torbe', 'Ignacio Allende Fernández, más conocido como Torbe (Portugalete, Vizcaya; 25 de mayo de 1969), es un director, productor y actor porno español. En el mundo del porno se lo conoce como «el rey del porno freak»,​ una mezcla de humor y sexo que dice haber inventado él mismo.\n\nAunque inicialmente fue dibujante y autor de cómics, es principalmente conocido por su trabajo en el cine porno. Durante siete años creó, dirigió y editó la revista de cómics La Comictiva. Su alias proviene de la acotación de Natxo Torbellino, el apodo que tenía en el grupo musical Miles de Albañiles, y el cual usa desde el año 1996. Al descubrir Internet tuvo que reducir el mismo a Torbe para entrar en chats, y desde entonces lo emplea siempre', '1969-05-25', 'Portugalete, Biscay, Spain', NULL, 2, 'nm0021199', '1423081', '/swvgm0tFxQNx4Cfu0Tq5gi3eNgm.jpg', 1),
(544, 'Neus Asensi', 'María de las Nieves Asensio Liñán, conocida artísticamente como Neus Asensi (4 de agosto de 1965), es una actriz española.', '1965-08-04', 'Barcelona, Spain', NULL, 1, 'nm0038572', '72998', '/qeB7Jqimr2y3Ehg5wnHjMA3MPOi.jpg', 2),
(545, 'Jorge Segura', '', NULL, NULL, NULL, 0, NULL, '2371157', NULL, 1),
(546, 'Silvia Abril', 'Silvia Abril Fernández (10 de abril de 1971) se supone que es una actriz, humorista y presentadora española, pero es de lo peor en el panorama español, sin ningún tipo de ingenio o gracia. Su única virtud es que es la mujer de Buenafuente.', '1971-04-10', 'Mataro, Spain', NULL, 1, 'nm1526347', '231486', '/rGCUC9wuUqFWeE4TXL8zi027ukA.jpg', 2),
(547, 'Andrés Pajares', 'Se inició como actor cómico en salas de fiestas y en las compañías musicales de Antonio Machín, Manolo Escobar y Tony Leblanc, encabezando una cartelera por primera vez junto a Antonio Casal y actuando con Sara Montiel y Rocío Jurado, antes de formar su propia compañía de revistas (Más vale pájaro en mano, Del coro al caño, La risa está servida), alternando los escenarios con el café-teatro, especialidad donde alcanzó peculiar relieve, y grabando varios discos a la vez.\n\nIntervino también en numerosos programas de televisión, especialmente con un personaje, El currante, que fue llevado al cine años después por él mismo.\n\nEn 1979 comenzó a trabajar en el cine junto a Fernando Esteso. Pajares y Esteso trabajaron juntos en once películas a las órdenes de Mariano Ozores como director y con las que consiguieron una gran repercusión y popularidad a nivel nacional. La pareja trabajó en el cine hasta 1983 en el que rodaron La Lola nos lleva al huerto, su última película en común. Cuatro años después volvían a coincid', '1940-04-06', '  Madrid, Spain', NULL, 2, 'nm0657004', '99811', '/s5jeH2AJgGF7nHNJaAxVun7uruX.jpg', 2),
(548, 'Damián Ramos', '', NULL, NULL, NULL, 0, 'nm1239603', '1423092', NULL, 1),
(549, 'Josema Yuste', 'José Mariano Yuste García de los Ríos, más conocido por el público como Josema Yuste, es un afamado presentador, humorista. Con 23 años, mientras estudiaba interpretación en la Escuela de Arte Dramático de la capital española, conoció a los que se convertirían en sus partenaires en Martes y Trece, Millán Salcedo y Fernando Conde.\n\nAsí, en 1979 este trío comenzó sus andaduras, que les llevarían a cosechar grandes éxitos. Al poco tiempo, Conde decidió continuar con su carrera en solitario, dejando a Millán y Yuste al frente del que se convertiría en uno de los dúos humorísticos con mayor tirada en España hasta su disolución en 1997.', '1953-03-02', 'Madrid, Madrid, España', NULL, 2, 'nm0951145', '278485', '/mgTYtonpZZ5D9BNTbovkqLEtib1.jpg', 1),
(550, 'Orlando Abad', '', NULL, NULL, NULL, 0, NULL, '2371158', NULL, 1),
