(566, 'Tomás Roncero', 'Tomás Gómez-Díaz Roncero (9 de mayo de 1965), más conocido como Tomás Roncero, es un periodista deportivo español.', '1965-05-09', 'Ciudad Real, Castilla La Mancha, Spain', NULL, 2, 'nm3906443', '1423080', '/x02f3TWRKHhXiprqIezxrN1Xww9.jpg', 1),
(567, 'Edda Díaz', 'Es una actriz, humorista, directora y libretista argentina. Con mordaz vis cómica, en la década de 1970 fue una de las pioneras del café-concert argentino.  Cursó estudios en la Alianza Francesa, el Conservatorio Amancio Williams y el Conservatorio Nacional de Arte Dramático del cual egresó en 1964.  Dos años después, junto a sus compañeros de conservatorio Antonio Gasalla, Carlos Perciavalle y Norah Blay protagoniza Help, Valentino con rotundo éxito. El espectáculo es la piedra fundamental del café-concert argentino con escenografía de Edgardo Giménez y Dalila Puzzovio.  En televisión fue uno de los personajes más típicos de Los Campanelli1​ entre 1969 y 1973, llevado al cine en dos oportunidades.', '1942-01-04', 'Aguilares, Buenos Aires, Argentina', NULL, 1, 'nm0246559', '1187257', '/A10GGNMj1zqXHa4B3frUcUAEfee.jpg', 2),
(568, 'Ricardo Darín', 'Ricardo Alberto Darín (Buenos Aires, Argentina, 16 de enero de 1957) es un actor y director argentino, cuya trayectoria comenzó en la industria televisiva a fines de los años 60 y, desde entonces, ha aparecido en películas donde interpreta roles dramáticos y cómicos. Es conocido por su interpretación del estafador Marcos en la cinta de 2000 Nueve reinas, y del retirado agente judicial Benjamín Espósito en el drama ganador del Premio Óscar El secreto de sus ojos (2009). Asimismo, ha aparecido en más de cuarenta filmes, entre los que se incluyen éxitos de crítica tales como El hijo de la novia, Luna de Avellaneda, El aura, Carancho, Un cuento chino, Elefante blanco, Tesis sobre un homicidio y Relatos salvajes.\n\nProtagonizó tres películas nominadas al máximo galardón de la industria del cine, el Premio Óscar. Entre sus reconocimientos se incluyen doce nominaciones al Premio Cóndor de Plata y cuatro al Premio Goya.2 En 2015 ganó la Concha de Plata al mejor actor por su actuación en la comedia dramática Truman.3\n\n', '1957-01-16', 'Buenos Aires, Argentina', NULL, 2, 'nm0201857', '69310', '/v5QjMW1Pc6ham06EejNzIkaJsb9.jpg', 5),
