(571, 'Torbe', 'Ignacio Allende Fernández, más conocido como Torbe (Portugalete, Vizcaya; 25 de mayo de 1969), es un director, productor y actor porno español. En el mundo del porno se lo conoce como «el rey del porno freak»,​ una mezcla de humor y sexo que dice haber inventado él mismo.\n\nAunque inicialmente fue dibujante y autor de cómics, es principalmente conocido por su trabajo en el cine porno. Durante siete años creó, dirigió y editó la revista de cómics La Comictiva. Su alias proviene de la acotación de Natxo Torbellino, el apodo que tenía en el grupo musical Miles de Albañiles, y el cual usa desde el año 1996. Al descubrir Internet tuvo que reducir el mismo a Torbe para entrar en chats, y desde entonces lo emplea siempre', '1969-05-25', 'Portugalete, Biscay, Spain', NULL, 2, 'nm0021199', '1423081', '/swvgm0tFxQNx4Cfu0Tq5gi3eNgm.jpg', 1),
