(579, 'Imanol Arias', 'Actor español de cine, teatro y televisión nacido en Riaño, León. De familia de origen vasco, con apenas unos meses regresó a la tierra familiar. Sin haber cumplido los veinte años marchó a Madrid para trabajar en teatro, participando en montajes bajo la dirección de José Tamayo, José Luis Gómez y Miguel Narros, entre otros, algunos para el Centro Dramático Nacional. Su debut cinematográfico tuvo lugar en la película La Corea (1976), de Pedro Olea. Su popularidad se consolidó, especialmente, por sus trabajos para televisión. Como director, también abordó Un instante en tu piel (1988), episodio de la serie Delirios de amor, y el largometraje Un asunto privado (1996), de desigual fortuna.', '1956-04-26', 'Riaño, León, Castilla y León, España', NULL, 2, 'nm0002181', '36281', '/adEr2tspBeXZ7ONxunI5crsTs96.jpg', 1),
