(605, 'Jorge D\'Alessandro', 'Roberto Jorge D\'Alessandro Di Ninno (28 de julio de 1949) es un exfutbolista y entrenador argentino. Como jugador, fue guardameta del CA San Lorenzo de Almagro y de la Unión Deportiva Salamanca, siendo portero titular durante 9 temporadas con los charros en la Primera División de España.\n\nTras varios años como jugador y luego como entrenador, actualmente es tertuliano en el programa El Chiringuito de Jugones de Mega y en el diario Público. El 31 de octubre de 2011 se hace oficial el retorno a los banquillos y ficha por el Club Gimnàstic de Tarragona para el resto de la temporada, al que termina descendiendo a 2ªB. Su último equipo fue la Sociedad Deportiva Huesca, al que también finalmente desciende.', '1949-07-28', 'Buenos Aires, Argentina.', NULL, 2, 'nm2314323', '1423087', '/9B8yd2TeI6ECslzgUn7zN2x3qMG.jpg', 1),
