(654, 'Eloi Yebra', 'Eloi Yebra (19 de octubre de 1980) es un actor, cómico, MC, selector de reggae, doblador y monologuista español. Ha participado en numerosas películas, series, programas de televisión y obras de teatro en España entre las que destacan Barrio y Torrente 2, misión en Marbella, entre otras muchas. También es uno de los nuevos componentes de Ska-P desde octubre de 2018 y miembro desde sus inicios de Positive Vibz y Kienes Sound.', '1980-10-19', 'Barcelona, Barcelona, Catalunya, Spain', NULL, 2, 'nm0947112', '108911', '/pSVMisRJhWeXiyvAA2aPS0WNxEu.jpg', 1),
