(666, 'Alexis Valdés', 'Alexis Valdés Gutiérrez (La Habana, 16 de agosto de 1963) es un actor, cineasta, humorista, guionista, monologuista, productor, poeta, compositor e intérprete cubano. Hijo del actor humorístico cubano Leonel Valdés (m. 2010) y una profesora, tras licenciarse en ingeniería y llevar diez años actuando en Cuba, se instala en España en la década de los 90 donde se hace conocido gracias a sus intervenciones en programas como El club de la comedia. En 2005, actúa, dirige y produce su primera película, Un rey en La Habana. Actualmente reside en Miami (Estados Unidos) donde produce y presenta Late Nights de gran éxito como \"Esta Noche Tu Night\" Y \" Seguro que Yes\" y también escribe y produce obras de teatro de gran éxito. En 2020 escribe el poema \'Esperanza\" de gran impacto en toda el habla hispana.', '1963-08-16', 'La Habana, Cuba', NULL, 2, 'nm0883796', '257713', '/tMacwMxeL7ff2XIvvmKaXyHk7w3.jpg', 1),
(667, 'José Luis López Vázquez', 'José Luis López Vázquez de la Torre (Madrid, 11 de marzo de 1922-Madrid, 2 de noviembre de 2009)​ fue un actor español. José Luis López Vázquez era hijo de una modista y de un funcionario público. Se formó como actor en el Teatro de las Organizaciones Juveniles y en el TEU, pero también era diseñador de vestuario y escenógrafo, faceta en la que destacó durante los años cincuenta y sesenta. En el cine interpretó en un principio papeles cómicos haciendo pareja con Gracita Morales, pero hacia los años sesenta empezó a actuar en películas dramáticas y llegó a aparecer en más de 200 largometrajes.', '1922-03-12', 'Madrid, Madrid, Spain', '2009-11-01', 2, 'nm0007023', '231170', '/jJrFKvxMUBPwOvUPQfF3h5LcW6r.jpg', 1),
