(703, 'Antonio Resines', 'Antonio Fernández Resines (7 de agosto de 1954), es un actor español de cine y televisión, principalmente, con diversas actuaciones en el teatro.\n\nFue presidente de la Academia de las Artes y las Ciencias Cinematográficas de España (2015-2016) y ganador de un premio Goya a la mejor interpretación masculina protagonista.', '1954-08-07', 'Torrelavega, Cantabria, Spain', NULL, 2, 'nm0720277', '37569', '/jm4yMnneOWa5diykiBV13qbMsS2.jpg', 2),
