(708, 'Manolo Codeso', 'Manuel Codeso Ruiz, (Cádiz, 15 de marzo de 1926-Madrid, 6 de junio de 2005) fue un actor español.\n\nActor asociado siempre al registro cómico, durante los años 40 y 50, y bajo los auspicios del empresario teatral Mariano Madrid, triunfó sobre los escenarios españoles en espectáculos de revista, formando parte del trío humorístico Zori, Santos y Codeso junto a Tomás Zori y Fernando Santos.\n\nEn 1962 Manuel Codeso inicia su carrera en solitario. Emprende entonces una carrera cinematográfica no demasiado extensa.', '1926-03-15', 'Cádiz, Cádiz, Andalucía, Spain', '2005-06-06', 2, 'nm0168482', '237478', '/fWbTh9wjE4lkUJkS2pfJ8lm5JFk.jpg', 1),
