(719, 'Rosa María Sardà', 'Rosa María Sardà Tàmaro (30 de julio 1941 - 11 junio 2020)​ fue una actriz, humorista, presentadora y directora teatral española. Nacida en Barcelona, Sardà pertenece a una familia de personas del espectáculo: estuvo casada con el también actor Josep Maria Mainat, miembro del trío cómico La Trinca, y es hermana mayor del periodista Javier Sardà.3​ Tiene tres hermanos más, uno de ellos, falleció por culpa del sida en los años 1980.4​ Tiene un hijo actor, Pol Mainat,5​ con el que coincidió en Abuela de verano.\n\nDe formación autodidacta, empezó a hacer teatro de aficionados en el barrio de Horta. En 1962 pasó al teatro profesional, al incorporarse a la compañía de Dora Santacreu y Carlos Lucena, con la obra Cena de matrimonios, de Alfonso Paso y, de esta misma compañía, pasó a la de Alejandro Ulloa y, posteriormente, también a la de Pau Garsaball, con la obra En Baldiri de la Costa.\n\nCon posterioridad, dio el salto en el campo televisivo (en 1975, protagoniza Una vella, coneguda olor, basada en la obra de Josep ', '1941-07-30', 'Barcelona, Spain', '2020-06-11', 1, 'nm0003030', '962', '/4oqgav0ocVz5LzUGwR3hmA6aZyD.jpg', 2),
