(725, 'Espartaco Santoni', 'Espartaco Garibaldi Borga Santoni (Carúpano, Venezuela, 14 de junio de 1937 - Marbella, 3 de septiembre de 1998) fue un actor, productor de cine y empresario hostelero venezolano, afincado en España.\n\nSantoni fue un habitual de las revistas de farándula en España, sobre todo a raíz de sus numerosos amoríos, que no dudó en airear en un polémico libro de memorias. A lo largo de su vida convivió con siete mujeres; una de ellas fue la hoy baronesa Thyssen-Bornemisza, Carmen Cervera (con la que contrajo matrimonio en 1975) y entre sus restantes amores se cuentan otras actrices y famosas como Analía Gadé, Bárbara Rey, la princesa Carolina de Mónaco, Ursula Andress, Massiel y Marisa Mell. Según su hija, Paola Santoni, sus tres grandes amores fueron Tere Velázquez, Marujita Díaz y Carmen Cervera.', '1937-06-14', 'Carúpano, Venezuela', '1998-09-03', 2, 'nm0763852', '33827', '/76M72gHpW7OEkMcb0E6hhde36Ja.jpg', 2),
(726, 'Jake Nong', '', NULL, NULL, NULL, 0, NULL, '2373109', NULL, 1),
(727, 'Luis Cuenca', 'Luis Cuenca García (Navalmoral de la Mata, Cáceres, 6 de diciembre de 1921 - Madrid, 21 de enero de 2004) fue un actor español.\n\nNacido en el seno de una familia de actores, siendo hijo de Jesús Cuenca Arroyo (artista de teatro, natural de Sacedón, Guadalajara) y de Carmen García Carrasco (artista de teatro, natural de Burgos). Sus abuelos maternos José García Rojo y Victoria Carrasco, naturales de Córdoba: Archidona y El Terrible) eran los propietarios de la compañía de teatro (“Los Carrasco”) en la que trabajaban sus padres. Desde muy pequeño se inició en la interpretación y subió por primera vez a un escenario con tan sólo siete años.\n\nFinalizada la Guerra Civil Española, comienza a trabajar en espectáculos de Revista y se incorpora a la Compañía de Celia Gámez, actuando con el nombre artístico de Tony Aster.\n\nDurante los siguientes cuarenta años, se consagra como uno de los más destacados actores cómicos del género en España.', '1921-12-06', 'Navalmoral de la Mata, Cáceres, Extremadura. Spain', '2004-01-21', 2, 'nm0191093', '980145', '/o3LBBJGqzz3qTzpUpSktzJfcxAH.jpg', 4),
