(739, 'Javier Bardem', 'Javier Ángel Encinas Bardem (Las Palmas de Gran Canaria, 1 de marzo de 1969), más conocido como Javier Bardem, es un actor español, hijo de la actriz española Pilar Bardem y proveniente de una familia de grandes actores españoles. En 2007, ganó el Premio Óscar al Mejor Actor de reparto por su papel como el psicópata asesino Anton Chigurh en No Country for Old Men (2007). También ha cosechado elogios de la crítica por papeles en películas tales como Jamón, jamón, Carne trémula, Boca a boca, Los lunes al sol y Mar adentro. Interpretó al antagonista principal Raoul Silva en la película de James Bond de 2012 Skyfall, por la que recibió una nominación tanto al BAFTA como al SAG por Mejor Actor de reparto.\n\nBardem además ha ganado seis Goyas, un Globo de Oro, un BAFTA, el premio del Festival de Cannes al mejor actor y un premio del Sindicato de Actores. Es el primer español en ser nominado a un Óscar (Mejor Actor, 2000, por Antes que anochezca), así como el primer actor español en ganar un Óscar. Recibió su tercera', '1969-03-01', 'Las Palmas de Gran Canaria, Gran Canaria, Canary Islands, Spain', NULL, 2, 'nm0000849', '3810', '/IShnFg6ijWhpbu29dFBd9PtqQg.jpg', 28),
(740, 'Javier Cansado', 'Ángel Javier Pozuelo Gómez (18 de septiembre de 1955​), artísticamente conocido como Javier Cansado, es humorista y locutor de radio español, miembro del dúo humorístico Faemino y Cansado.', '1955-09-18', '  Madrid, Spain', NULL, 2, 'nm0134425', '1331711', '/wB0BVZBGLateJumMr2D8Kse5Mo4.jpg', 1),
