(746, 'Jorge Sanz', 'Jorge Sanz Miranda (Madrid, 26 de agosto de 1969) es un actor español,  hijo de militar (coronel de caballería) y empresaria y tiene cuatro hermanos.\n\nDebutó a los nueve años en la película La miel (1979), de Pedro Masó. En 1982, tras aparecer en Conan el Bárbaro, protagonizó Crónica del alba. Valentina a las órdenes de Antonio Betancor. Todavía en la adolescencia, participó en películas como Mambrú se fue a la guerra, de Fernando Fernán Gómez y El año de las luces, de Fernando Trueba, donde coincidió por primera vez con Maribel Verdú, una de sus parejas artísticas más frecuentes.  En 2010 protagonizó ¿Qué fue de Jorge Sanz?, miniserie de comedia con seis capítulos producida por Canal+, creada por David Trueba y el propio Sanz, con guion y dirección del primero. En ella el actor se interpreta a sí mismo en un mal momento profesional, económico y personal, basándose parcialmente en hechos reales.', '1969-08-26', 'Madrid, Spain', NULL, 2, 'nm0764450', '145414', '/8MmH5A2zDHCdFyA691nn6xJY49I.jpg', 2),
(747, 'Fernando Trueba', 'Fernando Rodríguez Trueba, conocido como Fernando Trueba (18 de enero de 1955), es un director de cine, guionista y productor español.', '1955-01-18', '  Madrid, Spain', NULL, 2, 'nm0874096', '37526', '/ie3WiHvVWsfvUYVSSlCpnqi1dFw.jpg', 1),
(748, 'Yon González', 'Yon González Luna (20 de mayo de 1986) es un actor español, hermano del también actor Aitor Luna. Después de su paso por SMS (La Sexta) en el personaje de Andrés, Yon González saltó a la fama por su aparición en El internado como Iván Noiret. Sus últimos proyectos más destacados han sido papeles en las series de televisión Gran hotel, Bajo sospecha y Las chicas del cable.', '1986-05-20', 'Bergara, Gipuzkoa, Spain', NULL, 2, 'nm2304398', '228874', '/p8PNt1BoZobAF3vhbqE5ulXedMw.jpg', 12),
(749, 'Ana Obregón', '', '1955-03-18', 'Madrid, Spain', NULL, 1, 'nm0643505', '46422', '/vijdstsjRwlMMr9WVX0eG1o0PaO.jpg', 2),
(750, 'Maria Lapiedra', 'Maria Pascual y García (19 de julio de 1984) es una escritora, actriz porno y modelo, conocida por su nombre artístico de María Lapiedra.  Licenciada en filología catalana con matrícula de honor, alcanzó la fama gracias a sus apariciones en los programas del corazón DEC (Antena 3) y, más tarde en Sálvame (Telecinco). Desde 2009 se ha dedicado al emprendimiento de proyectos relacionados con el erotismo: libros, películas, páginas web de shows eróticos, y un videoblog en YouTube.', '1984-07-19', 'Lerida, Catalonia, Spain', NULL, 1, 'nm3272056', '228875', '/fsr55rCD8Mm9910SxufeFIazuhV.jpg', 4),
(751, 'David Bisbal', 'David Bisbal Ferre (Almería, 5 de junio de 1979) es un cantante español, que alcanzó la popularidad en el año 2001 tras su participación en la primera edición de Operación Triunfo, donde quedó en segundo lugar.', '1979-06-05', 'Almería, Andalucía, Spain', NULL, 2, 'nm1121953', '41821', '/uXIXWpRGt8AE6GX3IN68dHj6Sh8.jpg', 3),
