(757, 'Carmen de Mairena', 'Carmen Brau Gou​ (1933-2020) más conocida como Carmen de Mairena, es una popular transexual​ española. Desde mediados de los años cincuenta hasta la llegada de la Transición, era conocido como Miguel de Mairena, un cantante de cuplé de cierto renombre en las salas de espectáculos más destacadas de Barcelona', '1933-03-15', 'Barcelona, Spain', '2020-03-22', 1, 'nm1596825', '1093951', '/zY87KRX0HfsR48TRAcVqxDHIbPK.jpg', 2),
(758, 'El Dioni', 'Dionisio Rodríguez Martín (Madrid, 31 de octubre de 1949), más conocido como El Dioni, es un famoso personaje público, actor porno y exvigilante de seguridad español que robó un furgón blindado de la empresa Candi S. A., en la que trabajaba junto a Pedro. El furgón contenía 298 millones de pesetas (1 791 016,07 euros).\n\nPadeció estrabismo hasta que se sometió a una operación y en 2004 se le intervino por un cáncer en las cuerdas vocales. Tuvo ofertas para actuar en televisiones autonómicas, pero no pudo acudir por orden judicial, debido a su libertad condicional tras cumplir seis meses de cárcel por tráfico de drogas.\n\nEn este mismo año, el Dioni volvió a la actualidad televisiva gracias a su participación en el reality show Acorralados, de Telecinco, donde fue detenido por la guardia civil aunque posteriormente volvió al concurso temporalmente, hasta que abandona por problemas de salud. También hizo una aparición en Torrente 4 y recientemente ha empezado a trabajar en el mundo del porno con Torbe', '1949-10-31', '  Madrid, Spain', NULL, 2, NULL, '1817661', NULL, 1),
