(760, 'Enrique Cerezo', 'Enrique Cerezo Torres (27 de febrero de 1948) es el actual presidente del Atlético de Madrid desde el 28 de mayo de 2003 tras la dimisión de Jesús Gil, club del que es accionista. Además es director cinematográfico y propietario de Enrique Cerezo Producciones Cinematográficas, del canal autonómico Madrid y de la cadena de cines madrileños Conde Duque y la empresa de vídeo bajo demanda a través de internet FlixOlé.​ Posee más de un 70% de títulos del cine español, lo que lo sitúa como el líder del sector cinematográfico en el país.', '1948-02-27', 'Madrid, Spain', NULL, 2, 'nm0148554', '931206', '/1sZqfoDZPRlcQVTj96ledN1hovm.jpg', 1),
