(763, 'María Patiño', 'María Patiño Castro (15 de agosto de 1971) es una periodista, colaboradora y presentadora de televisión española de la crónica social y prensa rosa, asociada al grupo de comunicación Mediaset España desde 2012, y anteriormente a Atresmedia (2002-2011).', '1971-08-15', 'Ferrol, A Coruña, Galicia, Spain', NULL, 1, 'nm1489895', '2371196', '/tYYRirHMv4DGTG3oMGLTEolGJkD.jpg', 1),
(764, 'Sergio Agüero', 'Sergio Leonel Agüero del Castillo (2 de junio de 1988), conocido como El Kun Agüero, es un futbolista argentino y director de KRÜ Esports, organización de e-sports. Juega como delantero y su equipo actual es el Manchester City de la Premier League de Inglaterra. Es internacional con la selección argentina. También posee nacionalidad española.\n\nGanó con el Atlético de Madrid la UEFA Europa League y la Supercopa de Europa en 2010, mientras que con la camiseta del Manchester City ha conseguido cuatro Premier League, en 2012, 2014, 2018 y 2019, además de ser el extranjero más goleador en esta competición. También ganó un FA Cup en 2019, tres Community Shield en 2013, 2018, y 2019, cuatro Copas de la Liga en 2012, 2016, 2018 y 2019.\n\nEn su carrera con los equipos representativos de Argentina ha logrado consagrarse campeón de la Copa Mundial de Fútbol Sub-20 en las ediciones de 2005 y 2007, obteniendo en esta última el Balón y la Bota de Oro, y la medalla de oro en los Juegos Olímpicos de Pekín 2008. También disput', '1988-06-02', 'Quilmes, Buenos Aires, Argentina', NULL, 2, 'nm4097420', '2371197', '/cvoeNeGkdzBmJEAX3IaH0NYUgJ6.jpg', 1),
