(782, 'Gerard Butler', 'Butler nació en Paisley, Renfrewshire, Escocia,​ siendo el más joven de tres hermanos e hijo de Margaret y Edward Butler, un corredor de apuestas.​ Butler es de una familia católica de origen irlandés.​ Su familia y él, se trasladaron a Montreal, Canadá, cuando tenía seis meses de edad,​ pero su madre volvió a Escocia con él, cuando su matrimonio se rompió, cuando Gerard tenía 18 meses de edad.​ Butler no vio a su padre desde que tenía 18 meses, hasta los 16 años de edad, cuando Edward Butler fue en su búsqueda.\" Tras ello, ya no se separaron, hasta que Butler tuvo 22 años de edad y su padre fue diagnosticado de cáncer y murió.​ Butler estudió en la escuela St Mirin\'s & St Margaret\'s High School en Paisley, asistió al Teatro Juvenil de Escocia, mientras fue un adolescente, y logró buenas notas para estudiar derecho en la Universidad de Glasgow.​ Cantó en una banda de rock llamada Speed.​\n\nEn la Universidad de Glasgow, durante su etapa de estudiante, se convirtió en el presidente de la sociedad de derecho de l', '1969-11-13', 'Paisley, Scotland, UK', NULL, 2, 'nm0124930', '17276', '/eJn92Loeq9GzKJVkCaVEQejIq2Z.jpg', 22),
