(904, 'Paul Walker', 'Paul William Walker IV (12 de septiembre de 1973-30 de noviembre de 2013) fue un actor, modelo, piloto de carreras y biólogo marino estadounidense,​ conocido por su papel de Brian O\'Conner en la película de acción The Fast and the Furious, repitiendo el papel en cinco de las seis siguientes películas de la franquicia. También actuó en otras películas como Bajo cero (2006), Timeline (2003), Inmersión letal (2005), Nunca juegues con extraños (2001) y La prueba del crimen (2006).\n\nTras licenciarse en biología marina en la Universidad de California, estudios que combinaba con su carrera como modelo profesional, Walker comenzó su carrera como actor invitado en varios programas de televisión como The Young and the Restless y Touched by an Angel. También obtuvo fama a través de películas para adolescentes tales como Alguien como tú y Juego de campeones. Fuera de la actuación, fue el rostro de la marca de perfumes The Coty Prestige, la fragancia Davidoff Cool Water para hombres, y protagonizó la serie de National Geo', '1973-09-12', 'Glendale, California, USA', '2013-11-30', 2, 'nm0908094', '8167', '/gOnKt6xCdVSiK0aYmmmnEx7s5rX.jpg', 13),
(905, 'Michelle Rodriguez', 'Mayte Michelle Rodriguez (12 de julio de 1978) es una actriz y modelo estadounidense. A raíz de su primer papel protagonista en la película independiente Girlfight (2000), es conocida por sus papeles de la típica chica dura y rebelde en éxitos hollywoodenses como The Fast and the Furious, Resident Evil, S.W.A.T., Avatar, Machete, Battle: Los Angeles, Resident Evil: Retribution, Fast and Furious 6 y Machete Kills, así como por su papel de Ana Lucía Cortez en la serie de televisión Lost.\n\nTambién ha realizado numerosos trabajos de voz en videojuegos como Call of Duty y Halo y prestó su voz para la película animada en 3D Turbo y en la televisión para IGPX.\n\nSus películas han recaudado más de $5 mil millones, y Entertainment Weekly la calificó como \"la actriz latina más exitosa de Hollywood\".', '1978-07-12', 'Bexar County, Texas, USA', NULL, 1, 'nm0735442', '17647', '/xSvkVrLz6xas1mCeOR9i4QtmhnQ.jpg', 19),
