(933, 'Dwayne Johnson', 'Dwayne Douglas Johnson (2 de mayo de 1972) es un actor y luchador profesional estadounidense, conocido popularmente como The Rock (La Roca​ en español). Se desempeñó como luchador profesional para la WWE hasta su retirada oficial en 2019, con el objetivo de centrarse en su carrera artística.\n\nHa participado en una gran diversidad de películas siendo premiado en muchas de ellas, siendo su papel como Luke Hobbs en The Fast and the Furious uno de los más reconocidos.\n\nEntre sus logros como luchador se destacan diez Campeonatos Mundiales: ocho como Campeón de la WWE y dos como Campeón de la WCW. También fue dos veces Campeón Intercontinental de la WWE y cinco veces Campeón Mundial en Parejas. También fue el ganador del Royal Rumble 2000 todo esto lo vuelve Campeón de las Tres Coronas.\n\nEs famoso por acabar todos sus discursos en el cuadrilátero y al presentarse en escena con la frase: \"If you smell... What The Rock is Cooking?\" que se puede traducir como: ¿Pueden oler... Lo que está cocinando la Roca? Esta frase ', '1972-05-02', 'Hayward, California, USA', NULL, 2, 'nm0425005', '18918', '/kuqFzlYMc2IrsOyPznMd1FroeGq.jpg', 43),
(934, 'Jason Statham', 'Jason Statham (Derbyshire, 26 de Julio de 1967)​ es un actor de cine y modelo inglés.\n\nEs mundialmente famoso por sus papeles en películas de acción y aventura como Lock and Stock (1998), Snatch: cerdos y diamantes (2000), Revólver (2005), La carrera de la muerte (2008) y Blitz (2011), así como por interpretar a Chev Chelios en la película Crank (2006) y su secuela Crank: High Voltage (2009), a Arthur Bishop en las películas The Mechanic (2011) y su secuela Mechanic: Resurrection (2016), por protagonizar la trilogía de Transporter como Frank Martin, a Lee Christmas en la serie películas de The Expendables y a Deckard Shaw en la serie de películas de Fast & Furious. Con su aspecto de tipo duro, Jason Statham ha sabido hacerse un hueco en el cine, siendo su especialidad el género de acción, afianzando que los papeles de riesgo son lo suyo. Por lo general realiza sus propias escenas de acción sin dobles​ y destaca por ser encasillado como un antihéroe en sus personajes.', '1967-07-26', 'Shirebrook, Derbyshire, England, UK', NULL, 2, 'nm0005458', '976', '/lldeQ91GwIVff43JBrpdbAAeYWj.jpg', 87),
(935, 'Vanessa Kirby', 'Vanessa Nuala Kirby (18 de abril de 1988) es una actriz británica de cine, teatro y televisión.\n\nEs más conocida por haber interpretado a Estella en la miniserie Great Expectations,​ y a Margarita del Reino Unido en la producción de Netflix The Crown,​ serie que le permitió ganar el premio BAFTA en la categoría de Mejor actriz de reparto.', '1988-04-18', 'Wimbledon, London, England, UK', NULL, 1, 'nm3948952', '556356', '/a8a9U00KL2JJkkekzhNnueIGKKF.jpg', 26),
(936, 'Helen Mirren', 'Helen Mirren DBE (26 de julio de 1945)​ es una actriz británica.\n\nEs una de las pocas actrices que han ganado los cuatro premios principales dentro del cine por una sola película (The Queen): el Óscar, el BAFTA, el Globo de Oro y el Premio del Sindicato de Actores.\n\nEn dos oportunidades ha sido galardonada con el premio por interpretación femenina en el Festival Internacional de Cine de Cannes: en 1984 por la película Cal y en 1995 por La locura del rey Jorge.', '1945-07-26', 'Hammersmith, London, England, UK', NULL, 1, 'nm0000545', '15735', '/eY26gqv9EGunId7kp32pLueXvz4.jpg', 25),
