(965, 'Ryan Reynolds', 'Ryan Rodney Reynolds (23 de octubre de 1976) es un actor canadiense.\n\nEl éxito y el reconocimiento le llegaron con su participación en la comedia titulada Two Guys and a Girl (1998-2001), antes de que iniciara su carrera de comediante y actor dramático para la industria de cine de Hollywood. Es reconocido por sus intervenciones en producciones como Blade: Trinity (2004), The Amityville Horror (2005), Definitely, Maybe (2008), X-Men Origins: Wolverine (2009), The Proposal (2009), Buried (2010), Linterna Verde (2011) y en la adaptación cinematográfica del cómic Deadpool (2016) y su secuela, Deadpool 2.  En 2010 la revista estadounidense People lo eligió como el hombre más sexy del año.', '1976-10-23', 'Vancouver, British Columbia, Canada', NULL, 2, 'nm0005351', '10859', '/4SYTH5FdB0dAORV98Nwg3llgVnY.jpg', 55),
