(1048, 'François Berléand', 'François Berléand es un actor de cine, televisión y teatro francés, de padre moldavo y de madre francesa.\n\nExplica su niñez en un libro aparecido en noviembre de 2006, El Hijo del hombre invisible; relata el trauma que le condujo a partir de once años las puertas de la locura, trauma extrañamente causado por una única afirmación de su padre: «De todos modos, tú, eres el hijo del hombre invisible», alusión al célebre folletín de la época. En el transcurso de estudios de comercio, sigue una formación teatral, algo pese a él, y debuta en una obra titulada \"Sobre una playa del Oeste\". Con sus estudios acabados, se inscribe en un curso de arte dramático de Tania Balachova, y coincide con Daniel Benoin, un escenógrafo con el que trabajará desde 1974 a 1981, participando en una quincena de espectáculos, tanto clásicos como contemporáneos. Después de haber frecuentado el equipo de Le Splendid, empieza su carrera cinematográfica en 1978. Encadena entonces papeles secundarios en los años 1980. Tras una serie de segundo', '1952-04-22', 'Paris, France', NULL, 2, 'nm0075710', '7693', '/5TDYSUfCj8vaG5sqJXUU06Cvafa.jpg', 7),
