(1085, 'Sylvester Stallone', 'Michael Sylvester Gardenzio Stallone (6 de julio de 1946) es un actor, guionista, productor y director de cine estadounidense, estrella del cine de acción de Hollywood.\n\nHa dado vida a tres personajes icónicos de la historia del cine: a Rocky Balboa, un boxeador de Filadelfia que venció contra todo pronóstico y se convirtió en campeón; a John Rambo, ex boina verde veterano de la guerra de Vietnam, especializado en guerrilla, supervivencia y combate, y a Barney Ross, también un veterano de la Guerra del Vietnam y líder de un grupo de mercenarios veteranos y novatos, contratados para operaciones de espionaje y militares. La cinta Rocky (1976) le valió dos nominaciones al premio Óscar, en la categoría de Mejor Actor y Mejor Guion. En 2016 ganó el Globo de Oro a Mejor actor de reparto por el papel de Rocky Balboa en el spin-off de la saga, Creed (2015), además de ser nominado al Óscar en la misma categoría.\n\nAparte de las sagas de Rocky, Rambo y The Expendables (2010-2014), entre sus cintas más populares se encue', '1946-07-06', 'New York City, New York, USA', NULL, 2, 'nm0000230', '16483', '/qDRGPAcQoW8Wuig9bvoLpHwf1gU.jpg', 30),
(1086, 'Jet Li', 'Li Lian Jie (Pekín, 26 de abril de 1963), más conocido por su nombre artístico Jet Li, es un artista marcial, actor y productor chino, nacionalizado singapurense en 2009.\n\nDespués de retirarse a la edad de 17 años del wushu, disciplina en la que ganó 15 medallas de oro y se retiró invicto, debutó como actor en la película El templo de Shaolin (1982). Estrella del cine internacional, protagonizó muchas películas de artes marciales aclamadas por la crítica, destacando la serie Érase una vez en China, en la que interpretó al héroe Wong Fei Hung.\n\nSu primer papel en una película de Hollywood fue como villano en Lethal Weapon 4 (1998), pero su primer papel como protagonista en Estados Unidos y que le dio fama mundial fue en Romeo debe morir (2000).', '1963-04-26', 'Beijing, China', NULL, 2, 'nm0001472', '1336', '/5a6u17dAf11kLvdRUG6QdoRRURj.jpg', 31),
(1087, 'Dolph Lundgren', 'Hans Lundgren (3 de noviembre de 1957) conocido como Dolph Lundgren, es un actor sueco, cuya actividad polifacética incluye trabajos en el cine como director, guionista y productor. Además posee el cinturón negro (6 Dan) en karate estilo Kyokushinkai, el cinturón negro (2 Dan) en judo, fue boxeador amateur. Tiene un máster de ingeniero químico.1​2​ ,formación académica en el MIT en esa misma área de la ciencia y es poliglota, dominando 6 idiomas. Es famoso por sus películas de acción y artes marciales de Hollywood, y su primer éxito vino cuando interpretó al boxeador soviético Ivan Drago en Rocky IV, en 1985.', '1957-11-03', 'Stockholm, Sweden', NULL, 2, 'nm0000185', '16644', '/t3hMzibYVUS1KBXFgtxuNnax8qX.jpg', 23),
(1088, 'Chuck Norris', 'Carlos Ray Norris (10 de marzo de 1940),​ conocido como Chuck Norris, es un actor estadounidense, campeón mundial de Tang soo do, exmilitar y fundador de una asociación de karate. Experto en Artes marciales, posee Cinturón negro en artes tales como; Taekwondo, Hapkido, Karate, Judo, Full Contact Y Jiu Jitsu Brasileño.', '1940-03-10', 'Ryan, Oklahoma, USA', NULL, 2, 'nm0001569', '51576', '/m3uLikdhi9qObRvGVHsKX5H93lR.jpg', 10),
(1089, 'Jean-Claude Van Damme', '', '1960-10-18', 'Berchem-Sainte-Agathe, Brussels, Belgium', NULL, 2, 'nm0000241', '15111', '/qAHXPJ4IybMsCbNY3811CytFj3H.jpg', 31),
(1090, 'Bruce Willis', 'Actor y productor germano-estadounidense, cuya trayectoria comenzó en la industria televisiva durante los años 80 y, desde entonces, ha aparecido en películas donde interpreta roles cómicos, dramáticos y de acción. Es conocido por su interpretación del oficial John McClane en la serie Die Hard, en la que obtuvo buenas críticas y una recaudación considerable a partir del estreno de la primera cinta en 1988.​ Asimismo, ha aparecido en más de 60 filmes, entre los que se incluyen éxitos de taquilla como Pulp Fiction, Sin City, Doce monos, El quinto elemento, Armageddon, El sexto sentido y Los Mercenarios.\n\nLas películas en las que ha aparecido Willis han logrado sumar de 2,64 a 3,05 mil millones de dólares en las taquillas estadounidenses, por lo que se le considera como uno de los actores más rentables en un rol estelar o secundario.4​ Por sus interpretaciones, ha sido acreedor de varios premios, entre ellos dos premios Emmy, un Globo de Oro y cuatro Saturn.6\n\nEn cuanto a su vida privada, se casó con la actriz D', '1955-03-19', 'Idar-Oberstein, Germany', NULL, 2, 'nm0000246', '62', '/caX3KtMU42EP3VLRFFBwqIIrch5.jpg', 31),
(1091, 'Arnold Schwarzenegger', 'Arnold Alois Schwarzenegger (30 de julio de 1947) es un actor, empresario, político y exfisicoculturista profesional de origen austríaco y nacionalizado estadounidense. Ejerció como trigésimo octavo gobernador del Estado de California en dos mandatos desde 2003 hasta 2011.\n\nSchwarzenegger comenzó a entrenar con pesas cuando tenía quince años, ganó el título de Mr. Universo con veinte y luego encadenó siete victorias en la competición de Mister Olympia entre 1970 y 1980. Sigue siendo un icono de este deporte y ha escrito varios libros y artículos sobre su práctica. El evento Arnold Sports Festival, que lleva su nombre, es considerado una de las mejores competiciones de fisioculturismo de la actualidad. Es ampliamente reconocido como uno de los fisioculturistas más importantes de todos los tiempos y su embajador más carismático.\n\nSchwarzenegger ganó fama mundial a partir de la década de 1980 como icono del cine de acción de Hollywood. Su irrupción se produjo como protagonista de la película épica de espada y br', '1947-07-30', 'Thal, Styria, Austria', NULL, 2, 'nm0000216', '1100', '/z6IbTtI2FWAVZE6b1V4mqEHjwO6.jpg', 26),
(1092, 'Terry Crews', 'Terrence Alan Crews (30 de julio de 1968), más conocido como Terry Crews, es un actor, comediante, actor de doblaje y exjugador de fútbol americano estadounidense, conocido por su participación en películas de acción y comedia como: White Chicks, Norbit, Dueños de la calle, Los indestructibles y Deadpool 2. Desde 2013 forma parte del reparto principal de Brooklyn Nine-Nine interpretando el papel del Teniente Terry Jeffords.', '1968-07-30', 'Flint, Michigan, USA ', NULL, 2, 'nm0187719', '53256', '/pxTY4SglLo5hFcMH00MxPeC5u55.jpg', 19),
