(1094, 'Liam Hemsworth', 'Liam Hemsworth (13 de enero de 1990) es un actor australiano. Saltó a la fama en 2010, tras interpretar el papel de Will Blakelee en la película La última canción, basada en el libro de Nicholas Sparks del mismo nombre, y se estabilizó en el mundo del cine con la saga Los juegos del hambre (2012-2015).\n\nEs hermano menor de los también actores Luke Hemsworth (n. 1980) y Chris Hemsworth (n. 1983) e hijo de Craig Hemsworth (n.1966)', '1990-01-13', 'Melbourne, Victoria, Australia', NULL, 2, 'nm2955013', '96066', '/7UIm9RoBnlqS1uLlbElAY8urdWD.jpg', 10),
