(1127, 'Eric Roberts', 'Eric Anthony Roberts (Biloxi, Misisipi, 18 de abril de 1956) es un actor estadounidense de cine, televisión y teatro.\n\nCreció en Atlanta (Georgia), donde asistió a la Henry W. Grady High School. Es el hermano mayor de las actrices Julia Roberts y Lisa Roberts Gillan, así como padre de la actriz Emma Roberts.\n\nRoberts estuvo nominado al Oscar al mejor actor de reparto en 1985 por su papel como un convicto fugitivo en el filme Runaway Train. En 1987, ganó el Theatre World Award por su actuación debut en Broadway en la obra Burn This.\n\nOtras de sus actuaciones incluyen King of the Gypsies, Star 80, Raggedy Man, The Pope of Greenwich Village, The Coca-Cola Kid, Rude Awakening, Best of the Best, By the Sword, The Specialist, The Immortals, La Cucaracha, Purgatory y Con Games.\n\nEn 1996, personificó a El Amo en la película Doctor Who: La película. Roberts también apareció en la película de 2000 Race Against Time como un padre que vende sus órganos para pagar el tratamiento médico de su hijo y en el filme de 2002 Spu', '1956-04-18', 'Biloxi, Mississippi, USA', NULL, 2, 'nm0000616', '21315', '/o0EyI0Otwyg0jwxLpbmV20I57oi.jpg', 17),
