(1130, 'Giselle Itié', 'Giselle Itié Ramos (Ciudad de México, 3 de octubre de 1982) es una actriz mexicana, nacionalizada brasileña.  Nacida en la Ciudad de México. Es hija de un mexicano, Fernando Itié, y de una brasileña, Sandra Ramos. Debido al Terremoto de 1985 en Ciudad de México, se trasladó con su familia a Brasil, tierra de su madre.\n\nEn febrero de 2014, Itié se casó con el actor Emílio Dantas. El matrimonio se separó en julio del año siguiente.\n\nEn noviembre de 2015, asume su relación con su pareja televisiva en Os Dez Mandamentos, el actor Guilherme Winter. Con el cual tiene una relación estable, y el 2 de marzo de 2020 su amor dio frutos dando la bienvenida al mundo a su primogénito.', '1981-10-03', 'Mexico City, Distrito Federal, Mexico', NULL, 1, 'nm0411658', '99414', '/1YTR2u0ZyXTlvdJbSYKbWyqW1i3.jpg', 8),
