(1132, 'Mickey Rourke', 'Mickey Rourke es un actor, guionista y ex boxeador estadounidense, que ha aparecido principalmente como protagonista en películas de acción, drama y suspenso.\n\nDurante los años 1980, protagonizó la comedia dramática Diner (1982), el drama La ley de la calle (1983), la comedia negra criminal The Pope of Greenwich Village (1984) y el drama erótico Nueve semanas y media (1986), y recibió elogios a nivel crítico por su trabajo en la biopic de Charles Bukowski Barfly y en la cinta de terror y misterio El corazón del ángel, ambas estrenadas en 1987. En 1991 Rourke, que antes había practicado boxeo, abandonó la actuación para dedicarse a boxear de manera profesional.\n\nDespués de retirarse del boxeo en 1994, volvió a actuar y tuvo papeles secundarios en varios filmes, entre ellos el drama The Rainmaker (1997), la comedia dramática Buffalo \'66 (1998), el thriller Get Carter (2000), la película de misterio The Pledge (2001), la comedia negra criminal Spun (2002) y el thriller de acción Man on Fire (2004), interpretando', '1952-09-16', 'Schenectady, New York, USA', NULL, 2, 'nm0000620', '2295', '/i6vXukUwRsJa7S9yhZgoKt9xLDv.jpg', 22),
