(1171, '50 Cent', 'Reconocido como uno de los más prolíficos artistas musicales de su tiempo, Curtis \'50 Cent\' Jackson ha conseguido utilizar su poder como estrella dentro de la industria musical para abarcar un amplio espectro del negocio, incluyendo propiedad musical, representación de artistas, producción de películas, ropa y calzado, videojuegos, campañas de bebidas y suplementos deportivos. Con unas ventas anuales que se acercan velozmente a los 300 millones de dólares provenientes de sus variados intereses y con numerosos negocios más vislumbrándose en el horizonte, \'50 Cent\' ha afianzado su posición en la industria como una poderosa fuerza tanto en el sector económico como en el del entretenimiento.\n\n\'50 Cent\' saltó a la escena musical en el año 2003 y desde entonces ha estado rescribiendo la historia del hip-hop. Get Rich or Die Tryin\', su primer álbum hizo historia cuando vendió 872.000 copias, rompiendo el récord de la primera semana de venta de los mayores sellos musicales en la era del SoundScan. Fue número uno en l', '1975-07-06', 'New York City, New York, USA', NULL, 2, 'nm1265067', '62644', '/uyEfYdXj8lJusUyH7I7ChvhDXPH.jpg', 6),
