(1183, 'Harrison Ford', 'Harrison Ford es un actor estadounidense de cine y televisión.\n\nDebe su notoriedad a su colaboración con el guionista, productor y director George Lucas, que fue el primero en darle la posibilidad de consagrarse como actor. Sus papeles de Han Solo en la trilogía original de Star Wars y de Indiana Jones lo elevaron al nivel de estrella internacional. Aunque un fracaso inicial en taquilla, la película de Ridley Scott Blade Runner, donde desempeña el papel del cazador de replicantes Rick Deckard, terminó convirtiéndose en una película de culto de la ciencia ficción. Con más de cinco mil seiscientos millones de dólares recaudados en todo el mundo por sus películas, Ford es el actor con mayores ingresos en taquilla de la historia. En 1998 fue elegido, con cincuenta y seis años, el hombre vivo más sexy del mundo por la revista estadounidense People, y en 1995 por la británica Empire como uno de los cien actores más sexy de la historia (en el puesto 15).\n\nMundialmente famoso por sus papeles en películas de acción y ', '1942-07-13', 'Chicago, Illinois, USA', NULL, 2, 'nm0000148', '3', '/fPKTfCiWbjkBnM3Gbj0FV9BjdoO.jpg', 23),
(1184, 'Mel Gibson', 'Mel Columcille Gerard Gibson AO (3 de enero de 1956) es un actor, director y productor de cine australiano-estadounidense nacionalizado irlandés.\n\nAbanderado de la mejor generación del cine australiano y tras lograr la fama en Hollywood con las series de películas Mad Max y Lethal Weapon, Gibson se embarcó en dirigir y actuar en la película Braveheart (Corazón Valiente), ganadora de cinco Premios de la Academia incluyendo mejor película y mejor dirección. La dirección de Gibson en esta película le convirtió en el sexto actor-director ganador del Óscar como mejor director.​ En 2004, dirigió y produjo La Pasión de Cristo, película que logró recaudar más de 600 millones de dólares, y que relataba las últimas horas de la vida de Jesucristo. En 2017 obtuvo una nominación al Oscar por Mejor Director por la película Hasta el último hombre.', '1956-01-03', 'Peekskill, New York, USA', NULL, 2, 'nm0000154', '2461', '/jnqHMaOslt8cef2atSmOpGRvNla.jpg', 26),
(1185, 'Wesley Snipes', 'Wesley Trent Snipes (31 de julio de 1962) es un actor, productor y practicante de hapkido, (2º dan) estadounidense, que creció en el barrio del Bronx, en Nueva York.', '1962-07-31', 'Orlando, Florida, USA', NULL, 2, 'nm0000648', '10814', '/81D6oJ81kiQ5xnEHhaHrY29ntdO.jpg', 12),
