(1188, 'Antonio Banderas', 'Actor y director español que ha alcanzado gran fama dentro del panorama cinematográfico internacional. Nació en Málaga e inició su carrera como actor en el seno una compañía de teatro independiente. Tras fijar su residencia en Madrid, comenzó a trabajar en el cine como actor secundario. En 1982 rodó Laberinto de pasiones, su primera película con Pedro Almodóvar, director gracias al que alcanzó gran popularidad a partir de su intervención en filmes como La ley del deseo (1986), Mujeres al borde de un ataque de nervios (1987) y Átame (1989). También colaboró en producciones de otros realizadores españoles, como Los zancos (1984), de Carlos Saura, Bajarse al moro (1988), de Fernando Colomo, y Si te dicen que caí (1989), de Vicente Aranda. Con Los reyes del mambo tocan canciones de amor (1992, de Arne Glimcher), basada en la novela del mismo título de Oscar Hijuelos, Banderas comenzó a actuar en producciones extranjeras. Después de divorciarse de su primera mujer, Ana Leza, y de fijar su residencia en Estados Uni', '1960-08-10', 'Málaga, Andalucía, Spain', NULL, 2, 'nm0000104', '3131', '/qzmRHsvmXfYnI5EfJevYj34wAZE.jpg', 17),
