(1213, 'Tyrese Gibson', 'Tyrese Gibson (30 de diciembre de 1978) es un actor, cantante de R&B, compositor, rapero, ex modelo y VJ de MTV estadounidense. Después de lanzar varios álbumes, pasó a hacer películas, con varios roles principales en cintas de Hollywood.\n\nDebutó en cine en 2001 con la película Baby Boy, dirigida por John Singleton. Luego actuó en Boyz n the Hood y encarnó a Roman \"Rome\" Pearce en la saga de Fast & Furious. Además, participó en las bandas sonoras de Waist Deep y 2 Fast 2 Furious.', '1978-12-30', 'Los Angeles, California, USA', NULL, 2, 'nm0879085', '8169', '/eHhIFk7HOElgFCaD4igtAgn41kA.jpg', 19),
