(1215, 'Gal Gadot', 'Gal Gadot Varsano (30 de abril de 1985) es una actriz, productora y modelo Israelí. Nació en Rosh Ha\'ayin, Israel, en una familia judía Ashkenazi.  Sirvió en las Fuerzas de Defensa Israeli como Instructora de Combate durante dos años; comenzó a estudiar derecho y relaciones internacionales en la universidad IDC Herzliya mientras desarrollaba su carrera de modelo y actuación; ganó el título de Miss Israel en 2004 a 18 años de edad.\n\nSu carrera de modelo comenzó cerca del 2000 e hizo su debut cinematográfico en la cuarta película de la franquicia \"Fast and Furious\"; Fast & Furious - Rápidos y Furiosos 4 (2009), como Gisele Yashar, quien era una asociada del villano principal de la película. Fue en esa película donde su popularidad subió mucho.\n\nSu papel se expandió en las secuelas Fast & Furious 5 (2011) y Fast & Furious 6 (2013), en las que su personaje estaba vinculado románticamente con Han Seoul-Oh. En estas películas, Gal realizó sus propias acrobacias.  También apareció en las películas de 2010 Noche Loca', '1985-04-30', 'Rosh Ha\'ayin, Israel', NULL, 1, 'nm2933757', '90633', '/plLfB60M5cJrnog8KvAKhI4UJuk.jpg', 29),
(1216, 'Ludacris', 'Christopher Brian Bridges (11 de septiembre de 1977), también conocido popularmente como Ludacris, es un rapero, compositor, productor discográfico, filántropo y actor estadounidense y gabonés.', '1977-09-11', 'Champaign, Illinois, USA', NULL, 2, 'nm0524839', '8171', '/dd4oZILcqzPbcM0R4SXefcAREIV.jpg', 18),
