(1218, 'Gina Carano', 'Gina Joy Carano (16 de abril de 1982) es una actriz, modelo y exluchadora de artes marciales mixtas (MMA).\n\nApareció como la gladiadora Crush en American Gladiators.​ Ha sido denominada como la «Cara de las mujeres de MMA».​ Fue en un momento la tercera mejor luchadora en el mundo en 145 libras (66 kg), según la clasificación de las Mujeres del Distrito Unificado de MMA. Protagonizó la película de acción de 2012 Haywire y apareció en la cinta de 2013 Fast & Furious 6.', '1982-04-16', 'Dallas County, Texas, USA', NULL, 1, 'nm2442289', '78452', '/kDcHntDmMEzftUQc0ASV7FM71Ar.jpg', 17),
