(1262, 'Pedro Reyes Rodríguez', 'Pedro Reyes nació en Tánger en 1961, cuando esta ciudad ya pertenecía a Marruecos desde cinco años antes y había dejado de ser zona internacional. Pasó toda su niñez y adolescencia en Huelva,2​ de donde es su madre. Es en esta ciudad donde Pedro comenzó su andadura por el mundo de la escritura y el teatro, creando en 1977 el grupo de teatro Centuria, un grupo de amigos con inquietudes artísticas entre los que se encontraba Pablo Carbonell, Juan Romero Mancha, Valentín Gandásegui y Arturo Macías Uceda como miembros oficiales, aunque debido a la singularidad de esta formación teatral otros muchos quisieron ser parte de aquella aventura y así podríamos citar a Manolo Gandásegui, Azcona, y Nazario Seguí, como técnico de luces.\n\nEs con Pablo cuando a la edad de 20 años decidió irse de Huelva camino a Sevilla, donde crearon el grupo Pedro y Pablo, en busca de un sinfín de aventuras. Es en una sala de la calle Betis donde comenzaron su carrera artística. Allí coincidieron con Loles León.\n\nEn 1982 decidieron tomar ru', '1961-05-08', 'Tànger, Morocco', '2015-03-25', 2, 'nm0721386', '975454', NULL, 1),
