(1273, 'Manuela Velasco', 'Manuela Velasco es una actriz y presentadora española, nacida en Madrid. Debutó en una película cuando tan sólo tenía 8 años. Es principalmente conocida por su trabajo en la popular saga REC, dirigida por Jaume Balagueró. Ha participado también en un considerable número de series de televisión con pequeños papeles, como en \'Cuéntame cómo pasó\' o \'Ángel o demonio\'. Actualmente forma parte del elenco de actores de \'Velvet\', una de las series más populares en España.', '1975-10-23', 'Madrid, Spain', NULL, 1, 'nm0892299', '34793', '/f2u6qNuTFzysZusZ522bCCHzgP4.jpg', 11),
