(1275, 'Chris Pine', 'Christopher Whitelaw Pine (26 de agosto de 1980), más conocido como Chris Pine, es un actor y modelo estadounidense famoso por interpretar a James T. Kirk en la saga reboot de Star Trek y a Jake Hardin en Just My Luck.', '1980-08-26', 'Los Angeles, California, USA', NULL, 2, 'nm1517976', '62064', '/vSe6sIsdtcoqBhuWRXynahFg8Vf.jpg', 38),
(1276, 'Pedro Pascal', 'Pascal nació en Santiago de Chile, de madre psicóloga infantil y padre, José Balmaceda, que es médico de fertilidad. Es nieto de un matrimonio español, una abuela nacida en la isla de Mallorca y un abuelo nacido en el País Vasco.​\n\nSus padres fueron simpatizantes del presidente Salvador Allende,​ y estuvieron involucrados en el movimiento de oposición contra la dictadura militar de Augusto Pinochet alrededor de la fecha de su nacimiento. Poco después de su nacimiento, su familia obtuvo asilo político en Dinamarca donde vivieron un tiempo.​ Posteriormente se trasladaron a Estados Unidos. Pascal se crio en San Antonio (Texas) y en Orange County (California) y vive en Nueva York desde 1993. Estuvo involucrado en natación competitiva durante sus primeros años, participando en los campeonatos estatales en Texas a la edad de once años, pero inmediatamente dejó de nadar competitivo después de entrar en la clase de teatro.\n\nEstudió arte dramático en la Orange County High School of the Arts y la Tisch School of the Ar', '1975-04-02', 'Santiago, Chile', NULL, 2, 'nm0050959', '1253360', '/dBOrm29cr7NUrjiDQMTtrTyDpfy.jpg', 47),
(1277, 'Robin Wright', 'Robin Gayle Wright (8 de abril de 1966) es una actriz y directora estadounidense. Es famosa en el mundo principalmente por sus interpretaciones de Buttercup en The Princess Bride, Jenny Curran en Forrest Gump y Claire Underwood en la serie House of Cards.\n\nSe hizo conocida al interpretar a Kelly Capwell en la serie Santa Barbara de la cadena NBC, entre 1984 y 1988, siendo nominada a tres Premios Daytime Emmy por su trabajo. Sus participaciones en el cine incluyen, además de las mencionadas, las películas Toys (1992), Message in a Bottle (1999), El protegido (2000), Nueve vidas (2005), Moneyball (2011) y Wonder Woman (2017).\n\nDesde 2013 protagoniza la serie House of Cards de Netflix junto a Kevin Spacey. Su trabajo le ha otorgado tres nominaciones a los Primetime Emmy en la categoría de mejor actriz de serie dramática, y ganó un Globo de Oro en la categoría de mejor actriz de serie de televisión - drama.', '1966-04-08', 'Dallas, Texas, USA', NULL, 1, 'nm0000705', '32', '/3IvlZd2PpT3Tuxy8lr6ymWLyoNU.jpg', 25),
(1278, 'Connie Nielsen', 'Connie Inge-Lise Nielsen (3 de julio de 1965) es una actriz, bailarina y cantante danesa.\n\nAdemás del danés, habla fluidamente el alemán, inglés, sueco, francés e italiano.', '1965-07-03', 'Elling, Frederikshavn, Denmark', NULL, 1, 'nm0001567', '935', '/lvQypTfeH2Gn2PTbzq6XkT2PLmn.jpg', 29),
