(1280, 'Amr Waked', 'Amr Waked (12 de abril de 1973) es un actor de cine, televisión y actor de teatro. Él es mejor conocido para el público internacional y en Hollywood por su papel en la película de 2005 Syriana. Otras destacadas interpretaciones incluyen a un Jeque yemení llamado Muhammad en Pesca del Salmón en el Yemen, y Pierre Del Río en Lucy del director Luc Besson.', '1973-04-12', 'Cairo Egypt', NULL, 2, 'nm0906756', '2960', '/5rMQibz1vTvs8nfNQOvd4gpQvCX.jpg', 6),
