(1414, 'Lynda Carter', 'Lynda Carter (24 de julio de 1951) es una actriz y cantante estadounidense; de padre estadounidense con ascendencia irlandesa y madre mexicana. Es conocida por su interpretación de la Mujer Maravilla en la serie de televisión del mismo nombre, la cual estuvo en transmisión de 1975 a 1979.', '1951-07-24', 'Phoenix, Arizona, USA', NULL, 1, 'nm0004812', '44935', '/qZJgjBKEL4ioZywSGzYzxldEAvf.jpg', 12),
