(1418, 'David Thewlis', 'David Wheeler (20 de marzo de 1963), conocido artísticamente como David Thewlis, es un actor británico de cine, televisión y teatro.\n\nEs conocido por su papel de Remus Lupin​ en las películas de Harry Potter y por su participación en películas como: Naked de Mike Leigh, Total Eclipse de Agnieszka Holland, La isla del doctor Moreau de John Frankenheimer, Siete años en el Tíbet de Jean-Jacques Annaud, War Horse de Steven Spielberg y Wonder Woman de Patty Jenkins. En 2017 desempeñó un papel protagonista en la tercera temporada de la serie de televisión Fargo.', '1963-03-20', 'Blackpool, Lancashire, England, UK', NULL, 2, 'nm0000667', '11207', '/sNuYyT8ocLlQr3TdAW9CoKVbCU8.jpg', 17),
(1419, 'Danny Huston', 'Daniel Sallis Huston (14 de mayo de 1962), conocido como Danny Huston, es un actor, guionista y director estadounidense, nacido en Italia.Es medio-hermano de la actriz Anjelica Huston y del guionista Tony Huston, todos hijos del director y actor John Huston.\n\nComenzó su andadura en el mundo del cine con la película \"Mr. North\", protagonizada por Anthony Edwards, Robert Mitchum y Anjelica Huston. Entre su filmografía destaca \"Ivans Xtc\" por la cual fue nominado en la categoría de mejor actor en los Independent Spirit Awards de 2003.', '1962-05-14', 'Rome, Italy', NULL, 2, 'nm0396812', '6413', '/iiVgafHitV0IbJYbaSNtHcWHF7P.jpg', 8),
(1420, 'Elena Anaya', 'Elena Anaya (nacida el 17 de julio de 1975) es una actriz española cuya carrera se remonta a 1995. Anaya nació en Palencia, España, el 17 de julio de 1975. Es la menor de 5 hijos. Recibió atención internacional por primera vez en 2001 por su papel en el drama sexualmente explícito Lucía y el sexo (Sex and Lucía) y también apareció en Hable con ella (Hable con ella) de Pedro Almodóvar. Su papel más conocido en la película de Hollywood fue como vampiro en 2004 en Van Helsing, interpretando a la novia de Drácula, Aleera. También aparece en el video musical de Justin Timberlake para su single de 2006, SexyBack. En 2004, fue nombrada como una de las Shooting Stars de las películas europeas por European Film Promotion.', '1975-07-17', 'Palencia, Palencia, Castilla y León, Spain', NULL, 1, 'nm0025745', '3623', '/hSkjzOfvRQ8DUJdhWveIKgRlyXb.jpg', 16),
