(1479, 'Zack Snyder', 'Zack Snyder (1 de marzo de 1966) es un director, productor y guionista de cine estadounidense.​ Es reconocido por su trabajo en el llamado DC Extended Universe, en donde ha dirigido las películas El hombre de acero y Batman v Superman: Dawn of Justice.\n\nEn sus películas pueden verse tomas donde la imagen pasa de cámara lenta a cámara rápida de forma súbita e inesperada, Snyder aplicó con éxito este personal y característico estilo cinematográfico en películas como 300, Watchmen, el remake de la película Dawn of the Dead y Ga\'Hoole: la leyenda de los guardianes.\n\nSnyder es cofundador de The Stone Quarry, una compañía de producción que estableció en 2004, junto con su esposa Deborah Snyder y su socio productor Wesley Coller.', '1966-03-01', 'Green Bay, Wisconsin, USA', NULL, 2, 'nm0811583', '15217', '/iD0GDqkvJXDXiNEZej198hjt3Tt.jpg', 10),
(1480, 'Ben Affleck', 'Actor, guionista, productor y director norteamericano, nacido en Berkeley, California. Obtuvo un Oscar de la Academia de Hollywood por su guión de la película El indomable Will Hunting (1997), compartido con Matt Damon. Comenzó a hacerse conocido en la película Mallrats, de 1995, para saltar casi a continuación a la fama con la actuación en, El indomable Will Hunting. Atrás quedaban diversas participaciones en otras películas de poca trascendencia, incluyendo el rol principal en Chasing Amy, de 1997. Se pudo situar entonces como actor de papeles centrales de películas de alto presupuesto, tales como Armageddon (1998) Pearl Harbor (2001), Al límite de la verdad (2002), Pánico nuclear (2002) y Daredevil (2003). Junto a su amigo de la infancia, el también actor y director Matt Damon, fundaron una empresa de producción de películas llamada LivePlanet. Su estilo como actor ha pasado por los más variados registros, desde comedias románticas a películas patrióticas, desde un personaje unidimensional como el de la se', '1972-08-15', 'Berkeley, California, USA', NULL, 2, 'nm0000255', '880', '/aTcqu8cI4wMohU17xTdqmXKTGrw.jpg', 22),
(1481, 'Henry Cavill', 'Henry William Dalgliesh Cavill (5 de mayo de 1983) es un actor británico de cine y televisión. Inició su carrera profesional en la película Laguna en 2001. Al año siguiente participó en el filme The Count of Monte Cristo, basado en la novela de Alexandre Dumas y donde personificó a Albert de Morcerf.\n\nEn 2007 actuó en la película de fantasía Stardust. Es conocido por su interpretación de Charles Brandon, primer duque de Suffolk, en la serie de televisión The Tudors, que fue producida por Showtime y en la que colaboró desde 2007 hasta el 2010.2​\n\nEn 2013 interpretó a Clark Kent (Superman) en la película Man of Steel del director Zack Snyder, repitiendo este papel en la secuela de 2016 Batman v Superman: Dawn of Justice y posteriormente en la película Liga de la Justicia en 2017, ambas del mismo director. Las dos primeras se convirtieron en las películas de Superman más taquilleras de todos los tiempos.', '1983-05-05', 'Jersey, Channel Islands, UK', NULL, 2, 'nm0147147', '73968', '/hErUwonrQgY5Y7RfxOfv8Fq11MB.jpg', 58),
(1482, 'Jesse Eisenberg', '', '1983-10-05', 'New York City, New York, USA', NULL, 2, 'nm0251986', '44735', '/yYhwWRcxDHTn63gSEF1vnDAD7cD.jpg', 34),
(1483, 'Amy Adams', 'Amy Lou Adams (Vicenza, Italia, 20 de agosto de 1974), conocida como Amy Adams, es una actriz de cine y televisión y cantante estadounidense nacida en Italia, ganadora de dos premios Globo de Oro en la categoría de mejor actriz - comedia o musical y de un Premio del Sindicato de Actores al mejor reparto.\n\nAdams comenzó su carrera artística en teatros de cena antes de hacer su debut en pantalla en 1999, en la comedia negra Muérete, bonita. Luego protagonizó la película Encantada de Disney, un éxito crítico y comercial, por la cual recibió una nominación al premio Globo de Oro como mejor actriz - comedia o musical por su interpretación de Giselle.\n\nEl 12 de enero de 2017 Adams recibió la su estrella en el paseo de la fama de Los Angeles.', '1974-08-20', 'Vicenza, Veneto, Italy', NULL, 1, 'nm0010736', '9273', '/1h2r2VTpoFb5QefAaBYYQgQzL9z.jpg', 26),
(1484, 'Diane Lane', 'Diane Colleen Lane (22 de enero de 1965) es una actriz estadounidense.\n\nHa sido nominada a los Óscar, Globos de Oro, Premios del Sindicato de Actores y Emmy.1​ Conocida por sus intervenciones en películas como Judge Dredd (1995), La tormenta perfecta (2000), Unfaithful (2002), Bajo el sol de la Toscana (2003), Hollywoodland (2006) y Nights in Rodanthe (2008).', '1965-01-22', 'New York City, New York, USA', NULL, 1, 'nm0000178', '2882', '/o9pPS52JrleScO4Qq6q1nYlaxWz.jpg', 27),
(1485, 'Jeremy Irons', 'Jeremy John Irons (19 de septiembre de 1948) es un actor británico ganador de los premios Tony, Óscar, Globo de Oro, SAG y Emmy.\n\nEs famoso, principalmente, por sus interpretaciones en proyectos para la televisión y el cine tales como Retorno a Brideshead, La misión, El hombre de la máscara de hierro, La casa de los espíritus, The French Lieutenant\'s Woman, Die Hard with a Vengeance (La jungla de cristal 3 en España, Duro de matar 3: La venganza en Latinoamérica), Reversal of Fortune (El misterio Von Bülow) y más la serie de televisión The Borgias.\n\nEl 17 de octubre de 2011, fue nombrado embajador de Buena Voluntad de la Organización de las Naciones Unidas para la Alimentación y la Agricultura (FAO).', '1948-09-19', 'Cowes, Isle of Wight, England, UK', NULL, 2, 'nm0000460', '16940', '/w8Ct1q02Ht3sWdOSqfp3B85TzT.jpg', 14),
