(1491, 'Lauren Cohan', 'Lauren Cohan (7 de enero de 1982)1​ es una actriz y modelo británico-estadounidense. Es más conocida por interpretar a Maggie Greene en la serie The Walking Dead, Bela Talbot en Supernatural y Rose en The Vampire Diaries. Más recientemente recibió el protagónico para la nueva serie de ABC Whiskey Cavalier.', '1982-01-07', ' Philadelphia, Pennsylvania, USA', NULL, 1, 'nm1659348', '62220', '/zJ9nZ5jqQTUD55GLKbgfiKlUoBN.jpg', 27),
