(1498, 'Harry Lennix', 'Harry Joseph Lennix III (16 de noviembre de 1964) es un actor estadounidense. Es mejor conocido por sus papeles como Terrence \"Dresser\" Williams en la película de Robert Townsend The Five Heartbeats y como Boyd Langton en la serie de televisión Joss Whedon Dollhouse.', '1964-11-16', 'Chicago, Illinois, USA', NULL, 2, 'nm0502015', '9464', '/kNGiizWpetf4pyAkINkjkWacmCL.jpg', 8),
