(1502, 'Kevin Costner', 'Kevin Michael Costner es un actor, cantante, músico, productor, director y empresario estadounidense. Ha sido nominado a tres premios BAFTA (British Academy of Film and Television Arts), ganó dos premios de la Academia y dos premios Golden Globe. Los papeles de Costner incluyen al teniente John J. Dunbar en la película Dances with Wolves, Jim Garrison en JFK, Ray Kinsella en Field of Dreams, Robin Hood en Robin Hood: Prince of Thieves, Crash Davis en Bull Durham, Robert \"Butch\" Haynes en Un mundo perfecto y Eliot Ness en Los intocables. Costner también fundó la banda Modern West y ha actuado con la banda desde 2007.', '1955-01-18', ' Lynwood, California, USA', NULL, 2, 'nm0000126', '1269', '/bykmxJHLfbFM3NT05RZXhx8YTzF.jpg', 14),
(1503, 'Ezra Miller', 'Ezra Matthew Miller (30 de septiembre de 1992) es un actor, músico, cantante y activista estadounidense. Su debut cinematográfico ocurrió en 2008 con su papel de Robert en Afterschool, mientras que su primer rol importante fue en el drama We Need to Talk About Kevin de 2011.  Un año después, recibió varios galardones por su actuación de Patrick en la película The Perks of Being a Wallflower, adaptación cinematográfica de la novela homónima de Stephen Chbosky. En 2015 coprotagonizó el drama The Stanford Prison Experiment y la comedia Trainwreck. Asimismo, en el 2016 interpretó a Flash, en la película de superhéroes basada en los personajes de DC Comics Batman v Superman: Dawn of Justice, y a Credence Barebone en el largometraje de género fantástico Animales fantásticos y dónde encontrarlos. En el 2017, interpretó a Flash en la película Liga de la Justicia.  Además es baterista y cantante de la banda Sons of an Illustrious Father.', '1992-09-30', 'Wyckoff, New Jersey, USA', NULL, 3, 'nm3009232', '132157', '/6wmTpbYpmhthaxzM5ss3377F9IV.jpg', 35),
