(1507, 'Neil deGrasse Tyson', '(Bronx, 5 de octubre de 1958) es un astrofísico, escritor y divulgador científico estadounidense. Actualmente es director del Planetario Hayden en el Centro Rose para la Tierra y el Espacio, investigador asociado en el Departamento de Astrofísica del Museo Estadounidense de Historia Natural. Desde el año 2006 es el presentador del programa de televisión de corte educativo científico NOVA ScienceNOW del canal público de Boston WGBH, miembro de PBS, y que ha sido un invitado frecuente en The Daily Show, The Colbert Report, Real Time with Bill Maher y Jeopardy!.', '1958-10-05', 'Manhattan, New York City, New York, USA', NULL, 2, 'nm1183205', '550307', '/ioIlzowM483KNbacWgKjNimiIOM.jpg', 4),
