(1515, 'Jason Momoa', 'Joseph Jason Namakaeha Momoa (1 de agosto de 1979) es un actor, escritor, productor, director y modelo estadounidense.\n\nEs conocido por interpretar a Aquaman en el Universo extendido de DC Comics, comenzando con la película de superhéroes Batman v Superman: Dawn of Justice en 2016, y en el conjunto de Liga de la Justicia en 2017 y su película individual Aquaman en 2018.​ También es conocido por sus papeles televisivos como Ronon Dex en la serie de televisión de ciencia ficción militar Stargate Atlantis (2004-2009), como Khal Drogo en la serie de televisión de fantasía de HBO Game of Thrones (2011-2012) y como Declan Harp en la serie de Netflix Frontier (2016-presente).', '1979-08-01', 'Honolulu, Hawaii, USA', NULL, 2, 'nm0597388', '117642', '/6dEFBpZH8C8OijsynkSajQT99Pb.jpg', 37),
