(1517, 'Ray Fisher', 'Ray Fisher (8 de septiembre de 1987) es un actor de cine y televisión estadounidense.\n\nEs más conocido por su papel en la comedia The Good, The Bad and the Confused y por interpretar a Cyborg en las películas del universo cinematográfico de DC Cómics.', '1987-09-08', ' Camden, New Jersey, USA', NULL, 2, 'nm3570321', '1313559', '/p87MNscHga8S2SbmATimP143Af9.jpg', 6),
