(1520, 'Patrick Wilson', 'Patrick Joseph Wilson (3 de julio de 1973) es un actor y cantante estadounidense.​\n\nDesde 1996 ha participado en varios musicales y ha protagonizado varias obras teatrales en el circuito de Broadway.​ En 2003 trabajó en la serie de televisión Angels in America de la cadena HBO, la cual está basada en la obra homónima de Tony Kushner y donde interpretó a Joe Pitt.​ Como actor de cine se ha destacado en películas como The Alamo, El fantasma de la ópera, Little Children, Watchmen, The A-Team, The Ledge, The Conjuring e Insidious y su secuela.​ En 2011 estelarizó la serie dramática A Gifted Man de la cadena televisiva CBS, donde encarnó el papel de un neurocirujano que ve el espíritu de su difunta esposa.​ En 2015 tuvo un papel protagónico en la segunda temporada de la serie televisiva de la cadena FX Fargo. Ha sido nominado a los premios Tony, a los Emmy y a los Globo de Oro.', '1973-07-03', 'Norfolk, Virginia, USA', NULL, 2, 'nm0933940', '17178', '/tc1ezEfIY8BhCy85svOUDtpBFPt.jpg', 42),
(1521, 'Carla Gugino', 'Carla nació en Sarasota, Florida. Se mudó con su madre a Paradise, California, cuando Carla tenía sólo cinco años. Durante su infancia, se mudaron muchas veces dentro del estado. Pero siguió siendo una estudiante de sobresaliente durante toda la escuela secundaria y se graduó como la mejor alumna. Una importante agencia de modelos descubrió a Carla en San Diego y la envió a Nueva York para comenzar una nueva carrera cuando tenía 15 años. Nueva York era más de lo que podía manejar a esa temprana edad, así que regresó a Los Ángeles en el verano, modelando e inscribiéndose en una clase de actuación por sugerencia de su tía, Carol Merrill, conocida de \"Let\'s Make a Deal\" (1963). Durante su tiempo libre, Carla disfruta del yoga, viajando y pasando tiempo con sus amigos en Los Ángeles.', '1971-08-29', 'Sarasota, Florida, USA', NULL, 1, 'nm0001303', '17832', '/7lSH5LOexOHwvt9lOTsLTbXdU1G.jpg', 32),
