(1589, 'Michael Shannon', 'Michael Corbett Shannon nació y se crió en Lexington, Kentucky, hijo de Geraldine Hine, abogada, y Donald Sutherlin Shannon, profesor de contabilidad en la Universidad DePaul. Su abuelo fue el entomólogo Raymond Corbett Shannon.\n\nShannon comenzó su carrera profesional en Chicago. Su primer papel como actor fue en \"Winterset\" en el Centro de Teatro de Illinois. Durante los siguientes años, continuó trabajando en el escenario con compañías como Steppenwolf, The Next Lab y Red Orchid Theatre. Posteriormente se mudó a Londres por un año y actuó en el escenario del West End de Londres en producciones como \"Woyzeck\", \"Killer Joe\" y \"Bug\".\n\nMientras estaba en Chicago, Shannon también se mantuvo ocupada frente a las cámaras de cine y televisión, sobre todo en el proyecto de pantalla grande Chicago Cab (1997), basado en la larga obra de teatro \"Hellcab\". Canguro Jack, trinca y brinca (2003) marcó la tercera producción de Jerry Bruckheimer en la que Shannon ha aparecido. También apareció en Dos policías rebeldes II (20', '1974-08-07', 'Lexington, Kentucky, USA', NULL, 2, 'nm0788335', '335', '/6mMczfjM8CiS1WuBOgo5Xom1TcR.jpg', 25),
