(1645, 'Rachel McAdams', 'Rachel Anne McAdams (17 de noviembre de 1978) es una actriz canadiense de cine y televisión, nominada a los premios Óscar, BAFTA y SAG.\n\nDespués de graduarse en un programa de teatro de cuatro años en la Universidad York, en 2001, trabajó constantemente en producciones canadienses, como My Name is Tanino (2002), Perfect Pie (2002) o la serie Slings and Arrows (2003-2005), hasta que encontró la fama con películas como Mean Girls (2004) o el drama romántico The Notebook (2004). Por esta última actuación, McAdams recibió buenas críticas.\n\nPosteriormente apareció en películas como Red Eye (2005), Wedding Crashers (2005), The Family Stone (2005), Married Life (2008), State of Play (2009), The Time Traveler\'s Wife (2009), Sherlock Holmes (2009), Morning Glory (2010), Midnight in Paris (2011), Sherlock Holmes: juego de sombras (2011), Cuestión de tiempo (2013), Spotlight (2015), entre otras.', '1978-11-17', 'London, Ontario, Canada', NULL, 1, 'nm1046097', '53714', '/fxeMrZswIPIWhipvdRrHOVuPlQY.jpg', 21),
(1646, 'Benedict Wong', 'Benedict Wong (3 de junio de 1971)​ es un actor británico conocido por interpretar a Kublai Khan en la serie de Netflix Marco Polo (2014), a Bruce Ng en The Martian (2015) y a Wong en la adaptación cinematográfica de Doctor Strange (2016) de Marvel.  Wong no sólo ha tenido una ilustre carrera en el cine y la televisión, sino también en teatro.', '1971-06-03', 'Eccles, Greater Manchester, England, U.K', NULL, 2, 'nm0938950', '30082', '/ukmfsl59Isvn9odgzMWBidA3cmt.jpg', 30),
(1647, 'Mads Mikkelsen', '', '1965-11-22', 'Copenhagen, Denmark', NULL, 2, 'nm0586568', '1019', '/ntwPvV4GKGGHO3I7LcHMwhXfsw9.jpg', 82),
(1648, 'Tilda Swinton', 'Katherine Matilda Swinton (5 de noviembre de 1960), conocida como Tilda Swinton, es una actriz y modelo británica de ascendencia escocesa. Aunque su carrera se ha centrado en el cine de autor y experimental, también ha aparecido en diversas películas populares y de éxito comercial como Only Lovers Left Alive, Constantine, La playa, The Chronicles of Narnia: The Lion, the Witch and the Wardrobe, El curioso caso de Benjamin Button, Doctor Strange y Avengers: Endgame.\n\nFue nominada al Globo de Oro en 2001, 2007 y 2011, y en 2007 ganó el Óscar y el BAFTA por su papel de reparto en la cinta Michael Clayton. En 2020 recibió el León de Oro por su trayectoria en el Festival Internacional de Cine de Venecia.', '1960-11-05', 'London, England, UK', NULL, 1, 'nm0842770', '3063', '/gWbX3a7V2MgRMRzekfITNcb27xV.jpg', 23),
