(1686, 'Hayley Atwell', 'Hayley Elizabeth Atwell (5 de abril de 1982) es una actriz británica, conocida por su trabajo en producciones teatrales como Panorama desde el puente, en películas como El sueño de Casandra, La duquesa.\n\nMayormente es conocida por interpretar a Peggy Carter en las películas del Universo cinematográfico de Marvel Capitán América: el primer vengador (2011), Captain America: The Winter Soldier (2014), Avengers: Age of Ultron (2015), Ant-Man (2015), Avengers: Endgame (2019) y en la serie de televisión Agent Carter.', '1982-04-05', 'London, England', NULL, 1, 'nm2017943', '39459', '/qpU7tIYUkKrVZXcEiULsvOawt48.jpg', 34),
