(1690, 'Patrick Stewart', 'Sir Patrick Stewart es un actor británico de cine y televisión, conocido principalmente por sus papeles en obras de teatro de William Shakespeare y, especialmente, por ser el Capitán Jean-Luc Picard de la serie La Nueva Generación de la saga de Star Trek (Viaje a las Estrellas) y el Profesor Xavier en las películas de X-Men.\n\nStewart ha sido nombrado oficial de la Orden del Imperio Británico en la lista honorífica de año nuevo de 2001.', '1940-07-13', 'Mirfield, West Yorkshire, England, UK', NULL, 2, 'nm0001772', '2387', '/wEy5qSDT5jT3ZASc2hbwi59voPL.jpg', 24),
(1691, 'Charlize Theron', 'Charlize Theron (Benoni, Sudáfrica, 7 de agosto de 1975) es una actriz y modelo sudafricana nacionalizada estadounidense. Alcanzó la fama después de participar en varias producciones cinematográficas estadounidenses en la década de los noventa, entre las que destacan The Devil\'s Advocate (1997), Mi gran amigo Joe/Joe (1998) y The Cider House Rules (1999). En el año 2003 fue acreedora del Óscar a la mejor actriz por su interpretación de la asesina en serie Aileen Wuornos en la película Monster, lo que la convirtió en la primera africana en recibir el premio en esa categoría. Dos años después recibió por segunda vez una nominación al Óscar por su actuación en North Country. Desde 2007 Theron es ciudadana estadounidense, aunque aún conserva su ciudadanía sudafricana.', '1975-08-07', 'Benoni, Gauteng, South Africa', NULL, 1, 'nm0000234', '6885', '/1HloWLLhL3iTrmDtMigiitLB9Qx.jpg', 53),
