(1730, 'Zachary Quinto', 'Zachary John Quinto (2 de junio de 1977) es un actor estadounidense.\n\nSus roles más famosos son el de Adam Kaufman en 24, Spock en la undécima, duodécima y decimotercera entrega de la saga de ciencia ficción Star Trek y Gabriel \"Sylar\" Gray en Héroes.', '1977-06-02', 'Pittsburgh, Pennsylvania, USA', NULL, 2, 'nm0704270', '17306', '/qFqIaNMcDNd693epUSXo9zOTXev.jpg', 12),
(1731, 'Zoe Saldana', 'Zoe Yadira Saldaña Nazario (19 de junio de 1978), conocida como Zoe Saldana o Zoe Saldaña, es una actriz estadounidense. Ha tenido papeles en las películas Center Stage del año 2000 y Crossroads, de 2002. Más tarde ganó prominencia por su papel de Anamaría en Pirates of the Caribbean: The Curse of the Black Pearl de 2003, como Nyota Uhura en la película Star Trek de 2009, como Neytiri en la película Avatar, de James Cameron, en 2009.  También se la conoce por interpretar a Gamora en las películas del Universo cinematográfico de Marvel Guardianes de la Galaxia (2014), Guardianes de la Galaxia Vol. 2 (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1978-06-19', 'Passaic, New Jersey, USA', NULL, 1, 'nm0757855', '8691', '/aGb3JzoumA89gRFwbJYAxFm5Qdk.jpg', 27),
(1732, 'Bruce Greenwood', 'Bruce Greenwood (12 de agosto de 1956) es un actor canadiense. Desde 1985 está casado con la actriz Susan Devlin, también canadiense, y tienen 1 hija. Interpretó al presidente de los Estados Unidos en tres películas National Treasure: Book of Secrets, Trece días (John F. Kennedy, en esta última) y Kingsman: The Golden Circle. También trabajó en películas como Déjà Vu, Capote (donde interpretó a la pareja del escritor Truman Capote), Yo, robot, Swept Away, Rules of Engagement, Ararat y Star Trek.', '1956-08-12', 'Noranda, Québec, Canada', NULL, 2, 'nm0339304', '21089', '/tAQFbZX3fFSBOCzSC9zSRChkNqx.jpg', 10),
(1733, 'John Cho', 'John Cho (16 de junio de 1972) es un actor coreano-estadounidense conocido por su papel como el agente Demetri Noh en FlashForward.\n\nConocido principalmente por su participación en las películas de American Pie.', '1972-06-16', 'Seoul, South Korea', NULL, 2, 'nm0158626', '68842', '/5rg7nhrZnv9fIqnB2V43mCqnKgL.jpg', 9),
(1734, 'Simon Pegg', 'Simon John Pegg (Gloucester, 14 de febrero de 1970) es un actor, comediante, guionista y productor británico. Es conocido por sus trabajos con el director Edgar Wright y su compañero actor Nick Frost en la sitcom Spaced y las películas Shaun of the Dead, Hot Fuzz y The World\'s End; y sus colaboraciones con el director y guionista J.J. Abrams en las sagas Misión Imposible y el reboot de Star Trek.', '1970-02-14', 'Brockworth, Gloucestershire, England, UK', NULL, 2, 'nm0670408', '11108', '/nOWKXxgADG98RjKyfQ7oSDfns6J.jpg', 11),
