(1738, 'Winona Ryder', 'Winona Laura Horowitz (29 de octubre de 1971), más conocida como Winona Ryder, es una actriz estadounidense dos veces nominada al Óscar y ganadora de un Globo de Oro. Aunque su debut fue en Lucas (1986), su primer rol importante fue interpretando a Lydia, una adolescente de estética gótica, en la película Beetlejuice (1988).\n\nDespués de varias apariciones en la televisión y en la radio, apareció en el filme Escuela de jóvenes asesinos, en un papel tan criticado como aclamado. En 2000 recibió una estrella en el Paseo de la fama de Hollywood, California.', '1971-10-29', 'Winona, Minnesota, USA', NULL, 1, 'nm0000213', '1920', '/5yteOSY2lgGOgSWmRTlxqfY59MS.jpg', 127),
