(1740, 'Jennifer Morrison', 'Jennifer Morrison es una actriz, modelo y productora estadounidense, conocida por su papel en series como House, Once Upon a Time y How I Met Your Mother.\n\nComenzó su carrera como modelo infantil, apareciendo en los anuncios de imprenta para JCPenney y Montgomery Ward y los comerciales para el arroz Krispie y Mondos. Cuando tenía diez años, apareció en la portada de Deporte Ilustrado para Niños junto al atleta Michael Jordan. Debutó en su primera película a la edad de quince años como hija de Richard Gere y Sharon Stone en Intersección, figurando en los créditos como Jenny Morrison, y apareció más adelante como Samantha en El último escalón con Kevin Bacon. Su primer papel protagonista llegó en el 2000 con Leyendas urbanas: el corte final, y desde entonces ha aparecido en varias películas con papeles secundarios incluyendo La rutina con Adrien Brody, Sobreviviendo a la Navidad con Ben Affleck y James Gandolfini y Sr. y Sra. Smith con Brad Pitt y Angelina Jolie. En la televisión trabajó en algunos programas ex', '1979-04-12', 'Chicago, Illinois, USA', NULL, 1, 'nm0607185', '41421', '/i6dkHIME0BOPhbcPESHZND3vmtk.jpg', 24),
