(1757, 'Greg Grunberg', 'Es conocido por sus papeles como Sean Blumberg en Felicity (1998-2001). Pero su consolidación como actor no fue hasta Alias (2001-2006), serie original de la ABC donde hacía el papel de Eric Weiss, un agente de la CIA dedicado completamente a su trabajo. Ambas series fueron producidas por J. J. Abrams, su amigo desde la infancia. También realizó una aparición en la segunda temporada de la serie de FOX House. En 2006 comenzó a formar parte del reparto de la serie de la NBC Héroes, en la que interpreta a Matt Parkman, un policía que posee como habilidad especial escuchar los pensamientos de los demás (telepatía).', '1966-07-11', 'Los Angeles, California, USA', NULL, 2, 'nm0342399', '17305', '/ir2QunLf6aTaowpEygbIcjiZLDB.jpg', 10),
