(1766, 'Akiva Goldsman', 'Akiva J. Goldsman (7 de julio de 1962) es un escritor, guionista, director y productor de cine y televisión estadounidense, conocido por su trabajo en películas de gran éxito y adaptaciones de novelas populares.\n\nLa filmografía de Goldsman como guionista incluye Batman Forever y su secuela Batman & Robin, I, Robot, I Am Legend, Cinderella Man y numerosas reescrituras tanto acreditadas como no acreditadas. También escribió más de una docena de episodios para la serie de televisión de ciencia ficción Fringe.\n\nEn 2002, Goldsman recibió un Premio Óscar al Mejor guion adaptado y el Globo de Oro al Mejor Guion por la película de 2001 A Beautiful Mind, que también ganó el Óscar a la Mejor película.\n\nEn 2006, Goldsman se volvió a juntar con el director de A Beautiful Mind, Ron Howard, para adaptar la novela de Dan Brown El Código Da Vinci a la versión cinematográfica de Howard, recibiendo críticas mixtas por su trabajo. También escribió el guion de su precuela de 2009, Ángeles y demonios.', '1962-07-07', 'New York City, New York, USA', NULL, 2, 'nm0326040', '5575', '/zjnY7yoXZifRJR9x8hdGIm9ducG.jpg', 3),
