(1901, 'Wil Wheaton', 'Richard William \"Wil\" Wheaton III (29 de julio de 1972) es un escritor y actor estadounidense. Como actor, sus papeles más conocidos son el del alférez Wesley Crusher, de la serie de televisión Star Trek: The Next Generation, Gordie LaChance en la película Stand by Me, el adolescente rebelde Joseph “Joey” Trotta en Toy Soldiers, y participó en ocasiones en la serie The Big Bang Theory interpretándose a sí mismo.', '1972-07-29', 'Burbank, California, USA', NULL, 2, 'nm0000696', '3033', '/yqEW17L7Fdg2RDRLLo4SqRHkjyw.jpg', 13),
