(1914, 'Shohreh Aghdashloo', 'Shohreh Aghdashloo (nacida el 11 de mayo de 1952) es una actriz iraní americana que después de establecer una carrera teatral y cinematográfica en Irán, se trasladó a Inglaterra durante la Revolución iraní en 1979, y posteriormente se convirtió en ciudadana de los Estados Unidos. Después de varios años desempeñando papeles secundarios en televisión y cine, su actuación en House of Sand and Fog (2003) le valió varios premios de la crítica cinematográfica y una nominación a un Oscar a la Mejor Actriz de Reparto. Ha seguido desempeñando papeles secundarios y de personaje en el cine y la televisión y ganó un premio Emmy por su trabajo en el drama televisivo House of Saddam (2008). Y en la exitosa serie The Expanse en el papel de Chrisjen Avasarala.', '1952-05-11', 'Tehran, Iran', NULL, 1, 'nm0013037', '21041', '/vuE7zU05kmnalORwIzVTi8uIMRA.jpg', 21),
