(1948, 'Alice Eve', 'Eve nació en Londres, hija de los actores Trevor Eve y Sharon Maughan. Tiene dos hermanos menores, Jack y George. De origen galés e irlandés, asistió a la Bedales School y a la Westminster School en Londres.\n\nDurante un año sabático estudió en el Beverly Hills Playhouse y estudió Inglés en el St Catherine\'s College de Oxford. Durante su estadía en Oxford participó en numerosas obras teatrales, una de las cuales la llevó hasta Edimburgo.\n\nEn el año 2004 debutó en el cine con dirección de Richard Eyre en la película Stage Beauty. En este período formó parte del reparto de varias películas televisivas, como Hawking (2004) y The Rotter\'s Club (2005).\n\nOtros títulos de su filmografía son Starter for 10 (2006), comedia coprotagonizada por James McAvoy y dirigida por Tom Vaughan, o Big Nothing (2006), comedia criminal en la que compartía créditos con Simon Pegg, David Schwimmer y Natascha McElhone.\n\nEn 2010, protagonizó la película She\'s Out of My League,​ junto a Jay Baruchel; sus padres también actuaron en esta ci', '1982-02-06', 'London, England, UK', NULL, 1, 'nm1404408', '59860', '/tJUSx0Cw7pCnRsCWbGTX2POiTKM.jpg', 30),
