(2018, 'Mark Hamill', 'Mark Hamill es mejor conocido por su interpretación de Luke Skywalker en la trilogía original de Star Wars: La guerra de las galaxias (1977), El imperio contraataca (1980) y El retorno del Jedi (1983), un papel que repitió en Star Wars : El despertar de la fuerza (2015) y Star Wars: Los últimos Jedi (2017). También protagonizó y coprotagonizó las películas Correrías de verano (1978), Uno Rojo: División de choque (1980) y Kingsman: Servicio secreto (2014). El extenso trabajo de actuación de voz de Hamill incluye un papel de larga data como el Joker, comenzando con Batman (1992).\n\nHamill nació en Oakland, California, de Virginia Suzanne (Johnson) y William Thomas Hamill, capitán de la Marina de los Estados Unidos. Se especializó en teatro en Los Angeles City College e hizo su debut como actor en The Bill Cosby Show (1969). Luego desempeñó un papel recurrente (Kent Murray) en la telenovela Hospital General (1963) y coprotagonizó la serie de comedia Cosas de chicos (1974).\n\nLanzado el 25 de mayo de 1977, La guerr', '1951-09-25', 'Concord, California, USA', NULL, 2, 'nm0000434', '2', '/zMQ93JTLW8KxusKhOlHFZhih3YQ.jpg', 25),
(2019, 'Carrie Fisher', 'Carrie Frances Fisher nació el 21 de octubre de 1956 en Burbank, California, de los cantantes / actores Eddie Fisher y Debbie Reynolds. Fue actriz y escritora conocida por La guerra de las galaxias (1977), El imperio contraataca (1980) y El retorno del Jedi (1983). Fisher también es conocida por su libro, \"Postales desde el borde\", y escribió el guión de la película basado en su novela. Carrie Fisher y el agente de talentos Bryan Lourd tienen una hija, Billie Lourd (Billie Catherine Lourd), nacida el 17 de julio de 1992.\n\nEl 23 de diciembre de 2016, sufrió un infarto masivo a consecuencia de una apnea de sueño​ mientras se encontraba en un vuelo que la trasladaba de Londres a Los Ángeles, aplicándose inmediatamente medidas de reanimación. Fue trasladada a un centro médico de la ciudad en grave estado. La popular actriz estadounidense se encontraba realizando la gira de promoción de su nuevo libro, La princesa diarista.\n\nFinalmente, el 27 de diciembre de 2016, falleció en el centro médico de la UCLA.', '1956-10-21', 'Beverly Hills, Los Angeles, California, USA', '2016-12-27', 1, 'nm0000402', '4', '/rfJtncHewKVnHjqpIZvjn24ESeC.jpg', 9),
