(2025, 'David Prowse', 'David Charles Prowse (1 de julio de 1935 - 28 de noviembre de 2020) fue un fisicoculturista, levantador de pesas y actor británico, conocido particularmente por su interpretación física del personaje Darth Vader en la saga de películas de Star Wars (con la voz del interpretada por James Earl Jones), filmada entre 1976 y 1982. En 2015, protagonizó un documental titulado I Am Your Father («Soy tu padre») sobre su experiencia durante el rodaje de Star Wars. Antes de su papel como Vader, Prowse se hizo famoso en el Reino Unido por formar parte de la campaña publicitaria llamada Green Cross Code de educación vial a los peatones.​ Como agradecimiento por su aportación altruista y a la seguridad vial, fue honrado por la reina Isabel II como Miembro de la Orden del Imperio Británico.', '1935-07-01', 'Bristol, England, UK', '2020-11-29', 2, 'nm0001190', '24342', '/xTocYiKHlRYN8tfh8vyQFsRXC0K.jpg', 5),
