(2121, 'Adam Driver', 'Adam Driver es un actor estadounidense que nació en San Diego el 19 de noviembre de 1983. También es un marine retirado. Es conocido por su participación en la serie de HBO de \'Girls\' o en una de las sagas de \'Star Wars\'.\n\nCon solo 18 años, queda muy afectado por el atentado terrorista del 11 de septiembre de 2001 en Nueva York de las Torres Gemelas. Este hecho es el detonante para que se decida a alistarse en el ejército, concretamente en los marines. Fueron más de tres años los que le dedicó a las fuerzas armadas. Finalmente, se retira del ejército a causa de una lesión en la que se rompe el esternón.\n\nTras su retirada del ejército decide convertirse en actor. Empieza su formación en el conocido centro de Julliard en Nueva York. Se gradua en el año 2009 y poco tiempo después consigue su primer papel en Broadway con la obra \'Mrs. Warren?s Profession\'. También en 2010 llega a la gran pantalla con la pelicula \'J. Edgar\' de Clint Eastwood. Este fue su estreno en el cine e interpretó a Walter Lyle. Su segunda pe', '1983-11-19', 'San Diego, California, USA', NULL, 2, 'nm3485845', '1023139', '/fsbGQ1eZFgdsG1XnKlhNSvHsiGo.jpg', 23),
(2122, 'Daisy Ridley', 'Daisy Jazz Isobel Ridley (10 de abril de 1992) es una actriz inglesa, conocida por su papel como \"Rey\" en la película de 2015, Star Wars: El despertar de la fuerza (2015).\n\nNació en Westminster, es hija de Louise Fawkner-Corbett y Chris Ridley. Su tío abuelo era Arnold Ridley, un actor inglés, dramaturgo y nombrado Oficial de la Orden del Imperio Británico (OBE), mejor conocido por su autoría de la obra, \"The Ghost Train\", y su papel como \" Private Godfrey \"en la comedia británica, Dad\'s Army (1968). Asistió a la Tring Park School for Performing Arts, ubicada en Hertfordshire, Inglaterra, donde se formó en teatro musical y se graduó en 2010, a la edad de 18 años. Además de actuar, su repertorio de talentos incluye ballet, baile de jazz, latinoamericano y grifo. Su rango vocal es mezzo-soprano, donde es notablemente experta en canto de jazz y cabaret.  Al graduarse, fue contratada en varios roles en televisión, cine y música. Fue elegida para interpretar \"Jessie\" en la comedia dramática británica Youngers (201', '1992-04-10', 'Westminster, London, England, UK', NULL, 1, 'nm5397459', '1315036', '/sdp6sznypa9BOrZIunCxSQRKKoB.jpg', 20),
(2123, 'John Boyega', 'John Boyega (17 de marzo de 1992)​ es un actor británico-nigeriano.\n\nEs conocido por interpretar a FN-2187 / Finn en la serie de películas de Star Wars.', '1992-03-17', 'Peckham, London, England, UK', NULL, 2, 'nm3915784', '236695', '/3153CfpgZQXTzCY0i74WpJumMQe.jpg', 9),
(2124, 'Oscar Isaac', 'Óscar Isaac Hernández Estrada (Ciudad de Guatemala; 9 de marzo de 1979), conocido simplemente como Oscar Isaac, es un actor y músico estadounidense de origen guatemalteco.\n\nEs conocido por interpretar a Poe Dameron en la serie de películas de Star Wars y sus papeles principales en Inside Llewyn Davis (2013), por la que recibió una nominación al Globo de Oro, El año más violento (2014) y Ex Machina (2015).', '1979-03-09', 'Guatemala City, Guatemala', NULL, 2, 'nm1209966', '25072', '/dW5U5yrIIPmMjRThR9KT2xH6nTz.jpg', 66),
(2125, 'Lupita Nyong\'o', 'Lupita Amondi Nyong\'o es una actriz, directora de cine y videoclips mexicana-keniata. Saltó a la fama en 2013 gracias a la película 12 años de esclavitud, del director británico Steve Rodney McQueen, por la que fue aclamada por la crítica. Ganó el Óscar a la mejor actriz de reparto y el Premio SAG a la mejor actriz de reparto, y fue nominada al Globo de Oro a la mejor actriz de reparto y al BAFTA a la mejor actriz de reparto por dicha película, entre otros premios internacionales.', '1983-03-01', 'Mexico City, Mexico', NULL, 1, 'nm2143282', '1267329', '/y40Wu1T742kynOqtwXASc5Qgm49.jpg', 17),
(2126, 'Andy Serkis', 'Andrew Clement \"Andy\" Serkis (20 de abril de 1964) es un actor, director de cine y escritor británico. Conocido por haber interpretado a Gollum en las trilogías cinematográficas de El Señor de los Anillos y El hobbit y a otros personajes a través de la técnica de captura de movimiento.', '1964-04-20', 'Ruislip, Middlesex, England, UK', NULL, 2, 'nm0785227', '1333', '/eNGqhebQ4cDssjVeNFrKtUvweV5.jpg', 18),
(2127, 'Domhnall Gleeson', '', '1983-05-12', 'Dublin, Ireland', NULL, 2, 'nm1727304', '93210', '/uDbwncuKlqL0fAuucXSvgakJDrc.jpg', 20),
(2128, 'Max von Sydow', 'Max Carl Adolf von Sydow es un actor sueco. Nominado al Premio Óscar por Pelle el conquistador y por Tan fuerte, tan cerca (Extremely Loud and Incredibly Close), es fundamentalmente reconocido por sus trabajos con el cineasta Ingmar Bergman aunque también ha actuado a las órdenes de John Huston, Woody Allen, Martin Scorsese y Sydney Pollack. Hoy en día es uno de los actores más respetados de la industria del cine.\n\nHa protagonizado e interpretado diversos papeles secundarios en numerosas películas, en muchos países y en un sin fin de lenguas incluyendo su sueco natal, noruego, inglés, italiano, alemán, danés, francés y español. Von Sydow recibió el Premio Real Fundación Cultural de Suecia de 1954, el título de Commandeur des Arts et des Lettres en 2005, y fue nombrado Caballero de la Legión de Honor el 17 de octubre de 2012.', '1929-04-10', 'Lund, Skåne län, Sweden', '2020-03-08', 2, 'nm0001884', '2201', '/aUFBsGCN6qpcjsF14LccMzE5ye7.jpg', 10),
(2129, 'Gwendoline Christie', '', '1978-10-28', 'Worthing, West Sussex, England', NULL, 1, 'nm3729225', '1011904', '/kmlv5i02n3zKryBr2W3kSeWVKTD.jpg', 14),
(2130, 'Joonas Suotamo', 'Un nativo finlandés que jugó al baloncesto como un avance y centro para los Penn State NIttany Lions, donde se especializó en cine y video, Suotamo también es actor y cantante.\n\nAntes de obtener el papel de Star Wars y después de su carrera en el baloncesto, Joonas Suontamo trabajó como vendedor de seguros.\n\nSegún el director Rian Johnson en un podcast DGA, abrazar a Joonas vestido como Chewbacca tiene más ganas de abrazar a un perro que de abrazar a un oso.\n\nSegún el director Rian Johnson en un podcast de la DGA, cuando estaba vestido como Chewbacca, llevaba pequeños caramelos en la bolsa de Chewbacca.', '1986-10-03', 'Espoo, Finland', NULL, 2, 'nm6934058', '1709041', '/qzUsjyKkh1G07SFSsXwo4t7vGpv.jpg', 6),
