(2169, 'Hannah John-Kamen', 'Hannah Dominique E. John-Kamen (6 de septiembre de 1989)​, más conocida como Hannah John-Kamen, es una actriz británica.\n\nEs famosa por su papel de Dutch en la serie del canal Syfy Killjoys, de Viva en el musical Viva Forever y por interpretar a Ghost en la película del Universo Cinematográfico de Marvel Ant-Man and the Wasp. También es reconocida por interpretar a la viuda Dothraki en la popular serie de HBO Game of Thrones, por aportar la voz de Sweet Shalquoir en el videojuego Dark Souls II y por su papel de Sonja en el episodio \"Playtest\" de la serie británica Black Mirror.', '1989-09-07', 'Anlaby, East Yorkshire, England', NULL, 1, 'nm4789912', '1408809', '/2dWMAk6l0KavjxZpR1P4ln7bxYg.jpg', 18),
