(2178, 'Ewan McGregor', 'Ewan Gordon McGregor nació el 31 de marzo de 1971 en Perth, Perthshire, Escocia, hijo de Carol Diane (Lawson) y James Charles McGregor, ambos maestros. Su tío es el actor Denis Lawson. Fue criado en Crieff. A los 16 años, dejó la Academia Morrison para unirse al Perth Repertory Theatre. Sus padres lo alentaron a abandonar la escuela y perseguir sus objetivos de actuación en lugar de ser infeliz. McGregor estudió drama durante un año en Kirkcaldly en Fife, luego se matriculó en la Guildhall School of Music and Drama de Londres para un curso de tres años. Estudió junto a Daniel Craig y Alistair McGowan, entre otros, y se fue justo antes de graduarse después de engancharse al papel del soldado privado Mick Hopper en la serie de cuatro partes Lipstick on Your Collar de Dennis Potter (1993). Su primer papel notable fue el de Alex Law en Tumba abierta (1994), dirigida por Danny Boyle, escrita por John Hodge y producida por Andrew Macdonald. Esto fue seguido por The Pillow Book (1996) y Trainspotting (1996), este úl', '1971-03-31', 'Perth, Scotland, UK', NULL, 2, 'nm0000191', '3061', '/aEmyadfRXTmmR7UW7OXsm5a6smS.jpg', 33),
(2179, 'Frank Oz', 'Richard Frank Oznowicz, más conocido como Frank Oz (25 de mayo de 1944), es un director de cine, actor y titiritero inglés nacionalizado estadounidense.', '1944-05-25', 'Hereford, Herefordshire, England, United Kingdom ', NULL, 2, 'nm0000568', '7908', '/mb2JbT8s6LIgaxj6QTph0NW1pmI.jpg', 10),
