(2388, 'J.J. Abrams', 'Jeffrey Jacob Abrams, escritor, productor, actor, director y compositor de cine y televisión estadounidense nacido en Nueva York. Es propietario de la productora de cine Bad Robot Productions. Criado en Los Ángeles, estudió en el Sarah Lawrence College de Bronxville, donde fue coautor de un borrador cinematográfico que sería la base para la película de Disney Millonario al instante (Arthur Hiller, 1990). En los años siguientes, fue autor o coautor de películas como A propósito de Henry (Mike Nichols, 1991), Eternamente joven (Steve Miner, 1992), Armageddon (Michael Bay, 1998) y Nunca juegues con extraños (John Dahl, 2001). En 1998, Abrams fue coautor de su primera serie de televisión, Felicity, con su colaborador y viejo amigo Matt Reeves. Abrams fue productor ejecutivo de la serie las cuatro temporadas que se estuvo emitiendo. También creó y fue productor ejecutivo de Alias (2001-2006) para ABC, y fue coautor, junto a Damon Lindelof, y productor ejecutivo de la serie Perdidos (2004-2010). En 2005, recibió un', '1966-06-27', 'New York City, New York, USA', NULL, 2, 'nm0009190', '15344', '/k4IWd2RV5kY1kAL2VgKQwFvnCLP.jpg', 9),
