(2441, 'Hayden Christensen', 'Hayden Christensen nació el 19 de abril de 1981 en Vancouver, Columbia Británica, Canadá. Sus padres, Alie y David Christensen, están en el negocio de las comunicaciones. Él es de ascendencia danesa (padre) y sueco e italiano (madre). Hayden creció en Markham, Ontario, con los hermanos Kaylen, Hejsa y Tove. Hayden se propuso convertirse en actor cuando un encuentro casual a la edad de ocho años lo colocó en su primer comercial, para Pringles. Cuando tenía trece años, tuvo papeles protagónicos en varias series dramáticas de televisión.\n\nSu mayor descanso fue una parte importante en Tierras altas (2000) de Fox Family Network. En la serie, Hayden mostró su talento para actuar como un adolescente que fue abusado sexualmente por su madrastra y recurre a las drogas con desesperación. Más tarde, apareció en la película de televisión La caída (2000), donde coprotagonizó con su amigo Jonathan Jackson. Hayden también tuvo un papel en la película Las vírgenes suicidas (1999).\n\nEl 12 de mayo de 2000, se anunció que Chris', '1981-04-19', 'Vancouver, British Columbia, Canada', NULL, 2, 'nm0159789', '17244', '/RuwAecNK9VDeTrfw6LUE4q4rIt.jpg', 26),
