(2446, 'Freddie Prinze Jr.', 'Freddie James Prinze Jr. (8 de marzo de 1976) es un actor estadounidense, conocido principalmente por sus interpretaciones en películas sobre adolescentes y por ser la voz de Iron Bull, en Dragon Age: Inquisition. En 2010 interpretó al agente Cole Ortiz de la CTU en la famosa serie 24 , Fred Jones en Scooby-Doo y Scooby-Doo 2 Monsters Unleashed. Es hijo del actor Freddie Prinze, a quien nunca conoció, puesto que el tenía 10 meses cuando su padre se suicidó.', '1976-03-08', 'Los Angeles, California, USA', NULL, 2, 'nm0005327', '33260', '/8V9yNBjCNRBKROyjCLKLJGcCBdG.jpg', 15),
(2447, 'Liam Neeson', 'Liam Neeson nació el 7 de junio de 1952 en Ballymena, Irlanda del Norte, de Katherine (Brown), una cocinera, y Bernard Neeson, un cuidador de la escuela. Fue criado en una casa católica. Durante sus primeros años, Liam trabajó como operador de montacargas para Guinness, un camionero, un arquitecto asistente y un boxeador aficionado. Originalmente había buscado una carrera como maestro asistiendo a St. Mary\'s Teaching College, Newcastle. Sin embargo, en 1976, Neeson se unió al Belfast Lyric Players \'Theatre e hizo su debut como actor profesional en la obra \"The Risen People\". Después de dos años, Neeson se mudó al Teatro Abbey de Dublín, donde interpretó los clásicos. Fue aquí donde fue visto por el director John Boorman y fue elegido para la película Excalibur (1981) como Sir Gawain, su primer papel cinematográfico de alto perfil.\n\nDurante la década de 1980, Neeson apareció en un puñado de películas y series de televisión británicas, incluyendo Motín a bordo (1984), Toda una mujer (1984), La misión (1986) y A', '1952-06-07', 'Ballymena, County Antrim, Northern Ireland, UK', NULL, 2, 'nm0000553', '3896', '/bboldwqSC6tdw2iL6631c98l2Mn.jpg', 39),
