(2452, 'Alden Ehrenreich', 'Alden Ehrenreich nació en Los Ángeles, California el 22 de noviembre de 1989. Su madre, Sari Ehrenreich, es una diseñadora de interiores, y su padrastro es un ortodoncista. Se crió en el judaísmo reconstruccionista. Ehrenreich comenzó a actuar a la escuela primaria en Palisades en Pacific Palisades, California, y continuó haciéndolo en Crossroads School en Santa Mónica, California.\n\nEhrenreich fue descubierto en el bar mitzvah de un amigo de Steven Spielberg, cuando Spielberg vio una película de comedia corta en la que Alden a la edad de 14 años había actuado.1​\n\nEn 2007, Ehrenreich hizo una audición y obtuvo el papel de Bennie Tetrocini en la película Tetro de Francis Ford Coppola. Coppola pidió a Ehrenreich leer un pasaje de El guardián entre el centeno para su audición principal.\n\nVivió en Nueva York, y se especializó en arte dramático en la Universidad de Nueva York. En 2009, fundó la compañía de teatro y cine The Collectin junto a Zoe Worth.\n\nEn abril de 2012, reemplazó a Jack O\'Connell en el papel de Et', '1989-11-22', 'Los Angeles, California, USA', NULL, 2, 'nm2403277', '71375', '/bx86TPUmeHp0QkijQb16r2qIwEr.jpg', 10),
(2453, 'Woody Harrelson', 'Tras su graduación se trasladó a Nueva York y comenzó a estudiar en el Biloxi Blues de Neil Simon. En 1985 fue elegido para el papel de Woody Boyd, el ingenuo y cordial camarero de la serie de televisión Cheers, con el que ganó un Emmy, entre otros premios. Su primera actuación en el cine fue en la película Gatos salvajes de 1986 junto a Goldie Hawn. Continuó trabajando con pequeños papeles en el cine hasta el enfrentamiento amoroso que protagonizó con Michael J. Fox en la película de 1991, Doc Hollywood.\n\nPosteriormente Harrelson trabajó en películas como Asalto al tren del dinero, La cortina de humo, White Men Can\'t Jump, Vaqueros de Nueva York, Indecent Proposal, Hi-Lo Country y Natural Born Killers de Oliver Stone de 1994, donde interpreta a un despiadado asesino.\n\nEn 1996 protagonizó la controvertida película The People vs. Larry Flynt, que narra la vida del empresario Larry Flynt, y por la cual fue nominado al Oscar al mejor actor. En 2001 volvió a la televisión durante siete episodios de la comedia Wil', '1961-07-23', 'Midland, Texas, USA', NULL, 2, 'nm0000437', '57755', '/igxYDQBbTEdAqaJxaW6ffqswmUU.jpg', 25),
(2454, 'Emilia Clarke', 'Tras graduarse, Clarke comenzó su carrera con un papel en la serie de la BBC Doctors, y un papel co-protagonista en el telefilme norteamericano Triassic Attack.\n\nDesde 2011 ha interpretado a Daenerys Targaryen en la serie fantástica y de gran éxito de HBO Juego de tronos, basada en la serie de novelas Canción de hielo y fuego, escritas por George R. R. Martin. Por su papel en la serie, fue nominada tres veces a los Premios Primetime Emmy en la categoría de mejor actriz de reparto en Serie dramática.\n\nEn 2012 participó en las películas Spike Island en el papel de Sally Harris, y en el cortometraje de suspense Shackled como Malu.\n\nEn 2013 realizó su debut en Broadway interpretando a Holly Golightly en la adaptación teatral del clásico de Truman Capote de 1958 Breakfast at Tiffany\'s. Además de poner voz a Marianne en la serie animada Futurama en el episodio \"Stench and Stenchibility\". En la gran pantalla, Clarke protagonizó junto con Jude Law y Demián Bichir la película Dom Hemingway que fue estrenada por Fox Se', '1986-10-23', 'London, England, UK', NULL, 1, 'nm3592338', '1223786', '/86jeYFV40KctQMDQIWhJ5oviNGj.jpg', 42),
(2455, 'Donald Glover', 'Donald McKinley Glover (nacido el 25 de septiembre de 1983) es un actor, escritor, comediante, músico y rapero estadounidense. Glover llamó la atención por su trabajo en el grupo de esbozo Derrick Comedy y es mejor conocido por su papel como estudiante de la universidad comunitaria Troy Barnes en la serie de comedia NBC Community. Al contrario de un rumor persistente, no está relacionado con el actor Danny Glover.', '1983-09-25', 'Stone Mountain, Georgia, USA', NULL, 2, 'nm2255973', '119589', '/nilV7NtnML6PDa9VrvxD79F85K9.jpg', 7),
