(2543, 'Christopher Lee', 'Christopher Frank Carandini Lee (27 de mayo de 1922 - 7 de junio de 2015)​ fue un actor y músico inglés. Su gran afición al deporte, así como su altura (medía 1,96 metros), le dieron un físico muy reconocible. Interpretó sobre todo a villanos y participó en unas 250 producciones desde el año 1948. Estuvo encasillado varios años en películas de terror al interpretar al Conde Drácula. Continuó activo hasta el final de su vida, a pesar de la avanzada edad que alcanzó, e incluso durante su última década su carrera recibió un renovado impulso con papeles en éxitos de taquilla, como el de Saruman en las películas de El Señor de los Anillos y El hobbit o el de Conde Dooku en las precuelas de Star Wars.\n\nTambién colaboró con proyectos musicales con bandas como Rhapsody of Fire y Manowar,​ además de haber iniciado una nueva carrera como músico con su propia banda de heavy/power metal sinfónico Christopher Lee Charlemagne en 2010 con cuatro álbumes grabados. Ese año, recibió el premio Spirit of Metal en los Globo de Or', '1922-05-27', 'Belgravia, Westminster, England', '2015-06-07', 2, 'nm0000489', '113', '/dA26fBr3t7mKqjn3OYW6kbD1LXM.jpg', 9),
(2544, 'Jake Lloyd', 'Jake Matthew Lloyd (5 de marzo de 1989) es un ex-actor estadounidense. Es conocido fundamentalmente por su papel del niño Anakin Skywalker en Star Wars Episodio I: La Amenaza Fantasma.', '1989-03-05', 'Fort Collins, Colorado, USA', NULL, 2, 'nm0005157', '33196', '/tp5PRiy8Ip8Vs70pUY1jeHbk2wH.jpg', 10),
