(2550, 'Brian Blessed', 'Brian Blessed es actor británico.\n\nHijo de un minero de Yorkshire, tuvo que abandonar la escuela tras un accidente grave sufrido por su padre. Aficionado desde joven al teatro, Blessed tuvo que cumplir su servicio militar –en el Parachute Regiment– antes de poder matricularse en la Bristol Old Vic Theatre School. Entre sus amistades se encontraba Peter O\'Toole, a quien conoció en esa época en una fiesta, después de que Blessed le tumbara a Harold Pinter de un puñetazo.\n\nAventurero y montañero, ha escalado Everest en tres ocasiones, sin llegar a la cima.\n\nEn octubre de 2015 publicó su autobiografía, Absolute Pandemonium.\n\nSe consagró como actor de televisión a principios de la década de 1960 por su papel como policía en el serie de culto de la BBC, Z Cars. Su popularidad aumentó con papeles como Porthos en la serie de la BBC, Los tres mosqueteros (1967) y de nuevo como César Augusto en la miniserie Yo, Claudio (1976), también de la BBC. En 1980, fue Peppone en la serie de la BBC The Little World of Don Camillo', '1936-10-09', 'Mexborough, Yorkshire, England, UK', NULL, 2, 'nm0000306', '8318', '/3mLIr94V5IOA5ndY6GyqKKcyrX6.jpg', 8),
