(2566, 'Keira Knightley', 'Keira Knightley es una modelo y actriz inglesa de cine y televisión. Comenzó a actuar de niña en la televisión y debutó en el cine en 1995. Inicio con un papel secundario interpretando a Sabé en Star Wars: Episode I - The Phantom Menace 1999 y su primer papel importante llegó en la película de terror psicológico The Hole 2001.Ganó un amplio reconocimiento en 2002 después de ser la co-protagonista en la película Quiero ser como Beckham y la fama internacional en 2003 después de aparecer como Elizabeth Swann en la serie de películas Piratas del Caribe. Knightley se hizo reconocida por sus papeles protagónicos en los dramas de época, como Orgullo y prejuicio 2005, por la que obtuvo nominaciones para el Oscar y el Globo de Oro a la Mejor Actriz; Expiación 2007, por la que fue nominada de nuevo a un Globo de Oro; Seda 2007; La duquesa 2008; Un método peligroso 2011; y Ana Karenina 2012. También ha aparecido en una gran variedad de diversos géneros; entre ellos la comedia romántica Love Actually 2003, como Guinever', '1985-03-26', 'Teddington, London, England, UK', NULL, 1, 'nm0461136', '116', '/8OpsaapXmwpLQqHvN5iwoIElERY.jpg', 18),
