(2656, 'Jimmy Smits', 'Jimmy Smits (9 de julio de 1955) es un actor estadounidense. Nació en una familia católica de inmigrantes de Surinam y de Puerto Rico. Su padre era un tipógrafo de Surinam y su madre una enfermera puertorriqueña.\n\nEs ganador de un Globo de oro. Es principalmente conocido por su rol como el congresista demócrata Matt Santos en el drama político The West Wing. Además, ha trabajado en series de televisión como L. A. Law, interpretando a Víctor Sifuentes, NYPD Blue como el detective Boby Simón, Cane, Dexter y Sons of Anarchy como Nero Padilla. Entre sus papeles recientes más conocidos se encuentra el de interpretar al Senador Bail Organa en Star Wars (Episodios II, III y Rogue One) y a Nero Padilla en Sons of Anarchy. También destacó como Cyrus Garza en Outlaw. Apareció en el capítulo 7 de la 4ª temporada de la serie Brooklyn Nine-Nine interpretando al padre de una de las protagonistas. Además, interpretó al senador John Donovan en 24: Legacy.\n\nTambién, en la cuarta temporada de la serie How to Get Away with Murd', '1955-07-09', 'Brooklyn, New York, USA', NULL, 2, 'nm0001751', '33181', '/yn4g0hjKPhHgZlW2TFzNmlP1zKf.jpg', 16),
