(2675, 'Tony Pitts', 'Tony Pitts es actor, guionista y dramaturgo. Nacido en Sheffield, Pitts tenía la intención original de convertirse en médico, pero terminó trabajando como mecánico de automóviles en sus comienzos. Durante su estancia en Stannington College, Sheffield Barry Hines hizo una visita en busca de extras para su próximo drama Looks and Smiles. Pitts fue fundido y pronto se convirtió en un personaje más importante en la producción. Decidió seguir su ambición de convertirse en actor en 1983, consiguiendo el papel de Archie Brooks en el largometraje de ITV Emmerdale. Permaneció en el espectáculo durante un total de diez años, cuando el personaje fue asesinado en el infame episodio del accidente de avión del 30 de diciembre de 1993. Desde entonces, Pitts ha trabajado en televisión, cine, radio y teatro, incluyendo War Horse, Lilyhammer y Peaky Blinders. En 2018, Pitts escribió, produjo y protagonizó la película Funny Cow - la historia de una comediante femenina (interpretada por su amiga Maxine Peake) en el circuito de c', '1962-10-10', 'Sheffield, Yorkshire, England', NULL, 2, 'nm0686029', '1229255', '/yKxag5eLZJ2Oex5bj8RXWIR3LnC.jpg', 5),
