(2808, 'George Lucas', 'Fue criado en un rancho de Modesto, California, lugar de cultivo de nueces. Su padre era dueño de una tienda de venta de escritorios y tenía tres hermanos.​ Durante su adolescencia estudió en la Downey High School y era un fanático de las carreras de automóviles, incluso tenía planeado convertirse en un piloto de carreras profesional. Sin embargo sufrió un terrible accidente con su coche poco tiempo después de graduarse en la secundaria, estuvo hospitalizado por varias semanas y estuvo a punto de morir. Este accidente cambió definitivamente su manera de ver la vida. Decidió ir a la preparatoria Modesto Junior College, donde tomó materias como antropología, sociología y literatura, entre muchas otras. También empezó a filmar con una cámara de 8mm. Durante esta época, Lucas y su amigo John Plummer comenzaron a interesarse en el cine Canyon Cinema: proyecciones de cineastas asociados al underground y al avant-garde, como Jordan Belson, Stan Brakhage y Bruce Conner.\n\nLucas y Plummer también comenzaron a ver pelíc', '1944-05-14', 'Modesto, California, USA', NULL, 2, 'nm0000184', '1', '/WCSZzWdtPmdRxH9LUCVi2JPCSJ.jpg', 10),
