(2975, 'Bryce Dallas Howard', 'Bryce Dallas Howard (¡2 de marzo de 1981) es una actriz, guionista y directora estadounidense, hija del director Ron Howard. Hizo su debut como actriz bajo la dirección de su padre en la película Parenthood en 1989 y pasó a tener pequeños papeles en películas y hacer apariciones en el escenario en los años siguientes. Durante este tiempo ella también asistió a la New York University (NYU), Tisch School of the Arts, luego de conseguir la Licenciatura en Bellas Artes, y se inscribió en escuelas de arte dramático. Después de ganar la atención de M. Night Shyamalan, este le dio un papel en lo que sería su primera película como protagonista, The Village (2004) y La joven del agua (2006). Su actuación en Como gustéis (2006) le valió una nominación al Globo de Oro en 2008.\n\nHoward logró más reconocimiento por parte del público con sus papeles en Spider-Man 3 (2007), Terminator Salvation (2009), The Twilight Saga: Eclipse (2010), The Help (2011), Jurassic World (2015) y en Jurassic World: El reino caído (2018).', '1981-03-02', 'Los Angeles, California, USA', NULL, 1, 'nm0397171', '18997', '/qQX1rhQaJ1G8eMG2RknFKiXfNRc.jpg', 64),
