(2978, 'Dichen Lachman', 'Dichen Lachman nació en Katmandú, Nepal, de madre tibetana y padre australiano. Hasta los siete años, vivía en Katmandú con sus padres y su gran familia. Después de eso, se trasladó a Adelaide, Australia, con sus padres. Tras abandonar la universidad, Dichen comenzó interpretación y se trasladó a Sydney para seguir su carrera.', '1982-02-22', 'Kathmandu, Nepal', NULL, 1, 'nm1901842', '94797', '/96RTQAmcdl16ouztMrv7T177EyC.jpg', 26),
