(2986, 'BD Wong', 'Bradley Darryl «BD» Wong (San Francisco, California, 24 de octubre de 1960) es un actor estadounidense, conocido por sus papeles como el Dr. George Huang en Law & Order: Special Victims Unit, como el Padre Ray Mukada en Oz, Henry Wu en la película Jurassic Park, y por su papel recurrente como Song Liling en M. Butterfly.\n\nWong nació en San Francisco, California, hijo de Roberta Christine (de soltera Leong), una supervisora de una compañía telefónica, y William D. Wong. Es de origen chino. Wong asistió Lincoln High School antes de asistir a la Universidad Estatal de San Francisco.\n\nDescripción anterior del artículo de Wikipedia BD Wong, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1960-10-24', 'San Francisco, California, USA', NULL, 2, 'nm0000703', '14592', '/w7Hs9m6ocS2qlibvrLOvmyCKbAN.jpg', 23),
