(3014, 'Awkwafina', 'Nora Lum (2 de junio de 1988),​ conocida profesionalmente como Awkwafina, es una actriz y cantante estadounidense de ascendencia china y surcoreana.\n\nParticipó en las películas Ocean\'s 8 y Crazy Rich Asians (2018), además de protagonizar la cinta The Farewell (2019), por la cual ganó un Globo de Oro en 2020 como mejor actriz de comedia o musical.\n\nHa publicado dos álbumes, Yellow Ranger (2014) y In Fina We Trust (2018). Sus apariciones en televisión incluyen producciones como Girl Code, Future Man y Saturday Night Live.', '1988-06-02', 'Stony Brook, Brookhaven, New York, USA', NULL, 1, 'nm5377144', '1625558', '/l5AKkg3H1QhMuXmTTmq1EyjyiRb.jpg', 49),
