(3028, 'James Marsden', 'James Marsden es un actor, cantante y modelo estadounidense. Es reconocido por sus actuaciones en la trilogía X-Men con el rol de Cyclops (Cíclope) y por sus actuaciones en las películas Superman Returns, Hairspray, Enchanted y 27 Dresses. Fue del grupo de modelos de Versace.\n\nEs hijo de un destacado profesor universitario y una nutricionista que se separaron cuando tenía 9 años. James tiene otros cuatro hermanos.\n\nInició sus estudios de periodismo radiofónico en la Universidad del Estado de Oklahoma pero optó por renunciar a su formación universitaria para probar suerte como actor.\n\nTiene cuatro hermanos: dos hermanas menores, Jennifer y Elizabeth, y dos hermanos, Jeff y Robert.\n\nAsistió a la Escuela Secundaria Hefner y Putnam City North High School, en Oklahoma City, y más tarde asistió a la Oklahoma State University, donde estudió periodismo televisivo.\n\nEra también un miembro de la fraternidad Delta Tau Delta.\n\nActualmente James Marsden vive en Los Ángeles lo cual le ofrece la oportunidad de practicar sus', '1973-09-18', 'Stillwater, Oklahoma, USA', NULL, 2, 'nm0005188', '11006', '/mk142GG0saiSXALY6V4wWcmPROW.jpg', 29),
