(3034, 'Jim Carrey', 'James Eugene Jim Carrey (17 de enero de 1962) es un humorista, actor y cantante canadiense. Es conocido por sus interpretaciones con humor slapstick, y por su trabajo ganó dos Premios Globo de Oro y fue candidato a un Premio BAFTA.\n\nEmpezó a trabajar a fines de la década de 1970, como comediante en vivo en el club Yuk Yuk\'s de Toronto. Después de obtener cierto prestigio, en 1981 comenzó a trabajar en the Comedy Store de Los Ángeles, donde fue visto por el humorista Rodney Dangerfield, quien inmediatamente firmó con él la apertura de sus giras de actuaciones. Carrey, con mucho interés en el cine y la televisión, desarrolló una amistad con Damon Wayans, que le consiguió un papel en el programa de humor In Living Color, en el que interpretó a varios personajes durante la década de 1990.\n\nDespués de obtener éxito en series de televisión y varias películas de bajo presupuesto, protagonizó la comedia Ace Ventura, que se estrenó en febrero de 1994. La película tuvo una secuela en 1995 titulada Ace Ventura: When Nat', '1962-01-17', 'Newmarket, Ontario, Canada', NULL, 2, 'nm0000120', '206', '/u0AqTz6Y7GHPCHINS01P7gPvDSb.jpg', 25),
