(3133, 'Tom Cruise', 'Tom es el único hijo (entre cuatro hijos) de padres nómadas, Mary Lee (Pfeiffer), maestra de educación especial, y Thomas Cruise Mapother III, ingeniero eléctrico. Sus padres eran de Louisville, Kentucky, y él tiene ascendencia alemana, irlandesa e inglesa. Young Tom pasó su infancia siempre en movimiento, y cuando tenía 14 años había asistido a 15 escuelas diferentes en los Estados Unidos y Canadá. Finalmente se estableció en Glen Ridge, Nueva Jersey, con su madre y su nuevo esposo. Mientras estaba en la escuela secundaria, Tom quería convertirse en sacerdote, pero muy pronto desarrolló un interés en la actuación y abandonó sus planes de convertirse en sacerdote, abandonó la escuela y, a la edad de 18 años, se dirigió a Nueva York y una posible carrera como actor. Los próximos 15 años de su vida son materia de leyendas. Hizo su debut en el cine con una pequeña parte en Amor sin fin (1981) y desde el principio exhibió un innegable atractivo de taquilla para el público masculino y femenino.\n\nCon una atractiva ', '1962-07-03', 'Syracuse, New York, USA', NULL, 2, 'nm0000129', '500', '/8qBylBsQf4llkGrWR3qAsOtOU8O.jpg', 54),
(3134, 'Miles Teller', '', '1987-02-20', 'Downingtown, Pennsylvania, USA', NULL, 2, 'nm1886602', '996701', '/cg3LW0xX6RKr8dmescxq1bepcb5.jpg', 42),
(3135, 'Jennifer Connelly', 'Jennifer Lynn Connelly (12 de diciembre de 1970) es una actriz estadounidense ganadora del Óscar y el Globo de Oro por su papel en A Beautiful Mind. Asimismo, es reconocida por sus interpretaciones en películas como Labyrinth (1986), Requiem for a Dream (2000), Dark City (1998), Hulk (2003), Casa de arena y niebla (2003) y Diamante de sangre (2006).', '1970-12-12', 'Cairo, New York, USA', NULL, 1, 'nm0000124', '6161', '/bpILtSl6z5xc6YOAiPnDBlXDYMJ.jpg', 243),
