(3140, 'Val Kilmer', 'Val Edward Kilmer (31 de diciembre de 1959, Los Ángeles) es un actor estadounidense.\n\nNació en Los Ángeles, California, hijo de un agente inmobiliario. A los 16 años entra becado en la prestigiosa Julliard School. Comenzó a ser popular tras su interpretación en la obra Slab Boys, que representó en Broadway al lado de Kevin Bacon y Sean Penn. Ha rodado documentales y publicado libros de poesía. Kilmer intervino en comedias al principio de su carrera, como Top Secret! (1984), y compartió escenas con Tom Cruise en el éxito de Tony Scott, Top Gun (1986), aunque su encarnación de Jim Morrison en The Doors, de Oliver Stone, le dio la fama.\n\nEn 1988 se casó con la actriz Joanne Whalley, de quien terminaría divorciándose en 1996. Con Joanne compartiría créditos en las películas Willow (1988) y Kill me again (1989).\n\nSus papeles más reconocidos llegaron en los 90, donde interpretó al personaje Batman, en la película de Joel Schumacher, Batman Forever (1995). Ese mismo año compartió pantalla con De Niro y Al Pacino en ', '1959-12-31', 'Los Angeles, California, USA', NULL, 2, 'nm0000174', '5576', '/uqX8JxI6bWs1I3BOAtzJJD0DDo6.jpg', 119),
(3141, 'Ed Harris', 'Ed Harris es un actor de teatro, cine y televisión, escritor, productor y director estadounidense, mejor conocido por interpretar personajes secundarios en largometrajes como \"Apollo 13\", \"A Beautiful Mind\" y \"The Truman Show\", además de muchos papeles recurrentes y protagonistas en programas de televisión, entre ellos la interpretación de El hombre de negro en \"Westworld\" de HBO. Tiene un BFA en Drama del California Institute of the Arts, Valencia, EE. UU.', '1950-11-28', 'Englewood, New Jersey, USA', NULL, 2, 'nm0000438', '228', '/ryF0KkljweLhPkQ70x6w3u9Qjjj.jpg', 30),
