(3163, 'Tim Robbins', 'Tim Robbins nació en West Covina, California, y se crio en Nueva York. Es hijo de la actriz Mary Robbins y del cantante y músico Gil Robbins.​ Comenzó a actuar desde los 12 años en el Theatre New City cuando se encontraba en el instituto Stuyvesant.\n\nEstudió interpretación en UCLA. Cuando se graduó formó en 1981 un grupo teatral denominado Actor´s Gang, mediante el cual comenzó a representar obras teatrales vanguardistas de contenido sociopolítico.\n\nEn los años 80, trabajó en series de televisión. En el cine comenzó a hacer pequeños papeles en películas como \"Click, click\" dirigida por Jerry Schatzberg y protagonizada por Demi Moore. Más tarde fue haciendo papeles secundarios más importantes como una breve aparición en \"Top Gun\" (1986) dirigida por Tony Scott.\n\nEn 1988 comenzó una relación con la actriz Susan Sarandon, a quien había conocido en el rodaje de la película \"Los búfalos de Durham\".\n\nEn 1992 debutó como director y guionista con la sátira política \"Ciudadano Bob Roberts\". En 1994, interpretó magistr', '1958-10-16', 'West Covina, California, USA', NULL, 2, 'nm0000209', '504', '/hsCu1JUzQQ4pl7uFxAVFLOs9yHh.jpg', 21),
