(3232, 'Danny Trejo', 'Dan \"Danny\" Trejo (Echo Park, Los Ángeles, 16 de mayo de 1944) es un actor estadounidense de origen mexicano. Ha trabajado en múltiples películas de Hollywood, en general haciendo papeles secundarios como antagonista o antihéroe y es conocido por películas como Heat, Con Air, Desperado, Animal Factory, Predators, From Dusk Till Dawn, la tetralogía de Spy Kids y como protagonista en Machete.\n\nHa desarrollado una carrera en el negocio cinematográfico a través de un camino poco común. Desde estar encarcelado a ayudar a los jóvenes a luchar contra la adicción a las drogas, desde la actuación a la producción; el nombre, el rostro y los logros de Danny Trejo han sido bien reconocidos en Hollywood.\n\nTodo empezó cuando el actor se presentó al plató de Runaway Train (El tren del infierno, 1985) para ofrecer asesoramiento a un hombre a quien había estado ayudando. Se le ofreció de inmediato un papel como convicto. Desde entonces, Danny ha aparecido en docenas de películas, contándose entre ellas Blood in Blood Out; Des', '1944-05-16', 'Los Angeles, California, USA', NULL, 2, 'nm0001803', '11160', '/7JrUkRGBscZ1Hy5JinaaXjjzSCF.jpg', 16),
(3233, 'Michelle Yeoh', '', '1962-08-06', 'Ipoh, Perak, Malaysia', NULL, 1, 'nm0000706', '1620', '/6oxvfyrrM3YmhgFZSqc8ESqPZoC.jpg', 62),
