(3240, 'Loles León', 'María Dolores León Rodríguez, más conocida como Loles León  (1 de agosto de 1950) es una actriz española de cine, televisión, teatro y radio. Famosa por ser una de las chicas Almodóvar y por sus papeles en televisión, principalmente el de Paloma Hurtado en la serie de televisión Aquí no hay quien viva. Actualmente trabaja en La que se avecina en Telecinco, interpretando a Menchu, como personaje principal, y quedó como finalista en MasterChef Celebrity de TVE. Últimamente ha rodado la película La reina de España. Ha sido protagonista del cortometraje El Mundo Entero, rodado en Badajoz, Extremadura, premiado en multitud de festivales por su interpretación.', '1950-08-01', 'Barcelona, España', NULL, 1, 'nm0508249', '6536', '/vI4x3s9s7hqf1mUnCHa1ieJwnc3.jpg', 6),
