(3246, 'Alberto Chicote', 'Alberto Chicote del Olmo (23 de junio de 1969) es un chef y presentador de televisión español.\n\nEn su trayectoria culinaria ha destacado por mezclar la cocina tradicional con otras técnicas, siendo uno de los pioneros de la cocina fusión en la gastronomía española. Actualmente dirige el restaurante Yakitoro en Madrid, cuyo menú es una reinterpretación de la cocina japonesa. Además es conocido por sus apariciones en televisión y presenta dos programas: Pesadilla en la cocina y ¿Te lo vas a comer?, ambos en La Sexta. Anteriormente fue uno de los tres presentadores del concurso Top Chef.', '1969-06-23', '  Madrid, Spain', NULL, 2, 'nm2954821', '1439854', '/hCZZHrdEjf7upzg3S6yuirKAQX2.jpg', 2),
(3247, 'Sara Escudero', 'Criada en la localidad abulense de Arenas de San Pedro, en 1981, tras acabar la educación secundaria, inició la carrera de Medicina en la Universidad de Salamanca. En 2002 (tercer curso) abandonó dicha carrera y fue a Madrid a cursar estudios de teatro. Fue en la capital donde Sara Escudero descubrió la stand-up comedy.\n\nEs monologuista profesional desde 2007. Ha sido comparada con Eva Hache y El club de la comedia la eligió como ganadora del V Concurso de monólogos. El premio del mismo fue la participación en la temporada 2012-2013, grabando su monólogo El mundo miente compartiendo programa con Berto Romero, Joaquín Reyes, Florentino Fernández y Ernesto Alterio.\n\nEn primavera de 2013 entró a formar parte del equipo de La noche de José Mota grabando piezas ultra rápidas en la mayoría de los programas de la temporada.\n\nEl 24 de enero de 2014 se unió al equipo del programa de la sobremesa de La Sexta, Zapeando, presentado por Frank Blanco, formando equipo con sus compañeros de mesa Cristina Pedroche, Miki Nadal', '1981-08-18', 'Arenas de San Pedro (Ávila)', NULL, 1, NULL, '1490502', '/bTk9VVJPxLw9OmEM7xxsQWZfzhB.jpg', 1),
(3248, 'María del Monte', 'María del Monte Tejado Algaba (26 de abril de 1962), conocida artísticamente como María del Monte, es una cantante española de sevillanas y de canción española, así como presentadora de radio y televisión.', '1962-11-26', 'Seville, Seville, Andalucía, Spain', NULL, 1, 'nm1835980', '1993849', '/7RugVcUbeMbS4DybFLnQ3kNvZub.jpg', 1),
