(3269, 'Lorenzo Caprile', 'Lorenzo Caprile Trucchi (2 de agosto 1966) es un modista y diseñador de ropa español, aunque formalmente su nacionalidad es la italiana. En 1993 presentó en Madrid la primera colección de su firma.', '1966-08-02', '  Madrid, Spain', NULL, 2, 'nm1933596', '2518763', '/uijTmK6K7LgbvbBq7rGoNy1Joex.jpg', 1),
(3270, 'Anabel Alonso', 'Ana Isabel Alonso Gómez (11 de noviembre de 1964), más conocida como Anabel Alonso, es una presentadora de televisión, humorista y actriz de cine, teatro, televisión y doblaje española. A lo largo de su carrera, Alonso ha recibido múltiples premios y reconocimientos, entre ellos tres Fotogramas de plata, y ha sido nominada dos veces a la Unión de Actores y otras dos a la Academia de las Ciencias y las Artes de Televisión de España, siendo uno de los rostros más populares del cine español.', '1964-11-11', 'Baracaldo (Vizcaya), Spain', NULL, 1, 'nm0022134', '24894', '/h5QM85iI4726m8OgbZGZxkuC6aA.jpg', 4),
(3271, 'Miguel Lago', 'Miguel Lago (Vigo, 1981) es un cómico español licenciado en Filología Hispánica y colaborador de Todo es Mentira, programa de sobremesa de Cuatro presentado por Risto Mejide además de otros programas como la Resistencia, Carne Cruda además de presentar su espectaculo Miguel Lago Pone Orden', NULL, 'Vigo, Pontevedra, Galicia, Spain', NULL, 2, NULL, '1710707', '/puYFscHr480JTvJHGFL4kdG3li3.jpg', 1),
(3272, 'Daniela Blume', 'Alexandra García Mezcua, más conocida como Daniela Blume, (9 de febrero de 1985) es sexóloga, colaboradora de televisión, presentadora y locutora de radio española.', '1985-02-09', 'Barcelona, Spain', NULL, 1, 'nm2908439', '1945838', '/o8HOrcnQEZ1ShkJ674wfjkEAYqF.jpg', 4),
