(3275, 'Boris Izaguirre', 'Boris Rodolfo Izaguirre Lobo (29 de septiembre de 1965) es un periodista, presentador de televisión, guionista y escritor de origen venezolano y que también posee la nacionalidad española. El segundo de tres hermanos —Rhazil, el mayor, y Valentina, la menor—, es hijo de Rodolfo Izaguirre (exdirector de la Cinemateca Nacional de Venezuela) y Belén Lobo, bailarina de ballet clásico y danza contemporánea. Desde febrero de 2006 está casado con Rubén Nogueira.', '1965-09-29', 'Maracay, Venezuela', NULL, 2, 'nm0412698', '1062011', '/qIe22JhskRUGm2ULssqTmwgLCF0.jpg', 1),
