(3277, 'Rosa López', 'Rosa María López Cortés (14 de enero de 1981), conocida como Rosa López, es una cantante española de diversos géneros musicales. En la década de 2000 adquirió fama como artista al ganar la primera edición de Operación Triunfo,3​ donde le dieron el apodo de «Rosa de España». Luego de ganar el concurso representó a su país en el Festival de la Canción de Eurovisión 2002, en el que obtuvo la séptima posición con la canción «Europe\'s living a celebration».', '1981-01-14', 'Granada, Spain', NULL, 1, 'nm1129432', '2513878', '/iys76hC3HNf8mqmfyJN2FbygLHD.jpg', 1),
