(3300, 'Sigourney Weaver', 'Susan Alexandra Weaver, más conocida como Sigourney Weaver (8 de octubre de 1949), es una actriz y productora estadounidense de cine, televisión y teatro. Ha sido candidata a los Premios Óscar y a los Premios del Sindicato de Actores.​ Ha sido ganadora de dos Globo de Oro en las categorías de mejor actriz en drama y mejor actriz de reparto, y de un BAFTA a la mejor actriz de reparto.​ Es conocida por sus intervenciones como la teniente Ripley en varias películas de la saga de Alien: Alien, el octavo pasajero (1979), Aliens, el regreso (1986), Alien 3 (1992) y Alien Resurrection (1997). Ha participado también en otras películas tan recordadas como Ghostbusters (1984), Gorilas en la niebla (1988), Working Girl (1988), Copycat (1994), La tormenta de hielo (1997), Blancanieves: Un Cuento de Terror (1997), The Village (2004) y Avatar (2009). También es conocida como la «reina de la ciencia-ficción».', '1949-10-08', 'Manhattan, New York City, New York, USA', NULL, 1, 'nm0000244', '10205', '/flfhep27iBxseZIlxOMHt6zJFX1.jpg', 23),
