(3306, 'Kate Winslet', 'Kate Elizabeth Winslet (nacida el 5 de octubre de 1975) es una actriz inglesa y cantante ocasional. Ella ha recibido multiples premios y nominaciones. Es la persona más joven en acumular seis nominaciones al Premio de la Academia y ganó el Premio de la Academia a la Mejor Actriz por The Reader (2008).\n\nWinslet ha sido aclamado por su trabajo dramático y cómico en proyectos que van desde películas de época hasta películas contemporáneas, y desde las principales producciones de Hollywood hasta películas independientes menos publicitadas. Ha ganado premios del Screen Actors Guild, la Academia Británica de Artes Cinematográficas y de Televisión y la Asociación de Prensa Extranjera de Hollywood, entre otros, y ha sido nominada para un premio Emmy por actuación en televisión. Criada en Berkshire, Winslet estudió teatro desde la infancia y comenzó su carrera en la televisión británica en 1991.\n\nHizo su debut cinematográfico en Heavenly Creatures (1994), por la que recibió sus primeros elogios notables de la crítica.', '1975-10-05', 'Reading, Berkshire, England, UK', NULL, 1, 'nm0000701', '204', '/dgIrPQjcdfCnKiGc8ugg5W3GzFX.jpg', 18),
