(3381, 'Eric Johnson', 'Eric Johnson (Edmonton, Alberta, Canadá, 7 de agosto de 1979) es un actor canadiense.\n\nEl trabajo más importante de Eric fue interpretando al \"joven Tristán\", en la película que estelarizó Brad Pitt, \"Legends of the Fall\". Mientras que en Canadá, participó en una película llamada \"Scorn\".\n\nLuego integraría el elenco principal de la serie de aventuras sobre los primeros años de Superman Smallville interpretando a \"Whitney\" el novio de Lana Lang y rival de Clark Kent. En la ficción Whitney deja Smallville durante el final de la primera temporada para entrar al ejército. Sin embargo, regresó para el episodio llamado \"Visage\" de la segunda temporada, siendo el último episodio en el que participaría Whitney, pues el muere en combate. Eric aparecería en un cameo en un episodio de la cuarta temporada en una escena de flasback. También protagoniza la serie \"Flash Gordon\", una reciente adaptación del personaje del año 2007 en emisión en canal sci-fi.\n\nEn febrero de 2016 se confirma que interpretará a Jack Hyde en la p', '1979-08-07', 'Edmonton, Alberta, Canada', NULL, 2, 'nm0425053', '33337', '/xBifjKXfvZhYYx6P6dDaIvYIzVq.jpg', 11),
