(3388, 'Geoffrey Rush', 'Geoffrey Roy Rush (Toowoomba, 6 de julio de 1951), conocido como Geoffrey Rush, es un actor australiano multipremiado.\n\nEs uno de las pocos intérpretes que han obtenido la «Triple corona de actuación». Ha sido galardonado con todos los premios importantes del cine, entre ellos: un Oscar, dos Globos de Oro, tres BAFTA, cuatro del Sindicato de Actores, un Emmy, un Tony y Premios AACTA. Es uno de los pocos actores que han ganado los seis premios más importantes de la interpretación y el primero de su nacionalidad en ganar un Oscar. También es notable por ser el primer actor en ganar el Oscar, el BAFTA, el Globo de Oro, el premio del Sindicato de Actores y el Premio de la Crítica por una sola actuación: Shine. El resplandor de un genio de 1996. Otros trabajos notables de Geoffrey son Shakespeare in Love, Quills, El sastre de Panamá, Elizabeth, Los miserables y El discurso del rey. Rush también adquirió una considerable popularidad en las nuevas generaciones al interpretar el papel del pirata Héctor Barbossa en la', '1951-07-06', 'Toowoomba, Queensland, Australia', NULL, 2, 'nm0001691', '118', '/t69hkD07olTK8o2CwuNnC1wg5Es.jpg', 15),
