(3423, 'Tobey Maguire', 'Tobias Vincent Maguire ( 27 de junio de 1975) es un actor y productor de cine estadounidense. Ha interpretado a Peter Parker en la primera trilogía de la serie de películas de Spider-Man.\n\nComenzó su carrera con papeles menores en series de televisión y telefilmes. En 1997 tuvo un papel de reparto en La tormenta de hielo, de Ang Lee y en Deconstructing Harry de Woody Allen. Ya en la década de 2000, trabajó en Wonder Boys (2000), las tres películas basadas en el cómic Spider-Man y en la candidata al Premio Óscar a la mejor película, Seabiscuit (2003). Concluida la trilogía de Spider-Man, fue aclamado por la crítica debido a su interpretación en Brothers (2009), donde actuó junto a Jake Gyllenhaal y Natalie Portman. Por su trabajo, Maguire recibió una nominación al Premio Globo de Oro como mejor actor dramático. En 2013, protagonizó la película El gran Gatsby junto a Leonardo DiCaprio.\n\nEs vegano, y en 2002 la organización Personas por el Trato Ético de los Animales lo nombró «vegetariano más sexy del mundo».', '1975-06-27', 'Santa Monica, California, USA', NULL, 2, 'nm0001497', '2219', '/ncF4HivY2W6SQW5dEP3N3I4mfT0.jpg', 27),
(3424, 'Elijah Wood', 'Elijah Jordan Wood (nacido el 28 de enero de 1981) es un actor estadounidense. Hizo su debut cinematográfico con un papel menor en Back to the Future Part II (1989), luego consiguió una sucesión de papeles más importantes que lo convirtieron en un actor infantil aclamado por la crítica a los 9 años. Es mejor conocido por su papel de alto perfil como Frodo Bolsón en la aclamada trilogía de El señor de los anillos de Peter Jackson. Desde entonces, se ha resistido al encasillamiento eligiendo papeles variados en películas aclamadas por la crítica como Bobby, Eternal Sunshine of the Spotless Mind, Sin City, Green Street y Everything Is Illuminated. Protagonizó la película Day Zero (2007) y prestó la voz del personaje principal, Mumble, en la premiada película animada Happy Feet. Interpretó a un turista estadounidense convertido en vampiro en París, je t\'aime. En 2005, fundó su propio sello discográfico, Simian Records. Fue elegido para el papel principal de una película biográfica de Iggy Pop que se llamará The P', '1981-01-28', 'Cedar Rapids, Iowa, USA', NULL, 2, 'nm0000704', '109', '/7UKRbJBNG7mxBl2QQc5XsAh6F8B.jpg', 19),
