(3468, 'Mark Wahlberg', 'Mark Robert Michael Wahlberg (Boston, Massachusetts, 5 de junio de 1971) es un actor, modelo, cantante y productor de televisión estadounidense.  Como cantante, integró el grupo de rap Marky Mark & the Funky Bunch, que alcanzó un enorme éxito con el disco Music for the People. Como actor, fue nominado a los Oscar 2006 en la categoría de mejor actor de reparto por la película The Departed. Es hermano del también actor y músico Donnie Wahlberg. Recibió una estrella en el paseo de la fama de Hollywood el 29 de julio de 2010.', '1971-06-05', 'Boston, Massachusetts, USA', NULL, 2, 'nm0000242', '13240', '/bTEFpaWd7A6AZVWOqKKBWzKEUe8.jpg', 56),
