(3543, 'Naomi Watts', 'Naomi ya había trabajado como actriz durante más de una década cuando ganó notoriedad como una recién llegada prometedora en Mulholland Drive (2001), ganadora del premio del Festival de Cine de Cannes de David Lynch. Nacida el 28 de septiembre de 1968, Watts comenzó a actuar en su adolescencia y obtuvo su primer papel en una película en For Love Alone (1986). Posteriormente, Watts apareció con las futuras cabezas de cartel de Hollywood, Nicole Kidman y Thandie Newton, en Flirting (1991), el encantador romance adolescente de John Duigan. La siguiente película de Watts con Duigan, Wide Sargasso Sea (1992), no fue tan bien recibida.\n\nDespués de probar por primera vez Hollywood con el homenaje a la película Matinee (1992), de Joe Dante, Watts consiguió un papel protagónico como la estudiante perturbada de Jimmy Smits en el drama judicial poco visto de George Miller, Gross Misconduct (1993). Watts luego interpretó a Jet Girl en Tank Girl de Lori Petty (1995), pero la fantasía de ciencia ficción sufrió un destino i', '1968-09-28', 'Shoreham, Kent, England, UK', NULL, 1, 'nm0915208', '3489', '/5s6UE6VjYx5TBDvyFk4vfOdS9GR.jpg', 26),
