(3556, 'Milla Jovovich', 'Milla Jovovich (nacida el 17 de diciembre de 1975) es una actriz, supermodelo, músico y diseñadora de moda estadounidense nacida en Ucrania. A lo largo de su carrera, ha aparecido en una serie de películas de ciencia ficción y de acción, por lo que el canal de música VH1 se ha referido a ella como la \"reina reinante del kick-butt\".\n\nHa aparecido en la portada de más de un centenar de revistas, y también ha protagonizado películas como The Fifth Element (1997), Ultraviolet (2006) y la franquicia \'Resident Evil\'. Jovovich comenzó a modelar a los once años, cuando Richard Avedon la presentó en los anuncios de Revlon \"Las mujeres más inolvidables del mundo\", y continuó su carrera con otras campañas para cosméticos L\'Oréal, Banana Republic, Christian Dior, Donna Karan y Versace.\n\nEn 1988, tuvo su primer papel como actriz profesional en la película para televisión The Night Train to Kathmandu, y más tarde ese año apareció en su primer largometraje, Two Moon Junction. Después de más apariciones en televisión pequeña', '1975-12-17', 'Kiev, Ukraine', NULL, 1, 'nm0000170', '63', '/usWnHCzbADijULREZYSJ0qfM00y.jpg', 37),
(3557, 'Iain Glen', 'Iain Glen nació en Edimburgo, Escocia, y se educó en la Edinburgh Academy, un colegio independiente para chicos (ahora mixto) en Edimburgo. Asistió a la Universidad de Aberdeen y se entrenó en la prestigiosa escuela Royal Academy of Dramatic Art \"RADA\", donde ganó la Brancroft Gold Medal.', '1961-06-24', 'Edinburgh, Scotland, UK', NULL, 2, 'nm0322513', '20508', '/8IC1dwdpK1YPRQAlkaa8bofln1k.jpg', 16),
