(3562, 'Ruby Rose', 'Ruby Rose Langenheim (20 de marzo de 1986), es una modelo, DJ, artista de grabación, actriz, presentadora de televisión y ex-VJ de MTV australiana.  Comenzó su carrera en la actuación a partir de 2008, con su debut en la película australiana Suite for fleur. En 2012, tuvo un pequeño papel en el drama Around the Block. Tal vez sus papeles más reconocidos internacionalmente han sido en la serie de televisión Orange Is the New Black como Stella Carlin y en la película Pitch Perfect 3. Aunque su vida personal a veces eclipsa su carrera de actuación y modelaje, se ha granjeado elogios por su trabajo en series y películas.  El 7 de agosto de 2018, se anunció que protagonizaría la serie de Batwoman en la cadena The CW.', '1986-03-20', 'Melbourne, Victoria, Australia', NULL, 3, 'nm3199307', '1246972', '/va7tbytp3pTrnxHC1l5GWeSy1e9.jpg', 26),
