(3788, 'Avaah Blackwell', 'Con una poderosa presencia en la pantalla, Avaah Blackwell constantemente abre nuevos caminos para las mujeres en el cine. Interpretando protagonistas femeninas fuertes, además de ser elegida contra el género (Ray - Rebelde sin causa, Banquo - Macbeth, Sargeant Valant - A Soldier\'s Farewell), Miss Blackwell es un testimonio del producto de vanguardia que ofrece el reparto de género neutral. Una artista marcial altamente entrenada e hija de dos militares canadienses, Avaah infunde su enfoque con una disciplina física y mental única. Fusionando esto con su experiencia como modelo de pasarela (Versace, Giorgio Armani, Toronto Fashion Week, Fashion Art Toronto), directora de eventos (ACTRA Studio District Film Party TIFF 2015, HangLoose Media), maquilladora (Holt Renfrew, Nars, YSL, Shu Uemura, Laura Mercier, Festival de Shakespeare de Praga) y Directora/Asociada de Casting (Misión Imposible 4: Protocolo Fantasma, Missing- ABC TV Series, I\'m On It) Miss Blackwell ofrece un conjunto de habilidades raras y valiosas', NULL, NULL, NULL, 1, 'nm4389000', '1608736', '/juBF9ObwIiAoxW6NM7p32zTrAze.jpg', 2),
