(3819, 'Ricardo Montalban', 'Ricardo Gonzalo Pedro Montalbán y Merino, KSG (25 de noviembre de 1920 - 14 de enero de 2009) fue un actor de radio, televisión, teatro y cine mexicano. Tuvo una carrera que abarcó siete décadas (películas de 1943 a 2006) y múltiples papeles notables. A mediados de la década de 1970, Montalbán se destacó como el portavoz en los anuncios de automóviles del Chrysler Cordoba, en los que ensalzó la famosa \"piel corintia suave\" que se usaba para su interior. También anunció el Chrysler New Yorker. De 1977 a 1984, se hizo famoso como Mr. Roarke, la estrella principal de la serie de televisión Fantasy Island. Interpretó a Khan Noonien Singh tanto en el episodio de 1967 \"Space Seed\" de la primera temporada de la serie original de Star Trek como en la película de 1982 Star Trek II: The Wrath of Khan. Ganó un premio Emmy en 1978 por su papel en la miniserie How the West Was Won y un premio Lifetime Achievement Award del Screen Actors Guild en 1993. A los 80, continuó actuando, a menudo proporcionando voces para películ', '1920-11-25', 'Mexico City - Mexico', '2009-01-14', 2, 'nm0001544', '1793', '/lL4I7U0j6Jc31XNohM86FN6D23I.jpg', 21),
