(3840, 'John Larroquette', 'John Bernard Larroquette (25 de noviembre de 1947), es un actor estadounidense de televisión y cine. Entre sus papeles más reconocidos se encuentran Dan Fielding en la comedia Night Court (ganando cuatro premios Emmy consecutivos por un reparto sobresaliente en la serie de comedia), Mike McBride en McBride, John Hemingway en The John Larroquette Show, y Carl Sack en Boston Legal. Hasta 2018 participó en la serie The Librarians protagonizando a Jenkins.', '1947-11-25', 'New Orleans, Louisiana, USA', NULL, 2, 'nm0488662', '14101', '/rWXMelYm34YIBOzJJaQrBI50NEp.jpg', 13),
(3841, 'Judith Anderson', 'Dame Judith Anderson, DBE, de nacimiento Frances Margaret Anderson-Anderson (10 de febrero de 1897, Adelaida, Australia Meridional - 3 de enero de 1992, Santa Bárbara, California), fue una actriz estadounidense de origen australiano. Considerada una de las grandes actrices trágicas del teatro del siglo XX, como Katina Paxinou, Geraldine Page, Helene Weigel, Helen Hayes o Edwige Feuillère.\n\nDebutó en los escenarios de Sídney en el año de 1915 y tuvo su primera aparición en la ciudad de Nueva York en 1918.\n\nLa consagración le llegó con algunas interpretaciones memorables, en papeles como: Lavinia en la obra teatral A Electra le sienta bien el luto, de Eugene O\'Neill (1932); Gertrudis en la puesta en escena de Hamlet (1936); en La gaviota y Tres hermanas, de Antón Chéjov; con el rol de lady Macbeth en la producción Macbeth (1937 a 1941), y por su papel principal en Medea, de 1947.\n\nTambién participó en más de 25 filmes, representando la mayoría de las veces a personajes malvados o siniestros, como su papel de la', '1897-02-10', 'Adelaide, South Australia, Australia', '1992-01-03', 1, 'nm0000752', '3362', '/1ObiPNEpP1ohD8opYkCInERp2w4.jpg', 2),
