(3852, 'Christopher Plummer', 'Arthur Christopher Orme Plummer CC (nacido el 13 de diciembre de 1929) es un actor canadiense de teatro, cine y televisión. Hizo su debut cinematográfico en Stage Struck de 1958, y sus actuaciones cinematográficas notables incluyen The Night of the Generals, The Return of the Pink Panther, Star Trek VI: The Undiscovered Country, The Man Who Would Be King y The Insider. En una carrera que abarca siete décadas e incluye papeles sustanciales en cada una de las artes dramáticas, Plummer es probablemente más conocido por el público cinematográfico como el viudo autocrático Capitán Georg Johannes von Trapp en la exitosa película musical de 1965 The Sound of Music junto a Julie Andrews. Plummer también se ha aventurado en varios proyectos de televisión, incluida la legendaria miniserie The Thorn Birds.\n\nEn el siglo XXI, sus papeles cinematográficos incluyen The Insider como Mike Wallace, Inside Man con Denzel Washington, la película de Disney-Pixar 2009 Up como Charles Muntz, la producción de Shane Acker 9 como \'1\',', '1929-12-13', 'Toronto, Ontario, Canada', '2021-02-05', 2, 'nm0001626', '290', '/iZh3s9Vy9vYD4DYnAda6C1kdeco.jpg', 7),
