(3966, 'F. Murray Abraham', 'Fahrid Murray Abraham, conocido como F. Murray Abraham, es un actor estadounidense de ascendencia siria e italiana, ganador de los premios Óscar y Globo de Oro.\n\nNació en Pittsburgh, Pensilvania. Hijo de Josephine, una ama de casa, y Fahrid Abraham, un mecánico de coches. Su padre era un cristiano asirio, que emigró de Siria durante la hambruna de 1920. Su abuelo paterno fue un cantor en la Iglesia Ortodoxa Siria. La madre de Abraham fue la hija de un inmigrante italiano que trabajaba en las minas de carbón de Pensilvania.\n\nAbraham se crio en El Paso (Texas), cerca de la frontera con México, donde fue miembro de una pandilla durante su adolescencia.\n\nDesde 1962 está casado con Kate Hannan, con quien tiene dos hijos.', '1939-10-24', 'Pittsburgh, Pennsylvania, USA', NULL, 2, 'nm0000719', '1164', '/p2RYVGdrcP0m70BkkiKcwyrDeim.jpg', 27),
(3967, 'Anthony Zerbe', '', '1936-05-20', 'Long Beach, California, USA', NULL, 2, 'nm0001875', '2516', '/i6bSWWUJrzh3KeckBeE7uNeZ6KM.jpg', 8),
(3968, 'Donna Murphy', 'Donna Murphy (7 de marzo de 1959) es una cantante y actriz estadounidense de teatro, cine y televisión, más conocida por su trabajo en el teatro musical. Nominada en cinco oportunidades al premio Tony, ha ganado dos veces el galardón mejor actriz principal en un musical por su papel de Fosca en Passion (1994-1995) y como Anna Leonowens en El rey y yo (1996-1997).​ También fue nominada por su papel de Ruth Sherwood en Wonderful Town (2003), Lotte Lenya en LoveMusik (2007) y Bubble/Raisel en The People in the Picture (2011).', '1959-03-07', 'Corona, New York, USA', NULL, 1, 'nm0614220', '2517', '/tmre2oZkIHGqnLhWeldpX2Ujgl0.jpg', 6),
