(3991, 'Tom Hardy', 'Edward Thomas «Tom» Hardy (15 de septiembre de 1977) es un actor inglés. Ha trabajado, entre otras, en las películas Bronson, Star Trek: némesis u Origen. Ha interpretado también a Tommy Riordan en Warrior, a Bane en El caballero oscuro: La leyenda renace, a Max Rockatansky, protagonista de Mad Max: Furia en la carretera, y al simbionte Venom en la película homónima.\n\nEn 2011 recibió el BAFTA a la estrella emergente. Por su interpretación de John Fitzgerald en El renacido, recibió una nominación a los premios Oscar, al mejor actor de reparto en 2016.', '1977-09-15', 'Hammersmith, London, England, UK', NULL, 2, 'nm0362766', '2524', '/sGMA6pA2D6X0gun49igJT3piHs3.jpg', 91),
