(4004, 'Daniel Radcliffe', 'Daniel Jacob Radcliffe (23 de julio de 1989) es un actor inglés, principalmente conocido por haber protagonizado la saga cinematográfica de Harry Potter. Fundamentalmente por ello, ha recaudado una fortuna de 23 millones de libras esterlinas (algo más de 27 millones de euros), parte de la cual ha destinado a organizaciones benéficas.\n\nSus comienzos profesionales se remontan a 1998, cuando actuó en el telefilme David Copperfield adaptación de la novela homónima de Charles Dickens. Posteriormente, debutó con El sastre de Panamá (2001) y apareció en otras películas como en la independiente December Boys y la televisiva My Boy Jack. En 2007 protagonizó la obra de teatro Equus, del dramaturgo Peter Shaffer, en la que interpretaba al perturbado Alan Strang. Recibió críticas elogiosas, tanto en Inglaterra como en los Estados Unidos, además de varios premios y distinciones. Por otra parte, ha manifestado su ilusión por ser guionista o director. También ha mencionado su inclinación por la música, aunque ha decidido de', '1989-07-23', 'Hammersmith, London, England, UK', NULL, 2, 'nm0705356', '10980', '/uAICvHxj4cwSGjEY9B09Mhqxrk.jpg', 41),
(4005, 'Rupert Grint', 'Rupert Alexander Lloyd Grint (24 de agosto de 1988) es un actor británico, conocido por interpretar a Ron Weasley en la serie de películas de Harry Potter. Obtuvo dicho papel a los once años, después de haber participado anteriormente solo en obras de teatro escolares y grupos de teatro locales.​ Protagonizó, junto a Daniel Radcliffe y Emma Watson, las ocho películas de la serie cinematográfica.\n\nRealizó su primera aparición fuera de Harry Potter en el largometraje Thunderpants dirigido por Pete Hewitt y estrenado el 24 de mayo de 2002. Protagonizó la comedia dramática Driving Lessons, estrenada el 8 de septiembre de 2006, donde compartió reparto con Julie Walters, actriz que encarnó a Molly Weasley —madre del personaje de Grint— en la saga de películas de Harry Potter, y Cherrybomb (2009), una cinta de bajo presupuesto de lanzamiento limitado. Además coprotagonizó la comedia Wild Target, junto a Bill Nighy y Emily Blunt. Su primer proyecto luego del final de la saga Harry Potter ocurrió en 2012, con la cinta', '1988-08-24', 'Harlow, Essex, England, UK', NULL, 2, 'nm0342488', '10989', '/b804sjyziFgPiEmjWETcTsRcSSx.jpg', 15),
(4006, 'Emma Watson', 'Es una actriz, modelo y filántropa británica, conocida por interpretar a Hermione Granger en la serie de películas de Harry Potter. Watson fue elegida para interpretar a Hermione a la edad de nueve años, después de haber participado anteriormente solo en obras de teatro escolares.3​ Protagonizó, junto a Daniel Radcliffe y Rupert Grint, las ocho películas de la serie cinematográfica.4​ Debido a su trabajo en Harry Potter, ha sido galardonada con varios premios y se estima que ha ganado £ 26 millones.', '1990-04-15', 'Paris, France', NULL, 1, 'nm0914612', '10990', '/tvPPRGzAzdQFhlKzLbMO1EpuTJI.jpg', 26),
(4007, 'Helena Bonham Carter', '', '1966-05-26', 'Golders Green, London, England, UK', NULL, 1, 'nm0000307', '1283', '/DDeITcCpnBd0CkAIRPhggy9bt5.jpg', 32),
(4008, 'Robbie Coltrane', 'Anthony Robert McMillan (30 de marzo de 1950), más conocido como Robbie Coltrane, es un actor escocés de cine y televisión. Es famoso por sus apariciones como Rubeus Hagrid en las películas de Harry Potter, como Valentin Dmitrovich Zukovsky en las películas de James Bond GoldenEye (1995) y El mundo nunca es suficiente (1999), y como el Dr. Eddie «Fitz» Fitzgerald en la serie televisiva británica Cracker, durante los años 1990.\n\nDurante los años 70, adoptó su nombre artístico en honor al saxofonista John Coltrane. Además, en este mismo periodo comenzó a trabajar como actor de teatro y como comediante en vivo. Obtuvo fama como cómico en clubes nocturnos, usualmente trabajando en grupos ya formados, siendo la actriz Emma Thompson una de sus compañeras.\n\nDescripción anterior del artículo de Wikipedia Robbie Coltrane, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1950-03-30', 'Rutherglen, Lanarkshire, Scotland, UK', NULL, 2, 'nm0001059', '1923', '/jOHs3xvlwRiiG2CLtso5zzmGCXg.jpg', 8),
(4009, 'Ralph Fiennes', '', '1962-12-22', 'Ipswich, Suffolk, England, UK', NULL, 2, 'nm0000146', '5469', '/tJr9GcmGNHhLVVEH3i7QYbj6hBi.jpg', 30),
(4010, 'Michael Gambon', '', '1940-10-19', 'Cabra, Dublin, Ireland', NULL, 2, 'nm0002091', '5658', '/3jdWkDKf4IODbG4JKTeaC7AzxZH.jpg', 33),
(4011, 'Brendan Gleeson', 'Brendan Gleeson es un actor irlandés. Sus películas más conocidas incluyen las películas de Harry Potter, Braveheart, Gangs of New York, 28 Days Later y el papel de Michael Collins en The Treaty. Ganó un premio Emmy en 2009 por su interpretación de Winston Churchill en la película Into the Storm.\n\nGleeson nació en Dublín, Irlanda, y se ha descrito a sí mismo como un ávido lector de niño. Después de dejar la escuela por un corto tiempo, trabajó durante dos años en una oficina con una junta de salud. Luego se graduó del University College Dublin y pasó a la Drama School en Londres en la Royal Academy of Dramatic Art (RADA). Justo después de completar el Curso de drama de actuación de 3 años en RADA, Gleeson construyó un currículum muy respetable en el Royal National Theatre, el Shakespeare\'s Globe Theatre y la Royal Shakespeare Company en Stratford-upon-Avon. Gleeson se hizo conocido por su tremenda presencia en el escenario, particularmente mientras actuaba en obras de William Shakespeare como King Lear, Richa', '1955-03-29', 'Dublin, Ireland', NULL, 2, 'nm0322407', '2039', '/379TXtBPRrkBDrEBWPQ5v3up7kT.jpg', 20),
(4012, 'Richard Griffiths', '', '1947-07-31', 'Thornaby-on-Tees, North Yorkshire, England, UK', '2013-03-28', 2, 'nm0341743', '10983', '/EuV0DyZ5nBh3ZAUWjEqdWlt8sK.jpg', 11),
(4013, 'Gary Oldman', 'Gary Leonard Oldman (21 de marzo de 1958) es un actor, director de cine, guionista y productor inglés.\n\nEntre sus películas están JFK (1991), Amada Inmortal (1994), Drácula, de Bram Stoker (1992), Léon (1994), El quinto elemento (1997), Harry Potter y el prisionero de Azkaban (2004), Batman Begins (2005) Harry Potter y la Orden del Fénix (2007), The Dark Knight (2008), Tinker Tailor Soldier Spy, The Dark Knight Rises (2012) y Darkest Hour (2017). También ha doblado a Viktor Reznov en los videojuegos Call of Duty World at War y Call of Duty: Black Ops y a Lord Shen en Kung Fu Panda 2, por lo que recibió una nominación a Mejor Interpretación Vocal en los premios Annie.\n\nSu interpretación de Sid Vicious en Sid and Nancy figura en la lista «Las 100 mejores interpretaciones de la historia del cine». Ha recibido, entre otros, tres BAFTAs un premio Saturno, un Globo de Oro y un Oscar a mejor actor por su papel de Winston Churchill en Darkest Hour. En 2011, recibió el premio honorífico Empire Icon.\n\nSu ópera prima co', '1958-03-21', 'New Cross, London, England, UK', NULL, 2, 'nm0000198', '64', '/2v9FVVBUrrkW2m3QOcYkuhq9A6o.jpg', 39),
(4014, 'Alan Rickman', 'Alan Sidney Patrick Rickman (21 de febrero de 1946 - Londres, 14 de enero de 2016)1​ fue un diseñador gráfico, actor y director de cine británico. Es mayormente recordado por su interpretación de Severus Snape en la saga cinematográfica de Harry Potter.', '1946-02-21', 'Hammersmith, London, UK', '2016-01-14', 2, 'nm0000614', '4566', '/7tADZs4ILE93oJ5pAh6mKQFEq2m.jpg', 11),
