(4019, 'Tom Felton', 'Thomas Andrew Felton​ (22 de septiembre de 1987) es un actor y músico británico, conocido por interpretar a Draco Malfoy en la serie de películas de Harry Potter. Antes de ser elegido para interpretar a Draco Malfoy, participó (con resultados negativos) en los cástines para Harry Potter y para Ron Weasley.  Fue elegido para interpretar a Draco a la edad de once años, luego de haber participado en The Borrowers (1997), y Anna and the King (1999).2​Apareció en las ocho películas de la serie cinematográfica. Recientemente está realizando una serie, Origin, en la plataforma de YouTube Premium.', '1987-09-22', 'Kensington, London, England, UK', NULL, 2, 'nm0271657', '10993', '/4fO0PjiBbNFEnYLPe55xUUP7Wgf.jpg', 10),
