(4081, 'Alfonso Cuarón', 'Alfonso Cuarón Orozco es un director de cine, guionista y productor cinematográfico mexicano, ganador del Oscar, y mejor conocido por sus películas Roma (2018), Gravity (2013), Children of Men (2006), Y Tu Mamá También (2001), Harry Potter and the Prisoner of Azkaban (2004) y A Little Princess (1995).\n\nCuarón nació en Ciudad de México. Es el hijo de Alfredo Cuarón, un físico nuclear que trabajó en la Agencia Internacional de Energía Atómica por muchos años.\n\nEstudió filosofía en la Universidad Nacional Autónoma de México (UNAM) y cinematografía en el Centro Universitario de Estudios Cinematográficos (CUEC), una facultad de la misma universidad. Allí conoció al director Carlos Marcovich y al director de fotografía Emmanuel Lubezki, entre quiénes hicieron su primer cortometrae, Vengeance is mine. La contreversia causada por el hecho de que la película fue filmada en inglés fue la razón por la que fue expulsado de la escuela de cine.\n\nComenzó a trabajar en televisión en México, primero como técnico y luego como ', '1961-11-28', 'Mexico City, Mexico', NULL, 2, 'nm0190859', '11218', '/gaHhrzPfxfc3cbQLkDt54gtP3n1.jpg', 4),
