(4087, 'Rhys Ifans', 'Rhys Ifans ( 22 de julio de 1967)​ es un actor galés de cine y televisión. Ganador del BAFTA al mejor actor de televisión, ha participado en películas como Notting Hill (1999), Little Nicky (2000), Hannibal Rising (2007), Nanny McPhee and the Big Bang (2010), Harry Potter y las Reliquias de la Muerte: parte 1 (2010) y The Amazing Spider-Man (2012).', '1967-07-22', 'Haverfordwest, Pembrokeshire, Wales, UK', NULL, 2, 'nm0406975', '7026', '/g8EUs8r1ECh9plKtrxBparsxlZ1.jpg', 30),
(4088, 'Bill Nighy', 'William Francis Bill Nighy (12 de diciembre de 1949) es un actor británico conocido por sus papeles antagónicos interpretando roles de villanos, como Viktor en la franquicia cinematográfica de Underworld, Davy Jones en Piratas del Caribe, el General Fallon en Jack el cazagigantes, entre otros.\n\nNighy nació en Caterham (Surrey), en 1949 y se formó en teatro en la escuela de actuación de Guildford. Realizó su debut profesional en el teatro en el Watermill Theatre de Newbury y luego siguió ganando experiencia en teatros regionales. En Liverpool creó, junto a Julie Walters y Pete Postlethwaite, una compañía de teatro itinerante que se presentaba en locales de variedades. Su primera actuación en Londres fue en el Hampstead Theatre, en noviembre de 1978, en la obra Comings and Goings.\n\nSu larga asociación con el trabajo de David Hare comenzó a principios de la década de 1980, cuando fue elegido para Dreams of Leaving, un filme de la cadena BBC, escrito y dirigido por Hare. Su siguiente trabajo juntos fue Map of the', '1949-12-12', 'Caterham, Surrey, England, United Kingdom', NULL, 2, 'nm0631490', '2440', '/acbigDOU1L1vMWAL3Wf0r8h8qLA.jpg', 33),
