(4097, 'Michelle Fairley', 'Michelle Fairley es una actriz británica de cine, televisión y teatro.\n\nApareció en una gran cantidad de programas de televisión norirlandeses, entre ellos The Bill y Holby City Heartbeat. Una de sus primeras apariciones fue interpretando a la asesina Cathy Michaels en la serie de ITV1, Inspector Morse, en el episodio titulado «The Way Through The Woods».\n\nInterpretó a la señora Granger en la primera parte de Harry Potter y las Reliquias de la Muerte, papel que en Harry Potter y la cámara secreta desempeñó Heather Bleasdale.\n\nEl 19 de marzo de 2010 se anunció que remplazaría a Jennifer Ehle en el papel de Catelyn Stark en la serie de HBO Game of Thrones. También interpreta a la madre de Nathan en la serie británica Misfits. El 4 de junio de 2013 se confirmó que la actriz formaría parte del conjunto de actores de la serie Suits de la cadena USA Network en su tercera temporada desde el primer capítulo. Representa a Ava Hessington, una empresaria británica que dirige una compañía petrolífera. Contacta con Harvey', '1963-07-11', 'Coleraine, County Londonderry, Northern Ireland, UK', NULL, 1, 'nm0265610', '20057', '/j8lQfEPHCKWV2QCiJJuH97CnoBX.jpg', 14),
