(4134, 'Rade Šerbedžija', 'Rade Šerbedžija (a veces aparece en los créditos como Rade Sherbedgia; nacido el 27 de julio de 1946) es un actor y director croata de origen serbio.\n\nFue uno de los más populares actores yugoslavos de las décadas de 1970 y 1980. En la actualidad, es internacionalmente conocido, principalmente por su papel como actor secundario en películas de Hollywood en las décadas de 1990 y de 2000. Recientemente, Šerbedžija destacó por su papel como el ex-general Dmitri Gredenko del Ejército Rojo de la Unión Soviética en la serie de televisión 24. Tiene doble nacionalidad, tanto de Croacia como de Eslovenia, teniendo los pasaportes de ambos países.', '1946-07-27', 'Bunić, Croatia', NULL, 2, 'nm0784884', '1118', '/eGK40yJnDCJOhtGXZrhkrkfVOwu.jpg', 8),
