(4205, 'Robert Pattinson', 'Robert Thomas Pattinson (13 de mayo de 1986) es un actor, modelo, productor y cantante británico.\n\nComenzó su carrera actoral interpretando a Cedric Diggory en Harry Potter y el cáliz de fuego (2005) y luego alcanzó un reconocimiento mundial por interpretar a Edward Cullen en las adaptaciones cinematográficas de las novelas de La Saga Crepúsculo (2008-2012) de Stephenie Meyer,​ por lo tanto se establece entre los actores más estables y de mejor paga de Hollywood.​\n\nEn 2010, Pattinson fue nombrado entre las 100 personas más influyentes del mundo por la revista Time,​ y en el mismo año la revista Forbes nombró a Pattinson como una de las celebridades más poderosas del mundo en el Forbes Celebrity 100.', '1986-05-13', 'Barnes, London, England, UK', NULL, 2, 'nm1500155', '11288', '/6RVxNlNmc0DIfZzaJKCJM43If3M.jpg', 40),
