(4238, 'Kenneth Branagh', 'Actor, director y productor británico, considerado internacionalmente como uno de los actores/directores más relevantes de su generación. Nacido en Belfast, su familia se trasladó a Reading, en Berkshire, cuando él tenía diez años. Estudió en la Royal Academy of Dramatic Arts (RADA) hasta 1981. Su primer compromiso profesional fue para actuar en la obra de Julian Mitchell Another country (Otro país) en el Queen\'s Theatre, Londres, actuación por la que recibió el premio de la Sociedad de teatros del West End al novel más prometedor en 1982. Se incorporó a la Royal Shakespeare Company (RSC) en 1984, y fue aclamada su interpretación como protagonista en Enrique V. Al año siguiente, escribió y dirigió su primera obra, Tell me honestly (Dime la verdad), en el Donmar Warehouse, y en 1986 produjo, dirigió y protagonizó Romeo y Julieta en el Lyric, Hammersmith. En 1987 formó la Renaissance Theatre Company y protagonizó la primera producción, Public enemy (Enemigo público), que también había escrito. La compañía conti', '1960-12-10', 'Belfast, Northern Ireland, UK', NULL, 2, 'nm0000110', '11181', '/AbCqqFxNi5w3nDUFdQt0DGMFh5H.jpg', 28),
(4239, 'John Cleese', 'John Marwood Cleese (nacido el 27 de octubre de 1939) es un actor, cómico, escritor y productor de cine inglés. Alcanzó el éxito en el Festival Fringe de Edimburgo y como guionista e intérprete en The Frost Report. A finales de la década de 1960 se convirtió en miembro de Monty Python, la compañía de comedia responsable del programa de sketches Monty Python\'s Flying Circus y de las cuatro películas de Monty Python: And Now for Something Completely Different, Holy Grail, Life of Brian y The Meaning of Life. A mediados de la década de 1970, Cleese y su primera esposa, Connie Booth, coescribieron y protagonizaron la comedia británica Fawlty Towers. Más tarde, coprotagonizó con Kevin Kline, Jamie Lee Curtis y su antiguo colega de los Python, Michael Palin, A Fish Called Wanda y Fierce Creatures. También protagonizó Clockwise, y ha aparecido en muchas otras películas, como dos de James Bond, dos de Harry Potter y tres de Shrek. Con el guionista de Yes Minister, Antony Jay, cofundó la productora Video Arts, encarga', '1939-10-27', 'Weston-Super-Mare, Somerset, England, UK', NULL, 2, 'nm0000092', '8930', '/kg63gNYQtGPi2fSNIvCnVAclCbi.jpg', 15),
