(4307, 'Don Cheadle', 'Donald Frank Cheadle (29 de noviembre de 1964) es un actor y productor de cine y televisión estadounidense. Ganador del Globo de Oro al mejor actor de reparto - Serie, miniserie o telefilme y dos veces ganador del Premio del Sindicato de Actores al mejor reparto.\n\nCandidato a los Premios Óscar, Emmy y BAFTA.1​ Conocido por sus intervenciones en películas como Boogie Nights (1997), Traffic (2000), Ocean\'s Twelve (2004), Hotel Rwanda (2004), Crash (2004), El vuelo (2012).\n\nEs conocido por interpretar a Teniente Coronel James «Rhodey» Rhodes en las películas del Universo cinematográfico de Marvel Iron Man 2 (2010), Iron Man 3 (2013), Avengers: Age of Ultron (2015), Capitán América: Civil War (2016), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1964-11-29', 'Kansas City, Missouri, USA ', NULL, 2, 'nm0000332', '1896', '/b1EVJWdFn7a75qVYJgwO87W2TJU.jpg', 15),
(4308, 'Paul Rudd', 'Paul Stephen Rudd (Passaic, Nueva Jersey; 6 de abril de 1969) es un actor, comediante, escritor y productor de cine estadounidense. Estudió teatro en la Universidad de Kansas y en la Academia Americana de Artes Dramáticas, antes de hacer su debut como actor en 1992 con la serie dramática de NBC titulada Sisters.\n\nEs conocido por sus papeles en las películas: Clueless (Fuera de onda) (1995), Romeo + Julieta de William Shakespeare (1996), Mucho más que amigos (1998), Wet Hot American Summer (2001), El reportero: la leyenda de Ron Burgundy (2004), Virgen a los 40 (2005), Lío embarazoso (2007), Mal ejemplo (2008), Te quiero, tío (2009), Si fuera fácil (2012), Las ventajas de ser un marginado (2012), Los amos de la noticia (2013), Los principios del cuidado (2016), Mudo (2018) y Una familia ideal (2018).\n\nDesde 2015, Rudd interpreta a Scott Lang/Ant-Man en el Universo cinematográfico de Marvel, en las películas Ant-Man (2015), Capitán América: Civil War (2016), Ant-Man y la avispa (2018) y Vengadores: Endgame (201', '1969-04-06', 'Passaic, New Jersey, USA', NULL, 2, 'nm0748620', '22226', '/8eTtJ7XVXY0BnEeUaSiTAraTIXd.jpg', 56),
(4309, 'Chadwick Boseman', 'Chadwick Aaron Boseman (29 de noviembre de 1977) es un actor, guionista y dramaturgo estadounidense. Es mejor conocido por interpretar a Jackie Robinson en 42 (2013) y James Brown en Get on Up (2014). También tuvo papeles en la serie de televisión Lincoln Heights (2008) y en Persons Unkonwn (2010), y las películas The Express (2008) y Draft Day (2014).\n\nEs reconocido por interpretar a T\'Challa / Pantera Negra en el Universo cinematográfico de Marvel en las películas Capitán América: Civil War (2016), Black Panther (2018), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1976-11-29', 'Anderson, South Carolina, USA', '2020-08-28', 2, 'nm1569276', '172069', '/nL16SKfyP1b7Hk6LsuWiqMfbdb8.jpg', 11),
(4310, 'Brie Larson', 'Actriz, directora y cantante estadounidense. Educada en casa antes de estudiar actuación en la American Conservatory Theater. Comenzó su carrera como actriz en televisión, apareciendo en la comedia Raising Dad de 2001, por la cual fue nominada para un Premio Joven Artista.\n\nCuando era adolescente, tuvo breves papeles en distintas películas. Su actuación en la película de comedia Hoot (2006) fue elogiada, y posteriormente interpretó papeles secundarios en las películas Greenberg (2010), Scott Pilgrim vs. the World (2010), 21 Jump Street (2012) y Don Jon (2013) . De 2009 a 2011, apareció como un adolescente rebelde en la serie de televisión Estados Unidos de Tara.\n\nSu papel decisivo llegó con Short Term 12 (2013), por el que recibió elogios de la crítica. El éxito adicional llegó en 2015 cuando protagonizó Room. Ganó varios premios por su interpretación de una madre con problemas de secuestro de la víctima en la película, incluyendo el Premio de la Academia, el Premio BAFTA, el Premio Critic\'s Choice, el Premio', '1989-10-01', 'Sacramento, California, USA', NULL, 1, 'nm0488953', '60073', '/iqZ5uKJWbwSITCK4CqdlUHZTnXD.jpg', 30),
(4311, 'Tom Holland', 'Thomas Stanley Holland es un actor y bailarín británico, conocido por interpretar a Lucas Bennett en la película Lo imposible (2012), a Thomas Nickerson en En el corazón del mar (2015) y Peter Parker/Spider-Man en las películas del Universo cinematográfico de Marvel.', '1996-06-01', 'Surrey, England, UK', NULL, 2, 'nm4043618', '1136406', '/bBRlrpJm9XkNSg0YT5LCaxqoFMX.jpg', 159),
(4312, 'Evangeline Lilly', 'Nicole Evangeline Lilly (3 de agosto de 1979),​ conocida artísticamente como Evangeline Lilly, es una actriz y escritora canadiense. Logró popularidad por su papel de Kate Austen en la serie de televisión Lost (2004-2010), por la que obtuvo un Premio del Sindicato de Actores y recibió una nominación al Globo de Oro.​ También es reconocida por sus interpretaciones de Connie James en The Hurt Locker (2008), Hope Van Dyne en Ant-Man and the Wasp (2018), Bailey Tallet en Real Steel (2011) y Tauriel en la serie fílmica de El Hobbit.', '1979-08-03', 'Fort Saskatchewan, Alberta, Canada', NULL, 1, 'nm1431940', '19034', '/4wWBoEWUkdsE8dp46zvDLf9jefC.jpg', 32),
(4313, 'Anthony Mackie', 'Anthony D. Mackie (23 de septiembre de 1978) es un actor estadounidense conocido por su papel como el sargento JT Sanborn en la película The Hurt Locker, ganadora en los Premio Oscar a la Mejor Película.\n\nEs conocido por interpretar a Sam Wilson / Falcon en las películas del Universo cinematográfico de Marvel Captain America: The Winter Soldier (2014), Avengers: Age of Ultron (2015), Ant-Man (2015), Capitán América: Civil War (2016), Avengers: Infinity War (2018), Avengers: Endgame (2019).\n\nHa aparecido en otras películas y series de televisión, así como en los escenarios de Broadway.', '1979-09-23', 'New Orleans, Louisiana, USA', NULL, 2, 'nm1107001', '53650', '/eZSIDrtTzhvabyjrmIITQLsjx8h.jpg', 21),
(4314, 'Sebastian Stan', 'Sebastian Stan (13 de agosto de 1982) es un actor rumano-estadounidense.​  Es muy conocido por interpretar a Bucky Barnes / Winter Soldier en las películas del Universo cinematográfico de Marvel Capitán América: el primer vengador (2011), Captain America: The Winter Soldier (2014), Capitán América: Civil War (2016), Black Panther (2018), Avengers: Infinity War (2018), Avengers: Endgame (2019).', '1982-08-13', 'Constanta, Romania', NULL, 2, 'nm1659221', '60898', '/nKZgixTbHFXpkzzIpMFdLX98GYh.jpg', 38),
(4315, 'Danai Gurira', 'Danai Jekesai Gurira (14 de febrero de 1978) es una actriz y dramaturga estadounidense de ascendencia zimbabuense. Ha aparecido en diversos programas de televisión, películas y obras de teatro. Es más conocida por su papel como Michonne en la serie de televisión The Walking Dead.\n\nReconocida por interpretar a Okoye en el Universo cinematográfico de Marvel en las películas Capitán América: Civil War (2016), Black Panther (2018), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1978-02-14', 'Grinnell, Iowa, USA', NULL, 1, 'nm1775091', '82104', '/xgo39kFf6rAynb1i9J1BeLfSXxg.jpg', 9),
(4316, 'Letitia Wright', 'Letitia Michelle Wright (31 de octubre de 1993), conocida como Letitia Wright, es una actriz británica de origen guyanés. Es más conocida por su éxito Urban Hymn (2016).[cita requerida] y por interpretar a Shuri en el Universo cinematográfico de Marvel en las películas Black Panther (2018), Avengers: Infinity War (2018) y Avengers: Endgame (2019).', '1993-10-31', 'Georgetown, Guyana', NULL, 1, 'nm4004793', '1083010', '/i6fbYNn5jWA6swWtaqgzaj02RMc.jpg', 6),
(4317, 'John Slattery', 'John M. Slattery, Jr. (nacido el 13 de agosto de 1962) es un actor y director estadounidense, mejor conocido por su papel de Roger Sterling en la serie Mad Men de AMC.\n\nDescripción arriba del artículo de Wikipedia John Slattery, con licencia de CC-BY-SA, lista completa de colaboradores en Wikipedia.', '1962-08-13', 'Boston, Massachusetts, USA', NULL, 2, 'nm0805476', '21134', '/t1mhOQR8XwCqp7xArTy8FCENTsR.jpg', 10),
(4318, 'Marisa Tomei', 'Marisa Tomei (4 de diciembre de 1964) es una actriz de cine, teatro y televisión estadounidense. Tras su trabajo en As the World Turns, Tomei se hizo conocida como integrante del reparto de la secuela de The Cosby Show, A Different World, en 1987. Después de trabajar en un par de películas, su carrera se catapultó en 1992 con la comedia Mi primo Vinny, por la cual ganó el premio Óscar como mejor actriz de reparto.\n\nHabiendo actuado en varias películas a lo largo de los años, sus cintas más exitosas comercialmente son What Women Want (2000), Anger Management (2003) y Wild Hogs (2007).​ Recibió elogios por parte de la crítica por sus actuaciones en Unhook the Stars (1996), Slums of Beverly Hills (1998), Before the Devil Knows You\'re Dead (2007) y fue nominada al Oscar por In the Bedroom (2001) y El luchador (2008).', '1964-12-04', 'Brooklyn, New York, USA', NULL, 1, 'nm0000673', '3141', '/pP0J79KUzPPjW4QO42iF4KKM7C6.jpg', 15),
(4319, 'Angela Bassett', '', '1958-08-16', 'New York City, New York, USA', NULL, 1, 'nm0000291', '9780', '/oe6mXi0K68LWsGwGy6gwfnOu74z.jpg', 10),
(4320, 'Michael Douglas', 'Michael Kirk Douglas (25 de septiembre de 1944) es un actor y productor de cine estadounidense, ganador de un Premio Óscar al Mejor actor por Wall Street (1987) y otro como productor a la Mejor película por One Flew Over the Cuckoo\'s Nest (Alguien voló sobre el nido del cuco, 1975), además de cuatro Globos de Oro.  Es hijo de Kirk Douglas, legendario actor del cine clásico de Hollywood.', '1944-09-25', 'New Brunswick, New Jersey, USA', NULL, 2, 'nm0000140', '3392', '/kVYGPIZowzXLEQfAGUNOqKjAbBb.jpg', 15),
(4321, 'Michelle Pfeiffer', '', '1958-04-29', 'Santa Ana, California, USA', NULL, 1, 'nm0000201', '1160', '/oGUmQBU87QXAsnaGleYaAjAXSlj.jpg', 20),
(4322, 'William Hurt', 'William Hurt fue un actor de teatro, cine y televisión estadounidense, formado en la Juilliard School, Manhattan, Nueva York, EE. UU. Por su papel principal en el largometraje \"El beso de la mujer araña\", recibió un premio de la Academia en 1986, seguido de 3 nominaciones más para papeles en las películas \"Hijos de un Dios menor\", \"Broadcast News\" y \"A Historia de la violencia \".', '1950-03-20', 'Washington, District of Columbia, USA', '2022-03-13', 2, 'nm0000458', '227', '/j3mjmuHLBW4XQSw53C8Sh0Lh3ZQ.jpg', 27),
