(4324, 'Linda Cardellini', 'Linda Edna Cardellini (nacida el 25 de junio de 1975) es una actriz de cine y televisión estadounidense. Es más conocida por sus papeles como estudiante de secundaria Lindsay Weir en Freaks and Geeks, como Velma Dinkley en las películas de Scooby-Doo y como Samantha Taggart en Urgencias (ER).', '1975-06-25', 'Redwood City, California, USA', NULL, 1, 'nm0004802', '1817', '/bcycvynDprC1rrhBNrnBjn5uOUd.jpg', 37),
(4325, 'Frank Grillo', 'Frank Anthony Grillo (8 de junio de 1965) es un actor y modelo estadounidense conocido por sus papeles en la saga de películas de La Purga (The Purge: Anarchy y The Purge: Election Year). En el Universo Cinematográfico de Marvel como Brock Rumlow y Frank Campana en Warrior. Interpretó el papel de Nick Savrinn en la primera temporada de Prison Break.', '1965-06-08', 'New York City, New York, USA', NULL, 2, 'nm0342029', '81685', '/br2nPzelch2Tb3pZHnYAbXng7cz.jpg', 28),
