(4329, 'Jacob Batalon', 'Jacob Batalon (9 de octubre de 1996)1​ es un actor estadounidense. Hizo su debut como actor en 2016 en la película North Woods como Cooper; en 2017 forma parte del elenco principal de la película Spider-Man: Homecoming, en el papel de Ned Leeds.\n\nEs conocido por interpretar a Ned Leeds en las películas del Universo cinematográfico de Marvel Spider-Man: Homecoming (2017), Avengers: Infinity War (2018), Avengers: Endgame (2019) y Spider-Man: Far From Home (2019).', '1996-06-06', 'Honolulu, Hawaii, USA', NULL, 2, 'nm8188622', '1649152', '/53YhaL4xw4Sb1ssoHkeSSBaO29c.jpg', 26),
(4330, 'Robert Redford', 'Charles Robert Redford Jr. (nacido el 18 de agosto de 1936), más conocido como Robert Redford, es un actor, director de cine, productor, empresario, modelo, ambientalista, filántropo y fundador del Festival de Cine de Sundance. Ha recibido dos premios Oscar: uno en 1981 por dirigir Ordinary People y otro por Lifetime Achievement en 2002. Sus películas populares incluyen Butch Cassidy and the Sundance Kid (1969), Jeremiah Johnson (1972), The Candidate (1972), The Sting (1973), The Way We Were (1973), The Great Gatsby (1974), Three Days of the Condor (1975), All the President\'s Men (1976), The Natural (1984), Out of Africa (1985) y Zapatillas (1992). Como cineasta, sus películas notables incluyen Ordinary People (1980), A River Runs Through It (1992), Quiz Show (1994), The Horse Whisperer (1998) y The Legend of Bagger Vance (2000).\n\nDescripción arriba del artículo de Wikipedia Robert Redford, con licencia CC-BY-SA, lista completa de colaboradores en Wikipedia.', '1936-08-18', 'Santa Monica, California, USA', NULL, 2, 'nm0000602', '4135', '/rra8c7kXwiOxwFdM3mJ83VPgFBT.jpg', 27),
(4331, 'Josh Brolin', 'Josh James Brolin (12 de febrero de 1968) es un actor de cine y televisión estadounidense.  Su primer papel fue en la película Los Goonies en 1985. Desde entonces ha aparecido en varias películas y es conocido por papeles como Llewellyn Moss en No Country for Old Men, el Agente K joven en Hombres de negro III, Thanos en Avengers: Age of Ultron (Cameo), Avengers: Infinity War, Avengers: Endgame, Cable en Deadpool 2, el presidente George W. Bush en W y Dan White en Milk, por la cual recibió nominaciones al Óscar y SAG como mejor actor de reparto. Además, ha tenido papeles en películas como El hombre sin sombra, In the Valley of Elah, American Gangster, True Grit, Sin City: A Dame to Kill For y Hail, Caesar!. Es hijo del actor James Brolin.', '1968-02-12', 'Santa Monica, Los Angeles, California, USA', NULL, 2, 'nm0000982', '16851', '/sX2etBbIkxRaCsATyw5ZpOVMPTD.jpg', 33),
