(4341, 'Yvette Nicole Brown', 'Yvette Nicole Brown (12 de agosto de 1971) es una actriz estadounidense. Se le conoce sobre todo por tener uno de los papeles principales en la serie Community, aunque ha aparecido en numerosas ocasiones en anuncios y otros programas de televisión como Malcolm in the middle y That\'s So Raven. Tuvo un papel recurrente como Helen Ophelia Dubois en la serie de Nickelodeon Drake & Josh y realizó una breve aparición en la película La isla como una enfermera. También ha actuado en anuncios para Hamburger Helper, Big Lots, Pine-Sol, Home Depot, Aquapod, Shout, Fiber One Yoplait Yogour, DiGiorno Pizza, Dairy Queen y en algunos spots de la empresa Time Warner, además de tener una aparición en el programa Game Shakers como conductora.', '1971-08-12', 'East Cleveland, Ohio, USA', NULL, 1, 'nm1304328', '111513', '/tKCNqEQPynScG384Oj80vL6aDQQ.jpg', 7),
