(4375, 'James Spader', 'James Todd Spader (7 de febrero de 1960) es un actor estadounidense.\n\nSus papeles son reconocidos por los particulares toques excéntricos y dramáticos en sus películas, tales como Pretty in Pink, Sex, Lies, and Videotape, Crash, Stargate, Wolf o Secretary. Sus papeles más famosos en la televisión son del abogado Alan Shore en la serie The Practice, su spin-off Boston Legal, por el que ganó tres premios Emmy Awards y su más reciente papel, Raymond Reddington en la serie The Blacklist, donde se aprecia la calidad de actor y la voz y captura de movimiento del robot Ultron en la película de Marvel Studios, Avengers: Age of Ultron.', '1960-02-07', 'Boston, Massachusetts, USA', NULL, 2, 'nm0000652', '13548', '/uET0mbf2bMkUXbRb1Oxi8Qjqcw3.jpg', 34),
(4376, 'Aaron Taylor-Johnson', 'Aaron Johnson está encaminado a convertirse en uno de los actores más buscados de su generación. Johnson es ya una estrella establecida en el Reino Unido, gracias al lanzamiento de la exitosa película de Paramount Pictures MI GATO ANGUS, EL PRIMER MORREO Y EL PLASTA DE MI PADRE. En vista de sus próximos proyectos KICK ASS y EL MEJOR no cabe duda de que va a dar mucho que hablar en Hollywood en los próximos meses. Este verano fue incluido en el artículo \"Estrellas del mañana\" de la revista Screen International, que presenta a los actores más prometedores que están a punto de saltar a la fama.\n\nJohnson está rodando KICK ASS, con un papel protagonista frente a Nicholas Cage y Christopher Mintz-Plasse. La película es una adaptación de Matthew Vaughn del cómic de Mark Millar sobre un estudiante de secundaria al que da vida Johnson.\n\nJohnson participó recientemente en la comedia de Paramount Pictures sobre la adolescencia y hacerse mayor, MI GATO ANGUS, EL PRIMER MORREO Y EL PLASTA DE MI PADRE. Johnson daba vida a ', '1990-06-13', 'High Wycombe, Buckinghamshire, England, UK', NULL, 2, 'nm1093951', '27428', '/vkph4FcqFrOnVbrIQD7MbJXz4Uf.jpg', 17),
