(4420, 'Peter Dinklage', 'Actor de cine, televisión y teatro estadounidense. Aunque su papel más conocido hasta la fecha es el de Tyrion Lannister en la serie Juego de tronos (HBO), el cual le ha valido dos Emmy y un Globo de Oro, Dinklage ha participado en proyectos como la independiente The Station Agent (2003), Elf (2003), Find Me Guilty (2006), Underdog (2007), Death at a Funeral (2007) y su remake de 2010 o Las crónicas de Narnia: el príncipe Caspian (2008). El actor está casado con Erica Schmidt, con la que es padre de una niña.\n\nEl papel que definitivamente lanzó la carrera de Dinklage fue en la galardonada The Station Agent (2003), donde hizo el papel del protagonista.5​ Por dicho papel recibió nominaciones como Mejor actor en los Independent Spirit Awards y Screen Actors Guild Awards. Ese mismo año, participó en Tiptoes, estrenada directamente en DVD, junto a Gary Oldman. Años antes, había destacado en su rol debut en Living in Oblivion (1995) donde hace el papel de Tito, un desganado actor de cine independiente que cuestiona', '1969-06-11', 'Morristown, New Jersey, USA', NULL, 2, 'nm0227759', '22970', '/lRsRgnksAhBRXwAB68MFjmTtLrk.jpg', 16),
