(4437, 'Nick Stahl', 'Después de que su madre lo llevase a una obra de teatro para niños cuando sólo tenía cuatro años, tuvo claro que su futuro era ser actor. Su carrera se inició con diferentes anuncios y obras de teatro amateur, a la que siguieron dos teleseries que fueron estrenadas a principios de los años 90.\n\nSu despegue pudo haber llegado en 1993, cuando Mel Gibson le eligió como protagonista de su primera película como director, El hombre sin rostro, en la que realizó una notable y sólida actuación como el incomprendido y rebelde Charles E. \'Chuck\' Norstadt; pero sus siguientes trabajos tuvieron una repercusión mucho menor, lo que le hizo desaparecer del primer plano.\n\nTodo cambió en 1998 cuando consiguió dos papeles importantes en Comportamiento perturbado y La delgada línea roja, que consiguieron un cierto éxito comercial y volvieron a ponerle en primera línea, confirmada ahora por sus trabajos en En la habitación (In the bedroom) y su elección para ser uno de los protagonistas de Terminator 3.\n\nEn el 2003 formó parte d', '1979-12-05', 'Harlingen, Texas, USA', NULL, 2, 'nm0001763', '6408', '/hV1Fs7LcYWBQ90hWYA3DrCh0rPV.jpg', 15),
