(4577, 'Alicia Borrachero', 'Ha trabajado en el teatro en obras como Mucho ruido y pocas nueces y Cambio de marea, dirigidas por Juan Carlos Corazza.\n\nHa participado en series de Antena 3 como Hermanos de leche y Farmacia de guardia, o de Telecinco como Médico de familia, Un lugar en el mundo, 7 vidas, Periodistas y Hospital Central. En estas dos últimas, como protagonista, interpretando a los personajes que más éxito y popularidad le han dado, la periodista Ana Ruiz y la doctora Cruz Gándara, respectivamente.1 2\n\nTambién ha participado en el rodaje de ocho largometrajes: Don Quixote, dirigida por Peter Yates, Things I forgot to remember de Enrique Oliver, La fabulosa historia de Diego Marín, del director Fidel Cordero, Muerte en Granada, de Marcos Zurinaga, Sangre ciega de Miguel Albaladejo, The Killer Tongue, de Alberto Sciamma, Tres palabras del director Antonio Giménez-Rico y Shooting Elizabeth dirigida por Baz Taylor.', '1968-02-14', '  Madrid, Spain', NULL, 1, 'nm0097304', '25132', '/44E8TT0f10IQ9HwQfKYrA79857N.jpg', 3),
