(4632, 'Common', 'Lonnie Rashid Lynn, Jr. ( Chicago, Illinois, Estados Unidos, 13 de marzo de 1972) más conocido por Common o inicialmente como Common Sense, es un rapero y actor estadounidense.\n\nSu álbum debut en un sello mayor, Like Water for Chocolate, fue aclamado por los críticos y tuvo éxito comercial, mientras que su último álbum, Be, en el que Kanye West produce nueve temas, vendió 800.000 copias y fue candidato a un Grammy como Mejor Álbum de Rap. También es conocido por su papel de Elam Ferguson en la serie original de AMC: Hell on Wheels.\n\nEn el 2014, fue ganador, junto a John Legend, del Oscar a la Mejor Canción Original, por la canción «Glory». En el 2017, participó en la película: John Wick, Pacto de Sangre. Junto a Keanu Reeves (John Wick). Como némesis de John Wick, y guardaespaldas personal de uno de los objetivos de Wick en Roma.\n\nDescripción anterior del artículo de Wikipedia Common, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1972-03-13', 'Chicago, Illinois, USA', NULL, 2, 'nm0996669', '4238', '/dHOcvZJmHz50gk78Eta7PfoZQLH.jpg', 11),
