(4668, 'J.K. Simmons', 'Jonathan Kimble Simmons (9 de enero de 1955), más conocido como J. K. Simmons, es un actor estadounidense ganador del Óscar, Globo de Oro, BAFTA, Premio del Sindicato de Actores, entre otros premios.  Es conocido por su papel del neonazi Vernon Schillinger en la serie Oz, de HBO, por su papel como J, Jonah Jameson en las películas de Spider-Man, como también sus papeles en dos películas de los hermanos Coen, The Ladykillers y Burn After Reading. Ganó el Óscar a Mejor actor de Reparto por su participación como Terence Fletcher en la película Whiplash, de 2014.', '1955-01-09', 'Detroit, Michigan, USA', NULL, 2, 'nm0799777', '18999', '/7kIiPojgSVNRXb5z0hiijcD5LJ6.jpg', 30),
