(4671, 'Matt Smith', 'Matthew Robert «Matt» Smith es un actor de televisión británico, más conocido por su papel como la Undécima encarnación del Doctor en la serie de televisión británica Doctor Who y a Philip Mountbatten, Duque de Edimburgo, en la serie Crown.\n\nAunque inicialmente aspiró a ser un jugador profesional de fútbol, una lesión de espalda le obligó a retirarse de este deporte y después de unirse al National Youth Theatre y estudiar drama y escritura creativa en la Universidad de Anglia del Este, Smith se convirtió en un actor en 2003 y comenzó a actuar en películas como Murder in the Cathedral, Fresh Kills, The History Boys y On the Shore of the Wide World.\n\nAntes de su papel en Doctor Who, el primer papel de Smith en la televisión llegó en 2006 como Jim Taylor en la adaptación de la BBC de Phillip Pullman The Ruby in the Smoke, mientras que su primer gran papel reconocido en televisión fue como Danny en el 2007 en la serie de la BBC Party Animals.', '1982-10-28', 'Northampton, Northamptonshire, England, UK', NULL, 2, 'nm1741002', '136532', '/xr2GSp8Pm6fT5VGm0I9tsWVcZ8q.jpg', 24),
