(4785, 'Ian McKellen', 'Sir Ian Murray McKellen (25 de mayo de 1939) es un actor británico de cine y teatro. Es ganador de seis premios Laurence Olivier, un Globo de Oro, un Tony, un premio del Sindicato de Actores, un BIF, y dos premios de la Crítica Cinematográfica; y candidato al Óscar, al BAFTA y al Emmy. Su labor interpretativa ha abarcado desde Shakespeare y el teatro popular contemporáneo hasta la fantasía y la ciencia ficción. La BBC declaró que «sus interpretaciones le han asegurado un nicho en el canon del teatro inglés y dentro del gremio cinematográfico». Es uno de los actores teatrales más notables del Reino Unido y es considerado comúnmente como un icono de la cultura británica.\n\nComenzó su carrera profesional en 1961 como parte del selecto elenco del Belgrade Theatre. En 1969, fue invitado a formar parte de la compañía de teatro del Prospect Theatre y encabezó el elenco de las obras Ricardo II de Shakespeare y Eduardo II de Marlowe, consagrándose firmemente como uno de los actores clásicos más importantes del país. Du', '1939-05-25', 'Burnley, Lancashire, England, UK', NULL, 2, 'nm0005212', '1327', '/5cnnnpnJG6TiYUSS7qgJheUZgnv.jpg', 20),
(4786, 'Liv Tyler', '', '1977-07-01', 'New York City, New York, USA', NULL, 1, 'nm0000239', '882', '/hXFKqlOPVjtfBSPlmQwFnJvhvmU.jpg', 21),
(4787, 'Viggo Mortensen', 'Viggo Peter Mortensen (Nueva York, 20 de octubre de 1958) es un actor y director de cine estadounidense de ascendencia danesa. Por sus interpretaciones ha sido nominado en tres ocasiones a los Premios Óscar, en cuatro a los Premios Globo de Oro y una vez a los premios Goya. También ejerce como poeta, músico, fotógrafo y pintor.\n\nSu padre es danés y su madre estadounidense —su abuelo materno era de Nueva Escocia (Canadá) y su abuela materna de Nueva Inglaterra (Estados Unidos)—. La pareja se había conocido en Noruega y se casaron en los Países Bajos, en una ceremonia luterana. A pesar de que en Dinamarca su familia paterna era ganadera, su padre se dedicó a los negocios y, con la esperanza de hacer fortuna, en 1960 se trasladó con su familia (Viggo tiene dos hermanos más jóvenes) a América del Sur. La familia se desplazaría a Buenos Aires, en Argentina, pasando a menudo las vacaciones de vuelta en Dinamarca, en la granja familiar Mortensen. La familia se asentó finalmente en Argentina, en donde Mortensen vivió', '1958-10-20', 'Manhattan, New York City, New York, USA', NULL, 2, 'nm0001557', '110', '/vH5gVSpHAMhDaFWfh0Q7BG61O1y.jpg', 31),
(4788, 'Sean Bean', 'Bean se dio a conocer por su trabajo en el filme de Mike Figgis Lunes tormentoso (1988), donde destacaba en un reparto integrado por Sting y Melanie Griffith en los papeles principales. Otras interpretaciones destacables, en su mayor parte como villano, son la de un terrorista irlandés en la película de 1992 Juego de patriotas, el papel del agente del MI6 Alec Trevelyan en la película de la serie Bond, GoldenEye (1995), un codicioso hombre de negocios en National Treasure (2004), aunque no solo ha tenido actuaciones como malvado; es el protagonista de las diversas adaptaciones al cine de las novelas de Bernard Cornwell, interpretando a Richard Sharpe, un fusilero británico en las guerras napoleónicas. También ha participado en películas como Troya, donde interpretaba el papel de Odiseo, Rōnin, La isla (2005) Silent Hill (2006) o The Hitcher (2007) junto a Sophia Bush, y ha hecho de Zeus en Percy Jackson y el ladrón del rayo (2010). En 2006 prestó su voz para el videojuego de Bethesda Softworks, The Elder Scro', '1959-04-17', 'Sheffield, South Yorkshire, England, UK', NULL, 2, 'nm0000293', '48', '/kTjiABk3TJ3yI0Cto5RsvyT6V3o.jpg', 33),
