(4792, 'Orlando Bloom', 'Orlando Jonathan Blanchard Bloom (13 de enero de 1977), conocido habitualmente como Orlando Bloom, es un actor británico. Su salto a la fama se produjo con dos papeles protagonistas en grandes producciones: en 2001 el del príncipe elfo Legolas en El Señor de los Anillos: la Comunidad del Anillo, primera película de la trilogía basada en la novela de J. R. R. Tolkien;​ y en 2003 el del herrero Will Turner en Pirates of the Caribbean: The Curse of the Black Pearl.\n\nTras los éxitos mencionados se estableció en Hollywood, donde ha protagonizado varias películas como Elizabethtown y Kingdom of Heaven. Sus trabajos más recientes incluyen la película coral New York, I Love You y sus papeles en Sympathy for Delicious y Main Street. Bloom hizo su debut teatral en el escenario del Duke of York, con un papel en la obra In Celebration, que se representó hasta 2007. El 12 de octubre de 2009, Bloom fue nombrado Embajador de buena voluntad de Unicef.', '1977-01-13', 'Canterbury, Kent, England, UK', NULL, 2, 'nm0089217', '114', '/w3HyVAbiVgM3Q1SIkl3GFr17D5w.jpg', 19),
