(4866, 'Peter Jackson', 'Peter Robert Jackson (Pukerua Bay, Porirua; 31 de octubre de 1961) es un director, guionista y productor de cine neozelandés, conocido especialmente por dirigir, producir y coescribir la trilogía cinematográfica de El Señor de los Anillos: La Comunidad del Anillo (2001), Las dos torres (2002) y El retorno del Rey (2003); así como su precuela, la trilogía de El hobbit: Un viaje inesperado (2012), La desolación de Smaug (2013) y La batalla de los Cinco Ejércitos (2014).  Es ganador de tres premios Óscar, un Globo de Oro y tres BAFTA, entre otros galardones. En 2013 fue nombrado miembro de la prestigiosa Orden de Nueva Zelanda.', '1961-10-31', 'Pukerua Bay, North Island, New Zealand', NULL, 2, 'nm0001392', '108', '/4hh7hips4xc6kgpNDQKQH3goRvJ.jpg', 12),
