(4903, 'Miranda Otto', 'Miranda Lin Otto (16 de diciembre de 1967) es una actriz australiana reconocida mundialmente por el papel de la doncella guerrera Éowyn en la trilogía de El Señor de los Anillos, dirigida por Peter Jackson y por su papel como Zelda Spellman en la serie Chilling Adventures of Sabrina (Netflix). Siendo de una familia de actores, Otto comenzó a actuar a la edad de 19 años, y desde entonces ha aparecido en una amplia variedad de películas de bajo presupuesto, así como en proyectos de grandes estudios.\n\nSu primera actuación notable la representó en Emma\'s War (1986), en la que interpretó a una adolescente que se muda a Australia durante la Segunda Guerra Mundial. Tras una década de papeles aclamados por la crítica australiana, atrajo la atención de Hollywood al aparecer en dos papeles secundarios, en La delgada línea roja (1998) y What Lies Beneath (2000). No obstante, su interpretación más famosa la llevó a cabo en 2002, cuando se integró en el elenco de las películas de El Señor de los Anillos.\n\nEn 2008, protago', '1967-12-16', 'Brisbane, Queensland, Australia', NULL, 1, 'nm0001584', '502', '/szME1IBVTLgiKrO5D5wvOGnvUDW.jpg', 21),
(4904, 'Brad Dourif', 'Bradford Dourif es un actor de cine y televisión estadounidense candidato a un premio Óscar y a un premio Emmy. Probablemente es más conocido por su papel en One Flew Over the Cuckoo\'s Nest, que le valió la citada candidatura al Óscar como mejor actor de reparto. También ha puesto su voz al personaje de Chucky en las películas del Muñeco diabólico (Child´s Play), ha interpretado a Lon Suder en Star Trek: Voyager, al doctor Gediman en Alien: Resurrección y a Gríma Lengua de Serpiente en la adaptación cinematográfica de El Señor de los Anillos. También ha ganado un premio Saturn por El Exorcista III y ha sido candidato a un premio Emmy por su papel en Deadwood. Como secundario también ha participado en la adaptación a la gran pantalla de Dune (David Lynch, 1984), interpretando al malvado Mentat del barón Vladimir Harkonnen, Piter de Vries.', '1950-03-18', 'Huntington, West Virginia, USA', NULL, 2, 'nm0000374', '1370', '/z2LYR7Ickql7g5hnWJSIAWMPD4o.jpg', 19),
(4905, 'John Noble', 'John Noble (nacido el 20 de agosto de 1948, altura 5\' 11¾\" (1,82 m)) es un actor de cine y televisión australiano, y director de teatro de más de 80 obras.  Nació en Port Pirie, Australia del Sur, Australia, y actualmente está protagonizando como científico Walter Bishop en la serie de televisión Fringe de J. J. Abrams.\n\nHizo apariciones ocasionales en la serie de televisión Todos los Santos.  Es conocido internacionalmente por su actuación como Denethor en la trilogía El Señor de los Anillos.  Su última película es Una noche con el rey.  Interpretó al cónsul ruso Anatoly Markov en la sexta temporada de la serie televisiva estadounidense 24.  En 2011 será protagonista como agente inmobiliario en el videojuego de Rockstar L.A. Noire.', '1948-08-20', 'Port Pirie - South Australia - Australia', NULL, 2, 'nm0633604', '1381', '/hYBf3SVAySRrVsjCjhdypqedqk0.jpg', 13),
