(4940, 'Vince Vaughn', 'Vincent Anthony Vaughn (Mineápolis, Minnesota; 28 de marzo de 1970), conocido profesionalmente como Vince Vaughn, es un actor de cine estadounidense. Comenzó a actuar a finales de los años 1980 en breves papeles en televisión antes de conseguir mayor reconocimiento con su participación en películas como Swingers (1996) y The Lost World: Jurassic Park (1997). Desde entonces ha trabajado en varias películas, la mayoría comedias, como Old School, Starsky & Hutch, Dodgeball: A True Underdog Story, Couples Retreat, Sr. y Sra. Smith, Wedding Crashers y The Break-Up, entre otras.\n\nComenzó su carrera en el espectáculo como modelo, apareciendo en anuncios publicitarios de Chevrolet y posteriormente apareciendo en algunos episodios de series televisivas como Playas de China o Hércules. En 1993 con su papel en Rudy, reto a la gloria obtuvo una mayor presencia ante las cámaras y se hizo amigo del actor Jon Favreau.\n\nSu revelación llegó con Swingers, dirigida por Doug Liman que llamó la atención del mismísimo Steven Spiel', '1970-03-28', 'Minneapolis, Minnesota, USA', NULL, 2, 'nm0000681', '4937', '/w93uYyaTUjddFo9uNKsU9nf7HOH.jpg', 24),
