(4973, 'Félix Cubero', 'Félix Jesús Cubero León es un actor, guionista y director español español nacido en Arnedo (La Rioja) el 18 de junio de 1961.  Licenciado en arte dramático por la RESAD de Madrid, tiene una extensa trayectoria profesional en todos los ámbitos interpretativos: teatro, cine, televisión, etc. Ha trabajado como actor de reparto en el cine a las órdenes de los directores ganadores del Óscar Fernando Trueba, Juan José Campanella y Alejandro González Iñárritu. Y también ha trabajado bajo la dirección de ganadores del Premio Goya como Gonzalo Suárez, Icíar Bollaín, David Trueba, Daniel Monzón, Imanol Uribe, Luis García Berlanga o Fernando Trueba. Ha trabajado en más de 30 obras teatrales con prestigiosos directores españoles, un ruso y un argentino. Ha intervenido como actor episódico en más de 55 series de televisión para todas las cadenas españolas, y una vez también para la británica Sky TV. Ha escrito teatro, cortometrajes y algún sketch profesional de televisión (y numerosas animaciones publicitarias.) Entrevist', '1961-06-18', 'La Rioja, Spain', NULL, 2, 'nm0190908', '116082', '/c7HXwjQE4C5L91xpEcP8U3YAzZl.jpg', 2),
(4974, 'Marta Etura', 'Marta Etura Palenzuela (San Sebastián, Guipúzcoa, 28 de octubre de 1978) es una actriz española de cine, teatro y televisión ganadora de un Premio Goya a la mejor actriz de reparto en 2010 por su trabajo en la película Celda 211. [Wikipedia]', '1978-07-05', 'Donostia-San Sebastián, Guipúzcoa, País Vasco, Spain', NULL, 1, 'nm1011070', '34019', '/nzi1LHG2KelUsVJNRkFRewGfZ6y.jpg', 8),
