(4978, 'Manolo Solo', 'Manuel Fernández Serrano, conocido artísticamente como Manolo Solo es un actor español, ganador de un Goya y dos premios de la Unión de Actores al mejor actor de reparto de cine. Asimismo, ha actuado en series de televisión y en obras de teatro. También ha trabajado como director y actor de doblaje.2​3​', '1964-01-01', 'Algeciras, Cadiz, Spain', NULL, 2, 'nm1254805', '592709', '/qiUCKEbGarxLH5yQSkawaOJKNwP.jpg', 2),
