(4982, 'David Selvas', 'David Selvas Jansana (Barcelona, (España), 1971), es un director y actor de teatro, cine y televisión. En 2005 se inició como director con El virus, de Richard Strand y Who is p?, un ensayo abierto sobre Pier Paolo Pasolini que se presentó en Espai Lliure de Barcelona en 2006. Desde entonces ha estrenado como director True West, de Sam Shepard; La gavina, de Anton Chéjov; Hedda Gabler, de Henrik Ibsen; L\'habitació blava, de David Hare, y Oleanna, de David Mammet. Mientras tanto ha continuado combinando la tarea de dirección con una intensa actividad como intérprete en el teatro, el cine y la televisión.', '1971-12-21', 'Barcelona, Cataluña, España', NULL, 2, 'nm0783591', '942100', '/sD2k0H5FLxk26VUHy62qLcJI18w.jpg', 6),
