(5039, 'Penélope Cruz', 'Penélope Cruz Sánchez (28 de abril de 1974) es una actriz y modelo española ganadora de un Óscar. Su filmografía incluye múltiples películas en lengua española y otros idiomas: inglés, italiano y francés. Varias de estas producciones han alcanzado gran éxito en Europa y América, y han proporcionado a la actriz otros premios de carácter nacional e internacional: un Premio Óscar, tres Premios Goya, el Premio BAFTA y el Premio David de Donatello.', '1974-04-28', 'Madrid, Spain', NULL, 1, 'nm0004851', '955', '/tU2ATiHHBAKn4SHqKOagYqdpHiy.jpg', 34),
