(5041, 'Stefania Sandrelli', 'Stefania Sandrelli es una actriz italiana. Gran intérprete de comedia, se dio a conocer en la película Divorcio a la italiana (1961) de Pietro Germi, en la que, con sólo quince años, compartió protagonismo con Marcello Mastroianni. A partir de entonces su popularidad no hizo sino crecer, especialmente por su participación en las llamadas comedias a la italiana, aunque también ha interpretado papeles dramáticos. Ha trabajado con los más importantes directores italianos de su momento, como Germi, Bernardo Bertolucci, Ettore Scola, Mario Monicelli, Luciano Salce, Gabriele Muccino o Tinto Brass y también ha participado en producciones españolas, dirigida por Bigas Luna. Entre otros importantes premios, recibió en 2005 el León de Oro a toda su carrera en el LXII Festival de Venecia.', '1946-06-05', 'Viareggio, Toscana, Italy', NULL, 1, 'nm0762248', '34027', '/aPmAstwHeEyN17UDKcSJf4OGBEQ.jpg', 11),
