(5060, 'Marilyn Monroe', 'Norma Jeane Baker (nacida como Norma Jeane Mortenson; Los Ángeles, California, 1 de junio de 1926-ib., 4 de agosto de 1962), más conocida como Marilyn Monroe, fue una actriz de cine, modelo y cantante estadounidense, una de las más populares del siglo XX, considerada como un icono pop.\n\nEn 1945, empezó a trabajar como modelo​ y años más tarde inició su carrera en Hollywood con el nombre artístico de Marilyn Monroe. Desde finales de la década de 1940, apareció en muchos pequeños papeles, gracias a un contrato con la Twentieth Century Fox; durante esa etapa, destacan sus participaciones en La jungla de asfalto (The Asphalt Jungle; 1950), y Eva al desnudo (All About Eve; 1950). Su primer papel protagonista lo obtuvo en la cinta de 1952 Don\'t Bother to Knock. Alcanzó su período de mayor popularidad a partir del año siguiente, cuando protagonizó películas como Los caballeros las prefieren rubias (Gentlemen Prefer Blondes; 1953); Cómo casarse con un millonario (How to Marry a Millionaire; 1953) y The Seven Year Itc', '1926-06-01', 'Los Angeles, California, USA', '1962-08-04', 1, 'nm0000054', '3149', '/vcp6rHL2sZWdlJQDEWsEe0jAAe1.jpg', 8),
