(5135, 'Willem Dafoe', 'William James «Willem» Dafoe (22 de julio de 1955) es un actor estadounidense de cine y teatro, coproductor y miembro fundador de la compañía teatral The Wooster Group.\n\nNominado al premio Oscar una vez como mejor actor y en tres ocasiones como mejor actor de reparto. Ha tenido papeles en películas como To Live and Die in L.A., Platoon, Nacido el 4 de julio, La última tentación de Cristo, Mississippi Burning, Wild at Heart, The Boondock Saints, El paciente inglés, Inside Man, The Life Aquatic with Steve Zissou, Spider-Man, El aviador, American Psycho, Anticristo y le prestó su voz a personajes de Fantastic Mr. Fox, Buscando a Nemo y a Nathan Dawkins en el videojuego Beyond: Two Souls; en este último también se utilizó su rostro para la caracterización del personaje.', '1955-07-22', 'Appleton, Wisconsin, USA', NULL, 2, 'nm0000353', '5293', '/ui8e4sgZAwMPi3hzEO53jyBJF9B.jpg', 33),
