(5232, 'Carl Weathers', 'Carl Weathers (14 de enero de 1948) es un actor estadounidense y exjugador de fútbol americano en Estados Unidos y Canadá.​ Se hizo conocido por haber interpretado a Apollo Creed en la saga de películas Rocky, y por su interpretación de Dillon en la primera película de Depredador.', '1948-01-14', 'New Orleans, Louisiana, USA', NULL, 2, 'nm0001835', '1101', '/9Tot1ywxTQA3vFCcAjyK6h9Dao3.jpg', 11),
(5233, 'Elpidia Carrillo', 'Elpidia Carrillo (Parácuaro, 16 de agosto de 1961) es una actriz y directora mexicana, quien es considerada la primera actriz de ascendencia indígena en conseguir reconocimiento en el circuito del cine internacional en Hollywood. Su carrera incluye papeles en producciones latinoamericanas, así como en un gran número de filmes y series de televisión estadounidenses y británicos. Es más conocida en Estados Unidos por su papel antagónico femeníno en la película de acción icónica Predator, y sus protagónicos en Bread and Roses y Nine Lives. Fue nominada para el Independent Spirit Award for Best Female Lead (mejor actuación femenina) por su desempeño en Salvador, y también destacó por su papel de Tecuichpo en la película independiente La otra conquista.', '1961-04-16', 'Paracuaro, Michoacan, Mexico', NULL, 1, 'nm0001990', '1102', '/zYVzGHtODIUs83uOlGnNtBMwLwo.jpg', 15),
