(5312, 'Aaron Eckhart', 'Con numerosas películas a sus espaldas, Aaron Eckhart goza de muy buena posición dentro de la industria. Ha obtenido reconocimiento por sus papeles, entre otros el de la pareja de Julia Roberts en Erin Brockovich, dirigida por Steven Soderbergh. Se dio a conocer por su retrato de un hombre que busca venganza tras un desengaño amoroso en la polémica película de Neil LaBute En compañía de hombres, una de las películas independientes más taquilleras de 1997.\n\nDio vida a Harvey Dent/Dos Caras en la película de Warner Bros El caballero oscuro, dirigida por Christopher Nolan. También ha trabajado en Gracias por fumar, el debut de Jason Reitman en la dirección, producida por Fox Searchlight y por la que fue nominado a un Globo de Oro y a un Independent Spirit Award; y junto a Catherine Zeta-Jones en Sin reservas, el remake de Scott Hicks de la película alemana de 2001 Deliciosa Martha, estrenada por Warner Bros. en 2007.\n\nEntre sus trabajos más recientes destacan las películas independientes Mi vida es una ruina, ju', '1968-03-12', 'Cupertino, California, USA', NULL, 2, 'nm0001173', '6383', '/5EFQvRHlpP1Iaw2e6vjOaBny6DV.jpg', 17),
