(5370, 'Tom Sizemore', 'Thomas Edward \"Tom\" Sizemore, Jr. (29 de septiembre de 1961), es un actor estadounidense. Es conocido por sus papeles en películas como Saving Private Ryan, Black Hawk Down, Heat, Días extraños y Pearl Harbor. También ha interpretado roles secundarios en True Romance, Natural Born Killers, The Relic, Devil in a Blue Dress y Wyatt Earp.', '1961-11-29', 'Detroit, Michigan, USA', NULL, 2, 'nm0001744', '3197', '/soINOuacuiThRb2LyPD4tTWve7C.jpg', 15),
