(5375, 'Jessica Chastain', 'Oriunda de Northern California, Jessica Chastain se crio en una familia numerosa de cinco hermanos. Creció soñando con triunfar en el mundo del cine, y para cumplir sus objetivos estudió arte dramático en el prestigioso Julliard School neoyorquino. Mientras, daba sus primeros pasos en el oficio encima de un escenario en espera de una oportunidad en el planeta audiovisual. Llegó al fin en 2004, año en que logró un breve papel en un episodio de la serie Urgencias. Su graduación como actriz televisiva llegó el año siguiente, cuando se integró en el reparto de la serie Ley y orden: Juicio con jurado. Sus méritos en la pequeña pantalla no pasaron desapercibidos y en 2011 entró en el cine por la puerta grande con La deuda, su debut en la gran pantalla, y El árbol de la vida. Continúa su imparable escalada a la élite gracias a Criadas y señoras, por la que consigue una candidatura al Oscar como mejor secundaria. Le siguen Coriolanus, La noche más oscura (por la que vuelve a lograr una notable cosecha de premios y la', '1977-03-24', 'Southern California, California, USA', NULL, 1, 'nm1567113', '83002', '/mR1ELpP0T2Q1ZRSaADPgtrbPGla.jpg', 20),
(5376, 'Jeff Daniels', '', '1955-02-19', 'Athens, Georgia, USA', NULL, 2, 'nm0001099', '8447', '/r0mkZJZnTSJO3HJRsMW5HtszxE8.jpg', 14),
(5377, 'Michael Peña', 'Peña nació y se crió en Chicago, a Nicolasa, una trabajadora social, y Eleuterio Peña, que trabajaba en una fábrica de botones. Sus padres eran originarios de México. Después de graduarse de la escuela secundaria, acudió a una convocatoria de casting abierto para la película de Peter Bogdanovich Rebelión en las aulas 2 (1996), y para su sorpresa, venció a cientos de otros jóvenes por un papel. Después de mudarse a Los Ángeles, Peña rápidamente reservó una sucesión de roles en características como Star Maps, Mis queridos compatriotas (1996) (junto a Jack Lemmon y James Garner), La cucaracha (1998) (ganador del premio a la Mejor película en el Festival de cine de Austin) , Bellyfruit (1999) y Disney / Jerry Bruckheimer cuentan con 60 segundos (2000). Michael reside en Los Ángeles, donde toca el bajo con su banda, juega golf y cajas para relajarse.', '1976-01-13', 'Chicago, Illinois, USA ', NULL, 2, 'nm0671567', '454', '/tu5CtDtVP4oZBVQgi0s4vgZErIg.jpg', 21),
