(5381, 'Naomi Scott', 'Naomi Grace Scott (6 de mayo de 1993) es una actriz, modelo y cantante indo-británica. Interpretó el papel de Mohini Banjaree en la película original de Disney Channel, Lemonade Mouth.​  También ha aparecido en Life Bites, un programa de televisión británico. Tuvo un papel principal como Maddy Shannon en la serie de FOX, Terra Nova. En 2017, interpretó a la ranger rosa en la película, Power Rangers, revisión de la famosa serie de los años 90.​ En 2019, interpretó a la princesa Jasmin en la versión de Disney, Aladdín.', '1993-05-06', 'Hounslow, Greater London, England, UK', NULL, 1, 'nm4305463', '240724', '/nNqqgP2yF1jkLZq9ndYcXOzTD2G.jpg', 40),
