(5575, 'Judy Greer', 'Judy Greer (nacida el 20 de julio de 1975, altura, 5 \'8 \"(1,73 m)) es una actriz estadounidense conocida por interpretar una serie de personajes secundarios, como Kitty Sánchez en la serie de Fox / Netflix Arrested Development y Cheryl Tunt en la serie de comedia animada Archer. Greer ha tenido un papel secundario en varias películas de comedia romántica, como The Wedding Planner, 13 Going on 30, 27 Dresses y Love and Other Drugs. También tuvo un papel secundario en la película de 2011 The Descendants En 2011, Greer comenzó a presentar una serie en línea de videos de ejercicios llamados Renuentemente saludable.\n\nVida temprana\n\nGreer nació en Detroit, Michigan el 20 de julio de 1975 y creció en Redford Township y Livonia. Fue criada como católica. Greer asistió a Churchill High School y Bunny Sanfords Academy of Dance en Livonia. En 1997 se graduó de The Theatre School en DePaul University.\n\nVida personal\n\nGreer está casada con Dean E. Johnsen, productor ejecutivo de Real Time con Bill Maher.\n\nDescripción arri', '1975-07-20', 'Detroit, Michigan, USA', NULL, 1, 'nm0339460', '20750', '/pTLjIjh83R424RGxIfq4U0yx947.jpg', 22),
