(5599, 'John Lithgow', 'John Arthur Lithgow (Rochester, 9 de octubre de 1945) es un actor estadounidense conocido principalmente por su actuación como Dick Solomon en la serie de televisión de la cadena NBC 3rd Rock from the Sun. Ha actuado en teatro, cine y radio. Ha ganado múltiples premios Emmy y premios Tony, así como también dos nominaciones a los Premios Óscar. Ha grabado música para niños. Tiene un Master en Artes de la Universidad de Harvard. En enero de 2010 ganó un Globo de oro gracias a su personaje atormentado de Arthur Mitchell en la serie Dexter. (Wikipedia)', '1945-10-19', 'Rochester, New York, USA', NULL, 2, 'nm0001475', '12074', '/8Y1sjBdnVR483S8PrnAQzlESwhx.jpg', 11),
(5600, 'Brian Cox', 'Brian Denis Cox, CBE (Dundee, 1 de junio de 1946), es un actor escocés. Fue el primer actor en representar al personaje de Hannibal Lecter en cine, antes que Anthony Hopkins, en el film de suspenso Manhunter (1986).\n\nHa trabajado en películas como Troya, donde interpretó a Agamemnon, El caso Bourne, Rob Roy, Braveheart, Match Point y X-Men 2, en el rol de William Stryker (el creador de Wolverine). Debutó en el cine con Nicolás y Alejandra, en 1971. A principios de los años 1980 interpretó la primera versión del personaje de Hannibal Lecter. También trabajó con Daniel Day-Lewis en el filme The Boxer, de Jim Sheridan. Recibió el premio al mejor actor en el Festival de Cine de Sitges de 2008.', '1946-06-01', 'Dundee, Scotland, UK', NULL, 2, 'nm0004051', '1248', '/yvoAgJTOvuNSPSKegcIcD62ySY9.jpg', 15),
