(5629, 'Robert De Niro', 'Robert De Niro Jr. (Nueva York; 17 de agosto de 1943), más conocido como Robert De Niro, es un actor, director y productor de cine estadounidense.\n\nGanador de premios Óscar por su actuación en las películas Toro salvaje y El padrino II. Es ampliamente conocido por sus papeles de gánster y de personajes conflictivos y turbulentos, destacando sus múltiples colaboraciones con el director Martin Scorsese, y por sus primeros trabajos con el director Brian De Palma.\n\nDurante su carrera ha interpretado a personajes de toda clase de géneros, así como de terror, drama, e incluso de comedia. Sus interpretaciones más destacadas se encuentran en cintas como El Padrino II (1974), Taxi Driver (1976), The Deer Hunter (1978), Toro salvaje (1980), Érase una vez en América (1984), Goodfellas (1990), Despertares (1990), El cabo del miedo (1991), Casino (1995) y Los intocables de Eliot Ness (1987).', '1943-08-17', 'New York, New York', NULL, 2, 'nm0000134', '380', '/cT8htcckIuyI1Lqwt1CvD02ynTh.jpg', 38),
