(5638, 'Martin Scorsese', 'Martin Charles Scorsese (Queens, Nueva York, 17 de noviembre de 1942), conocido como Martin Scorsese, es un director, guionista, actor y productor estadounidense de cine, ganador de un Óscar, tres Globos de Oro, dos premios BAFTA, un Primetime Emmy, y un premio del gremio de directores de Estados Unidos, además de ser uno de los fundadores de World Cinema Foundation. Fue condecorado con la Legión de Honor francesa en 1987.\n\nLas obras de Scorsese abordan principalmente los temas de la vida italo-estadounidense. Le gusta mucho la música, mundo al que ha dedicado alguna de sus películas (No Direction Home sobre Bob Dylan , Shine a Light sobre los Rolling Stones y George Harrison: Living in the Material World acerca del ex miembro de The Beatles). Scorsese es ampliamente considerado como uno de los directores más influyentes de su generación.\n\nGanó un premio MFA por su obra como director de cine otorgado por la prestigiosa Escuela de Cine de la Universidad de Nueva York. Tras múltiples nominaciones a lo largo de ', '1942-11-17', 'Queens, New York, USA', NULL, 2, 'nm0000217', '1032', '/8KlPVWc91TruU0M9urCGqbf1ils.jpg', 14),
