(5666, 'Kevin Spacey', 'Kevin Spacey Fowler, KBE (South Orange, 26 de julio de 1959), es un actor, director, productor y comediante estadounidense, ganador de dos premios Óscar.\n\nNació en South Orange, en el estado de Nueva Jersey, con el nombre Kevin Spacey Fowler. Es el hermano menor de los tres hijos de un matrimonio formado por un padre redactor técnico, y una madre secretaria. El trabajo del padre motivó que la familia se mudara en varias ocasiones, viviendo en distintas localidades del país. Finalmente se establecieron en California, donde el pequeño Kevin puso de manifiesto su carácter revoltoso. Sus padres le enviaron a un internado dirigido por militares, de donde fue expulsado a los pocos meses. Ingresó entonces en un colegio del Valle de San Fernando, cercano a Los Ángeles. Allí Spacey se encontró a gusto y comenzó a participar en el teatro amateur de la escuela.[cita requerida]\n\nFinalizada la escuela, y tras una breve estancia en un colegio de actuación de Los Ángeles, Spacey marchó a Nueva York y comenzó a estudiar inte', '1959-07-26', 'South Orange, New Jersey, USA', NULL, 2, 'nm0000228', '1979', '/dlVRkUYKyZdJ39AN55cY1LoyXAP.jpg', 13),
(5667, 'Lily James', '', '1989-04-05', 'Esher, Surrey, England, UK', NULL, 1, 'nm4141252', '1016168', '/sOyEG5H6MRSokyKO5qnNT3wIC2h.jpg', 47),
(5668, 'Jamie Foxx', 'Eric Marlon Bishop (nacido el 13 de diciembre de 1967), conocido profesionalmente como Jamie Foxx, es un actor, cantante, compositor, comediante y presentador de radio estadounidense. Como actor, su trabajo en la película Ray le valió el Premio de la Academia y el Premio BAFTA al Mejor Actor, así como el Premio Globo de Oro al Mejor Actor en un musical / comedia. También es un músico ganador del Premio Grammy, produciendo dos álbumes que han tenido una gran calificación en el Billboard 200: Unpredictable, que encabezó la lista, e Intuition.\n\nFoxx fue abandonado siete meses después del nacimiento, y posteriormente fue adoptado y criado en Terrell por los padres adoptivos de su madre, Estelle y Mark Talley. Foxx tuvo una estricta educación bautista y comenzó las clases de piano a la edad de cinco años por orden de su abuela. A menudo ha reconocido la influencia de su abuela en su vida como una de las principales razones de su éxito. Cuando descubrió que las comediantes solían ser llamadas primero para actuar, c', '1967-12-13', 'Terrell, Texas, USA', NULL, 2, 'nm0004937', '134', '/hPwCMEq6jLAidsXAX5BfoYgIfg2.jpg', 12),
(5669, 'Jon Bernthal', 'Jonathan Edward «Jon» Bernthal (20 de septiembre de 1976)​ es un actor estadounidense conocido por sus papeles como Shane Walsh en la serie de televisión The Walking Dead y como Frank Castle/Punisher en el Universo cinematográfico de Marvel. También apareció en varias series como Law & Order: Criminal Intent (2002), The Class (2006-2007) y The Pacific (2010) y en películas como El lobo de Wall Street (2013), Fury (2014), Sicario (2015), The Accountant (2016), Wind River (2017) y Baby Driver (2017). En 2013 interpretó al Detective Joe Teague en la serie Mob City (2013), también de Frank Darabont.', '1976-09-20', 'Washington, District of Columbia, USA', NULL, 2, 'nm1256532', '19498', '/pEDKAsy1zO9dgSeBjohqklOXRUQ.jpg', 31),
(5670, 'Flea', '', '1962-10-16', 'Melbourne, Victoria, Australia', NULL, 2, 'nm0281359', '1237', '/nGQE7xf4YJeqO0a4lpFebhwI7R9.jpg', 12),
(5671, 'Sky Ferreira', 'Sky Tonia Ferreira es una cantante, compositora, modelo y actriz estadounidense. En su adolescencia, Ferreira comenzó a cargar videos en Myspace de sí misma cantando canciones que había escrito, lo que llevó a su descubrimiento por los productores Bloodshy & Avant y un eventual contrato de grabación con Parlophone en 2009.  Altura 5 ft 7.5 in (1.71 m). Color de pelo morena. Color de ojos Miel.', '1992-07-08', 'Venice, California', NULL, 1, 'nm3650037', '223331', '/8bQmDJt0cRNDWA3x79cQUG9cXSC.jpg', 8),
