(5702, 'Walter Hill', 'Nació el 10 de enero de 1942 en Long Beach en el estado de California, ha dicho en varias entrevistas que de niño sufría de asma, razón por la cual tuvo muchos problemas para terminar la escuela, su abuelo era un perforador de petroleo, esto influiría para que Walter Hill más tarde trabajara en esta labor.\n\nVivió y curso estudios de Arte en Ciudad de México en la Universidad Mexico City College. Trabajó en perforaciones petroleras y en construcción. Hasta 1968 sólo hizo una incursión en el cine como ayudante de director en la película El caso Thomas Crown (version de 1968). También fue ayudante de director ese mismo año para la película Bullitt, y en Take the Money and Run (1969) estuvo a los servicios de nada más y nada menos que Woody Allen como su ayudante.\n\nDesde un principio Walter Hill mostró su inclinación por escribir guiones. Su primer guion fue el de un western, pero aquel guion nunca se llegó a adaptar a la pantalla grande. Luego escribió The Getaway y Hickey and Boggs; estos dos guiones fueron lle', '1942-01-10', 'Long Beach, California, USA', NULL, 2, 'nm0001353', '1723', '/3CiICrmhaYnirmOMHEaFXYTbsnT.jpg', 6),
