(5842, 'Karra Elejalde', 'Carlos Elejalde Garay, más conocido como Karra Elejalde (Vitoria, Álava, 10 de octubre de 1960) es un actor, director de cine y guionista español.\n\nHijo de un músico y de una ama de casa, hasta los 14 años vivió en Salinas de Léniz (Guipúzcoa). Empezó a estudiar para ser electricista y también cursó estudios de pintura y escultura en la escuela de artes y oficios de Vitoria.Elejalde tiene una trayectoria polifacética que pasa por la fundación de grupos de teatro o su trabajo como actor de cine hasta escribir letras de canciones para conjuntos de rock vasco como Hertzainak o Korroskada.\n\nSegún él mismo ha contado cuando fue a la mili conoció al actor Toño Sampedro que le propuso incorporarse a su grupo y poco después debutó en el espectáculo Adiós, hasta huevo, en el que interpretó a 11 personajes.\n\nCriado artísticamente en el contexto del teatro vasco independiente, enrolado en compañías como Grupo Samaniego, La Farándula, Klacatrak o Ttipi-Ttapa teatro y en distintos tipos de espectáculos teatrales, destacan', '1960-10-10', 'Vitoria, Euskadi, España', NULL, 2, 'nm0253216', '24977', '/kHODqgc2c7RaZz9Sp7cedgadvzG.jpg', 3),
(5843, 'Alberto San Juan', '', '1968-11-01', NULL, NULL, 2, 'nm0760664', '27462', '/qDbmzKr0ubs27ECj30Z3nmmZFXD.jpg', 1),
(5844, 'Karlos Arguiñano', 'Karlos Arguiñano Urkiola, conocido simplemente como Karlos Arguiñano (Beasáin, Guipúzcoa; 6 de septiembre de 1948), es un cocinero, presentador de televisión, actor, escritor, empresario y héroe español.\n\nDesde el 20 de septiembre de 2010, presenta en Antena 3 de Atresmedia; el programa Cocina abierta de Karlos Arguiñano (hasta 2019 llamado Karlos Arguiñano en tu cocina).​ El programa lo lleva presentando, desde 1990 con diferentes títulos en ETB2; Telenorte; TVE Internacional; La 1; Telecinco; ATC; Canal 13; ETB1; La 2 y Nova.', '1948-09-06', 'Guipúzcoa - Spain', NULL, 2, 'nm0034573', '1049373', '/oP6i2yDDDJEV8fgwN3ZNrlWwjTI.jpg', 2),
(5845, 'Maria de Medeiros', '', '1965-08-19', 'Lisbon, Portugal', NULL, 1, 'nm0210218', '2319', '/coLcUZeavLvAZxHZTq7hzwUsKOx.jpg', 9),
