(5859, 'Paula Soldevila', 'Paula Soldevila (Madrid, 1965) conoce desde niña la mágica trampa y el maravilloso cartón del escenario y la pantalla. Hija de la inolvidable actriz Laly Soldevila y del productor de cine Jaime Borrell, se acostumbró a curiosear en los rodajes, en los platós de televisión o entre las cajas a edad temprana.\n\nEl trabajo interpretativo no bastaba para saciar la curiosidad incurable de Soldevila, y a raíz de un encuentro con el reverenciado Juan Carlos Corazza en el año 2000, empezó a trazar en su Estudio para el Actor una ya intensa trayectoria como profesora, investigadora y directora escénica.', '1965-01-01', 'Madrid, Madrid, Spain', NULL, 1, 'nm0097343', '17082', '/6gJRS8toQA7dLKW5n1XG3kcPqlY.jpg', 3),
(5860, 'Sara Mora', 'Sara Mora Romeo, conocida artísticamente como Sara Mora, (Escatrón, 1953) es una actriz española.\n\nSiendo muy joven se trasladó a vivir a la ciudad de Zaragoza, donde se inicia como aficionada en el mundo del espectáculo. En 1973 se instala en Madrid, debutando sobre las tablas con la obra La Muerte de Danton, de Alberto González Vergel. En años sucesivos combina cine, teatro y televisión.\n\nEn la pequeña pantalla interviene en programas como Sumarísimo (1978) y Gol... y al mundial 82 (1981-1982).\n\nSu presencia en el cine, coincide en el tiempo con el auge del destape, género en el que trabaja en títulos como Las alegres vampiras de Vögel (1974), Compañero te doy (1978), La insólita y gloriosa hazaña del cipote de Archidona (1979), Los energéticos (1979), Barba Azul y sus mujeres (1980), La masajista vocacional (1981) y Al sur del edén.\n\nYa en la década de 1990, interviene en las series de televisión La forja de un rebelde, de Mario Camus, Curro Jiménez II (1995) y Querido maestro así como en películas como Tr', '1953-01-01', 'Escatrón, Aragón, Spain', NULL, 1, 'nm0602341', '106059', '/c9cvzPwBPRsEMBQIwGX9x1ZZqIP.jpg', 5),
(5861, 'José Luis Torrijo', '', NULL, NULL, NULL, 2, 'nm0868925', '3653', '/7BZSoX2lYzX6hjq2PI3XXuYNvti.jpg', 1),
