(5864, 'Rossy de Palma', 'Rosa Elena García Echave, artísticamente Rossy de Palma (16 de septiembre de 1964), es una actriz,​ cantante​ y modelo española. Se dio a conocer como \"chica Almodóvar\" en películas de dicho director como Mujeres al borde de un ataque de nervios o La flor de mi secreto. Posteriormente ha trabajado a las órdenes de directores como Robert Altman, Mike Figgis y Terry Gilliam.\n\nCon una polifacética carrera internacional es considerada una de las musas9​ del diseñador Jean Paul Gaultier.10​ En 1992 participó en el video musical «Too Funky» de George Michael. También formó parte del grupo musical Peor Impossible.12​ Ha sido condecorada con la medalla de oficial de la Orden de las Artes y las Letras de Francia.', '1964-09-16', 'Palma, Balearic Islands, Spain', NULL, 1, 'nm0658041', '25258', '/3IH9ZBUcFNwBr8IcS1RZhMKTpeg.jpg', 15),
