(5866, 'David Trueba', 'David Rodríguez Trueba (Madrid, 10 de septiembre de 1969) es un escritor, periodista, director de cine, guionista y actor español. Es hermano de Fernando Trueba.', '1969-09-10', 'Madrid, Madrid, Spain', NULL, 2, 'nm0874093', '59879', '/76KoMGIBuQWMmxOI8Nsz9fQZ4tI.jpg', 2),
(5867, 'Elena Irureta', 'Elena Irureta (Zumaya, Guipúzcoa, 30 de julio de 1955) es una actriz española.\n\nAunque conocida para muchos por su papel de Laura Hurtado en la serie de Telecinco El comisario, en la que participó desde 1999 hasta 2009, Elena Irureta cuenta con una amplia trayectoria tanto en televisión, con participaciones anteriores en otras series, como en cine y teatro.', '1955-07-30', 'Donostia-San Sebastián, Guipúzcoa, País Vasco, Spain', NULL, 1, 'nm0410118', '16980', '/gJWLhfOXFoYTTVjh5Q9GlxLSsEE.jpg', 3),
