(5943, 'Ryan Potter', 'Ryan Potter es un actor, director, artista marcial, fotógrafo y filántropo estadounidense. Nació en Portland, Oregon, pero pasó gran parte de su infancia en Tokio. A la edad de siete años, regresó a los Estados Unidos. Ryan comenzó a actuar a la edad de quince años, después de ver un folleto que buscaba candidatos para una serie de Nickelodeon con el tema de las artes marciales, Supah Ninjas (2011). Fue elegido como Mike Fukanaga en el programa, que duró de 2011 a 2013. También interpretó a Fred\'s Best Friend en la serie Fred: The Show (2012). En 2013, Ryan apareció en el cortometraje Save the Date (2013). En 2014, protagonizó tanto la película independiente Senior Project (2014) como el superhéroe animado por ordenador Big Hero 6 (2014) de Disney. En esta última película, expresó el personaje principal, Hiro Hamada, un niño prodigio que trabaja en equipo con un gran robot. Ryan expresó Hiro de nuevo el videojuego Disney Infinity: Marvel Super Héroes (2014). Ryan interpretará a Eric Barret en la película Unde', '1995-09-12', 'Portland, Oregon, USA', NULL, 2, 'nm3994407', '515510', '/3Hdip1zNYrea3V7uzJQYxTps5Ne.jpg', 8),
