(6025, 'Richard Dean Anderson', 'Richard Dean Anderson (Minneapolis, Minnesota, 23 de enero de 1950), es un actor estadounidense famoso mundialmente por su papel como MacGyver en la serie homónima y también como Jack O\'Neill, coronel del Equipo SG-1 de la serie Stargate SG-1.\n\nHijo de Stuart Jean y Jocelyn Rhae Anderson (nacida Jocelyn Rhae Carter), tiene tres hermanos: Jeffrey Scott, Thomas John y James Stuart, Margarita. Tiene una hija llamada Wylie Quinn Annarose, la cual tuvo con su entonces pareja (nunca contrajeron matrimonio) Apryl Prose.\n\nEs propietario de la productora Gekko Films, que produjo la serie Stargate SG-1 de la que él fue protagonista.', '1950-01-23', 'Minneapolis, Minnesota, USA', NULL, 2, 'nm0000760', '26085', '/w9Wi0OUEFGy9vMUpiZjj9GLzpag.jpg', 20),
