(6034, 'Morena Baccarin', 'Morena Baccarin (2 de junio de 1979) es una actriz estadounidense de origen brasileño más conocida por sus papeles en varios programas de televisión estadounidenses de ciencia ficción: como Inara Serra en la serie Firefly, como Adria en la serie Stargate SG, como Anna en la versión 2009 de la serie V y como Leslie Thompkins en la serie Gotham.\n\nEn el cine salto a la fama por interpretar a Vanessa en la película Deadpool y su secuela.', '1979-06-02', 'Rio de Janeiro, Rio de Janeiro, Brazil', NULL, 1, 'nm1072555', '54882', '/kIL3zOqiC0xSXuCED6tB3KJWnSh.jpg', 28),
