(6051, 'Ming-Na Wen', 'Ming-Na Wen (20 de noviembre de 1963) es una actriz portuguesa nacida en Macao y nacionalizada estadounidense. Es más conocida por su papel de la doctora Jing-Mei Chen en la serie ER Emergencias (desde el 12 de enero de 1995 al 9 de diciembre de 2004). Como actriz de voz su papel más reconocido es el de la protagonista de la película Mulan. Desde 2013 interpreta el rol de Melinda May en la serie Agents of S.H.I.E.L.D., de la cadena ABC.', '1963-11-20', 'Coloane Island, Macau', NULL, 1, 'nm0001840', '21702', '/eqCzFF83It56cUdjpskzvg8jgq.jpg', 24),
