(6054, 'Paul Dano', 'Paul Franklin Dano (19 de junio de 1984) es un actor, director, guionista y músico estadounidense. Ha trabajado, entre otras, en las películas There Will Be Blood, Little Miss Sunshine, Ruby Sparks , Love & Mercy, Looper, 12 años de esclavitud, Prisoners, Youth y Okja. En 2018, debutó como director con Wildlife.​', '1984-06-19', 'New York City, New York, USA', NULL, 2, 'nm0200452', '17142', '/tHsaqfauzG4MuFs5oCbq0pRy5EF.jpg', 52),
(6055, 'Jeffrey Wright', 'Jeffrey Wright (7 de diciembre de 1965) es un actor y productor de cine y televisión estadounidense. Ganador del Globo de Oro al mejor actor de reparto - series, miniserie o telefilme y del Emmy al mejor actor de reparto - miniserie o telefilme; y candidato al Premio del Sindicato de Actores.​ Conocido por sus intervenciones en películas y series de televisión como Angels in America (2003), The Manchurian Candidate (2004) y su participación en las películas de James Bond Casino Royale (2006) y Quantum of Solace (2008) como Felix Leiter.', '1965-12-07', 'Washington, D.C., USA', NULL, 2, 'nm0942482', '2954', '/npJjOiFiAP4wiRDNjKsO8ho03Mg.jpg', 26),
(6056, 'John Turturro', 'John Michael Turturro (Brooklyn, Nueva York; 28 de febrero de 1957) es un actor y director estadounidense-italiano.2​ Su carrera abarca cuatro décadas durante las cuales ha actuado en más de ochenta películas en roles cómicos y dramáticos, además ha trabajado ocasionalmente en el teatro y la televisión y dirigido cinco largometrajes. Ha recibido diversos premios y nominaciones por su trabajo tanto delante como detrás de cámaras y es considerado una figura importante del cine independiente por su extensa trayectoria en filmes alejados del circuito comercial.\n\nDespués de debutar en el cine de la mano de Martin Scorsese con un breve papel en Toro salvaje (1980), se destacó interpretando personajes protagonistas y secundarios en cintas cómo Five Corners (1987), Do the Right Thing (1989), Miller\'s Crossing (1990), Barton Fink (1991), Quiz Show: El dilema (1994), Box of Moonlight (1996), El gran Lebowski (1998), O Brother, Where Art Thou? (2000) y La ventana secreta (2004). Por su actuación en Barton Fink, Turturro', '1957-02-28', 'Brooklyn, New York, USA', NULL, 2, 'nm0001806', '1241', '/6O9W9cJW0kCqMzYeLupV9oH0ftn.jpg', 35),
(6057, 'Colin Farrell', 'Colin James Farrell (31 de mayo de 1976) es un actor irlandés ganador del Globo de Oro. Ha trabajado en películas como Tigerland (2000), Daredevil (2003), Miami Vice (2006), Minority Report (2002), Phone Booth (2003), The Recruit (2003), Alejandro Magno (2004), S.W.A.T. (2003), In Bruges (2008) y Total Recall (2012).', '1976-05-31', 'Castleknock, Dublin, Ireland', NULL, 2, 'nm0268199', '72466', '/3iHqlaeSAQwJ0KraRKD1A4vBaCS.jpg', 38),
