(6124, 'Michael Keaton', 'Michael John Douglas (5 de septiembre de 1951), conocido como Michael Keaton, es un actor de cine y televisión estadounidense, ganador de un Globo de Oro al mejor actor de comedia o musical y candidato al Premio del Sindicato de Actores al mejor actor de televisión - Miniserie o telefilme.​ Es conocido por su vasta carrera e intervenciones en películas como Beetlejuice (1988), Batman (1989), Batman Returns (1992), Multiplicity (1996), Jackie Brown (1997), Jack Frost (1999), White Noise (2005) Toy Story 3 (2010), Birdman (2014), Spotlight (2015), The Founder (2016) y Spider-Man: Homecoming (2017). En 2008 dirigió su primera película, en la que también actuó, The Merry Gentleman.', '1951-09-05', 'Coraopolis, Pennsylvania, USA', NULL, 2, 'nm0000474', '2232', '/baeHNv3qrVsnApuKbZXiJOhqMnw.jpg', 40),
(6125, 'Jack Nicholson', 'John Joseph «Jack» Nicholson es un actor, productor, guionista y director de cine estadounidense, doce veces nominado y tres veces ganador del Premio de la Academia.\n\nNicholson es considerado uno de los actores más versátiles en la historia del cine estadounidense por sus grandes interpretaciones y muy diversos roles. Durante la primera mitad de la década de los 70, participó en producciones como Mi vida es mi vida (1970), El último deber (1973) y Chinatown (1974), que le valieron nominaciones al Óscar.\n\nEn 1975 recibió su primer premio de la Academia por su papel en One Flew Over the Cuckoo\'s Nest, en la categoría de Mejor actor. En los siguientes años Nicholson recibiría numerosas nominaciones al Óscar por su trabajo en Rojos (1981), El honor de los Prizzi (1985), Tallo de hierro (1987), Algunos hombres buenos (1992) y About Schmidt (2002). Obtuvo el premio en dos ocasiones más por Mejor actor y Mejor actor secundario en Mejor... imposible (1997) y La fuerza del cariño (1983), respectivamente. Esto lo convi', '1937-04-22', 'Manhattan, New York, USA', NULL, 2, 'nm0000197', '514', '/6h12pZsgj3WWjMtykUgfLkLEBWz.jpg', 21),
(6126, 'Kim Basinger', 'Kimila Ann Basinger (Athens, Georgia, Estados Unidos, 8 de diciembre de 1953) más conocida como Kim Basinger, es una actriz, productora y modelo estadounidense. Varias veces galardonada por su desempeño actoral y por su carrera como modelo.\n\nSe convirtió en actriz de televisión a mediados de los años 1970 y en actriz de cine a comienzos de los años 1980, década durante la cual fue una de sus principales sex-symbol. Participó en más de treinta películas, entre las que se encuentran éxitos de taquilla como Nunca digas nunca jamás, Nueve semanas y media, Locos de amor y Batman. Su actuación en el filme L.A. Confidential la hizo acreedora de diversos galardones, entre ellos un Óscar, un Globo de Oro y un premio del Sindicato de Actores.\n\nKim se casó dos veces. La primera de ellas en 1980 con el maquillador Ron Snyder, del que se divorció nueve años después. Posteriormente, en 1993, con el también actor Alec Baldwin, padre de su hija Ireland Eliesse y de quien se separó en 2002.', '1953-12-08', 'Athens, Georgia, USA', NULL, 1, 'nm0000107', '326', '/iqQ4o2sRna7J1Z9KkB9Avp9CIsk.jpg', 14),
