(6175, 'Michael Caine', 'Maurice Joseph Micklewhite​ (14 de marzo de 1933), más conocido como Michael Caine, es un prolífico actor británico. Famoso por su particular acento inglés de East End, Caine ha aparecido en más de 154 películas a lo largo de su carrera y es considerado un icono de la industria cinematográfica británica.\n\nLogró el reconocimiento del público en los sesenta con las cintas inglesas Zulu de 1964, Archivo confidencial de 1965, Alfie de 1966, por la cual aspiró al Óscar, The Italian Job de 1969 y La batalla de Inglaterra de 1969. Entre sus películas más importantes durante los setenta se encuentran: Asesino implacable de 1971, El último valle de 1972, La huella, la cual le dio su segunda candidatura al Óscar, El hombre que pudo reinar de 1975 y Un puente lejano de 1977. Logró un éxito mayor durante los ochenta con películas que fueron éxito, tanto en taquilla como en crítica con: Educando a Rita de 1983, por la que consiguió el BAFTA y un Globo de Oro, y con Hannah y sus hermanas de 1986, por la que consiguió el Ós', '1933-03-14', 'Rotherhithe, London, England, UK', NULL, 2, 'nm0000323', '3895', '/hZruclwEPCKw3e83rnFSIH5sRFZ.jpg', 28),
(6176, 'Cillian Murphy', 'Cillian Murphy (25 de mayo de 1976) es un actor de cine, teatro y televisión irlandés mayormente conocido por dar vida a Thomas Shelby de la serie de televisión inglesa Peaky Blinders y a El Espantapájaros en Batman Begins. Ha participado en varias películas dirigidas por Danny Boyle y Christopher Nolan, dos de los directores británicos con mayor proyección internacional.', '1976-05-25', 'Douglas, Cork, Ireland', NULL, 2, 'nm0614165', '2037', '/i8dOTC0w6V274ev5iAAvo4Ahhpr.jpg', 128),
(6177, 'Tom Wilkinson', 'Thomas Geoffrey \"Tom\" Wilkinson, OBE es un actor inglés. Ha sido nominado dos veces a un premio de la Academia por sus papeles en In The Bedroom y Michael Clayton. En 2009, ganó el Globo de Oro y el premio Primetime Emmy al mejor actor de reparto en una miniserie o película para John Adams.', '1948-02-05', 'Leeds, West Yorkshire, England, UK', NULL, 2, 'nm0929489', '207', '/tiKygcGRycQ9sTdDeYuXYyVKfzc.jpg', 12),
(6178, 'Rutger Hauer', 'Rutger Oelsen Hauer, más conocido como Rutger Hauer es un actor de origen neerlandés de cine y televisión que trabaja principalmente en Hollywood.\n\nRutger Oelsen Hauer nació el 23 de enero de 1944 en la ciudad de Breukelen, en la provincia de Utrecht, en Holanda. Sus padres, Teunke y Ared, eran actores teatrales. Su hermana mayor y sus dos hermanas menores también eran actrices. Abandonó los estudios en el instituto para intentar dedicarse, como su abuelo, a la marina, pero terminó desechando la idea a causa de su daltonismo (como su bisabuelo) para trabajar durante un período como obrero de la construcción y ejercer de poeta bohemio en sus ratos libres, por los cafés de Ámsterdam. Ingresó en las Fuerzas Armadas holandesas (en la Marina), pero abandonó la carrera militar al poco tiempo. Rutger Hauer decidió finalmente seguir los pasos de sus padres y recibió clases de interpretación.\n\nDivorciado de Heidi Merz, con quien tuvo a su primer hija, la actriz Aysha Hauer nacida en 1966, en 1985 contrajo matrimonio p', '1944-01-23', 'Breukelen, Utrecht, Netherlands', '2019-07-19', 2, 'nm0000442', '585', '/aNvyDYD0YscuwMfgy15wb5gRKph.jpg', 10),
(6179, 'Ken Watanabe', 'Ken Watanabe ( 21 de octubre de 1959) es un actor japonés, principalmente conocido por sus roles de héroe trágico en las películas El último samurái (2003) y Cartas desde Iwo Jima (2006), y sus actuaciones en Memorias de una geisha (2005) e Inception (2010).', '1959-10-21', 'Koide, Niigata, Japan', NULL, 2, 'nm0913822', '3899', '/psAXOYp9SBOXvg6AXzARDedNQ9P.jpg', 14),
(6180, 'Morgan Freeman', 'Morgan Freeman (1 de junio de 1937) es un actor y director estadounidense, ganador del premio Óscar en 2005 por Million Dollar Baby. Además ha recibido otras nominaciones por sus actuaciones en El reportero de la calle 42 (1987), Paseando a Miss Daisy (1989), Cadena perpetua (1994) e Invictus (2009). También ha ganado los premios Globo de Oro y SAG. Es el narrador de Through the Wormhole.\n\nSu extensa carrera incluye otros éxitos de taquilla como Brubaker (1980), Sin perdón (1992), Tiempos de gloria (1989), Se7en (1995), Deep Impact (1998), Pánico nuclear (2002), Bruce Almighty (2003), The Bucket List (2007), Wanted (2008), tres entregas de la saga de Batman (Batman Begins, 2005; The Dark Knight, 2008 y The Dark Knight Rises, 2012) Lucy (2014) y la comedia Ted 2 (2015).', '1937-06-01', 'Memphis, Tennessee, USA', NULL, 2, 'nm0000151', '192', '/905k0RFzH0Kd6gx8oSxRdnr6FL.jpg', 49),
