(6269, 'Danny DeVito', 'Daniel Michael \"Danny\" DeVito, Jr. (Neptune, Nueva Jersey, Estados Unidos, 17 de noviembre de 1944) es un actor, director y productor estadounidense. Premiado con los premios Globo de Oro y Emmy por su participación en la comedia de situación Taxi. Destacado por su trabajo en los filmes Twins, La guerra de los Rose, Hoffa, Erin Brockovich, Batman Returns y Man on the Moon, entre otras.\n\nDeVito es descendiente de italianos. con una apariencia muy reconocible y con un humor muy punzante que llega fácilmente al público. Es muy conocido en su país por ser Louie De Palma en la serie Taxi (1980), a pesar de haber actuado en películas como Alguien voló sobre el nido del cuco y La fuerza del cariño.\n\nSu participación en las comedias Los gemelos golpean dos veces, La guerra de los Rose, y Batman Regresa lo hicieron mundialmente famoso y lo encasillaron en ese género. DeVito luchó contra esta etiqueta haciendo interpretaciones muy respetadas en películas como L.A. Confidential, Heist, y The Big Kahuna.\n\nEn 1999, produj', '1944-11-17', 'Asbury Park, New Jersey, USA', NULL, 2, 'nm0000362', '518', '/uLW4Y9yjtwxtVmcJfwHZ7sKJai4.jpg', 27),
