(6274, 'Vincent Schiavelli', 'Vincent Andrew Schiavelli fue un actor siciliano-estadounidense, notorio por su trabajo en teatro, cine y televisión. \n\nSchiavelli debutó en el cine en 1971 con la película Juventud sin esperanza, del director de origen checo Miloš Forman, quien contó con él para buena parte de sus proyectos posteriores. Fue con este realizador con el que interpretó algunos de sus papeles más aplaudidos, como el del lunático Frederickson en Atrapado sin salida o Alguien voló sobre el nido del cuco (1975) o criado de Salieri en Amadeus (1984), además de aparecer en cintas como Valmont (1989), El escándalo de Larry Flint (1996) o Man on the Moon (1999).\n\nCon una altura de 1,96 metros y un rostro que podía transformarse en una máscara lúgubre, Schiavelli encarnó a secundarios inolvidables, como en Ghost (1990), película en la que era el voluble fantasma del metro de Nueva York que ayudaba al personaje de Patrick Swayze a manejarse en el mundo material. El actor interpretó más de un centenar de personajes en cine y televisión, co', '1948-11-11', ' Brooklyn, New York, USA', '2005-12-26', 2, 'nm0001704', '3418', '/vwYSxl3eAwS7hkGIuMysWt0A4FR.jpg', 7),
