(6319, 'Uma Thurman', 'Uma Karuna Thurman (nacida el 29 de abril de 1970) es una actriz y modelo estadounidense. Ha actuado en papeles principales en una variedad de películas, que van desde comedias románticas y dramas hasta películas de ciencia ficción y acción. Tras sus primeros papeles en películas como Dangerous Liaisons (1988), saltó a la fama internacional en 1994 tras su papel en Pulp Fiction de Quentin Tarantino, por la que fue nominada a un Oscar, un BAFTA y un Globo de Oro. Protagonizó varias películas más a lo largo de la década de 1990, como The Truth About Cats & Dogs, Batman & Robin, Gattaca y Les Misérables.\n\nGanó un Globo de Oro por la miniserie Hysterical Blindness (2002). Su carrera se revitalizó cuando se reunió con el director Quentin Tarantino para interpretar el papel central en dos películas de Kill Bill (2003/2004), lo que le valió dos nominaciones adicionales al Globo de Oro y una nominación al Premio BAFTA.\n\nThurman nació en Boston, Massachusetts. Su padre, Robert Alexander Farrar Thurman, un profesor nac', '1970-04-29', 'Boston, Massachusetts, USA', NULL, 1, 'nm0000235', '139', '/pGyACejvvLI6tB0gFQ2rCjwqKvd.jpg', 64),
