(6399, 'Tommy Lee Jones', 'Tommy Lee Jones (15 de septiembre de 1946) es un actor y cineasta estadounidense. Ha recibido cuatro nominaciones al Premio de la Academia, ganando el premio en la categoría de mejor actor de reparto por su actuación como el alguacil Samuel Gerard en la película de suspense de 1993 El fugitivo.\n\nOtros de sus papeles destacados incluyen al ranger Woodrow F. Call en la miniserie Lonesome Dove, el agente K en la serie cinematográfica de Hombres de negro, al alguacil Ed Tom Bell en No Country for Old Men, al villano Dos Caras en Batman Forever, al terrorista William \"Bill\" Strannix en Under Siege, al ranger Roland Sharp en Man of the House, el ranchero Pete Perkins en Los tres entierros de Melquiades Estrada, al coronel Chester Phillips en Capitán América: El primer vengador, el director de la CIA Robert Dewey en Jason Bourne y a Warden Dwight McClusky en Natural Born Killers.\n\nTambién ha encarnado figuras de la vida real como el empresario Howard Hughes en The Amazing Howard Hughes, el congresista republicano ra', '1946-09-15', 'San Saba, Texas, USA', NULL, 2, 'nm0000169', '2176', '/zixpaPmOonRh1I3TWgxDkeGxkrv.jpg', 39),
(6400, 'Nicole Kidman', 'Nicole Mary Kidman (20 de junio de 1967), más conocida como Nicole Kidman, es una actriz y productora australiana nacida en los Estados Unidos. Ganadora de un Óscar, cuatro Globos de Oro, dos Emmy y un Bafta. Entre 2006 y 2009 se convirtió en la actriz mejor pagada de la industria cinematográfica.\n\nDespués de hacer varias apariciones en teatro, cine y televisión, Kidman obtuvo el papel que la precipitó a la fama en el thriller de 1989 Calma total. Sus actuaciones en varias películas, tales como Todo por un sueño (1995), Moulin Rouge!, Los otros (2001), y Las horas (2002), han recibido alabanzas por parte de la crítica y en la década de 2000 sería considerada una de las mejores actrices del mundo. En 2003, Kidman recibió su estrella en el Paseo de la Fama de Hollywood en Hollywood, California. Kidman es también embajadora de buena voluntad del Fondo de Desarrollo de las Naciones Unidas para la Mujer (Unifem) y Unicef. El 21 de octubre de 2009 la actriz pidió una respuesta integral a la violencia que padecen la', '1967-06-20', 'Honolulu, Hawaii, USA', NULL, 1, 'nm0000173', '2227', '/jTtiPqW6VlNE9nTf4BuUzuIqzlR.jpg', 34),
