(6427, 'Ian McShane', 'Ian David McShane (Blackburn, Inglaterra; 29 de septiembre de 1942) es un actor británico. A pesar de que ha protagonizado varias películas, es por sus papeles en televisión por los que es más conocido, comenzando por la serie de la BBC Lovejoy (1986-1994) y el wéstern de la HBO Deadwood (2004-2006), con la que obtuvo un Globo de Oro.\n\nEn el Reino Unido, su papel más conocido es el de Lovejoy, un pícaro pero apuesto comerciante de antigüedades, en la serie Lovejoy (1986-1994), de la BBC. También disfrutó de la fama en los Estados Unidos con su papel de Don Lockwood en la serie Dallas. Incluso antes de Lovejoy, McShane era conocido por sus apariciones en series de televisión como Wuthering Heights (1967), Jesús de Nazaret (1977, como Judas Iscariote), y Disraeli (1978), así como en películas como Sky West and Crooked (1965) y La batalla de Inglaterra (1969).\n\nEn 1983, protagonizó la efímera serie de Bare Essence. En 1985, apareció en el álbum de Grace Jones Slave to the Rhythm. Actuó en dos episodios de Miami ', '1942-09-29', 'Blackburn, Lancashire, England, UK', NULL, 2, 'nm0574534', '6972', '/q9qKbux5Jo76Sj8g3luxBt6rYtz.jpg', 24),
