(6457, 'Peter Stormare', 'Rolf Peter Ingvar Storm (27 de agosto de 1953), conocido artísticamente como Peter Stormare, es un actor sueco de cine, teatro y televisión, y también se dedica a la música y a la dirección teatral. Por su inglés fluido y su habilidad de imitar acentos, se ha convertido en un actor muy prestigioso en las producciones estadounidenses, usualmente interpretando personajes europeos o de otras nacionalidades.\n\nStormare comenzó su carrera en el teatro Dramaten de Estocolmo, y mientras estaba de gira con la obra Class Enemy, fue descubierto por el cineasta Ingmar Bergman quien le daría un papel en la película Fanny y Alexander (1982) y luego en producciones teatrales como La señorita Julia, El rey Lear, Hamlet (1987) y Largo viaje hacia la noche (1988).​ Durante once años en el Dramaten, Stormare también escribió y dirigió obras como Class, El Paso y The Electric Boy.\n\nSu primer papel como protagonista en el cine fue en Den Frusna Leoparden (1986), donde intenta apartar a su hermano menor de la vida criminal. Al año', '1953-08-27', 'Arbrå, Gävleborgs län, Sweden', NULL, 2, 'nm0001780', '53', '/5muzSVt66Qxc8KuVbq0phZIN9tj.jpg', 20),
