(6509, 'Halle Berry', 'Halle Berry (14 de agosto de 1966) es una modelo,actriz de cine y televisión estadounidense ganadora de un Premio Óscar, un Globo de Oro, dos Premios del Sindicato de Actores y un Emmy.\n\nFue una de las actrices mejor pagadas de Hollywood durante la década de 2000 y ha participado en la producción de varias de las películas en las que actuó. Berry también es un modelo de portavoz de Revlon. Antes de convertirse en actriz, comenzó a modelar y participó en varios concursos de belleza, terminando como primera finalista en el concurso de Miss Estados Unidos y ocupando el sexto lugar en el concurso de Miss Mundo en 1986. Su avance cinematográfico fue en la comedia romántica Boomerang (1992), junto a Eddie Murphy, que lo llevó a películas como la comedia familiar The Flintstones (1994), la comedia-drama política Bulworth (1998) y la película para televisión Presenting Dorothy. Dandridge (1999), por la cual ganó el Premio Primetime Emmy y el Premios Globo de Oro a la Mejor Actriz en una Miniserie o Película, entre mu', '1966-08-14', 'Cleveland, Ohio, USA', NULL, 1, 'nm0000932', '4587', '/ylkN2DRmjIFwoJDzHL3Zw7CSvwF.jpg', 19),
(6510, 'Mark Dacascos', '', '1964-02-26', 'Honolulu, Hawaii, USA', NULL, 2, 'nm0001092', '18702', '/trOACuJz1KzhB51qe6asaxRuxrh.jpg', 47),
