(6536, 'Owen Wilson', 'Owen Cunningham Wilson (18 de noviembre de 1968) es un actor de cine, humorista y guionista estadounidense.  Conocido principalmente por sus papeles en Zoolander y Shanghai Noon. Como guionista estuvo nominado al Óscar al mejor guion original por el guion de la película The Royal Tenenbaums, escrito junto a Wes Anderson, con quien ha colaborado como actor en varias de sus películas. También ha colaborado con Ben Stiller en varias películas entre ellas podemos mencionar la trilogía de Night at the Museum, Los padres de ella y Zoolander, entre otras.', '1968-11-18', ' Dallas, Texas, USA', NULL, 2, 'nm0005562', '887', '/op8sGD20k3EQZLR92XtaHoIbW0o.jpg', 74),
