(6647, 'Ana de Armas', 'Ana Celia de Armas Caso (Santa Cruz del Norte, 30 de abril de 1988), conocida artísticamente como Ana de Armas, es una actriz española-cubana. Comenzó su carrera cuando era adolescente en su país de origen, Cuba, y tuvo un papel principal en el drama romántico Una rosa de Francia (2006). A la edad de 18 años, se mudó a Madrid, España y protagonizó el popular drama adolescente El Internado durante seis temporadas desde 2007 hasta 2010.​\n\nDespués de mudarse a Los Ángeles, de Armas tuvo papeles de habla inglesa en el thriller erótico Knock Knock (2015) y la película de comedia y crimen War Dogs (2016), y tuvo un papel secundario en la película biográfica deportiva Hands of Stone (2016). Ella saltó a la fama con su papel como proyección holográfica de IA en la película de ciencia ficción Blade Runner 2049 (2017). Su interpretación de Marta Cabrera, enfermera, en la película de misterio Knives Out (2019) fue nominada al Globo de Oro a la Mejor Actriz de Comedia o Musical.', '1988-04-30', 'Santa Cruz del Norte, Cuba', NULL, 1, 'nm1869101', '224513', '/14uxt0jH28J9zn4vNQNTae3Bmr7.jpg', 199),
