(6768, 'Jake Gyllenhaal', 'Jacob «Jake» Benjamin Gyllenhaal, (19 de diciembre de 1980) es un actor y productor de cine estadounidense, hijo del director Stephen Gyllenhaal y de la guionista Naomi Foner.​\n\nComenzó a actuar a la edad de diecinueve años. Su primer papel protagonista fue en la película Cielo de octubre (1999), a la cual le siguieron la película independiente de culto Donnie Darko, en la que daba vida a un adolescente con problemas psicológicos y en la que compartía reparto con la actriz Maggie Gyllenhaal, su hermana en la cinta y en la vida real, y El día de mañana (2004), una película del tema catastrófico del enfriamiento global que supuso su debut en el cine de gran presupuesto y en el que interpretaba a un estudiante, hijo de Dennis Quaid. El año 2005 fue seguramente cuando se produjo su consagración como actor ante el gran público, gracias a su interpretación de un marine frustrado en Jarhead, el infierno espera y, sobre todo, al personaje del vaquero Jack Twist en Brokeback Mountain, de Ang Lee, donde compartía prota', '1980-12-19', 'Los Angeles, California, USA', NULL, 2, 'nm0350453', '131', '/oA6fp6SQBQQWZEzn4NfY3E8mJhV.jpg', 32),
