(6801, 'Sam Raimi', 'Sam Raimi (Royal Oak, 23 de octubre de 1959) es un director, productor y guionista estadounidense. A Raimi se lo reconoce mayormente por su trabajo en la dirección de la primera trilogía del personaje Spider-Man, estrenada entre los años 2000\'s. Además también por su labor como director con filmes de terror de bajo presupuesto como la trilogía de The Evil Dead, el cual fue uno de sus primeros proyectos.\n\nTambién participó en filmes realizados por sus compañeros, como los hermanos Coen, para quienes también ha sido ayudante de dirección. Raimi es una estrella de culto que no abandonó ese género hasta 1999 con For Love of the Game. En 1990, Raimi también trabajó para la televisión, como productor de series como Hércules los viajes legendarios y Xena: la princesa guerrera. Raimi tiene un hermano mayor; Ivan, guionista y un hermano menor, el actor Ted Raimi.', '1959-10-23', 'Royal Oak, Michigan, USA', NULL, 2, 'nm0000600', '7623', '/8gssvwiPrFRuFRlr5ruKx68k1Jl.jpg', 24),
(6802, 'Alfred Molina', 'Alfred Molina (24 de mayo de 1953) es un actor inglés, es mayormente conocido por su papel del Doctor Octopus en la película de 2004 Spider-Man 2. También ha participado en otras películas como El código Da Vinci, The Pink Panther 2, El Aprendiz de Brujo, Prince of Persia, Frida entre otras. También hizo acto de presencia en la serie Law & Order: Los Angeles bajo el papel de Ricardo Morales.', '1953-05-24', 'London, England, UK', NULL, 2, 'nm0000547', '658', '/nJo91Czesn6z0d0pkfbDoVZY3sg.jpg', 21),
(6803, 'Kirsten Dunst', 'Kirsten Caroline Dunst (Point Pleasant, 30 de abril de 1982) es una actriz, modelo y cantante estadounidense. Debutó en el medio cinematográfico con Oedipus Wrecks, un cortometraje de Woody Allen perteneciente a la antología cinematográfica Historias de Nueva York (1989). A los doce años fue reconocida por su interpretación de la vampiresa Claudia en Entrevista con el vampiro (1994), papel por el cual fue nominada al Globo de Oro como mejor actriz de reparto. Ese mismo año actuó en la película Mujercitas, lo que contribuyó al aumento de su popularidad.\n\nAlcanzó la fama internacional con su participación en la trilogía de Spider-Man, en la cual interpretó a Mary Jane Watson, y por su actuación en la primera entrega recibió el Premio Empire a la mejor actriz. Por este papel fue nominada a galardones como el Premio MTV. Desde entonces ha aparecido en películas como la comedia romántica Wimbledon (2004), el drama de ciencia ficción Eternal Sunshine of the Spotless Mind (2004) y la tragicomedia de Cameron Crowe, E', '1982-04-30', 'Point Pleasant, New Jersey, USA', NULL, 1, 'nm0000379', '205', '/sFYHUU1gWd57pttD8732tkBsXV5.jpg', 37),
(6804, 'Ted Raimi', '', '1965-12-14', 'Detroit, Michigan, USA', NULL, 2, 'nm0001646', '11769', '/vCfwp1BzY7qXs74fMLE1ydGxsTY.jpg', 41),
