(6806, 'Rosemary Harris', 'Rosemary Harris (19 de septiembre de 1927) es una actriz inglesa nominada al premio Oscar y ganadora de un Tony. Es actualmente conocida por su papel en Spider-Man, Spider-Man 2 y Spider-Man 3 como la Tía May.', '1927-09-19', 'Ashby, Suffolk, England, UK', NULL, 1, 'nm0365281', '18998', '/rpSsXg0tB7wWQMffvvMqLzrvZAj.jpg', 13),
