(6812, 'Elizabeth Banks', 'Elizabeth Irene Mitchell​ (10 de febrero de 1974) conocida como Elizabeth Banks, es una actriz, directora y productora estadounidense. Hizo su debut en 1998 como Vicki en el filme Surrender Dorothy. Se destaca principalmente por sus papeles en Scrubs, Modern Family, Atrápame si puedes, Qué esperar cuando estás esperando, Virgen a los 40, W, Spider-Man, Dando la nota y Los juegos del hambre.', '1974-02-10', 'Pittsfield, Massachusetts, USA', NULL, 1, 'nm0006969', '9281', '/xy1OKADZmcfc4P2j0EytHQuyRut.jpg', 20),
