(6880, 'Zendaya', 'Zendaya Maree Stoermer Coleman (1 de septiembre de 1996)3​, más conocida como Zendaya, es una actriz y cantante estadounidense. Comenzó su carrera apareciendo como una modelo infantil y bailarina, antes de ganar reconocimiento por su papel como Rocky Blue en la serie de Disney Channel Shake It Up (2010–13).  En 2013, Zendaya participó en la decimosexta temporada del concurso Dancing with the Stars. De 2015 a 2018, produjo y encarnó el rol de KC Cooper en la sitcom de Disney Channel K.C. Undercover. Hizo su gran avance cinematográfico en 2017 y 2019, interpretando a Michelle «MJ» Jones en las películas Spider-Man: Homecoming y Spider-Man: Lejos de casa del Universo Cinematográfico de Marvel. También interpretó a Anne Wheeler en la película de drama musical El gran showman.\n\nZendaya comenzó su carrera en la música grabando canciones de forma independiente y lanzando los sencillos «Swag It Out» y «Watch Me» en 2011, esta última en colaboración con Bella Thorne. Firmó con Hollywood Records en 2012 y más tarde lan', '1996-09-01', 'Oakland, California, USA', NULL, 1, 'nm3918035', '505710', '/6TE2AlOUqcrs7CyJiWYgodmee1r.jpg', 40),
(6881, 'Tony Revolori', 'Tony Revolori (28 de abril de 1996) es un actor estadounidense, principalmente conocido por interpretar el papel de Zero Moustafa en El Gran Hotel Budapest.\n\nEs conocido por interpretar a Flash Thompson en las películas del Universo cinematográfico de Marvel Spider-Man: Homecoming (2017) y Spider-Man: Far From Home (2019)', '1996-04-28', 'Anaheim, California, USA', NULL, 2, 'nm1727825', '1291350', '/ouuo4ulVO9j6T8JixFp4lWTVdtd.jpg', 18),
(6882, 'Andrew Garfield', 'Andrew Russell Garfield (20 de agosto de 1983) es un actor y productor británico-estadounidense nominado al Premio Óscar. A pesar de nacer en Los Ángeles, se crio en Epsom, Surrey, donde comenzó a actuar en teatros y producciones televisivas. Su debut cinematográfico se produjo en 2007, con el drama dirigido por Robert Redford Leones por corderos. Un año después protagonizó Boy A y por su interpretación ganó un Premio BAFTA.\n\nSaltó a la fama internacional cuando encarnó a Eduardo Saverin en la película The social network, que le valió una nominación al Globo de Oro y BAFTA. Ese año también tuvo un papel secundario en Nunca me abandones, por el cual fue candidato nuevamente al BAFTA y al Premio saturn.\n\nPor lo que respecta al teatro, en 2012 actuó en la producción de Broadway Muerte de un viajante, donde encarnó a Biff y compartió reparto con Philip Seymour Hoffman. Por su interpretación fue candidato al Premio Tony. Su incursión en la producción ocurrió en 2014 con la película de suspense 99 Homes.', '1983-08-20', 'Los Angeles, California, USA', NULL, 2, 'nm1940449', '37625', '/beO5YvbTjrr5yy8hW26KVDMSr35.jpg', 58),
(6883, 'Angourie Rice', 'Angourie Rice (1 de enero de 2001) es una actriz australiana protagonista en películas como These Final Hours y The Nice Guys. Es conocida por interpretar a Betty Brant en el Universo cinematográfico de Marvel en las películas Spider-Man: Homecoming y Spider-Man: Lejos de casa.', '2001-01-01', 'Perth, Western Australia, Australia', NULL, 1, 'nm3886028', '1265629', '/d5acxDB06gtV5OUW20EtAShZnQp.jpg', 26),
