(6890, 'Thomas Haden Church', 'Thomas Richard McMillen, más conocido como Thomas Haden Church, (17 de junio de 1960) es un actor de cine estadounidense.​ Es más conocido por sus papeles como Lyle Van der Grooth en la película George of the Jungle, Jack en la película Entre copas y como Flint Marko / Hombre de Arena en la última película de la trilogía de Spider-Man de Sam Raimi, Spider-Man 3.', '1960-06-17', 'Yolo, California, US', NULL, 2, 'nm0002006', '19159', '/VP6VDYL0OEDwSbTRysiJ0kAGxI.jpg', 23),
