(7071, 'Emma Stone', 'Emily Jean «Emma» Stone (Scottsdale, Arizona, 6 de noviembre de 1988) es una actriz y cantante estadounidense. Ha recibido numerosos premios, entre ellos: un Óscar, un BAFTA, un SAG y un Globo de Oro, a mejor actriz, por su interpretación en la cinta La La Land. Adicionalmente ha ganado la Copa Volpi. Además es considerada como una de las mejores actrices de su generación.\n\nComenzó su carrera apareciendo en obras teatrales en el Valley Youth Theatre de Phoenix como Las aventuras de Alicia en el país de las maravillas y Joseph and the Amazing Technicolor Dreamcoat, y debutó en televisión en The New Partridge Family (2005), sin embargo, solo se produjo un episodio piloto.​ Su primer papel en cine se dio en la comedia de Greg Mottola Superbad (2007), junto a Michael Cera y Jonah Hill.​ Obtuvo reconocimiento por sus trabajos posteriores en producciones como easy A (2010) y The Help (2011) en las cuales fue protagonista y que determinaron excelentes críticas para la actriz.\n\nCon The Amazing Spider-Man en 2012, —ju', '1988-11-06', 'Scottsdale, Arizona, USA', NULL, 1, 'nm1297015', '54693', '/2hwXbPW2ffnXUe1Um0WXHG0cTwb.jpg', 19),
