(7073, 'Martin Sheen', 'Ramón Antonio Gerardo Estévez (3 de agosto de 1940), conocido como Martin Sheen, es un actor estadounidense, conocido por su intervención en la película Apocalypse Now y por su papel como Josiah Bartlet, el presidente de los Estados Unidos en el drama televisivo El ala oeste de la Casa Blanca. También ha participado en películas como The Amazing Spider-Man, Atrápame si puedes, The Departed, Gandhi, La zona muerta y Wall Street. Con su hijo Emilio Estévez ha trabajado en dos películas, Bobby y The Way.', '1940-08-03', 'Dayton, Ohio, USA', NULL, 2, 'nm0000640', '8349', '/m2Y3Q0uyuW6htrn2W9UWCWMkpZu.jpg', 7),
