(7110, 'Zoey Deutch', 'Zoey Deutch se dió a conocer por su papel de Maya en la serie de Disney Channel Zack y Cody: Todos a bordo y actualmente, acaba de terminar el rodaje de Why Him?, film que protagoniza junto James Franco y Bryan Craston, dirigida por John Hamburg (I Love You Man).\n\nJunto a Kevin Spacey y Nicholas Hoult, Zoey formará parte del elenco de Rebel In The Rye, film dirigido por Nicholas Hoult. Basado en una historia real, la película sigue la vida del famoso escritor J.D. Salinger, centrándose en las circunstancias que rodean la creación de su obra más conocida: El guardián entre el centeno. Deutch interpretará a Oona O\'Neill, hija del legendario dramaturgo Eugene O\'Neill, que tuvo un romance con Salinger.\n\nEl pasado abril se estrenó a nivel mundial en el Festival de Cine de Tribeca la película Vincent N Roxxy. Este film en el que Zoey comparte cartel con Emile Hirsch, Zoe Kravitz y Emory Cohen.\n\nDentro del cine independiente, Deutch ha participado en varias producciones. Protagoniza la película de Ry Russo-Young Bef', '1994-11-10', 'Los Angeles, California, USA', NULL, 1, 'nm3614913', '1059597', '/aG8lof9iCfmv135fKamRy6ffnUA.jpg', 48),
