(7117, 'Aasif Mandvi', 'Aasif Mandvi ha tenido una carrera de éxito en el cine, la televisión y el teatro. Actualmente, podemos ver a Mandvi como corresponsal en Oriente Medio de \"The Daily Show with Jon Stewart\", ganadora de un Emmy® y del Peabody, que ahora está en su décimo octava temporada.\n\nLa película de Mandvi \"Today’s Special\", una tierna comedia Tandoori al estilo de Nueva York, que coescribió y que protagoniza, se estrenó en los cines de Estados Unidos en 2010. Mandvi interpreta a Samir, un cocinero de talento que sueña con convertirse en un gran chef francés. Pero cuando se ve obligado a abandonar su sueño y encargarse del restaurante indio de su padre en Jackson Heights, su vida cambia para siempre. La película, cuyo estreno mundial tuvo lugar en el Festival de Cine de Londres de 2009, aborda los temas de la comida, la familia, el amor, la magia y Nueva York.\n\nSu último trabajo ha sido en la comedia \"Los becarios\", protagonizada por Owen Wilson y Vince Vaughn. Otras interpretaciones recientes incluyen: \"Una historia casi', '1966-03-05', 'Mumbai, Maharashtra, India', NULL, 2, 'nm0541902', '20644', '/sMxD5GKEfVgEhqav2mcgtO8g3M.jpg', 5),
(7118, 'Gregg Edelman', '', '1958-09-12', 'Chicago - Illinois - USA', NULL, 2, 'nm0248981', '17179', '/jvdye1mZkBb5x4xjjtmtuLRmXzy.jpg', 6),
(7119, 'Daniel Dae Kim', 'Daniel Dae Kim (4 de agosto de 1968) es un actor coreano.\n\nEs conocido por interpretar a Jin-Soo Kwon en la serie de televisión Lost , a Jack Kang en la adaptación cinematográfica de la saga superventas Divergente y a Johnny Gat en la serie del videojuego Saints Row. Actualmente ya no interpreta a Chin Ho Kelly en la serie de televisión Hawaii Five-0 por discrepancias con su contrato.', '1968-08-09', 'Busan, South Korea', NULL, 2, 'nm0196654', '18307', '/aXbTKgL4u6oVumQ459B9VkGTn4A.jpg', 11),
(7120, 'Hal Sparks', '', '1969-09-25', 'Cincinnati, Ohio, U.S.A', NULL, 2, 'nm0005452', '75316', '/sxmESxUf1nFEwheqXAtYDUMJP2s.jpg', 6),
(7121, 'Joel McHale', 'Joel Edward McHale (20 de noviembre de 1977) es un actor, comediante, escritor, productor de televisión, y artista de voz estadounidense, nacido en Italia.\n\nSu fama se debe principalmente a ser el presentador del programa The Soup, el cual es emitido en el canal de televisión por cable E!, y por su papel como Jeff Winger en la serie televisiva de comedia emitida por la NBC Community. Además del gran papel del oficial Butler en la película Deliver Us From Evil de Scott Derrickson, tuvo un pequeño papel como empleado de un banco en Spider-Man 2 y otro en la quinta temporada de Sons Of Anarchy, en los capítulos 6 y 7.', '1971-11-20', 'Rome, Lazio, Italy', NULL, 2, 'nm0570364', '74949', '/jFtqHLCrmGSIJtwdxloO3KM98iC.jpg', 10),
