(7168, 'Bonnie Somerville', 'Bonnie fue criada por su madre, y la gran familia católica irlandesa de su madre en Flatbush, Brooklyn. Su madre es una de 9 hijos! Bonnie comenzó a actuar y cantar a una edad temprana, apareciendo en todas las obras de teatro de la escuela secundaria en Poly Prep Country Day School en Bay Ridge, Brooklyn. Asistió al Boston College como estudiante de Teatro Musical, y se fue a vivir a Nueva York para tratar de actuar profesionalmente. Bonnie cantó en muchas bandas de la escena musical de Nueva York, y tuvo un acuerdo de desarrollo para cantar su propia música a los 17 años.  La descubrió un explorador de modelaje mientras servía mesas en la ciudad de Nueva York, e hizo algo de modelaje en Nueva York, y Europa, sólo para regresar más enfocada en la actuación. Hizo las maletas y se mudó a Los Ángeles a la edad de 22 años, muy pronto tuvo una banda y luego un agente. Una de sus primeras audiciones, después de conseguir un agente, fue para el papel principal en la miniserie de CBS, Amours et rock\'n\' roll (1999), ', '1974-02-24', 'Brooklyn, New York, USA', NULL, 1, 'nm0813887', '66579', '/jqEMCpxhAiPptkx0EboBDIOA521.jpg', 7),
