(7421, 'Ving Rhames', 'Irving Rameses «Ving» Rhames (12 de mayo de 1959) es un actor estadounidense y ganador de un Globo de Oro.\n\nNació en Nueva York, hijo de Reather, ama de casa, y Ernest Rhames, un mecánico de automóviles. Sus padres fueron criados como aparceros en Carolina del Sur, llamaron a su hijo Irving por el periodista Irving Raskin Levine (fallecido en 2009), el cual mantuvo una larga y prolífica trayectoria en la NBC. Rhames creció en Harlem.\n\nEntró en la Escuela de Nueva York de las Artes Escénicas, donde descubrió su gusto por la actuación. Después de la escuela secundaria, estudió teatro en la SUNY Purchase. Su compañero estudiante de actuación Stanley Tucci le dio su apodo de «Ving». Rhames después se trasladado a Juilliard, donde empezó su carrera en el teatro de Nueva York.\n\nEmpezó a hacerse popular en el periodo 1985-90, al intervenir en filmes de Brian De Palma, Adrian Lyne y Wes Craven. Posteriormente participó en títulos tan conocidos como Pulp Fiction de Quentin Tarantino, Striptease y la primera entrega de', '1959-05-12', 'New York City, New York, USA', NULL, 2, 'nm0000609', '10182', '/4gpLVNKPZlVucc4fT2fSZ7DksTK.jpg', 16),
(7422, 'Sean Harris', 'Sean Harris (Londres, 7 de enero de 1966) es un actor británico más conocido por interpretar a Ian Curtis en la película 24 Hour Party People.\n\nSean estudió en el Drama Centre, en Londres y fue uno de los miembros del grupo 28 que entrenaron de 1989 a 1992. En 2002 interpretó al cantante Ian Curtis en la película 24 Hour Party People, una interpretación por la que fue nominado a un premio Chlotrudis en la categoría de mejor actor de reparto. En 2005 dio vida a Nick Sidney en la película Brothers of the Head. En 2012 apareció en la película Prometheus interpretada por Michael Fassbender y Charlize Theron. A finales de marzo de 2016 se anunció que Sean se había unido al elenco de American Gods dando vida a Mad Sweeney. En mayo de 2016 se anunció que, debido a razones personales, Sean había salido de la serie y su personaje ahora sería interpretado por el actor Pablo Schreiber.\n\nDescripción anterior del artículo de Wikipedia Sean Harris, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1966-01-01', 'London, England, UK', NULL, 2, 'nm0365317', '16702', '/jouyaTu0UuZMNBrADRRkCQX1VX1.jpg', 13),
