(7498, 'Aaron Paul', 'Aaron Paul es un actor y productor estadounidense. Nació el 27 de agosto de 1979 en Emmett, Idaho. Cuenta con una carrera de más de 20 años entre cine y televisión. Su papel más conocido es el de Jesse Pinkman en la exitosa serie \'Breaking Bad\', con la que consiguió grandes hitos como el premio a mejor actor de reparto en los Emmys.\n\nSus primeras escenas en la televisión fueron en 1998 en series como \'Even the Losers\' o \'Locust Valley\', en las que se encargaría de papeles secundarios y de poco peso en la trama. En 1999 aparecería en una de las series más conocidas de esa década: \'Beverly Hills, 90210\', aunque no tuvo un rol protagonista. No sería la única ocasión en la que tuviera un papel en una serie icónica. Ese mismo año también salió en un episodio de \'Melrose Place\'. Durante 1999 coleccionó apariciones en diferentes capítulos de muchas series como \'Suddenly Susan\' o \'3rd Rock from the Sun\'.\n\nFue en el año 2000 cuando dio el salto a la gran pantalla con la película \'Whatever It Takes\', protagonizada por ', '1979-08-27', 'Emmett, Idaho, USA', NULL, 2, 'nm0666739', '84497', '/lowE44ffgu4UmnOT3wOTKYhtUzp.jpg', 35),
