(7591, 'Jon Voight', 'Jonathan Vincent \"Jon\" Voight (Yonkers, Estado de Nueva York, 29 de diciembre de 1938) es un actor estadounidense. Es conocido sobre todo por películas como Cowboy de Medianoche, Odessa, Coming Home o El campeón, gracias a las cuáles se convirtió en uno de los actores más reconocidos de los años 60 y 70. Su papel en Coming Home le reportó un Óscar. Es padre de la actriz Angelina Jolie y del actor James Haven.', '1938-12-29', 'Yonkers, New York, USA', NULL, 2, 'nm0000685', '10127', '/oxLsItDwLddXu8YYJCfkddYNejL.jpg', 10),
