(7594, 'Jean Reno', 'Nació en Casablanca cuando formaba parte del protectorado francés, de padres gaditanos: él, de Sanlúcar de Barrameda y ella, que murió cuando Jean era adolescente, de Jerez de la Frontera. Ambos se exiliaron huyendo de la dictadura militar de Francisco Franco. Tiene una hermana pequeña, María Teresa (Marie-Thérèse), también de nacionalidad francesa. Debido a su ascendencia, Jean habla español de manera fluida, pudiendo ser considerado bilingüe. A los 17 años se mudó a la Francia continental, donde estudió en Cours Simon.​ Tras realizar el servicio militar en Alemania, Reno volvió al país galo para ser actor, y formó una compañía de teatro con Didier Flamand. Jean siempre se ha sentido orgulloso de sus orígenes españoles y no duda en hacer gala de ellos. En múltiples entrevistas ha afirmado que le gustaría trabajar en España, pero que no ha recibido aún ninguna propuesta, aunque realizó un pequeño papel en un corto publicitario de una marca de cervezas.', '1948-07-30', 'Casablanca, Morocco', NULL, 2, 'nm0000606', '1003', '/4TcZEDVA0u6x5pF2oZMuslxZKHe.jpg', 34),
