(7640, 'Anil Kapoor', 'Viviendo en un Chawl en Tilak Nagar, Anil, que habla punjabi, nació en 1959 de Surinder y Nirmal, también conocido como Suchitra Kapoor. Tiene un hermano mayor, Boney, una hermana, Reena, y un hermano menor, Sanjay. Su padre solía ser el secretario de Shammi Kapoor.\n\nSolitario, sin muchos amigos, estudió en la cercana O.L.P.S. (Nuestra Señora del Perpetuo Socorro), y era un fanático ferviente de las películas de Bollywood que se transmitían por televisión durante el Ganesh Maha Utsav todos los años. Era fanático de Raj Kapoor, y fue esto lo que influyó en su actuación, y la gente lo vio como una imitación del legendario showman. Consiguió un papel como artista infantil con Shashi Kapoor a la cabeza, pero la película (Tu Payal Main Geet) nunca se estrenó.\n\nDespués de la escuela, fue a estudiar a St. Xaviers College. Viajó en autobús y tren de Chembur a Bombay V.T., y caminó el resto del camino. Fue aquí donde conoció a Mazhar Khan. Un distraído Anil fue expulsado de la universidad en el segundo año debido a su', '1956-12-24', 'Mumbai, Maharashtra, India', NULL, 2, 'nm0438463', '72118', '/dwvnpiwg9m2zj0VHzlgzEotFl0G.jpg', 2),
