(7678, 'Rachel Weisz', 'Rachel Weisz es una actriz y modelo inglesa, ganadora del Óscar, el Globo de Oro, el SAG, el Premio Laurence Olivier, el Independent Spirit Awards y otros premios cinematográficos. Ganó reconocimiento público por su interpretación de Evelyn «Evy» Carnahan-O’Connell en la serie cinematográfica La momia. En 2005 su actuación en El jardinero fiel (2005) le mereció el Premio Óscar de la Academia. Está considerada como una de las musas del cine independiente, trabajando en películas de reputados directores como Paolo Sorrentino o Yorgos Lanthimos.', '1970-03-07', 'Westminster, London, England, UK', NULL, 1, 'nm0001838', '3293', '/58czHc8QU1L4H0N45T0UML8efgS.jpg', 30),
