(7728, 'Alicia Vikander', 'Alicia Amanda Vikander (3 de octubre de 1988) es una actriz sueca, conocida mundialmente por su participación secundaria en la adaptación de 2012 de Anna Karenina, como Alice Deane en la película El séptimo hijo, como Heather Lee en la película Jason Bourne, como Ava en la película Ex Machina, recientemente como Lara Croft en la nueva película Tomb Raider, y obteniendo notoriedad internacional al ser la ganadora del Óscar como mejor actriz de reparto en la película La chica danesa.\n\nGanó el Rising Star Award en 2012 en el Festival Internacional de Cine de Estocolmo y el Premio Guldbagge a la mejor actriz otorgado por el Instituto Sueco del Cine por la película de 2010 Pure.', '1988-10-03', 'Gothenburg, Västra Götalands län, Sweden', NULL, 1, 'nm2539953', '227454', '/9pmHTbXeRxUF51jJKthmHI49u9z.jpg', 23),
(7729, 'Vincent Cassel', '', '1966-11-23', 'Paris, France', NULL, 2, 'nm0001993', '1925', '/ykBEiVh6YQ9UmMAYUiQkZBH3VV4.jpg', 12),
(7730, 'Julia Stiles', 'Nació en Nueva York, ciudad en la que sus padres poseen una tienda de artesanía ubicada en el Soho.\n\nA los once años ya participaba en producciones teatrales de carácter vanguardista en La Mama Theatre y Theatre de Nueva York.\n\nEn 1996 debutó en el cine con la película de Billy Hopkins “I Love You, I Love You Not”. Tres años más tarde logró uno de sus primeros papeles importantes en “10 Razones Para Odiarte” (1999), una adaptación moderna de la obra de William Shakespeare “La Fierecilla Domada” dirigida por Gil Junger y co-protagonizaba Heath Ledger. En medio interpretó a la hija de Harrison Ford en “La Sombra Del Diablo” (1997).\n\nPosteriormente, su intervención en la serie de televisión “The 60’s” consiguió acrecentar su popularidad, especialmente en los Estados Unidos.\n\nOtros títulos de su filmografía son el thriller de acción de Doug Liman “El Caso Bourne” (2000), “La Sonrisa De Mona Lisa” (2003), película de Mike Newell protagonizada por Julia Roberts, o el remake de “La Profecía” (2006) dirigido por John', '1981-03-28', 'New York City, New York, USA', NULL, 1, 'nm0005466', '12041', '/vuXlmsJd8tec6D9ljv9AcpxeaxM.jpg', 21),
(7731, 'Amy De Bhrún', '', '1984-04-22', NULL, NULL, 1, 'nm2381142', '1188325', '/cN5ep9TcNHmJcK6uO0wMUtvgIOx.jpg', 3),
(7732, 'Ato Essandoh', 'Ato Essandoh (nacido el 29 de julio de 1972) es un actor de cine y televisión americano. Essandoh, que nació en Schenectady, Nueva York, se graduó de la New Rochelle High School en 1990. Obtuvo su licenciatura en ingeniería química en la Universidad de Cornell. También es dramaturgo y autor de Black Thang, publicado en la antología Plays and Playwrights 2003. También estudió interpretación en el Estudio de Interpretación de la ciudad de Nueva York. Essandoh es también cofundador del grupo de escritura y actuación The Defiant Ones. Sus padres son de Ghana, África Occidental. Essandoah se unió a la fraternidad Phi Kappa Psi de la Universidad de Cornell y, a través de esa organización, a la Sociedad Literaria de Irving.', '1972-07-29', 'Schenectady - New York - USA', NULL, 2, 'nm1017951', '5377', '/kkQFtsIxVUMuYDrVGeRfX2IG2F8.jpg', 6),
