(8017, 'Giovanni Ribisi', 'Antonino Giovanni Ribisi (Los Ángeles, California; 17 de diciembre de 1974) es un actor estadounidense. Ha trabajado en películas como 60 segundos, Boiler Room, Saving Private Ryan, Ted, Ted 2, The Mod Squad, The Gift, Sky Captain y el mundo del mañana, Lost in Translation, Enemigos públicos y Avatar. También es conocido por su papel de Frank, el hermano de Phoebe, en la serie Friends, y como Ralph en My name is Earl. Ribisi a menudo interpreta personajes cínicos e inteligentes, a veces con rasgos de villano.', '1974-12-17', 'Los Angeles, California, USA', NULL, 2, 'nm0000610', '1771', '/zcUsxYszZH9MRKeAqnMLXoLDwjw.jpg', 13),
