(8065, 'Nathan Fillion', 'Nathan Fillion (27 de marzo de 1971) es un actor canadiense.\n\nEntre sus papeles más conocidos se encuentran el del escritor Richard Castle en la serie Castle y el del capitán Malcolm Reynolds en la serie Firefly y la película Serenity, pero también ha doblado a personajes de videojuegos como Halo 3: ODST , Halo 5: Guardians y al Carismático Exo Cayde-6 en Destiny y Destiny 2.\n\nTambién es reconocido por sus apariciones en las revistas People y Entertainment Weekly. Además, Fillion es el cofundador de la organización Kids Need to Read (Los niños necesitan leer), que se dedica a conseguir más libros para las bibliotecas con fondos insuficientes.', '1971-03-27', 'Edmonton - Alberta - Canada', NULL, 2, 'nm0277213', '51797', '/aW6vCxkUZtwb6iH2Wf88Uq0XNVv.jpg', 32),
