(8116, 'Johnny Depp', 'John Christopher Depp II (9 de junio de 1963) es un actor, productor, director, guionista y músico estadounidense. Ha sido nominado en tres ocasiones al Óscar y recibió un Globo de Oro,​ un premio del Sindicato de Actores y un César.\n\nComenzó su carrera en la película de terror A Nightmare on Elm Street como Glen Lantz, una de las víctimas de Freddy Krueger. Dos años después, tuvo un papel de reparto en Platoon dirigido por Oliver Stone. Su papel de Tom Hanson en la serie de televisión 21 Jump Street lo convirtió en un ídolo adolescente.​ Mientras trabajaba en esta, actuó en la película Edward Scissorhands, que le valió su primera nominación al Globo de Oro y reconocimiento por parte de la crítica.  Posteriormente protagonizó la mayoría de las películas en las que trabajó, entre ellas Sleepy Hollow (1999), Pirates of the Caribbean: The Curse of the Black Pearl (2003) y sus respectivas secuelas, Charlie y la fábrica de chocolate (2005), Sweeney Todd: The Demon Barber of Fleet Street (2008), Alicia en el país d', '1963-06-09', 'Owensboro, Kentucky, USA ', NULL, 2, 'nm0000136', '85', '/ilPBHd3r3ahlipNQtjr4E3G04jJ.jpg', 101),
(8117, 'Anne Hathaway', 'Anne Jacqueline Hathaway (12 de noviembre de 1982) es una actriz estadounidense. Ganó el premio Óscar, el Globo de Oro, el BAFTA y el SAG a la Mejor actriz de reparto por su interpretación en Los miserables.\n\nLa revista People la nombró como una de las grandes estrellas descubiertas en 2013​ y apareció por primera vez en la lista de las 50 personas más bellas del mundo de dicha revista en 2006.', '1982-11-12', 'Brooklyn, New York,  USA', NULL, 1, 'nm0004266', '1813', '/tLelKoPNiyJCSEtQTz1FGv4TLGc.jpg', 31),
