(8234, 'Mike Tyson', 'Michael Gerard «Mike» Tyson ( 30 de junio de 1966), también conocido como Malik Abdul Aziz,​ es un exboxeador estadounidense.\n\nGanó dos veces el título mundial de los pesos pesados en la década de los 80 y es el boxeador más joven de la historia en conseguir un título mundial de los pesos pesados cuando el 22 de noviembre de 1986 ganó el título de la WBC ante Trevor Berbick, con tan solo 20 años, 4 meses y 22 días.​ Más tarde conseguiría unificar todas las coronas ante los campeones James Smith (WBA) y Tony Tucker (IBF), siendo derrotado, después de varias defensas, por James \"Buster\" Douglas en 1990.', '1966-06-30', 'Brownsville, Brooklyn, New York City, New York, U.S.', NULL, 2, 'nm0005512', '80757', '/pFbI6qiqb7GJLj6nedE7h8b3X6y.jpg', 4),
