(8247, 'Samara Weaving', 'Samara es hija de Simon Weaving, un escritor, productor y director de cine, y tiene una hermana menor, la actriz Morgan Weaving. Es sobrina del famoso actor Hugo Weaving y de Anna-Jane Weaving, quien tuvo una corta carrera como cantante en París a mediados de la década de los 80. Sus primos son Holly Weaving y el actor Harry Greenwood.\n\nNació en Adelaida, pero creció en Singapur, Fiyi e Indonesia. Cuando vivió en Yakarta, Indonesia, asistió a la Pattimura Elementary School. En el 2000 regresó a Australia y asistió a The Pittwater House Schools en las playas del Norte de Sídney. Luego asistió a la Canberra Girls\' Grammar School (CGGS). Salió con un joven llamado Paul por tres años, sin embargo la relación terminó en abril de 2011. En junio de 2012 comenzó a salir con el actor Axle Whitehead,​ pero la relación terminó a finales de agosto del mismo año.​\n\nDesde 2013 comenzó a salir con el modelo británico Rob Moore,​ sin embargo la relación terminó. Samara mantiene una relación con Jimmy Warden y en marzo de 201', '1992-02-23', 'Adelaide, South Australia, Australia', NULL, 1, 'nm3034977', '1372369', '/7sHnBVEiJOzjdfzUHo9vvDLkoCH.jpg', 54),
(8248, 'Adam Brody', 'Adam Brody es un actor de cine y televisión estadounidense. También ha dedicado parte de su tiempo a la música y a la producción. Nació en San Diego, California, Estados Unidos el 15 de diciembre de 1979.\n\nQuiso dedicarse al surf, deporte al que es muy aficionado. Esta es su primera opción mientras estudia en la universidad de Los Angeles. Finalmente, cuando acaba sus estudios universitarios, se muda a Hollywood donde decide lanzarse al mundo de la actuación. Empieza a prepararse en arte dramático en una escuela de la ciudad pero finalmente lo deja cuando conoce a un agente con el que firma su primer contrato y le proporciona diferentes pruebas y castings.\n\nEntre el año 1995 y el año 2000 colecciona diferentes apariciones en series de televisión como \'Now What\', \'The Sausage Factory\' o \'Growing up Brady\'. También en el cine aparece en grandes películas y de gran repercusión como \'American Pie 2\', \'The Ring\' o en la famosa película de Brad Pitt y Angelina Jolie en \'Sr. y Sra. Smith\'.\n\nSu papel más importante l', '1979-12-15', 'San Diego, California, USA', NULL, 2, 'nm0111013', '11702', '/2iKOiwAXR1cgPVFHOGpNTpVyVvC.jpg', 10),
