(8273, 'Tye Sheridan', 'Tye Kayle Sheridan (11 de noviembre de 1996) es un actor estadounidense.​ Es conocido por sus interpretaciones en cine tales como Steve en El árbol de la vida (2011), Ben Goudy en Scouts Guide to the Zombie Apocalypse (2015), Cíclope en X-Men: Apocalypse (2016), Wade Watts en Ready Player One (2018) y Cíclope en X-men: Dark Phoenix', '1996-11-11', 'Elkhart, Texas, USA', NULL, 2, 'nm4446467', '1034681', '/d5ZS2fjqC98cIGkhEGX0fRYhku4.jpg', 22),
(8274, 'Olivia Cooke', 'Olivia Kate Cooke​ (27 de diciembre de 1993) es una actriz inglesa. De 2013 a 2017, co-protagonizó como Emma Decody en la serie de televisión de thriller dramático de A&E Bates Motel. Antes de esto, apareció en dos miniseries de BBC, Blackout y The Secret of Crickley Hall. En 2014, Cooke protagonizó tres películas de suspenso sobrenaturales: The Quiet Ones, The Signal y Ouija. En 2015, interpretó a Rachel Kushner en el drama de comedia Me and Earl and the Dying Girl. En 2018, interpretó a Art3mis/Samantha en la película Ready Player One de Steven Spielberg.', '1993-12-27', 'Oldham, Greater Manchester, England, UK', NULL, 1, 'nm4972453', '1173984', '/yZNcUEqmvDJQQ7avMfJfCh7sVk9.jpg', 25),
(8275, 'Lena Waithe', 'Lena Waithe (17 de mayo de 1984) es una guionista, productora y actriz estadounidense. Protagonizó la serie de comedia y drama de Netflix Master of None (2015-2017). Se convirtió en la primera mujer negra en ganar el Premio Primetime Emmy por Mejor escritura para una serie de comedia en 2017 por escribir el episodio \"Acción de Gracias \" del programa, que se basó en su experiencia personal de hablar con su madre.', '1984-05-17', 'Chicago, Illinois, USA', NULL, 1, 'nm2913119', '1059572', '/lVcsbWQp1smLYTaz7ilAQ7ny5si.jpg', 4),
(8276, 'Mark Rylance', 'David Mark Rylance Waters (18 de enero de 1960) es un actor, director de teatro y dramaturgo inglés. Egresado de la Royal Academy of Dramatic Art, comenzó su carrera en 1980 en el Citizens Theatre de Glasgow y luego en la Royal Shakespeare Company, de la que fue miembro hasta 1989. Fue director artístico del Shakespeare\'s Globe entre 1995 y 2005.\n\nHa trabajado en teatros británicos y de Estados Unidos, tanto del West End y Broadway como del circuito alternativo. En cine participó, entre otras, en Prospero\'s Books, de Peter Greenaway, Intimidad, de Patrice Chéreau y Bridge of Spies, The BFG y Ready Player One, de Steven Spielberg.\n\nRecibió, entre otros premios, dos Olivier, tres BAFTAs, dos Tonys y un Oscar a Mejor Actor de Reparto. Fue, además, ordenado Knight Bachelor en 2016.', '1960-01-18', 'Ashford, Kent, UK', NULL, 2, 'nm0753314', '40900', '/bztEZRyXrvW3Pg1fexNASXlZrq7.jpg', 26),
(8277, 'Philip Zhao', 'Philip Zhao (20 de septiembre de 2004) es un actor estadounidense de ascendencia china, principalmente conocido por su papel de Shō en la película Ready Player One.', '2004-09-20', 'Rockville, Maryland, U.S.', NULL, 2, 'nm8354830', '1721235', '/e7ZKuxGfyeKjvFMXXeGBMjUvWkS.jpg', 4),
(8278, 'Win Morisaki', 'Win Morisaki(20 de agosto de 1990) es un cantante y actor japonés de ascendencia birmana. Es el vocalista principal de PrizmaX, una banda de ídolos de J-pop. Ha aparecido en películas y dramas de televisión en Japón y Myanmar, así como en la película de Hollywood Ready Player One.', '1990-08-20', 'Birmania', NULL, 2, 'nm3359104', '1561997', '/im1ZzQdfjd5NL9wjFwZj4zh6rOC.jpg', 5),
