(8337, 'John Malkovich', 'John Gavin Malkovich (9 de diciembre de 1953) es un actor, productor y director de cine estadounidense.\n\nHa trabajado como actor en más de setenta películas, entre ellas: El imperio del sol, The Killing Fields, Con Air, Of Mice and Men, Being John Malkovich, Burn After Reading, RED y Warm Bodies, y ha producido películas como Ghost World, Juno y The Perks of Being a Wallflower.\n\nRecibió un premio Emmy por Muerte de un viajante y fue nominado a los Premios Oscar por sus papeles en En un lugar del corazón y En la línea de fuego.', '1953-12-09', 'Christopher, Illinois, USA', NULL, 2, 'nm0000518', '6949', '/f0iIDIG986W2ddMrCjdnIV4lVEA.jpg', 16),
