(8410, 'Paul Guilfoyle', 'Paul Guilfoyle (Boston, Massachusetts, 28 de abril de 1949) es un actor de cine y televisión estadounidense.\n\nSe educó en Boston, en el Boston College High School, una escuela de los jesuitas, y se graduó en la Universidad de Lehigh. Es más conocido por su papel del detective Jim Brass en la serie CSI: Crime Scene Investigation. Sin embargo, su paso por la televisión es extenso, incluyendo papeles notables en Miami Vice, Law & Order y Ally McBeal. Debutó en cines en 1975 y trabajó dos veces con Harrison Ford, en Air Force One y en Random Hearts.\n\nDescripción anterior del artículo de Wikipedia Paul Guilfoyle, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1949-04-28', 'Boston, Massachusetts, USA', NULL, 2, 'nm0002117', '925', '/c7unxeM13lF9pMhZhYwlNsSFjFe.jpg', 13),
