(8414, 'Jürgen Prochnow', 'Jürgen Prochnow (Berlín, 10 de junio de 1941) es un actor alemán. Se dio a conocer internacionalmente por su papel de capitán del submarino alemán en Das Boot (El submarino, 1981), de Wolfgang Petersen, y como el duque Leto Atreides en Dune (1984), de David Lynch. Posteriormente ha intervenido por lo general en papeles de malo, en producciones de Hollywood y de varios países europeos.\n\nProchnow nació en Berlín aunque se crio en Düsseldorf. Su padre era ingeniero y tiene un hermano mayor, llamado Dieter.\n\nEstudió interpretación en la Folkwang Hochschule en Essen. Gracias a sus personajes en la gran pantalla y su fluidez en inglés, se ha convertido en uno de los actores alemanes más exitosos de Hollywood. Entre sus películas de mayor éxito, se pueden citar Beverly Hills Cop II (protagonizada por Eddie Murphy), la oscarizada El paciente inglés, Air Force One (con Harrison Ford) y el megaéxito El Código Da Vinci, protagonizado por Tom Hanks.\n\nEn 2008 participó en una producción española, La conjura de El Escorial', '1941-06-10', 'Berlin, Germany', NULL, 2, 'nm0001638', '920', '/xjakZgQRw4NXefazNuvQEaGhT1U.jpg', 11),
