(8479, 'Al Leong', 'Albert Leong (30 de septiembre de 1952), es un artista marcial, coreógrafo de artes marciales, escritor, actor, doble de riesgo y director de ascendencia asiática-estadounidense. Ha aparecido en cine y televisión, además de involucrarse en la producción cinematográfica.\n\nEn el año 2000 hizo su debut directorial y como escritor en la película independiente Daddy Tell Me a Story...\n\nLeong debuto en el rodaje la tristemente celebre Twilight Zone: The Movie en 1983. Como actor, generalmente tiene pequeños papeles de matón. Calva incipiente, cabello ondulado, bigote largo y ojos muy expresivos. Es de los pocos actores que, a pesar de casi no tener presencia preponderante en sus películas, tienen un gran ejército de seguidores.\n\nLas características especiales de los personajes que ha interpretado Al Leong es que siempre tienen un tiempo muy pequeño en pantalla, siempre mueren a manos del personaje principal, casi nunca tienen un diálogo y la mayoría son villanos o secuaces; a excepción de las películas Cage de Lang', '1952-09-30', 'St Louis, Missouri, U.S.', NULL, 2, 'nm0502959', '61704', '/zC01uEOvbdTQIg19LKVu5r2QKan.jpg', 6),
