(8513, 'Jan de Bont', 'Director de cine, fotógrafo y productor holandés, nacido en Eindhoven. Fue uno de los diecisiete hijos de una familia católica holandesa de Eindhoven. Sus primeros trabajos después de estudiar en el Amsterdam Film Academy fue con el director Adriaan Ditvoorst. De Bont fue el director de fotografía de muchas de las primeras películas de Ditvoorst. Su primeros trabajos realmente conocidos fue como director de fotografía de la obra de Paul Verhoeven, Delicias turcas (1973) protagonizada por Rutger Hauer y Monique van de Ven. A partir de la década de los 80, de Bont da el salto a Hollywood como director de fotografía. Así colaboraría en proyectos como El cuarto hombre (1983), La jungla de cristal (1988), Black Rain (1989) La caza del Octubre Rojo (1990) o Instinto básico (1994). De Bont debutaría como director con el taquillazo de Speed (1994). Después seguirían otros títulos como Twister (1996), La guarida (1999) o Lara Croft (2003).', '1943-10-22', 'Eindhoven, Noord-Brabant, Netherlands', NULL, 2, 'nm0000957', '2209', '/omuf0WjtBlkRWlVHPTgaXKhQsDe.jpg', 4),
