(8619, 'Paz Vega', 'María de la Paz Campos Trigo (2 de enero de 1976) conocida por su nombre artístico Paz Vega, es una actriz y modelo española. Su papel de Laura en la serie Siete vidas hizo que alcanzara un notable grado de popularidad. El reconocimiento en el cine le llegó con la película dirigida Julio Medem Lucía y el sexo (2001), con la que ganó el Premio Goya a la mejor actriz revelación. Por su trabajo en Solo mía, dirigida por Javier Balaguer, consiguió que la propusieran como candidata al premio a la mejor actriz principal.', '1976-01-02', 'Sevilla, Spain', NULL, 1, 'nm0891895', '3627', '/fNLlJysFd5f0Q8Lj20EZpU8BiRN.jpg', 23),
(8620, 'Yvette Monreal', 'Yvette Monreal (9 de julio de 1992) es una actriz estadounidense de origen mexicano-chileno, conocida por sus actuaciones en Matador (2014) como Senna Galan y como Reagan en la serie de MTV Faking It (2014).', '1992-07-09', 'Los Angeles, California, USA', NULL, 1, 'nm6060991', '1442968', '/l1TkZDvJX4cqaTwbHFTzk0coYgX.jpg', 15),
