(8744, 'Gemma Arterton', 'Gemma Christina Arterton​ (Gravesend, Kent; 2 de febrero de 1986) es una actriz inglesa de cine, teatro y televisión. Hizo su debut en el cine en la comedia St Trinian\'s (2007). Logró el reconocimiento comercial en la película Quantum of Solace (2008), interpretando a la chica Bond Strawberry Fields, actuación que le valió recibir un premio Empire en la categoría de actor revelación. En 2009 se convirtió en la protagonista de la película La desaparición de Alice Creed. Es conocida por sus papeles en películas de fantasía como Furia de Titanes (2010), Prince of Persia: The Sands of Time (2010), Byzantium (2013) y Hansel y Gretel: Cazadores de brujas (2013). Interpretó el papel de Joan en la obra de Bernard Shaw Saint Joan en el Donmar Warehouse en diciembre de 2016.  Gemma es hija de Barry Arterton, un soldador, y de Sally Heap, una empleada de limpieza.3​ Nació con polidactilia, condición que fue corregida por un doctor al poco tiempo de su nacimiento. A los 16 años, Arterton dejó la escuela para asistir al T', '1986-02-02', 'Gravesend, Kent, England, UK', NULL, 1, 'nm2605345', '59620', '/ntHUKvMHjBjVXX33nycm7zNFYI1.jpg', 34),
