(8750, 'Nicholas Hoult', 'Nicholas Caradoc Hoult​ (7 de diciembre de 1989) es un actor y modelo británico.\n\nRealizó su debut profesional en el cine en 1996 con el filme Intimate Relations a la edad de 7 años, pero no fue hasta 2002 cuando ganó el reconocimiento internacional por la cinta About a Boy. Posteriormente realizó papeles más maduros en películas como la saga X-Men y Mad Max: Fury Road. También destaca su elogiada participación en la serie de televisión Skins, transmitida de 2007 a 2008.', '1989-12-07', 'Wokingham, England, UK', NULL, 2, 'nm0396558', '3292', '/rbyi6sOw0dGV3wJzKXDopm2h0NO.jpg', 27),
