(8776, 'Natalia Vodianova', 'Natalia Mijáilovna Vodiánova (en ruso, Наталья Михайловна Водянова) es una supermodelo y actriz ocasional rusa. También conocida como Supernova,​ pues pasó de una infancia sumida en la pobreza a una vida de riqueza y lujo en las pasarelas tras firmar por ocho temporadas y un contrato de siete cifras con Calvin Klein. En 2012, Vodiánova quedó en tercer lugar en la lista de modelos por ingresos elaborada por Forbes, que estimó que había ganado $8.6 millones en un año.\n\nCreció en una familia con escasos recursos. Vivía con su madre y dos hermanas menores que ella, todas de padres distintos, una de las cuales padece parálisis cerebral. Desde los 11 años ayudaba a su madre, que vendía fruta en un puesto ambulante. Después instaló con una amiga su propio puesto de fruta para ayudar a sus familias.\n\nCon 15 años se inscribió en una academia de modelos con la intención de obtener ingresos extras. Allí le dijeron que, para triunfar en ese mundo, debía aprender inglés, cosa que hizo en tres meses. Con 17 años se traslad', '1982-02-28', 'Nizhny Nóvgorod, URSS', NULL, 1, 'nm1177440', '1105030', '/raYLNv3qwJ9lrl4hnMq65iy7k0v.jpg', 15),
