(8782, 'Rosie Huntington-Whiteley', 'Rosie Alice Huntington-Whiteley​ (18 de abril de 1987) es una modelo, actriz y diseñadora de moda británica, más conocida por su trabajo con las marcas Victoria\'s Secret y Burberry.\n\nAdemás de su carrera como modelo, Huntington-Whiteley también es una actriz ocasional. Su debut en el cine fue con el papel de Carly Spencer en la película de 2011 Transformers: el lado oscuro de la luna, tercera entrega de la serie cinematográfica de Transformers. En 2012 incursionó también en el diseño de indumentaria y lanzó su propia colección de lencería femenina para la empresa Marks & Spencer. La línea gozó de un buen rendimiento comercial, triplicando los niveles de ventas esperados.', '1987-04-18', 'Plymouth, Devon, England, UK', NULL, 1, 'nm2492819', '236048', '/uVL2iW7wjkc0hklI5ANosBINOfh.jpg', 18),
