(8920, 'Michael Rooker', 'Michael Rooker (6 de abril de 1955) es un actor estadounidense, conocido principalmente por protagonizar la película Henry, retrato de un asesino, basada libremente en la vida del asesino en serie Henry Lee Lucas, también por encarnar al personaje de Merle Dixon en la serie de televisión The Walking Dead y en los últimos años por darle vida a Yondu Udonta en las películas Guardianes de la Galaxia y Guardianes de la Galaxia Vol. 2.', '1955-04-06', 'Jasper, Alabama, USA', NULL, 2, 'nm0740264', '12132', '/dq3xFKDWJsQjPffm1bmB3TbMilq.jpg', 25),
