(8941, 'Seth Green', 'Seth Benjamin Gesshel-Green (nacido el 8 de febrero de 1974) es un actor, comediante, actor de doblaje y productor de televisión estadounidense. Es bien conocido por su papel de Daniel \"Oz\" Osbourne en Buffy the Vampire Slayer, así como por el hijo del Dr. Evil, Scott, en la serie de películas de comedia Austin Powers y Mitch Miller en That \'70s Show. También da voz a los personajes de Chris Griffin en Family Guy, el teniente Gibbs en Titan Maximum, Jeff \"Joker\" Moreau en la serie de videojuegos Mass Effect, y es uno de los creadores y productores de la serie de comedia stop motion Robot Chicken, en la que también da voz a muchos personajes. Green ha aparecido en muchas otras películas, como Rat Race, The Italian Job, Can\'t Hardly Wait, Without a Paddle, y cuando era niño en la película de terror Stephen King\'s It.', '1974-02-08', 'Overbrook Park, West Philadelphia, Pennsylvania, U.S.', NULL, 2, 'nm0001293', '13922', '/l4No5Eu6j0U80hCIkaSn17AOWrj.jpg', 25),
(8942, 'Michael Rosenbaum', 'Michael Owen Rosenbaum (11 de julio de 1972) es un actor estadounidense, conocido por interpretar a Lex Luthor en Smallville (The CW).  También ha actuado en películas y ha doblado a personajes animados, como por ejemplo a Wally West en la serie de animación de DC Comics La Liga de la Justicia.', '1972-07-11', 'Oceanside, New York, USA', NULL, 2, 'nm0742146', '19975', '/9a1wACjRIAg1cbTEsL5WrzPwnFi.jpg', 11),
(8943, 'Rhoda Griffis', '', '1965-01-09', 'Raleigh, North Carolina, USA', NULL, 1, 'nm0341421', '51456', '/jO50PgihnZ0gAlJDulpzxMoLgRB.jpg', 6),
(8944, 'David Hasselhoff', 'David Michael Hasselhoff (Baltimore, Maryland; 17 de julio de 1952), es un actor, productor y músico estadounidense. Su gran oportunidad llegó en 1982 con la serie Knight Rider (El coche fantástico en España), serie por la que se interesó desde que conoció el proyecto. La serie fue un enorme éxito, tanto en Europa como en América. Se mantuvo en antena durante cuatro años (1982-1986). En ella interpretaba a Michael Knight. El éxito de esta serie popularizó su imagen a nivel mundial. Tras la finalización de la serie entró en una fuerte crisis profesional, y decidió dedicarse a su otra pasión, la música. Grabó su primer disco, titulado Night Rocker, en 1985. En 1989 unos productores televisivos le comentaron la idea que tenían para una serie, las vidas de unos guardavidas en las playas de Malibú. Desde entonces la carrera de David volvió a coger fuerza, llegando aún más lejos que en sus mejores días en Knight Rider. La serie en cuestión se titula Baywatch (Los vigilantes de la playa en España) (1989-2001), y Dav', '1952-07-17', 'Baltimore, Maryland, USA', NULL, 2, 'nm0001327', '28238', '/gRcqYNBUQWFxRoAVRNY7xHzOONP.jpg', 14),
