(8997, 'James Gunn', 'James Gunn (5 de agosto de 1966) es un director, guionista y productor de cine estadounidense. Es conocido por ser el director, guionista y productor de grandes éxitos como Super (2010) y la adaptación cinematográfica del cómic de Marvel Guardianes de la Galaxia (2014) y su secuela Guardianes de la Galaxia Vol. 2 (2017). Como escritor ha trabajado en los guiones de Tromeo y Julieta (1996), Scooby-Doo (2002) y su secuela, Scooby-Doo 2: Monsters Unleashed (2004), y la versión Dawn of the Dead (2004). Es el hermano mayor del actor Sean Gunn.', '1966-08-05', 'St. Louis, Missouri, USA', NULL, 2, 'nm0348181', '15218', '/2kFzvqCGeYBrgbuuvvyGE75d9gM.jpg', 8),
