(9022, 'Corbin Bleu', 'Corbin Bleu Reivers (21 de febrero de 1989) es un actor, cantautor, modelo, bailarín y productor de cine ítalo-estadounidense de ascendencia jamaicana e italiana. Actualmente vive en Los Ángeles, California con su familia, Tiene tres hermanas: Jag, Phoenix y Hunter.\n\nTambién tuvo pequeños papeles en películas como Soldier en 1998, Corbin fue elegido para su primer papel protagonista en la película de 2004, Catch That Kid, Bleu es más conocido por su rol en High School Musical como Chad Danforth y por Flight 29 Down como Nathan. También ha protagonizado una película de Disney llamada Jump In! junto a su padre, el actor David Reivers, estrenó la segunda parte de High School Musical, High School Musical 2, y High School Musical 3, En el otoño de 2009, tuvo un papel principal en la película Free Style en 2008.\n\nApareció en el nuevo espectáculo The CW, The Beautiful Life en 2009, obtuvo el papel principal en el musical de Broadway In the Heights en 2010,​ La protagonizada por Corbin en las comedias de cortometraje', '1989-02-21', 'New York City, New York, USA', NULL, 2, 'nm0088298', '67602', '/AiPiQPFgMCNz9ycgAMtskkPZUeC.jpg', 6),
