(9029, 'Martin Freeman', 'Martin John Christopher Freeman (8 de septiembre de 1971), conocido simplemente como Martin Freeman, es un actor y comediante británico. Es más reconocido por sus papeles en las series The Office (2001-2003), Sherlock (2010-2017) y Fargo (2014). Además, ha trabajado en la película The Hitchhiker\'s Guide to the Galaxy (2005) y en la trilogía de El hobbit (desde 2012 hasta 2014), donde interpretó a Bilbo Bolsón.\n\nEs reconocido por interpretar a Everett K. Ross en el Universo cinematográfico de Marvel en las películas Capitán América: Civil War (2016) y Black Panther (2018).', '1971-09-08', 'Aldershot, Hampshire, England, UK', NULL, 2, 'nm0293509', '7060', '/pLG7mmxBXXTVAgzXvQl0ap3qlJU.jpg', 20),
(9030, 'Zooey Deschanel', 'Zooey Claire Deschanel (17 de enero de 1980) es una actriz, comediante, cantante, modelo, productora y compositora estadounidense. Debutó en el cine en 1999, con la película Mumford y más tarde consiguió su papel estelar en la película semi-autobiográfica que Cameron Crowe hizo en 2000, Casi famosos, donde interpretaba a Anita, la joven rebelde hermana mayor del protagonista William Miller. Cuenta con dos nominaciones a los premios Globo de oro.', '1980-01-17', 'Los Angeles, California, USA', NULL, 1, 'nm0221046', '11664', '/SclP5BoaEgq38OIr61iaQF5HYV.jpg', 16),
