(9046, 'Gérard Depardieu', 'Gérard Xavier Marcel Depardieu (27 de diciembre de 1948), más conocido como Gérard Depardieu, es un actor francés nacionalizado ruso en enero de 2013. Es caballero de la Legión de Honor, Caballero de la Orden Nacional del Mérito, ambas condecoraciones francesas, y Caballero Honorario de la Ordre national du Québec, condecoración otorgada por la provincia canadiense de Quebec.', '1948-12-27', 'Châteauroux, Indre, France', NULL, 2, 'nm0000367', '16927', '/oMspXVP2264ya1qHmlvNmgmHG6d.jpg', 23),
(9047, 'Hugo Silva', 'Rafael Hugo Fernández Silva (10 de mayo de 1977), más conocido como Hugo Silva, es un actor español.\n\nSu FP incluye estudios de teatro, arte dramático, canto, guitarra, hasta el punto de haber sido miembro de un grupo de música heavy llamado Inordem.', '1977-05-10', 'Madrid, Spain', NULL, 2, 'nm1281229', '112901', '/vD5q2gkKACW2GfasbLFUixbJbZb.jpg', 7),
(9048, 'Eugenia Suárez', 'María Eugenia Suárez Riveiro, más conocida como China Suárez, es una actriz, modelo, cantante y diseñadora de moda argentina. Suárez nació el 9 de marzo de 1992 en la Ciudad de Buenos Aires, hija de Guillermo Suárez y Marcela Riveiro Mitsumori. Tiene un hermano mayor, Agustín. Su abuela materna, Marta Mitsumori, era hija de inmigrantes japoneses. Suárez tiene primos que viven en la prefectura de Kōchi, en la isla de Shikoku.', '1992-03-09', 'Buenos Aires, Argentina', NULL, 1, 'nm1421927', '1246183', '/geUywxVqfMBWBAyhmfLK1VnpTic.jpg', 5),
(9049, 'Alejandro Fiore', 'Comenzó su carrera actoral en cine, en la película El profesor punk, escrita y dirigida por Enrique Carreras, protagonizada por Jorge Porcel. Debutó en televisión en la telenovela, Poliladron, emitida desde 1995 hasta 1997 por canal 13.\n\nEs conocido por sus interpretaciones en series y telenovelas como Pablo Lamponne en Los Simuladores, \"El Perro\" en la seria carcelaria Tumberos, Patricio Tamargo abogado del personaje de Pablo Echarri en Montecristo, entre otros trabajos.', '1969-07-05', 'Buenos Aires - Argentina', NULL, 0, 'nm0278442', '1175885', '/ofEsu96mEPGCGG2ZsdTgYmrUB6N.jpg', 1),
(9050, 'Pablo Cedrón', 'Pablo Cedrón comenzó su carrera trabajando en películas menores, y llegó a formar parte del programa humorístico De la cabeza junto a Alfredo Casero, colaborando en guiones de sketchs y actuando delante de la pantalla.\n\nUn año después, en 1994, el programa (que fue considerado de culto por los medios argentinos) comenzó a ser producido por el conductor televisivo Nicolás Repetto y pasó a llamarse Cha Cha Cha, incorporando en el staff a Mariana Briski, Mex Urtizberea, y conservando a los miembros del programa anterior, que se completaban con Diego Capusotto, Rodolfo Samsó (Alacrán) y Fabio Alberti.\n\nEn este programa creó uno de sus personajes más importantes a la fecha, el sexólogo Nelson Carmen Gómez, paraguayo y de vocabulario poco profesional, que respondía las preguntas del público a través de la conductora de un programa femenino de medio pelo. Tal fue la repercusión del personaje que el propio Repetto lo separó del grupo original y lo llevó a su programa (Nico - 1995), de gran éxito en los mediodías port', '1958-01-07', 'Mar del Plata, Buenos Aires, Argentina', '2017-11-01', 2, 'nm0147834', '74910', '/2XJwi7QMboKGsDzxtUKsZ2HuxQU.jpg', 1),
