(9335, 'Paco León', 'Francisco «Paco» León Barrios (4 de octubre de 1974) es un actor, director y productor de cine español. Es hermano de la también actriz María León e hijo de Carmina Barrios.\n\nLeón se dio a conocer en 2003 con la serie de sketches Homo zapping. Sin embargo, el éxito nacional le llegó en 2005 con el inicio de la serie de televisión Aída, donde interpretaba a Luis Mariano «Luisma» García García, un drogadicto rehabilitado, al que todos se refieren como «el tonto del barrio». Además, también ha sido el protagonista de las películas No lo llames amor... llámalo X, Kiki, el amor se hace, Embarazados, 7 años, Toc toc y La tribu.', '1975-10-04', 'Sevilla, Spain', NULL, 2, 'nm1346713', '224870', '/dZd0Z3mUgXrE0y21KknLp40Ivuk.jpg', 8),
