(9359, 'Rosa Salazar', 'Salazar, de ascendencia peruana y francesa, nació en Washington, D.C, donde se estableció su padre, de origen peruano. Tras la separación de sus progenitores, su madre comenzó una nueva relación que la separó definitivamente de su familia. A la edad de 15 años se propuso cumplir su sueño de convertirse en actriz después de mudarse a la ciudad de Nueva York, donde trabajó en el canal humorístico CollegeHumor. Poco después de mudarse a Los Ángeles en el año 2009, Salazar consiguió un papel recurrente en dos series de éxito, American Horror Story: Murder House y Parenthood.\n\nEn 2014, se unió al elenco de la película The Divergent Series: Insurgent, en el papel de Lynn, y también consiguió un rol en la cinta Maze Runner: The Scorch Trials, encarnando a Brenda.', '1985-07-16', 'Washington, D.C', NULL, 1, 'nm4023073', '973667', '/hrU1Kg1SH03x0RRmWEzmnWEonuU.jpg', 36),
(9360, 'Christoph Waltz', 'Christoph Waltz (4 de octubre de 1956) es un actor germano-austríaco.​ Ganador del premio Óscar al mejor actor de reparto en dos ocasiones por sus interpretaciones en Inglourious Basterds (2009) y en Django Unchained (2012), ambas películas del director Quentin Tarantino. Entre otros galardones, ha sido acreedor de los Globo de Oro, BAFTA y el premio al mejor actor del Festival de Cannes.', '1956-10-04', 'Vienna, Austria', NULL, 2, 'nm0910607', '27319', '/2Hhztd4mUEV9Y25rfkXDwzL9QI9.jpg', 8),
(9361, 'Ed Skrein', 'Edward George \"Ed\" Skrein ( 29 de marzo de 1983) es un actor y rapero. Es conocido por el personaje de Daario Naharis en la serie de televisión Game of Thrones, por su papel de Ajax en la película de Marvel, Deadpool y por su papel de Frank Martin en el reinicio de la saga de The Transporter con la película The Transporter Refueled. En la música, es conocido por su primer trabajo en 2007 titulado \"The Eat Up\".', '1983-03-29', 'Camden, London, England', NULL, 2, 'nm4534098', '1047649', '/c5PSRY9xbwJFCVCEeDIcx9SiJI1.jpg', 19),
(9362, 'Jackie Earle Haley', 'Jackie Earle Haley (14 de julio de 1961) es un actor de cine estadounidense. Comenzó como actor infantil y fue nominado al premio Óscar siendo adulto. Es conocido por sus papeles como Moocher en El relevo, Kelly Leak en la trilogía Los picarones, el pedófilo Ronnie McGorvey en Juegos secretos, el antihéroe Rorschach en Watchmen y el icono del terror Freddy Krueger en la versión de 2010 de A Nightmare on Elm Street. Además, interpretó a Guerrero en la serie dramática de Fox Human Target.', '1961-07-14', 'Northridge, California, USA', NULL, 2, 'nm0355097', '17183', '/qVPNzBEm9xF4YX1SwkXhxgsuqCt.jpg', 6),
(9363, 'Keean Johnson', 'Keean Johnson (25 de octubre de 1996) es un actor y bailarín estadounidense. Nacido en Colorado, interpretó a uno de los papeles principales, Hugo, en la película Alita: Battle Angel.', '1996-10-25', 'Denver, Colorado, USA', NULL, 2, 'nm5277107', '1448516', '/qYslz07HQUW1bAqdYSa3dUbnglb.jpg', 12),
(9364, 'Lana Condor', 'Lana Therese Condor es una actriz estadounidense de origen vietnamita. Hizo su debut cinematográfico en X-Men: Apocalipsis (2016), interpretando a Jubilation Lee / Jubilee. Condor nació el 11 de mayo de 1997 en Can Tho, Vietnam, y fue adoptada por sus padres estadounidenses, Mary Carol (Haubold) y el periodista Robert Condor, cuando era pequeña. Su hermano no biológico, Arthur Robert, fue adoptado junto con ella.\n\nCondor pasó sus primeros años en Chicago, Illinois. A los siete años, su familia se había establecido en Whidbey Island, Washington, donde Condor tomó su primera clase de baile. Luego bailó en la Rock School of Dance Education y en el Spectrum Dance Theatre de Seattle. A los 11 años, Condor y su familia se mudaron a la ciudad de Nueva York, donde continuó su entrenamiento de ballet clásico, bailando en múltiples academias de prestigio, incluida la Escuela de Ballet Clásico Joffrey, la Academia de Ballet Clásico Gelsey Kirkland y el Alvin Ailey American Dance. Teatro.\n\nMientras vivía en Nueva York, l', '1997-05-11', 'Cần Thơ, Vietnam', NULL, 1, 'nm7093076', '1452046', '/s4UQLSdAogS1skAbcB78pNBJyIL.jpg', 14),
