(9396, 'Maria Bakalova', 'Maria Bakalova nació el 4 de junio de 1996 en Burgas, Bulgaria. A la edad de seis años comenzó a cantar y tomar lecciones de flauta. Estudió en la Escuela Nacional de Artes de Burgas, especializándose en actuación para teatro y una segunda especialización en flauta. Posteriormente estudió en la Academia Nacional de Teatro y Artes Cinematográficas de Sofía. En 2019 se graduó con éxito.', '1996-06-04', 'Burgas, Bulgaria', NULL, 1, 'nm7210025', '2408703', '/nUivgeC0kyhkI6QOAhw2k5VGhBk.jpg', 11),
