(9399, 'Anya Taylor-Joy', 'Anya Taylor-Joy es una actriz estadounidense. Es más conocida por su papel protagónico como Thomasin en la película de terror sobrenatural The Witch (2015) y como Casey Cooke en la película de terror y suspense Split (2016).', '1996-04-16', 'Miami, Florida, USA', NULL, 1, 'nm5896355', '1397778', '/8YUcwFAOBK3Yt5jnj9G2U8IffD.jpg', 49),
(9400, 'Jack Black', 'Thomas Jacob Black (Santa Mónica, California, 28 de agosto de 1969), más conocido como Jack Black, es un actor, músico, comediante y productor estadounidense.  Entre su extensa filmografía, Black ha protagonizado películas tales como Amor ciego, King Kong, Nacho Libre, Tropic Thunder, The Holiday, Goosebumps, Bernie o Kung Fu Panda. También es considerado un miembro del grupo de actores cómicos llamado Frat Pack, que desde muy temprana edad han aparecido juntos en varias películas de Hollywood.  Black fue nominado a dos Premios Globo de Oro. Además, es vocalista de la banda de rock Tenacious D, que formó en 1994, junto con su amigo Kyle Gass.', '1969-08-28', 'Santa Monica, California, USA', NULL, 2, 'nm0085312', '70851', '/rtCx0fiYxJVhzXXdwZE2XRTfIKE.jpg', 40),
(9401, 'Seth Rogen', 'Seth Rogen (15 de abril de 1982) es un actor, comediante, escritor, director y productor de cine canadiense. Comenzó su carrera haciendo comedia en vivo durante cuatro años cuando era un adolescente, llegando al segundo puesto en un concurso amateur de comedia en su ciudad natal a los 16 años. Cuando todavía vivía en Canadá, asistió al casting para un papel secundario en Freaks and Geeks. Después de trasladarse a Los Ángeles para el papel, Freaks and Geeks fue cancelada después de una temporada. Consiguió un lugar en la también poco duradera Undeclared, serie en la cual también se encargó de escribir.\n\nDespués de conseguir trabajo como escritor en la temporada final de Da Ali G Show, por la cual él y otros escritores recibieron una nominación al premio Emmy, fue guiado por el director Judd Apatow hacia una carrera en el cine. Fue contratado para un papel de reparto importante y acreditado como coproductor en el debut como director de Apatow, The 40-Year-Old Virgin. Después de recibir elogios por su actuación,', '1982-04-15', 'Vancouver, British Columbia, Canada', NULL, 2, 'nm0736622', '19274', '/xCt0MWnPkk1tJIYYPT6fekgQRMg.jpg', 23),
