(9416, 'Faye Dunaway', 'Dorothy Faye Dunaway es una actriz estadounidense ganadora del premio Óscar así como de un premio Emmy, tres Globos de Oro y un BAFTA. Fue uno de los iconos sexuales más reconocidos de las décadas de 1960-70 y es una de las actrices con más películas en la lista de las 100 mejores de la historia. Figura controvertida en su profesión, de carácter «difícil» y con una carrera tan larga como llena de altibajos comerciales, se la considera, junto con Marlene Dietrich, Barbara Stanwyck y Lauren Bacall, como una de las más famosas «mujeres fatales» de la historia del cine.', '1941-01-14', 'Bascom, Florida, USA', NULL, 1, 'nm0001159', '6450', '/bwHJPkiDOjTslgrl0mri1Ndvx2V.jpg', 16),
