(9430, 'Chloë Grace Moretz', 'En ocasiones acreditada como Chloë Moretz, es una actriz de cine y modelo estadounidense. Sus primeras actuaciones las realizó a los 7 años en series y películas como The Amityville Horror (2005), (500) días con ella (2009), El diario de Greg, Mujeres desesperadas o Dirty Sexy Money. Con estas producciones fue nominada a varios Premios Young Artist.  Recibió reconocimiento mundial por su primer protagónico como Hit-Girl en la película Kick-Ass de 2010 al igual que en otras producciones como: Déjame entrar y Hugo (2011),5​ consagrando su carrera artística.\n\nChloë Moretz nació en Atlanta, Georgia, el 10 de febrero de 1997. Su madre, Teri, es enfermera, y su padre, McCoy Lee Moretz, es cirujano plástico.6​7​ Tiene cuatro hermanos mayores; Brandon, Trevor (siendo este su representante), Colin e Ethan.​ Su carrera en Hollywood comenzó cuando la familia se mudó a Los Ángeles en 2004.\n\nSu primer papel cinematográfico fue el de Molly en la película Heart of the Beholder. No fue hasta 2005 cuando actuó en el remake de', '1997-02-10', 'Atlanta, Georgia, USA', NULL, 1, 'nm1631269', '56734', '/u08QwcFnJpMtsDEYSlbUkMuE7bP.jpg', 44),
