(9436, 'Navid Negahban', 'Navid, aunque a veces se le llama \"el hombre de las mil caras\", todavía es considerado como Abu Nazir, el enigmático líder de al-Qaeda que jugó durante dos temporadas en la serie original de Showtime, \"Homeland\", ganadora del Emmy. Entre sus muchos seguidores están el presidente israelí, Shimon Peres, y el presidente de los Estados Unidos, Barack Obama. El versátil ladrón de escenas ha recibido elogios críticos como el delegado de IRK Jamot en la temporada final de la exitosa serie de Fox, \"24\", y ha aparecido en \"CSI: NY\", \"CSI: Miami\", \"NCIS: Los Angeles\" \"Ley y orden: SVU\", \"The Closer\", \"The Game\", \"Criminal Minds\", \"Lost\", \"JAG\", \"The West Wing\", \"Without a Race\", \"The Shield\" y otros.\n\nLa estrella de Navid sigue subiendo en la gran pantalla. Fue un destacado en el éxito de taquilla nominado al Oscar de Clint Eastwood, \"American Sniper\", como Sheikh Al-Obodi, un local iraquí que pagó para ayudar a los francotiradores a localizar sus objetivos. A continuación se lo puede ver en \"Baba Joon\", la primera pel', '1968-06-02', 'Mashhad, Iran', NULL, 2, 'nm1041023', '103330', '/cPsYncbHK7J76Sm4bc1rtgRh5qf.jpg', 9),
