(9580, 'Cathy Moriarty', 'Cathy Moriarty-Gentile (nacida el 29 de noviembre de 1960) es una actriz estadounidense. Su primer crédito cinematográfico fue Raging Bull, de Martin Scorsese, en 1980, como Vikki LaMotta, esposa del protagonista de Robert De Niro. Su actuación le valió una nominación al Oscar a la Mejor Actriz de Reparto. También apareció frente a Andrew Dice Clay en la breve sitcom de CBS Bless This House (1995). Más tarde, apareció como la villana Carrigan Crittenden en la película Casper de 1995 y como Rose Donlan, esposa del policía corrupto de Harvey Keitel en Cop Land de 1997. Se reunió con De Niro para la película Analyze That de 2002, en la que interpretó a la jefa de la mafia, Patti LoPresti.', '1960-11-29', 'The Bronx, New York, USA', NULL, 1, 'nm0001550', '14702', '/g5pXUDGH30egsCq9eTDrsikFAYk.jpg', 11),
