(9606, 'Clint Eastwood', 'Clinton «Clint» Eastwood Jr. (San Francisco, California; 31 de mayo de 1930) es un actor, director, productor, músico y compositor estadounidense. Su primer papel relevante fue como secundario en el reparto de la serie de televisión Rawhide (1959-1965). Alcanzó la fama interpretando al Hombre sin nombre en los spaghetti western conocidos como Trilogía del dólar que dirigió Sergio Leone en la década de 1960 —Por un puñado de dólares, La muerte tenía un precio y El bueno, el feo y el malo— y a Harry Callahan en la serie de películas de Harry el Sucio durante los años 1970 y 1980. Estos papeles, entre otros, lo convirtieron en un icono cultural de masculinidad.', '1930-05-31', 'San Francisco, California, USA', NULL, 2, 'nm0000142', '190', '/dU35NnjZ4aGw5abIJe3WXVf3Eey.jpg', 30),
