(9624, 'R. Lee Ermey', 'Ronald Lee Ermey (Emporia, 24 de marzo de 1944) es un sargento instructor del Cuerpo de Marines de los Estados Unidos retirado y actor estadounidense.\n\nEstudió arte dramático en la Universidad de Manila (en Filipinas) tras la guerra de Vietnam. Casi todos los personajes que interpreta son militares o figuras autoritarias. La más memorable de sus interpretaciones es, sin duda, la del sargento de artillería Hartman, instructor jefe en Full Metal Jacket, de Stanley Kubrick. Fue el anfitrión de un programa sobre historia, armamento y equipo militar llamado Mail Call en History Channel.\n\nEl 17 de mayo de 2002 fue ascendido de forma honoraria a Sargento de artillería por el entonces comandante del Cuerpo de Marines, James L. Jones, convirtiéndose así en el primer miembro retirado de la historia del Cuerpo de Marines en ser ascendido.', '1944-03-24', 'Emporia, Kansas, USA', '2018-04-15', 2, 'nm0000388', '8655', '/vOX3JHPLrKn2HJoPNguKcTN8Lk0.jpg', 15),
