(9629, 'Bibi Andersson', 'Bibi Andersson, cuyo nombre completo es Berit Elisabeth Andersson (n. Estocolmo, Suecia, 11 de noviembre de 1935), es una actriz y directora de cine, teatro y televisión. Su carrera está muy ligada al director sueco Ingmar Bergman.\n\nEn 1951, inició su carrera cinematográfica con el realizador Ingmar Bergman, en la producción de un corto publicitario para un detergente. Su primer papel cinematográfico lo interpretó en 1953 junto al actor Nils Poppe en la cinta Dumbon.\n\nRealizó estudios de actuación en el Terserus teaterskola, para luego, entre 1954 y 1956, estudiar en el Real Teatro Dramático de Estocolmo (Dramaten), participando posteriormente como actriz en el Teatro de Malmö (Malmö stadsteatern), bajo la dirección de Ingmar Bergman hasta 1959. Simultáneamente, participó en los filmes Fresas salvajes (1956) y El séptimo sello (1957) del mismo director, filmes que la lanzaron al estrellato. En 1962, se incorporó por un año al elenco del Teatro de Uppsala (Uppsala stadsteatern), regresando al Real Teatro Dramá', '1935-11-11', 'Kungsholmen, Stockholm, Stockholms län, Sweden', '2019-04-14', 1, 'nm0000761', '6657', '/cFA4cU61kpoCEUEtLtBUg5F0Do2.jpg', 6),
