(9672, 'Joaquin Phoenix', 'Joaquin Rafael Phoenix (registrado como Joaquin Rafael Bottom; San Juan, 28 de octubre de 1974) es un actor estadounidense de origen puertorriqueño, ganador del Óscar y nominado en 4 ocasiones a la estatuilla, ganador de dos Globos de Oro, de un Grammy, un SAG, un BAFTA, dos Critics Choice Awards, de la Copa Volpi en el Festival Internacional de Cine de Venecia y del premio a Mejor Actor en el Festival de Cannes. Es hermano del actor River Phoenix, y de las actrices Rain, Summer y Liberty Phoenix.\n\nPhoenix comenzó a actuar en televisión con su hermano, River, y su hermana, Summer. Su primer papel importante en el cine fue en SpaceCamp (1986). Durante este período, apareció en los créditos como Leaf Phoenix, su nombre propio. Recibió una atención más amplia por su interpretación de Cómodo en el épico Gladiator, que le valió una nominación a los Premios Óscar al mejor actor de reparto. Posteriormente, ganó el premio al mejor de comedia o musical en los Premios Globo de Oro por interpretar al músico Johnny Cash ', '1974-10-28', 'San Juan, Puerto Rico', NULL, 2, 'nm0001618', '73421', '/1UzIGSKFH0A9ouwnMwQQWUiqV2s.jpg', 16),
(9673, 'Rooney Mara', 'Patricia Rooney Mara (Bedford, Nueva York; 17 de abril de 1985) es una actriz estadounidense. Comenzó su carrera desempeñando papeles secundarios en varias películas independientes, incluida la película de drama Tanner Hall (2009), antes de interpretar a Nancy Thompson en la adaptación de 2010 de A Nightmare on Elm Street y como Erica Albright en la película de drama biográfico The Social Network (2010).\n\nEn 2011, Mara tuvo gran reconocimiento en su carrera cuando interpretó a Lisbeth Salander, en la película de David Fincher The Girl with the Dragon Tattoo, basada en la saga literaria de Stieg Larsson Millennium. Recibió elogios de la crítica por su actuación y fue nominada a un Premio de la Academia a la Mejor Actriz y al Globo de Oro a la mejor actriz – Drama. En 2013, participó en las películas Side Effects, Ain\'t Them Bodies Saints, y el aclamado drama romántico de ciencia ficción Her. Al año siguiente, actuó en la película de drama de aventuras Trash (2014). En 2015, obtuvo más elogios de la crítica por', '1985-04-17', 'Bedford, New York, USA', NULL, 1, 'nm1913734', '108916', '/zT6UyHFHEQ9RcKykplWCycKBnoS.jpg', 13),
(9674, 'Olivia Wilde', 'Olivia Wilde, es una actriz y modelo estadounidense. Es especialmente conocida por su papel en la serie de televisión House, donde interpretaba a la Dra. Remy Hadley o Trece. También destaca su papel como Alex Kelly, que tuvo un romance con Marissa Cooper y Seth Cohen en la segunda temporada de la serie The O. C., o como Quorra en Tron: Legacy. Otras producciones de cine y televisión en las que ha aparecido son Cowboys &amp; Aliens, In Time, Drinking Buddies y Rush.', '1984-03-10', 'New York City, New York, USA', NULL, 1, 'nm1312575', '59315', '/3C7ogDK7ZrpQezMxG8ILO2ILY9a.jpg', 24),
(9675, 'Matt Letscher', 'Mathew \"Matt\" Letscher es un actor estadounidense (26 de junio de 1970).\n\nActualmente es conocido por interpretar el papel de Eobard Thawne en las series The Flash y DCs Legends of Tomorrow. Es hermano del también actor, Brian Letscher.', '1970-06-26', 'Michigan, USA', NULL, 2, 'nm0504762', '28414', '/4tFddqIAqUnPAl64sM335GhYPdM.jpg', 8),
