(9707, 'Marisa Paredes', 'Desde niña mostraba una gran vocación por el teatro. En 1960 (a los catorce años de edad) debutó en cine. Al año siguiente debutó en teatro. Actuó con la compañía de Conchita Montes como meritoria, en la obra de José López Rubio Esta noche tampoco.\n\nEl teatro la ha acompañado durante toda su trayectoria profesional (hasta hace poco triunfaba en el teatro con Hamlet con Eduard Fernández), aunque el número de intervenciones como actriz en cine o televisión (Estudio 1 entre otros) es considerable.\n\nCine: primeros papeles\n\nEn las décadas de 1960 y 1970 Marisa Paredes interpreta papeles secundarios en filmes de géneros muy dispares; interviene en la película El mundo sigue (1965) de Fernando Fernán Gómez, en algún spaghetti western y en una comedia de Marisol.\n\nPosiblemente Ópera prima (1980) de Fernando Trueba supone un punto de inflexión y el inicio del despegue de Marisa Paredes en el cine.\n\nDe su relación con el director de cine Antonio Isasi-Isasmendi, nace en 1975 su única hija, la también actriz María Isasi', '1946-04-03', 'Madrid, Spain', NULL, 1, 'nm0004650', '954', '/aDfNPZ2plaCmdrYkCkburjBqYnP.jpg', 2),
(9708, 'Tony Valento', '', NULL, NULL, NULL, 2, 'nm0884401', '37573', NULL, 1),
(9709, 'David Thomson', '', '1933-01-10', 'Pensacola, Florida, USA', NULL, 2, 'nm0860989', '2187742', NULL, 1),
(9710, 'Jared Padalecki', 'Jared Tristan Padalecki (19 de julio de 1982) es un actor estadounidense. Es mayormente reconocido por interpretar a Sam Winchester en la serie Supernatural. Padalecki comenzó a tener interés en la actuación a los 12 años y tras graduarse de la secundaria, se mudó a Los Ángeles, California, donde consiguió contratos y saltó a la fama en el año 2000 con su papel en la serie Gilmore Girls y apareciendo en películas como New York Minute (2004) y El vuelo del Fénix (2004).\n\nEn 2005, fue seleccionado para interpretar a Sam Winchester en la serie Supernatural, la cual se convirtió en un éxito en términos de audiencia y en críticas, hecho que llevó a The CW a extenderla por más de doce temporadas, con lo que se convirtió en el programa de fantasía más largo de la televisión estadounidense y en el más longevo del canal.​ Gracias a su trabajo en dicha serie, ha sido reconocido en los Teen Choice Awards y People\'s Choice Awards.5​ Desde 2010, está casado con la actriz Genevieve Cortese, con quien tiene tres hijos.', '1982-07-19', 'San Antonio, Texas, USA', NULL, 2, 'nm0655585', '49623', '/q2YR6o6MKqO2szOhmmSSAnjs2aC.jpg', 14),
(9711, 'Danielle Panabaker', 'Danielle Nicole Panabaker (19 de septiembre de 1987) es una actriz estadounidense.\n\nFue miembro del reparto en el drama de la CBS Shark, y apareció en las películas como Mr. Brooks, Sky High y Viernes 13, entre otros proyectos. Entre el público joven es conocida por su papel de Caitlin Snow en la serie The Flash y por su aparición en películas de Disney Channel como Jordan-Manía y Diario de una adolescente junto con su hermana Kay Panabaker.', '1987-09-19', 'Augusta, Georgia, USA', NULL, 1, 'nm1263939', '31838', '/dpX6WMQjJDD93YYaC9Wd6tgucuZ.jpg', 26),
