(9801, 'Armie Hammer', 'Armand Douglas Hammer (Santa Mónica, California;1​2​ 28 de agosto de 1986) es un actor estadounidense, conocido por su interpretación en la película de drama biográfico The Social Network, el personaje principal del western El llanero solitario (2013), Illya Kuryakin en la película de acción The Man from U.N.C.L.E. (2015), Mike en la película de suspenso Mine (2016) y como la voz de Jackson Storm en la película animada Cars 3 (2017).\n\nPor su interpretación de Clyde Tolson, en el drama biográfico J. Edgar (2011), fue nominado para un Screen Actors Guild Award. Por su actuación como Oliver en el drama romántico Call Me by Your Name (2017), recibió nominaciones para un Critics\' Choice Award, un Independent Spirit Award y un Golden Globe Award como mejor actor de reparto.\n\nDescripción anterior del artículo de Wikipedia Armand Dougles Hammer, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1986-08-28', 'Los Angeles, California, USA', NULL, 2, 'nm2309517', '53807', '/dacZbbnheEhejYbkDgz7WhhSBJp.jpg', 20),
