(9854, 'Will Smith', 'Willard Carroll «Will» Smith, Jr., (25 de septiembre de 1968, Filadelfia, Pensilvania, Estados Unidos), mejor conocido como Will Smith, es un actor y rapero estadounidense que ha tenido éxito en sus dos facetas artísticas: ha sido nominado a cuatro Premios Globo de Oro y a dos Premios Óscar, y ha ganado Premios Grammy. A finales de los años 1980, alcanzó una modesta fama como rapero, con el nombre de The Fresh Prince. En 1990, su fama aumentó drásticamente, cuando protagonizó la serie de televisión The Fresh Prince of Bel-Air, que se transmitió durante más de media década (1990 - 1996) en la NBC y se ha retransmitido de forma permanente en diversas cadenas. A mediados de los 90, pasó de la televisión al cine, y actuó en numerosas películas que lograron un gran éxito de taquilla. También recibió un premio especial por su aportación a la música dentro del cine, en la Gala de los Premios Principales del 2007.\n\nEs el único actor de la historia que ha actuado en ocho películas consecutivas que hayan generado más d', '1968-09-25', 'Philadelphia, Pennsylvania, USA ', NULL, 2, 'nm0000226', '2888', '/6a6cl4ZNufJzrx5HZKWPU1BjjRF.jpg', 25),
(9855, 'Margaret Colin', 'Margaret Colin (26 de mayo de 1958)​ es una actriz estadounidense. Es conocida por su papel como Margo Montgomery Hughes en As the World Turns y por su papel como Eleanor Waldorf-Rose en Gossip Girl.', '1958-05-26', 'Brooklyn, New York, USA', NULL, 1, 'nm0171513', '8985', '/tsg9bGtD1mY1FLKIeIFUNeD5jpm.jpg', 13),
(9856, 'Judd Hirsch', 'Judd Seymore Hirsch (15 de marzo de 1935) es un actor estadounidense.\n\nFue nominado a un premio Óscar al mejor actor de reparto por su interpretación en la película de 1980 Ordinary People. También fue nominado a cuatro premios Globo de Oro (de los que ganó solo uno), un premio SAG, tres premios Primetime Emmy (de los que ganó uno) y tres premios Tony (de los que ganó dos). Ha trabajado en películas como A Beautiful Mind, Rocky Marciano, Independence Day, Man on the Moon, entre otras.', '1935-03-15', ' New York City, USA', NULL, 2, 'nm0002139', '6167', '/7rJ0TZfMoPLTcO203tHhE6tcPKP.jpg', 9),
(9857, 'Mary McDonnell', 'Mary McDonnell (28 de abril de 1952) es una actriz estadounidense de cine y televisión. Recibió candidaturas a los Premios Óscar por sus papeles como Erguida con puño (Hispanoamérica) o En pie con el puño en alto (España) en Dances with Wolves y May-Alice Culhane en Passion Fish. Es conocida como la Presidenta Laura Roslin en la serie Battlestar Galactica.', '1952-04-28', 'Wilkes-Barre, Pennsylvania, USA', NULL, 1, 'nm0001521', '1581', '/qqdaaFLEPXbB8thVJJkYJ4WoAuj.jpg', 18),
