(9956, 'Michael Bay', 'Director de cine estadounidense nacido en Los Ángeles, California. Procede de la publicidad y los videoclips. Trabajó para las principales compañías de ropa deportiva, refrescos y cervezas, y con artistas como Tina Turner, Meat Loaf o Lionel Richie. En 1981 estaba en el departamento de storyboard de Indiana Jones y a mitad de la década hizo sus pinitos como actor televisivo, salió en un capítulo de Corrupción en Miami, en 1986. Pero lo que a Bay le llamaba la atención era dirigir. Sus películas se caracterizan por seguir un esquema común, una primera parte donde se presentan los personajes y una segunda donde transcurre la acción, que es su especialidad. Algunos actores afirman que les presta menos atención a ellos que a los efectos especiales. Es la forma de ser de Michael Bay, que debutó como director en 1995 con Dos policías rebeldes, protagonizada por Will Smith y Martin Lawrence. En 1996 realizó la que considera su mejor película, La Roca, con uno de sus actores favoritos al frente, Sean Connery. Amante ', '1965-02-17', 'Los Angeles, California, USA', NULL, 2, 'nm0000881', '865', '/8I9H9IKROECFEn7usvyChbRMhbI.jpg', 18),
