(10037, 'Margot Robbie', 'Es una actriz, modelo y productora australiana, más conocida por haber interpretado a Donna Freedman en la serie Neighbours, a Naomi Belfort en la película El lobo de Wall Street, a Jane Porter en la película La leyenda de Tarzán, a Harley Quinn en la película de villanos Escuadrón Suicida de DC Comics y a Tonya Harding en el biopic I, Tonya.', '1990-07-02', 'Dalby, Queensland, Australia', NULL, 1, 'nm3053338', '234352', '/euDPyqLnuwaWMHajcU3oZ9uZezR.jpg', 37),
