(10041, 'Cara Delevingne', 'Cara Delevingne obtuvo su primer trabajo como actriz en el 2012 en la película Anna Karenina interpretando a la Princesa Sorokina. En el 2014 obtuvo un papel en la película The Face of an Angel, basada en hechos reales. Tuvo un papel en la película basada en el libro de John Green Ciudades de papel interpretando a Margo Roth Spiegelman, chica rebelde a la que le gusta vivir aventuras. Estuvo en una película británica llamada Kids In Love e interpretó a una sirena en la película Pan, en Tulip Fever y en London Fields. También participó en la película del 2016 Escuadrón suicida, donde interpretó a Encantadora. En 2017 estrenó la película Valerian y la ciudad de los mil planetas, donde representó a Laureline, colega de Valerian.\n\nDelevingne se identifica como bisexual. En una entrevista habló sobre las dudas que tenía sobre su orientación sexual cuando era joven y su relación con la cantante St. Vincent.6​ se describe como amante de los animales, llegó a subastar su reloj marca TAG Heuer en apoyo a una organizac', '1992-08-12', 'Hammersmith, London, England, UK', NULL, 1, 'nm5353321', '1289968', '/izZ8IbsIjNpjZ5S0HIYreVwVRzn.jpg', 27),
