(10043, 'Karen Fukuhara', 'Karen Stephanie Aika Fukuhara (10 de febrero de 1992) es una actriz estadounidense.\n\nEs conocida por sus papeles como Katana en la película de superhéroes de DC de 2016 Escuadrón suicida y como The Female (Kimiko) en la serie original de Amazon Prime de 2019 The Boys. También es conocida por interpretar al personaje de Glimmer en la serie de Netflix She-Ra y las princesas del poder y a Kipo en Kipo y la era de los magnimales.', '1992-02-10', 'Los Angeles, California, USA ', NULL, 1, 'nm7232332', '1461608', '/39xZ0fJEfq9Ql2fILUUDJmcHT15.jpg', 23),
(10044, 'David Harbour', 'David Kenneth Harbour (10 de abril de 1975) es un actor estadounidense que ha trabajado en cine, televisión y teatro. Saltó a la fama por su papel de Jim Hopper en la serie original de Netflix, Stranger Things.', '1974-04-10', 'New York City, New York, USA', NULL, 2, 'nm1092086', '35029', '/chPekukMF5SNnW6b22NbYPqAStr.jpg', 18),
