(10146, 'Jason Bateman', 'Jason Kent Bateman (n. 14 de enero de 1969) es un actor estadounidense ganador de un Globo de Oro y nominado a los Premios Emmy. Después de haber actuado en varias series de comedia durante la década de 1980, Bateman adquirió fama por su trabajo como Michael Bluth en la serie Arrested Development. Desde la finalización de la serie, ha aparecido en varias películas de Hollywood, tales como Juno, Quiero matar a mi jefe y Hasta que la muerte los juntó. Le dio su voz a Nick Wilde, el zorro de la película animada de Disney Zootopia.', '1969-01-14', 'Rye, New York, USA', NULL, 2, 'nm0000867', '23532', '/8e6mt0vGjPo6eW52gqRuXy5YnfN.jpg', 21),
