(10150, 'Johnny Galecki', 'Nació en Bree, Bélgica, donde su padre Richard Galecki estaba al servicio de la Fuerza Aérea de los EE. UU., mudándose a Chicago cuando tenía tres años. Su madre, Mary Lou Galecki, era una consultora de hipotecas. Sus padres son estadounidenses de ascendencia italiana, irlandesa y polaca.\n\nGalecki tiene un hermano menor, Nick, a quien describe como un \"genio de la mecánica\", y una hermana menor, Allison. Galecki creció en Oak Park, Illinois.\n\nCon 17 años comenzó a actuar en producciones teatrales muy prestigiosas como El violinista en el tejado, Pippin y Galileo, junto a Brian Dennehy en el teatro Goodman de Chicago.', '1975-04-30', 'Bree, Belgium', NULL, 2, 'nm0301959', '16478', '/gkwMiwHX7lmfjORRJi6T6SM3ppo.jpg', 12),
(10151, 'Hayley Marie Norman', '', '1989-03-03', 'Thousand Oaks, California, USA', NULL, 1, 'nm1190513', '66623', '/hhXJjwXseRmFzXcPjlkxxYNqvuK.jpg', 4),
(10152, 'Dorothy Cecchi', '', NULL, NULL, NULL, 1, NULL, '2799680', NULL, 4),
(10153, 'Peter Berg', 'Peter Berg (nacido el 11 de marzo de 1964) es un actor, director de cine, productor y escritor estadounidense. Es conocido por dirigir películas como Friday Night Lights, The Kingdom, The Rundown, Hancock y Battleship. Es muy apreciado por desarrollar la serie de televisión Friday Night Lights, basada en la película del mismo nombre que también dirigió. En su carrera más reciente, ha trabajado para traer a la pantalla grande historias reales de estadounidenses comunes en situaciones extraordinarias (Lone Survivor, Deepwater Horizon, Patriots Day). Como actor, es mejor conocido por su papel como el Dr. Billy Kronk en el drama médico de CBS de la década de 1990 Chicago Hope.\n\nDescripción anterior del artículo de Wikipedia Peter Berg, licenciado bajo CC-BY-SA, lista completa de contribuyentes en Wikipedia', '1964-03-11', 'New York City, New York, USA', NULL, 2, 'nm0000916', '36602', '/1pR16H0zqRG49ns8cYykYpodgGF.jpg', 7),
