(10173, 'Michael Mann', 'Director de cine estadounidense, nacido en Chicago, Illinois. A pesar de su renombre como creador de teleseries de éxito, Michael Mann ha hecho todo lo posible por convertirse en director de cine, vocación que crece en él tras licenciarse en la Universidad de Wisconsin y cruzar el Atlántico para recibir clases en Londres, en la prestigiosa London Film School. El futuro cineasta poseía una intuición única para el éxito en la pequeña pantalla, y pronto llamó la atención como autor de los guiones de Starsky y Hutch (1975), teleserie de 88 episodios protagonizada por los actores Paul Michael Glaser y David Soul. Ahora bien, pese a cotizarse cada vez más en las cadenas de televisión, no desistió de su viejo propósito, por fin cumplido cuando logra rodar la película Ladrón (1981). Este largometraje contó con un presupuesto medio y el reparto lo encabezó James Caan, pero el buen oficio cinematográfico de Mann no fue suficiente para apartarlo del medio televisivo. Certero a la hora de elegir nuevos proyectos, se conv', '1943-02-05', 'Chicago, Illinois, USA', NULL, 2, 'nm0000520', '638', '/1nRqwMyQuCkvNPAzDY5oOSfGZ6b.jpg', 14),
