(10182, 'Alice Braga', 'Alice Braga Moraes (nacida el 15 de abril de 1983) es una actriz brasileña. Ella ha aparecido en varias películas en su Brasil natal, sobre todo como Angélica en la muy aclamada Ciudad de Dios de 2002 y como Karina en la Ciudad baja de 2005. También ha protagonizado las películas de Hollywood I Am Legend (2007), Repo Men y Predators (ambas 2010).', '1983-04-15', 'São Paulo, São Paulo, Brazil', NULL, 1, 'nm0103797', '8602', '/ykVmsm3For9dCBfWLRtTL0EU24b.jpg', 31),
