(10242, 'Daryl Hannah', 'Daryl Christine Hannah (Chicago, Illinois; 3 de diciembre de 1960) es una actriz estadounidense.\n\nHizo su debut en la pantalla en 1978. En 1984 saltó a la fama con su interpretación de \'Madison\' (una sirena) en la comedia Splash. Ha sido estrella en numerosas producciones de Hollywood durante los años 80. En el año 2003 destacó en su papel de la asesina Elle Driver en Kill Bill, después de estar apartada de roles principales durante varios años.', '1960-12-03', 'Chicago, Illinois, USA ', NULL, 1, 'nm0000435', '589', '/4Wn3bsHa7Js7mYX0iehYN7BuHOi.jpg', 33),
(10243, 'Sam Shepard', '', '1943-11-05', 'Fort Sheridan, Illinois, USA', '2017-07-27', 2, 'nm0001731', '9880', '/mVR3Le1rSGIbQmld3Ve42RVFcyI.jpg', 7),
(10244, 'Dylan McDermott', 'Dylan McDermott (n. Mark Anthony McDermott; 26 de octubre de 1961)​ es un actor estadounidense. Es más conocido por su papel como el abogado Bobby Donnell en la serie dramática legal El abogado.\n\nMcDermott también es conocido por sus papeles en las dos primeras temporadas de American Horror Story, titulado American Horror Story: Murder House y American Horror Story: Asylum, interpretando a Ben Harmon y Johnny Morgan, respectivamente. También protagonizó el teniente Carter Shaw en la serie de TNT Dark Blue y protagonizó dos series de drama de corta duración de CBS Rehenes y Stalker.\n\nDescripción anterior del artículo de Wikipedia Dylan McDermott, con licencia CC-BY-SA 3.0 ES, lista completa de colaboradores en Wikipedia.', '1961-10-26', 'Waterbury, Connecticut, USA', NULL, 2, 'nm0001518', '32597', '/3i69RNLuL7KOD9pCmHQYruhcOdn.jpg', 17),
